DELIMITER $$
--
-- Events
--
CREATE DEFINER=`tangokompaniet_com`@`%` EVENT `Insert registration into history` ON SCHEDULE EVERY 1 DAY STARTS '2020-09-06 23:59:59' ON COMPLETION NOT PRESERVE ENABLE DO INSERT IGNORE into tbl_registration_history 
(firstName, lastName, email, phone, leader, 
firstNamePartner, lastNamePartner, emailPartner, phonePartner, status,
productType, 
productId, 
orderId, 
danceSite,
creaTimestamp,
name,
eventType,
year, 
teacher1, teacher2)
SELECT re.firstName, re.lastName, re.email, re.phone, re.leader, 
re.firstNamePartner, re.lastNamePartner, re.emailPartner, re.phonePartner, re.status,
re.productType, 
re.productId, 
re.orderId, 
re.danceSite,
re.creaTimestamp,
df.nameSV, 
co.eventType,
co.year,
te1.shortName as teacher1,te2.shortName as teacher2
from tbl_registration as re  
left outer join tbl_course as co on co.productId = re.productId
left outer join tbl_course_def as df on df.courseId = co.courseId
left outer join tbl_schedule_def as sc on sc.scheduleId = co.scheduleId
left outer join tbl_teacher as te1 on te1.shortName = co.teacher1
left outer join tbl_teacher as te2 on te2.shortName = co.teacher2
where productType != 'social'
and DATE(SUBSTR(re.productId, 1,6)) < DATE_SUB(NOW(), INTERVAL 25 WEEK)$$

CREATE DEFINER=`tangokompaniet_com`@`%` EVENT `Insert social registrations into history` ON SCHEDULE EVERY 1 DAY STARTS '2021-05-24 00:04:00' ON COMPLETION NOT PRESERVE ENABLE DO insert ignore into tbl_registration_social_history select * from tbl_registration where productType='social'
and DATE(SUBSTR(productId, 1,6)) < DATE_SUB(NOW(), INTERVAL 5 WEEK)$$

CREATE DEFINER=`tangokompaniet_com`@`%` EVENT `Delete old social registrations` ON SCHEDULE EVERY 2 DAY STARTS '2021-05-25 04:00:00' ON COMPLETION NOT PRESERVE ENABLE DO delete from tbl_registration where productType='social'
and DATE(SUBSTR(productId, 1,6)) < DATE_SUB(NOW(), INTERVAL 6 WEEK)$$

DELIMITER ;
