INSERT INTO `tbl_intrested` (`id`, `regdatum`, `kurs`, `namn`, `email`, `foraFolja`, `kommentar`) VALUES
(1, '2010-09-11', 'Lund-nybörjare', 'Eva Bengtsson', 'evbe87@yahoo.se', 'följa', 'tillsammans med min man.'),
(2, '2010-09-18', 'Malmö-nybörjare', 'signe beck', 'signebeck@hotmail.com', 'föra', 'jag och min partner vil gärne dansa tango. ät det for sent att anmelda nu?'),
(3, '2009-11-08', 'Malmö-nybörjare', 'Inga-Britt Andersson', 'inga-britt.a@telia.com', 'följa', ''),
(4, '2009-11-15', 'Lund-nybörjare', 'Birgit Ahlquist', 'birgit.ahlquist@yahoo.com', 'följa', 'Tisdagar. Är änka, 68 år men alert (spelar mycket tennis t.ex.) och har gått olika danskurser tidigare med min man (dock ej tango). Går det att hitta en manlig lämplig danspartner?'),
(5, '2009-11-16', 'Malmö-nybörjare', 'Karl Nittve', 'karl.nittve@gmail.com', 'föra', ''),
(6, '2009-11-18', 'Lund-nybörjare', 'Faris Nabil', 'faris_nb@hotmail.com', 'föra', 'Hello\r\nI am Faris and I am a master student inside Lund University.\r\nActully I almost know nothing about tango so I would love to join one of your classes in the near time.\r\nbut would Swedish language be a must ?\r\n\r\nthank you \r\n'),
(7, '2009-11-22', 'Malmö-nybörjare', 'Alexandra Vusir', 'avusir@hotmail.com', 'följa', ''),
(8, '2009-11-27', 'Malmö-nybörjare', 'Azize Gunes', 'azize.gunes@live.se', 'följa', 'Hej. Jag undrar om man måste ha en danspartner eller om det löser sig när man börjar.\r\n\r\nmvh Azize'),
(9, '2009-11-30', 'Lund-nybörjare', 'Elena', 'elena.mejia@hotmail.com', 'följa', 'Hej Daniel!\r\nJag har ett antal frågor till dig:Varar alla nybörjarkurser 6 gånger? Är det någon speciell ålder? Och hur menar ni med utflykter?'),
(10, '2009-12-01', 'Lund-nybörjare', 'kerstin Mouchard', 'kerstin.mouchard@bredband.net', 'följa', 'Det är min man som skall få denna kurs i julklapp med mig som partner förstås. Vi kan gå även i Malmö, bara det är nybörjare. Vi är 57 resp. 60 år men har god kondition.'),
(11, '2010-09-23', 'Malmö-nybörjare', 'Ulf Lundin', 'ulf@dqimage.se', 'föra', ''),
(12, '2010-09-26', 'Lund-nybörjare', 'Jessica Sierra', 'jessi75@live.se', 'följa', ''),
(13, '2010-09-29', 'Lund-nybörjare', 'Torbjörn och Camilla Johannesson', 'tbjohannesson@gmail.com', 'föra', 'Obs! Intresseanmälan för två personer dvs både föra o följa'),
(14, '2010-09-20', 'Lund-nybörjare', 'Lena Möller', 'lenamoller', 'föra', ''),
(15, '2010-09-20', 'Lund-nybörjare', 'Lena Möller', 'lenamolle@bredband2.com', 'följa', ''),
(16, '2010-09-21', 'Malmö-nybörjare', 'Tove Johansson', 'tooove@gmail.com', 'följa', ''),
(17, '2010-09-23', 'Malmö-nybörjare', 'Monica Ståhl', 'limhamn_1@hotmail.com', 'följa', ''),
(18, '2010-09-01', 'Lund-nybörjare', 'Helena Andersson', 'helena@a-hem.se', 'följa', ''),
(19, '2010-09-05', 'Malmö-nybörjare', 'Annika Bohlin', 'annika.bohlin@live.se', 'följa', 'Hej! Måste man ha en partner med sig eller finns möjlighet att bli \"ihop-parad\" hos er? Min man är inte vidare intresserad (än) av att lära sig dansa tango??'),
(20, '2010-08-09', 'Malmö-nybörjare', 'Åsa Rydnert', 'asarydnert@hotmail.com', 'följa', ''),
(21, '2010-08-29', 'Malmö-nybörjare', 'Nina Wictorin', 'nwictorin@hotmail.com', 'föra', 'Hej!\r\nKan man anmäla sig ensam, eller måste man ha en danspartner från början?\r\n\r\nUndrar Nina/tangonybörjare'),
(22, '2010-07-20', 'Malmö-nybörjare', 'Björn Stenström', 'bjorn.stenstrom@bredband.net', 'föra', 'Hej! Jag bor i Lund men jobbar i Malmö, så om det passar bäst att gå i Lund eller Malmö beror på när de börjar på dagen, om man skulle kunna hinna hem. Men i vårens program såg Malmö onsdag ut att passa bäst.\r\n\r\nMvh\r\n\r\nBjörn'),
(23, '2010-07-07', 'Malmö-nybörjare', 'Axel Fagerholm', 'aaxxeell@hotmail.com', 'föra', ''),
(24, '2010-07-18', 'Malmö-nybörjare', 'Jöran Lindkvist', 'jj@visitart.se', 'föra', 'Hej,\r\n\r\nVi är ett par som gärna vill börja att dansa tango på nybörjarnivå i Malmö eller Lund. Vi vill gärna veta när det börjar och om det är möjligt för oss tidsmässigt'),
(25, '2010-06-29', 'Malmö-nybörjare', 'Henrietta Josefsson', 'henrietta@josefsson.net', 'följa', ''),
(26, '2010-07-03', 'Lund-nybörjare', 'annelie pavlatos', 'annelie.pavlatos@gmail.com', 'följa', ''),
(27, '2010-06-09', 'Lund-nybörjare', 'Eva Fredriksson', 'eva-fredriksson@hotmail.com', 'följa', 'Jag har ingen partner, är det OK?'),
(28, '2010-06-29', 'Malmö-nybörjare', 'Tor Josefsson', 'tor@josefsson.net', 'föra', ''),
(29, '2010-06-06', 'Lund-nybörjare', 'Birgitta Olai', 'bixbiggs@yahoo.com', 'följa', 'Ja tack jag vill bli påmind om nästa nybörjarkurs. Har ingen partner.'),
(30, '2010-05-31', 'Malmö-nybörjare', 'Christian Melkersson', 'melkersson@gmail.com', 'föra', 'Vill gärna gå på måndagar i Malmö. '),
(31, '2010-04-23', 'Lund-nybörjare', 'Torbjörn och Helena Andersson', 'tobbe@a-hem.se', 'föra', 'vi är ett par....'),
(32, '2010-05-03', 'Lund-nybörjare', 'MalinLarsson', 'malin_larsson_lomma@hotmail.com', 'följa', 'Jag skulle gärna vilja börja kurs så snart det startas en ny nybörjarkurs. Har ni ev några sommarkurser eller endast till hösten?'),
(33, '2010-05-13', 'Malmö-fortsättning', 'Anne popescu', 'anne.popescu@telia.com', 'följa', 'Nivå 2'),
(34, '2010-05-24', 'Lund-nybörjare', 'Pia Fogelberg', 'pia.fogelberg@skane.se', 'följa', ''),
(35, '2010-05-24', 'Malmö-fortsättning', 'Lars Bringemo', 'larsb90@hotmail.com', 'föra', 'Hejsan!\r\nÄr intresserad av dessa till hösten 2010:\r\nFortsättning nivå 1\r\nMilonga kurs vore kul att testa.\r\nHar dock ingen partner'),
(36, '2010-04-20', 'Lund-nybörjare', 'Maria Lindh', 'maria.lindh@rektor.lu.se', 'följa', 'Vill gärna börja i höst, har ingen partner och är 55 år. Har dansat mycket annat - men aldrig tango.'),
(37, '2010-04-19', 'Malmö-fortsättning', 'Vesna Ponjavic', 'vesna.ponjavic@bredband.net', 'följa', ''),
(38, '2010-04-19', 'Malmö-fortsättning', 'Vesna Ponjavic', 'vesna.ponjavic@bredband.net', 'följa', ''),
(39, '2010-04-13', 'Lund-nybörjare', 'Yury Loayza', 'yuryloayza@gmail.com', 'föra', 'hej, när börjag nästa kurser?'),
(40, '2010-04-10', 'Malmö-nybörjare', 'Ulrika Hahn', 'opimius@telia.com', 'följa', 'Har dansat i flera år,dock ej tango och undrar om det är givande att gå grundkursen?...vill tro att jag är snabblärd.\r\nMvh/Ulrika'),
(41, '2010-03-27', 'Lund-nybörjare', 'anna truedsson', 'anna_truedsson@spray.se', 'följa', ''),
(42, '2010-03-17', 'Lund-nybörjare', 'Elise Krumholz', 'ehkrummy@gmail.com', 'föra', ''),
(43, '2010-03-16', 'Malmö-nybörjare', 'Jana Andersson', 'jana.86@gmail.com', 'föra', 'Hej!\r\nJag kommer flytta ner till Malmö till hösten, och är intresserad av att lära mig tango tillsammans med min flickvän. Vi är båda intresserade av att både lära oss föra och följa, och undrar om det fungerar med ert kursupplägg? \r\n\r\nVänliga hälsningar\r\n/Jana'),
(44, '2009-12-10', 'Lund-nybörjare', 'unn tjörnstrand', 'unnderwerk@hotmail.com', 'följa', ''),
