(280, '2010-12-07', 'Malmö-nybörjare', 'Mary-Anne López', 'manlop@spray.se', 'följa', 'Vi är ett par som dansat en termin på tangopalatset och vill gärna fortsätta nästa termin. Min sambo heter Jonas Jinnestrand.'),
