(285, '2010-12-10', 'Malmö-fortsättning', 'Camilla Andersson', 'camillamandersson@hotmail.com', 'följa', 'Hej Daniel\r\n\r\nJag hade tänkt att gå Ellinors följarkurs och vill bli påmind om nästa tillfälle (som jag hoppas blir under våren).\r\n\r\n/Camilla '),
(286, '2010-12-13', 'Malmö-fortsättning', 'agneta svartvik andersson', 'nenne_svart@hotmail.com', 'följa', 'Har gått två terminer på Tangoplapatset. I nuläget har jag en partner.'),
(287, '2010-12-13', 'Lund-nybörjare', 'Sofie Nodbring', 'sofie.nodbring@gmail.com', 'följa', 'Jag vill anmäla mitt intresse till att gå nybörjarkurs när kurserna börjar nästa gång och vill gärna bli påmind om den kommande kursstarten!'),
(288, '2010-12-15', 'Lund-nybörjare', 'Maria Bohlin', 'mbohlin@live.se', 'följa', 'Jag vill dansa tillsammans med Lars Svensson, vi är båda nybörjare, vill gå kurs på måndag el torsdag kväll!'),
