(444, '2010-11-22', 'Malmö-fortsättning', 'Anna Vagelin', 'anna@vagelin.com', 'följa', 'Hej, vilken nivå rekommenderar du för oss efter 5 terminer på Tangoakademin men alldeles för få praktikor?\r\n\r\nmvh Leif o Anna'),
