(613, '2010-10-26', 'Lund-nybörjare', 'Gullevi Berne', 'gullevi@msn.com', 'följa', ''),
(614, '2010-10-27', 'Lund-nybörjare', 'Essi Kääriäinen & Göran Sundblom', 'essi.kaariainen@gmail.com', 'följa', 'Hej! Vi vill gärna komma med nästa gång ni har en nybörjarkurs i Lund. Bästa kvällar för oss är tisdag och onsdag. Skicka gärna en mail till mig då det är dags att anmäla sig. \r\n\r\nVar är er kurslokal i Lund? \r\n\r\nVänligen\r\nEssi Kääriäinen och Göran Sundblom'),
(615, '2010-11-07', 'Lund-nybörjare', 'Angelika Lorenzen', 'lorenzen@bredband.net', 'följa', 'jag kommar med min man.'),
(616, '2010-11-08', 'Lund-nybörjare', 'Mikael Roll', 'mikael.roll@gmail.com', 'föra', 'Min flickvän vill också börja nästa termin.'),
(617, '2010-11-15', 'Malmö-nybörjare', 'Susanne Svensson', 'susannesvensson77@hotmail.com', 'följa', ''),
(618, '2010-11-18', 'Lund-nybörjare', 'Fredrik', 'Fredrik@honeyraft.com', 'föra', 'Hej,\r\nMin flickvän har alltid pratat om att hon skulle vilja lära sig dansa argentinsk tango. Jag hade tänkte ge henne det som en julklapp att hon och jag skall prova på detta. Kommer någon nybörjarkurs att börja under våren?\r\n\r\nMed vänliga hälsningar\r\nFredrik'),
(619, '2010-11-18', 'Lund-nybörjare', 'Lars Eckberg', 'lars@eckberg.dk', 'föra', 'Malmö eller Lund, spelar ingen roll.\r\nSkal jeg have en partner med selv?\r\n\r\nVänlig hälsning,\r\n--Lars'),
(620, '2010-11-21', 'Malmö-nybörjare', 'Eija Lukkari', 'eijalukkari@spray.se', 'följa', 'Jag har en egen danspartner; Mats Welander.'),
(621, '2010-11-22', 'Malmö-fortsättning', 'Eva Hellgren', 'eva.hellgren@tele2.se', 'föra', ''),
(622, '2010-11-22', 'Malmö-fortsättning', 'Anna Vagelin', 'anna@vagelin.com', 'följa', 'Hej, vilken nivå rekommenderar du för oss efter 5 terminer på Tangoakademin men alldeles för få praktikor?\r\n\r\nmvh Leif o Anna'),
(623, '2010-11-23', 'Malmö-fortsättning', 'Edith Mörtlund', 'ida_edith@home.se', 'följa', 'Hejsan!\r\nJag och min pojkvän vill fortsätta dansa tango i vår! Vi vill gå som par. Jag dansar lite bättre än honom, jag började för ett par år sedan i BsAs. Vi har gått en nybörjarkurs nu i höst, men den tyckte vi var lite för lätt. Huvudsaken är att vi kan fortsätta dansa.\r\nHälsningar, Edith och Ezequiel'),
(624, '2010-11-24', 'Malmö-fortsättning', 'Jan Spirer', 'spirer@ebox.tninet.se', 'föra', 'Jag går nybörjarkursen hösten 2010 på Tangoakedemin (Paul) och vill gärna forsätta nästa termin.'),
(625, '2010-11-25', 'Lund-nybörjare', 'Maria Marforio', 'maria.marforio@tetrapak.com', 'följa', ''),
(626, '2010-11-25', 'Lund-fortsättning', 'Karin Stalhammar', 'karin.stalhammar@gmail.com', 'följa', ''),
(627, '2010-11-25', 'Malmö-nybörjare', 'Olga Påhlsson', 'olgapahlsson@hotmail.com', 'följa', ''),
(628, '2010-11-29', 'Lund-nybörjare', 'Bror', 'brorbror@hotmail.com', 'föra', ''),
(629, '2010-11-30', 'Lund-nybörjare', 'Martin Olin', 'martin.olin@gmail.com', 'föra', 'Hej,\r\n\r\nMitt namn är Martin Olin och jag har på senare tid blivit intresserad av Argentinsk Tango och skulle vilja lära mig hur det går till.\r\n\r\nJag har tyvärr ingen partner att ta med mig, men jag hoppas att det går att lösa ändå.\r\n\r\nMin nivå är verkligen nybörjare, har aldrig tagit ett enda steg Tango tidigare, men jag ser fram emot att få prova på!\r\n\r\nMed vänlig hälsning\r\nMartin Olin'),
(630, '2010-12-01', 'Lund-fortsättning', 'SonjaJönsson', 'sonja.elisabeth@live.se', 'följa', 'Har gått nybörjarkursen på tangoakademin under hösten och vill väldigt gärna fortsätta med denna fantastiska dans.'),
(631, '2010-12-04', 'Malmö-fortsättning', 'Ingrid Häggblom', 'ingridhaggblom@hotmail.com', 'följa', 'Har gått en termin hos Tangoakademin men de kommer ej att ge kurser till våren, därmed söker jag efter en annan skola. Min partner från Tangoakademin är också intresserad av att fortsätta. '),
(632, '2010-12-04', 'Malmö-fortsättning', 'Emi Kielerstajn', 'Emi.Kielerstajn@gmail.com', 'följa', 'Hej, min man och jag har precis avslutat fortsättningskurs 1 på tangoakademin och är intresserade av att fortsätta hos er. \r\nMvh Emi'),
