(641, '2010-12-10', 'Malmö-fortsättning', 'Camilla Andersson', 'camillamandersson@hotmail.com', 'följa', 'Hej Daniel\r\n\r\nJag hade tänkt att gå Ellinors följarkurs och vill bli påmind om nästa tillfälle (som jag hoppas blir under våren).\r\n\r\n/Camilla '),
(642, '2010-12-13', 'Malmö-fortsättning', 'agneta svartvik andersson', 'nenne_svart@hotmail.com', 'följa', 'Har gått två terminer på Tangoplapatset. I nuläget har jag en partner.'),
