(648, '2011-01-07', 'Malmö-nybörjare', 'Nedeljka Micic', 'nedamicic@hotmail.com', 'följa', 'jag vill gärna veta om det går bra att börja utan partner. kan vara roligare än om bara tjejer dansar:-) \r\njag skulle gärna vilja komma på någon prova på innan om det finns?\r\njag hade tänkt mig börja den 3 feb på torsdagar men om gruppindelningen ser ojämn ut kan jag även tänka mig komma på onsdagar.\r\n\r\nser fram emot ert svar\r\n\r\nmvh Neda'),
(649, '2011-01-07', 'Malmö-nybörjare', 'Lina Lundkvist', 'linal@lsn.se', 'följa', 'Hej, jag vill börja a.s.a.p men är ensam. är det ok? min vännina är i samma situation. räcker det med de som vill föra eller ska man  stvinga sin egen man att följa med:)?'),
(650, '2011-01-09', 'Malmö-nybörjare', 'Anna Vallin', 'annaced@hotmail.com', 'följa', 'Ska gå nybörjare eller kanske fortsättning.'),
(651, '2011-01-11', 'Malmö-nybörjare', 'Viveka Olofsson', 'vivekaolofsson@yahoo.se', 'föra', 'har ingen \"kavaljer\" med. Har fått kursen i gåva!\r\nVill gå helst torsdagar 17.30'),
(652, '2011-02-07', 'Malmö-nybörjare', 'Jenny Sandsten', 'jenny.andersson@bredband2.com', 'följa', 'Jag och min man skulle vilja gå er grundkurs B Torsdagar 18-19.30 med start 24e mars i Malmö men såg att det stod lite olika information om tid osv beroende på vart man tittade. Stämmer det att det är Grund B och tiden? Har ni inte plats kanske det finns på Onsdag kvällen kl19.30? Vi har tidigare gått nybörjar kurs på Tangoakademin. MvH Jenny'),
(653, '2011-02-11', 'Malmö-nybörjare', 'Mantu Lindvall', 'mantulindvall@hotmail.com', 'föra', ''),
(654, '2011-02-13', 'Lund-nybörjare', 'Nima', 'nimamaki@hotmail.com', 'föra', 'Hej! Är det för sent att hoppa på den nystartade nybörjarkursen? När börjar i så fall nästa A-nivåkurs?'),
(655, '2011-02-22', 'Lund-nybörjare', 'Madeleine Jarlinius', 'fiska_fiskar@hotmail.com', 'följa', 'Vilka priser har ni på era kurser?\r\nmvh Madeleine'),
(656, '2011-03-09', 'Malmö-fortsättning', 'peter buchar', 'pb@qiart.com', 'föra', 'hej, jag hoppas/räknar med, att ligga på F2-F3 efter sommaren. \r\nMin styrka är god rytm, \"svagheten\" att våga föra. och teknik.\r\nSka ta privatlektioner i Gbg under våren innan flytt till Skåne, samt deltaga i Tango Primavera och Tango Retiro bl.a. \r\nSkulle önska mig en dansant danspartner på min nivå i Malmö, men det behöver jag inte innan kursstart, eller hur ?  hälsn. Peter  '),
(657, '2011-03-16', 'Lund-nybörjare', 'Swati Shukla', 'swatishukla@gmail.com', 'föra', 'I want to join the beginner Tango course.Please tell me when is the next course starting.\r\n\r\nRegards\r\nSwati\r\n'),
