(664, '2011-05-22', 'Malmö-nybörjare', 'Tina Kaic', 'tina_130@hotmail.com', 'föra', 'Jag är intresserad av att ge bort kurs/klasser till mina föräldrar i gåva. Jag skulle vilja veta priser för tango klasser, tacksam för svar omgående. \r\nMed vänlig hälsning\r\nTina Kaic\r\n0709-188716'),
