(676, '2011-09-05', 'Lund-nybörjare', 'Ulrika Björklund', 'bjorklund.ulrika@gmail.com', 'följa', 'Hej! Finns det platser kvar i höst för nybörjare på mån.kvällar i Lund? missade visserligen första passet som var ikväll, men det skulle jag kunna ta igen i Malmö på torsdag. Har ingen partner. Mvh, Ulrika'),
(677, '2011-09-06', 'Lund-nybörjare', 'Ewa Persson', 'ewa_b_persson@yahoo.se', 'följa', 'Jag missade att anmäla mig till kursen som börjar 6 sep.\r\nOm det finns plats, går jag gärna GRUNDKURS A tisdagar redan nu i höst. Det kanske inte gör något att jag missat första gången.....Har gått en grundkurs A hos er för flera år sedan.'),
