(784, '2010-10-08', 'Lund-nybörjare', 'Marie Jacobsson', 'jacobsson_marie@hotmail.com', 'följa', 'Hej!\r\nJag och min pojkvän har funderat på att börja dansa tango. Vi är intresserade av kursen som startar den 21 oktober. Finns det plats kvar?Kan man bara dansa med sin partner eller måste man byta? Finns det någon möjlighet att få prova en gång innan man bestämmer sig?\r\nTack på förhand!\r\n/Marie Javobsson'),
