(810, '2010-12-04', 'Malmö-fortsättning', 'Emi Kielerstajn', 'Emi.Kielerstajn@gmail.com', 'följa', 'Hej, min man och jag har precis avslutat fortsättningskurs 1 på tangoakademin och är intresserade av att fortsätta hos er. \r\nMvh Emi'),
