(826, '2011-01-07', 'Malmö-nybörjare', 'Nedeljka Micic', 'nedamicic@hotmail.com', 'följa', 'jag vill gärna veta om det går bra att börja utan partner. kan vara roligare än om bara tjejer dansar:-) \r\njag skulle gärna vilja komma på någon prova på innan om det finns?\r\njag hade tänkt mig börja den 3 feb på torsdagar men om gruppindelningen ser ojämn ut kan jag även tänka mig komma på onsdagar.\r\n\r\nser fram emot ert svar\r\n\r\nmvh Neda'),
(827, '2011-01-07', 'Malmö-nybörjare', 'Lina Lundkvist', 'linal@lsn.se', 'följa', 'Hej, jag vill börja a.s.a.p men är ensam. är det ok? min vännina är i samma situation. räcker det med de som vill föra eller ska man  stvinga sin egen man att följa med:)?'),
(828, '2011-01-09', 'Malmö-nybörjare', 'Anna Vallin', 'annaced@hotmail.com', 'följa', 'Ska gå nybörjare eller kanske fortsättning.'),
