(1148, '2010-10-27', 'Lund-nybörjare', 'Essi Kääriäinen & Göran Sundblom', 'essi.kaariainen@gmail.com', 'följa', 'Hej! Vi vill gärna komma med nästa gång ni har en nybörjarkurs i Lund. Bästa kvällar för oss är tisdag och onsdag. Skicka gärna en mail till mig då det är dags att anmäla sig. \r\n\r\nVar är er kurslokal i Lund? \r\n\r\nVänligen\r\nEssi Kääriäinen och Göran Sundblom'),
(1149, '2010-11-07', 'Lund-nybörjare', 'Angelika Lorenzen', 'lorenzen@bredband.net', 'följa', 'jag kommar med min man.'),
(1150, '2010-11-08', 'Lund-nybörjare', 'Mikael Roll', 'mikael.roll@gmail.com', 'föra', 'Min flickvän vill också börja nästa termin.'),
