(1152, '2010-11-18', 'Lund-nybörjare', 'Fredrik', 'Fredrik@honeyraft.com', 'föra', 'Hej,\r\nMin flickvän har alltid pratat om att hon skulle vilja lära sig dansa argentinsk tango. Jag hade tänkte ge henne det som en julklapp att hon och jag skall prova på detta. Kommer någon nybörjarkurs att börja under våren?\r\n\r\nMed vänliga hälsningar\r\nFredrik'),
(1153, '2010-11-18', 'Lund-nybörjare', 'Lars Eckberg', 'lars@eckberg.dk', 'föra', 'Malmö eller Lund, spelar ingen roll.\r\nSkal jeg have en partner med selv?\r\n\r\nVänlig hälsning,\r\n--Lars'),
(1154, '2010-11-21', 'Malmö-nybörjare', 'Eija Lukkari', 'eijalukkari@spray.se', 'följa', 'Jag har en egen danspartner; Mats Welander.'),
(1155, '2010-11-22', 'Malmö-fortsättning', 'Eva Hellgren', 'eva.hellgren@tele2.se', 'föra', ''),
(1156, '2010-11-22', 'Malmö-fortsättning', 'Anna Vagelin', 'anna@vagelin.com', 'följa', 'Hej, vilken nivå rekommenderar du för oss efter 5 terminer på Tangoakademin men alldeles för få praktikor?\r\n\r\nmvh Leif o Anna'),
(1157, '2010-11-23', 'Malmö-fortsättning', 'Edith Mörtlund', 'ida_edith@home.se', 'följa', 'Hejsan!\r\nJag och min pojkvän vill fortsätta dansa tango i vår! Vi vill gå som par. Jag dansar lite bättre än honom, jag började för ett par år sedan i BsAs. Vi har gått en nybörjarkurs nu i höst, men den tyckte vi var lite för lätt. Huvudsaken är att vi kan fortsätta dansa.\r\nHälsningar, Edith och Ezequiel'),
(1158, '2010-11-24', 'Malmö-fortsättning', 'Jan Spirer', 'spirer@ebox.tninet.se', 'föra', 'Jag går nybörjarkursen hösten 2010 på Tangoakedemin (Paul) och vill gärna forsätta nästa termin.'),
(1159, '2010-11-25', 'Lund-nybörjare', 'Maria Marforio', 'maria.marforio@tetrapak.com', 'följa', ''),
(1160, '2010-11-25', 'Lund-fortsättning', 'Karin Stalhammar', 'karin.stalhammar@gmail.com', 'följa', ''),
