(1186, '2011-02-07', 'Malmö-nybörjare', 'Jenny Sandsten', 'jenny.andersson@bredband2.com', 'följa', 'Jag och min man skulle vilja gå er grundkurs B Torsdagar 18-19.30 med start 24e mars i Malmö men såg att det stod lite olika information om tid osv beroende på vart man tittade. Stämmer det att det är Grund B och tiden? Har ni inte plats kanske det finns på Onsdag kvällen kl19.30? Vi har tidigare gått nybörjar kurs på Tangoakademin. MvH Jenny'),
