(1326, '2010-10-27', 'Lund-nybörjare', 'Essi Kääriäinen & Göran Sundblom', 'essi.kaariainen@gmail.com', 'följa', 'Hej! Vi vill gärna komma med nästa gång ni har en nybörjarkurs i Lund. Bästa kvällar för oss är tisdag och onsdag. Skicka gärna en mail till mig då det är dags att anmäla sig. \r\n\r\nVar är er kurslokal i Lund? \r\n\r\nVänligen\r\nEssi Kääriäinen och Göran Sundblom'),
