(1335, '2010-11-23', 'Malmö-fortsättning', 'Edith Mörtlund', 'ida_edith@home.se', 'följa', 'Hejsan!\r\nJag och min pojkvän vill fortsätta dansa tango i vår! Vi vill gå som par. Jag dansar lite bättre än honom, jag började för ett par år sedan i BsAs. Vi har gått en nybörjarkurs nu i höst, men den tyckte vi var lite för lätt. Huvudsaken är att vi kan fortsätta dansa.\r\nHälsningar, Edith och Ezequiel'),
