(1341, '2010-11-30', 'Lund-nybörjare', 'Martin Olin', 'martin.olin@gmail.com', 'föra', 'Hej,\r\n\r\nMitt namn är Martin Olin och jag har på senare tid blivit intresserad av Argentinsk Tango och skulle vilja lära mig hur det går till.\r\n\r\nJag har tyvärr ingen partner att ta med mig, men jag hoppas att det går att lösa ändå.\r\n\r\nMin nivå är verkligen nybörjare, har aldrig tagit ett enda steg Tango tidigare, men jag ser fram emot att få prova på!\r\n\r\nMed vänlig hälsning\r\nMartin Olin'),
(1342, '2010-12-01', 'Lund-fortsättning', 'SonjaJönsson', 'sonja.elisabeth@live.se', 'följa', 'Har gått nybörjarkursen på tangoakademin under hösten och vill väldigt gärna fortsätta med denna fantastiska dans.'),
(1343, '2010-12-04', 'Malmö-fortsättning', 'Ingrid Häggblom', 'ingridhaggblom@hotmail.com', 'följa', 'Har gått en termin hos Tangoakademin men de kommer ej att ge kurser till våren, därmed söker jag efter en annan skola. Min partner från Tangoakademin är också intresserad av att fortsätta. '),
(1344, '2010-12-04', 'Malmö-fortsättning', 'Emi Kielerstajn', 'Emi.Kielerstajn@gmail.com', 'följa', 'Hej, min man och jag har precis avslutat fortsättningskurs 1 på tangoakademin och är intresserade av att fortsätta hos er. \r\nMvh Emi'),
(1345, '2010-12-06', 'Malmö-fortsättning', 'Johan Stigård', 'johan.stigard@gmail.com', 'föra', ''),
