(1348, '2010-12-07', 'Malmö-nybörjare', 'Mary-Anne López', 'manlop@spray.se', 'följa', 'Vi är ett par som dansat en termin på tangopalatset och vill gärna fortsätta nästa termin. Min sambo heter Jonas Jinnestrand.'),
(1349, '2010-12-07', 'Malmö-nybörjare', 'Mary-Anne López', 'manlop@spray.se', 'följa', 'Vi är ett par som dansat en termin på tangopalatset och vill gärna fortsätta nästa termin. Min sambo heter Jonas Jinnestrand.'),
(1350, '2010-12-08', 'Malmö-fortsättning', 'gerrie Ferguson', 'info@norregard.net', 'föra', 'I would like to attend Forts 2 & 3 in Malmö on Thursdays as Förare, please!\r\n\r\nLove & Hugs\r\n\r\nGerrie  F:'),
(1351, '2010-12-08', 'Lund-fortsättning', 'Gerrie Ferguson', 'info@norregard.net', 'följa', 'I would like to attend, as per usual! Fors 3 & 4 Mondays in Lund\r\n\r\nMore Love & Hugs\r\n\r\nG.'),
(1352, '2010-12-08', 'Lund-fortsättning', 'Christina Bengmark', 'christina.bengmark@skane.se', 'följa', ''),
(1353, '2010-12-10', 'Malmö-fortsättning', 'Camilla Andersson', 'camillamandersson@hotmail.com', 'följa', 'Hej Daniel\r\n\r\nJag hade tänkt att gå Ellinors följarkurs och vill bli påmind om nästa tillfälle (som jag hoppas blir under våren).\r\n\r\n/Camilla '),
(1354, '2010-12-13', 'Malmö-fortsättning', 'agneta svartvik andersson', 'nenne_svart@hotmail.com', 'följa', 'Har gått två terminer på Tangoplapatset. I nuläget har jag en partner.'),
(1355, '2010-12-13', 'Lund-nybörjare', 'Sofie Nodbring', 'sofie.nodbring@gmail.com', 'följa', 'Jag vill anmäla mitt intresse till att gå nybörjarkurs när kurserna börjar nästa gång och vill gärna bli påmind om den kommande kursstarten!'),
(1356, '2010-12-15', 'Lund-nybörjare', 'Maria Bohlin', 'mbohlin@live.se', 'följa', 'Jag vill dansa tillsammans med Lars Svensson, vi är båda nybörjare, vill gå kurs på måndag el torsdag kväll!'),
(1357, '2010-12-16', 'Malmö-nybörjare', 'Nathalie Nilsson Norman', 'nathalie_norman@yahoo.com', 'följa', 'Dansa, föra el följa.? \r\nAntar att jag är följa. '),
(1358, '2010-12-20', 'Malmö-nybörjare', 'Charlotte Rinter', 'charlotte_rinter@hotmail.com', 'följa', ''),
(1359, '2011-01-07', 'Malmö-nybörjare', 'Matilda Eklund', 'meklund@hotmail.com', 'följa', 'vad kostar en nybörjarkurs?'),
(1360, '2011-01-07', 'Malmö-nybörjare', 'Nedeljka Micic', 'nedamicic@hotmail.com', 'följa', 'jag vill gärna veta om det går bra att börja utan partner. kan vara roligare än om bara tjejer dansar:-) \r\njag skulle gärna vilja komma på någon prova på innan om det finns?\r\njag hade tänkt mig börja den 3 feb på torsdagar men om gruppindelningen ser ojämn ut kan jag även tänka mig komma på onsdagar.\r\n\r\nser fram emot ert svar\r\n\r\nmvh Neda'),
(1361, '2011-01-07', 'Malmö-nybörjare', 'Lina Lundkvist', 'linal@lsn.se', 'följa', 'Hej, jag vill börja a.s.a.p men är ensam. är det ok? min vännina är i samma situation. räcker det med de som vill föra eller ska man  stvinga sin egen man att följa med:)?'),
(1362, '2011-01-09', 'Malmö-nybörjare', 'Anna Vallin', 'annaced@hotmail.com', 'följa', 'Ska gå nybörjare eller kanske fortsättning.'),
(1363, '2011-01-11', 'Malmö-nybörjare', 'Viveka Olofsson', 'vivekaolofsson@yahoo.se', 'föra', 'har ingen \"kavaljer\" med. Har fått kursen i gåva!\r\nVill gå helst torsdagar 17.30'),
(1364, '2011-02-07', 'Malmö-nybörjare', 'Jenny Sandsten', 'jenny.andersson@bredband2.com', 'följa', 'Jag och min man skulle vilja gå er grundkurs B Torsdagar 18-19.30 med start 24e mars i Malmö men såg att det stod lite olika information om tid osv beroende på vart man tittade. Stämmer det att det är Grund B och tiden? Har ni inte plats kanske det finns på Onsdag kvällen kl19.30? Vi har tidigare gått nybörjar kurs på Tangoakademin. MvH Jenny'),
(1365, '2011-02-11', 'Malmö-nybörjare', 'Mantu Lindvall', 'mantulindvall@hotmail.com', 'föra', ''),
(1366, '2011-02-13', 'Lund-nybörjare', 'Nima', 'nimamaki@hotmail.com', 'föra', 'Hej! Är det för sent att hoppa på den nystartade nybörjarkursen? När börjar i så fall nästa A-nivåkurs?'),
(1367, '2011-02-22', 'Lund-nybörjare', 'Madeleine Jarlinius', 'fiska_fiskar@hotmail.com', 'följa', 'Vilka priser har ni på era kurser?\r\nmvh Madeleine'),
(1368, '2011-03-09', 'Malmö-fortsättning', 'peter buchar', 'pb@qiart.com', 'föra', 'hej, jag hoppas/räknar med, att ligga på F2-F3 efter sommaren. \r\nMin styrka är god rytm, \"svagheten\" att våga föra. och teknik.\r\nSka ta privatlektioner i Gbg under våren innan flytt till Skåne, samt deltaga i Tango Primavera och Tango Retiro bl.a. \r\nSkulle önska mig en dansant danspartner på min nivå i Malmö, men det behöver jag inte innan kursstart, eller hur ?  hälsn. Peter  '),
(1369, '2011-03-16', 'Lund-nybörjare', 'Swati Shukla', 'swatishukla@gmail.com', 'föra', 'I want to join the beginner Tango course.Please tell me when is the next course starting.\r\n\r\nRegards\r\nSwati\r\n'),
