INSERT INTO `tbl_teacher_note` (`id`, `groupId`, `textId`, `language`, `textBody`, `creaTimestamp`, `updTimestamp`) VALUES
(1, 'PRESENCE', '2103032030SOGK2_7V2021-04-21', 'SV', '<p>Basic 2 &nbsp;&nbsp;Daniel &amp; Anna &nbsp;&nbsp;Malmö &nbsp;&nbsp;Wednesday &nbsp;&nbsp;2021-04-21 &nbsp;&nbsp;20:30 &nbsp;&nbsp;(12)</p>', '2021-04-21 18:15:00', '2021-04-21 18:15:00'),
(2, 'PRESENCE', '2101131730STF1_16V2021-04-21', 'SV', '<p>Rep. musikalitet i lyrisk och rytmisk tango, korsat grundsteg</p>\n<p>Nytt: låg boleo</p>', '2021-04-21 20:06:47', '2021-04-21 20:06:47'),
(3, 'PRESENCE', '2101131900STF2_16V2021-04-21', 'SV', '<p>Rep: dark side sacada med kors, upprepat</p>\n<p>Nytt. volcada</p>', '2021-04-21 20:09:28', '2021-04-21 20:09:28'),
(4, 'PRESENCE', '2104212030SOGK3_7V2021-04-21', 'SV', '<p>Lek 1. dubblering i giros och grundsteg</p>', '2021-04-21 20:12:55', '2021-04-21 20:12:55'),
(5, 'PRESENCE', '2104111600SOGK2_7V2021-04-25', 'SV', 'Rep. Milonga: oval giro, zickzack, klockan. \nNytt. Sätta ihop figurerna.\nPoint dutt.\n\nRep tango fa  parada, ocho och utsmyckningar. \n\nNästa gång bakåtocho.  ', '2021-04-25 15:39:09', '2021-04-25 15:39:09'),
(6, 'PRESENCE', '2103221730VGFK_11V2021-04-26', 'SV', 'Rep milonga, virvlande gång, oval giro, zickzack (la till rytmisering).\nLa till korslek.\nNytt; korsat grundsteg.  Korsad gång. \nNästa tillfälle; gungor i korsat system.', '2021-04-26 17:43:12', '2021-04-26 17:43:12'),
(7, 'PRESENCE', '2101131730STF1_16V2021-04-28', 'SV', '<p>Repetera låg bakåtboleo</p>\n<p>Sacada, sacada, parada, sandwich.</p>\n<p><br></p>\n<p>Nästa vecka; sista lektionen. Lite rep, sedan fika och dans och show</p>', '2021-04-28 16:44:52', '2021-04-28 16:44:52'),
(8, 'PRESENCE', '2101131900STF2_16V2021-04-28', 'SV', '<p>rep volcada, nytt volcada som start och i calecita från bakåtkors</p>\n<p>Nästa vecka: avslutning</p>', '2021-04-28 18:29:57', '2021-04-28 18:29:57'),
(9, 'PRESENCE', '2104212030SOGK3_7V2021-04-28', 'SV', '<p>Rep dubbeltempo i gång, gungor, giro, kors.</p>\n<p>Rep ocho bakåt, nytt. korsad gång.</p>\n<p>nytt. parada sandwich</p>', '2021-04-28 20:05:30', '2021-04-28 20:05:30'),
(10, 'PRESENCE', '2101141900STER1_16V2021-04-29', 'SV', '<p>volcada på stället och i calecita</p>\n<p>nästa gång vanlig volcada och avslutning</p>', '2021-04-29 20:15:18', '2021-04-29 20:15:18'),
(11, 'PRESENCE', '2104111415SOGK1_7V2021-05-02', 'SV', 'Rep boxar. Ocho.giro med flrarutsmyckning kors. Into Prada. Utsmyckningar. Omfamning.. Intro giro i båda riktningar.', '2021-05-02 13:14:45', '2021-05-09 13:30:17'),
(12, 'PRESENCE', '2104111600SOGK2_7V2021-05-02', 'SV', 'Rep cirlulära moment. Rep gungor.\n\nBakåt ocho. Sandwich. Utgång i gunga.\n\nPlanering nästa veckan: utgång i giro. ', '2021-05-02 18:19:09', '2021-05-02 18:19:09'),
(13, 'PRESENCE', '2103221730VGFK_11V2021-05-03', 'SV', 'Komma in i korsat system, följare resp förare tar extra steg. Gungor med vridning.\nNästa gång lägga till bakåtkors i utgången. Vals?', '2021-05-03 17:12:50', '2021-05-03 17:12:50'),
(14, 'PRESENCE', '2104212030SOGK3_7V2021-05-05', 'SV', '<p>Rep bakåt ocho med parada sandwich och korsad gång.</p>\n<p>Nytt: olika möjligheter i korset.&nbsp;</p>', '2021-05-05 19:28:37', '2021-05-05 19:28:37'),
