(203, 'Summer', 'Contact Us', 'EN', '\r\n<h1>Contact infomation</h1>\r\n\r\nE-mail to Daniel: \r\n<a href=\'mailto:daniel@tangokompaniet.com\'>\r\ndaniel@tangokompaniet.com\r\n</a> \r\n<p/>\r\nPhone to Daniel: 0046-(0)73 6563609\r\n', '2018-01-21 18:28:19', '2019-09-23 14:19:28', NULL),
(204, 'Summer', 'Other Info', 'EN', '<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n<h1>Other info</h1>\r\n<h3>Food and Beverages</h3>\r\n<p>Coffee, tea, coke, chocolate, fruits will be available. Malmoe has many good restaurants; so no need to be hungry!</p>\r\n<h3>TK-Tango-shop</h3>\r\n<p>Tangokompaniet offers many models from several different brands of good shoes for dancing – both classical and sneakers for both men and women in the studio at Fredriksbergsgatan 7. You can also find music, CDs, books and clothing! Some of our brands: Bandolera, Regina, Vikinga, Fabioshoes, DNI, Carlos Ferroni, Bloch, DSOL</p>\r\n<h3>Dancepartner</h3>\r\n<p>Please use Tangokompaniet Festivalito event on Facebook to search partner or Tangokompaniets Partnersearch on facebook. You can register without partner but it is easier with! We can help with partnersearch if you tried and didnt succeed !</p>\r\n<h3>Accomodation</h3>\r\n<p>Please search for local dancers that might take you in or look for youth hostels or hotels; you can find good deals at <a href=\"http://www.booking.com\" class=\"autohyperlink\" title=\"http://www.booking.com\">www.booking.com</a>. If nothing is found contact us !</p>\r\n<h3></h3>\r\n\r\n				\r\n			\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2019-09-23 14:19:28', NULL),
