(206, 'Summer', 'Register', 'EN', '<h1>Malmö Tango Summer Registration</h1>\n\n<h3>About the registration</h3>\nYou are welcome to register with or without partner. If you are a follower it might be a smart thing to catch a leader to register together with, since there are more followers that register than leaders and we take in an even amount of leaders and followers. Are you a dancer of both roles it is less important to register together with someone.\nBecause of the situation around the pandemic we want all who participate at the maraton to either be vaccinated, have antibodies or have made a recent test to covid-19 upon arrival. This to make the event as safe as possible. We will check your payment and papers at the registration when you arrive.\n\n\n<h3>Payment (see Prices)</h3>\nIf you have little money but still want to participate, you can help out during the maraton as payment. E-mail us at \n<a href=\"mailto:anna.tangokompaniet.com?subject=SUMMER registration request\">\nanna@tangokompaniet.com\n</a>', '2018-01-21 18:28:19', '2021-10-27 08:24:06', NULL),
(207, 'Summer', 'Schedule', 'EN', '<h1>Schedule</h1>\n<p>The classes that are given are:</p>\n<p><strong>Tango basics</strong> classes; for you who are a complete beginner or for you who want to repeat some basics in tango.</p>\n<p><strong>Workshops </strong>that are 1,5 hours hours long about one theme and&nbsp;are held for all levels of dancers except for complete beginners.</p>\n<p><strong>Tango DJ seminar</strong>&nbsp;that is &nbsp;for anyone who is interested in starting to tango DJ or for you who &nbsp;already are DJing and want to brush up your skills.&nbsp;You can choose one &nbsp;or both parts.</p>\n<p><strong>Seminars&nbsp;</strong>that are 2 hours long, twice during the festival. You have more time and we dig deeper. You can choose one or both parts.</p>\n<p><strong>Choreography seminar</strong>&nbsp;that is for you who want to learn a choreography during 5 days and perform it in the festival on Saturday night!</p>\n<p>The&nbsp;<strong>milongas&nbsp;</strong>are open for everyone and are included in the dance-packages or you can pay at the door!</p>\n<p>Please register to join the classes! You can register with or without partner to the dancing classes.</p>\n<p><img alt=\"stadsparken 2\" height=\"225\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/stadsparken-2-300x225.jpg\" width=\"300\"/></p>\n<p><strong>Monday 1st of July</strong></p>\n<p><strong>18.30 – 21.00 Milonga and free try-tango class,</strong>&nbsp;with Daniel &amp; Anna, outdoor, under roof,&nbsp;in Stadsparken in Lund. Adress: Ringvägen 15, 222 23 Lund. You have a map <a href=\"https://www.google.se/maps/place/Ringv%C3%A4gen+15,+222+25+Lund/@55.6957989,13.1832237,17z/data=!3m1!4b1!4m5!3m4!1s0x465397dd61b49607:0x560c7970fd485272!8m2!3d55.6957959!4d13.1854124\">here</a>!</p>\n<p><strong>Tuesday 2nd of July</strong></p>\n<p>17.30 – 20.30<strong>&nbsp;Seminar&nbsp;–&nbsp;CHOREOGRAPHY</strong>, with Daniel &amp; Anna at Tangokompaniet studio in Malmö. Adress: Fredriksbergsgatan 7, 212 11 Malmö.</p>\n<p><strong>Wednesday 3rd of July</strong></p>\n<p>17.30 – 20.30<strong> Seminar&nbsp;–&nbsp;CHOREOGRAPHY</strong>,&nbsp;with Daniel &amp; Anna at Tangokompaniet studio in Malmö. Adress: Fredriksbergsgatan 7, 212 11 Malmö.</p>\n<p>20.30 – 23.00 <strong>Milonga</strong>&nbsp;with DJ Johan Nordström, at Tangokompaniet studio in Malmö. &nbsp;Adress: Fredriksbergsgatan 7, 212 11 Malmö.</p>\n<p><img alt=\"konsthallen fb\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/konsthallen-fb-220x300.jpg\" width=\"220\"/></p>\n<p><strong>Thursday 4th of July</strong></p>\n<p>17.30 – 20.30 <strong>Seminar&nbsp;–&nbsp;CHOREOGRAPHY</strong>,&nbsp;with Daniel &amp; Anna at Tangokompaniet studio in Malmö. Adress: Fredriksbergsgatan 7, 212 11 Malmö.</p>\n<p>20.30 – 23.30 <strong>Milonga at Tangokompaniet</strong>,&nbsp;with &nbsp;DJs Micael Gonzalez Alonso &amp; Koki Lacherre and live music by Carlos &nbsp;Quilici and Cipriano Calonico. In collaboration with Street &nbsp;Tango.&nbsp;Adress:&nbsp;Fredriksbergsgatan 7, 212 11 Malmö</p>\n<p><img alt=\"tango malmö live\" height=\"225\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/tango-malmö-live-300x225.jpg\" width=\"300\"/></p>', '2018-01-21 18:28:19', '2019-09-23 14:19:28', NULL);
