(208, 'Summer', 'Teachers and DJs', 'EN', '\r\n\r\n<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n	\r\n					<h1>The crew</h1>\r\n<h1></h1>\r\n<p><strong style=\"color: black; font-family: Verdana, Arial, sans-serif; font-size: 11px;\">The teachers and performers</strong></p>\r\n<p>&nbsp;</p>\r\n<p><b>Anna Sol&nbsp;</b><img src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/anna.solakius.jpg\" width=\"212\" height=\"300\"><br>\r\nAnna teaches and organizes in Tangokompaniet since 2002. Her teaching offers the opportunity to explore her own body, the communication in dance and the expression in the music. Her dance expresses her person; energy, joy and the pursuit of consciousness. She is also a very active DJ, both regionally, nationally and internationally, and also hosts seminars on tango music and DJing.</p>\r\n<p><strong>Camila Holst-Viancos&nbsp;</strong><img class=\"alignnone size-medium wp-image-441\" alt=\"DSC_1302\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/DSC_1302-199x300.jpg\" width=\"199\" height=\"300\"></p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; -webkit-text-stroke: #000000}\r\nspan.s1 {font-kerning: none}\r\nspan.s2 {font: 12.0px \'Helvetica Neue\'; font-kerning: none}\r\n--></style>\r\n<p>Camila Viancos has a broad experience with teaching, dancing and performing from different dance styles such as salsa and modern dancing.&nbsp;Her focus in tango dancing is connection, musicality and body awareness. She is very passionated about teaching and she currently lives from teaching dance, yoga and pilates.&nbsp;Camila is also&nbsp;performing as a singer and teaches musicality for salsa dancers with live musicians.</p>\r\n<p><strong>Cecilia Warfvinge&nbsp;</strong><img alt=\"cecilia\" src=\"https://festivalito.tangokompaniet.com/wp-content/uploads/cecilia-248x300.jpeg\" width=\"248\" height=\"300\"></p>\r\n<p>For Cecilia, Tangon offers the opportunity to express dynamic musicality, and her dance has been described as elegant and musical. She has a background in classical music, and therefore has a deep understanding of the different expressions of music. Cecilia is inspired by her interest in fitness and Chinese Tai Chi, and advocates bodily control and playfulness in the dance.</p>\r\n<p><b>Daniel Carlsson&nbsp;</b><img class=\"alignnone size-medium wp-image-426\" alt=\"daniel.carlsson\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/daniel.carlsson.jpg\" width=\"212\" height=\"300\"></p>\r\n<div id=\"tw-target-text-container\">\r\n<p dir=\"ltr\" id=\"tw-target-text\" data-placeholder=\"Översättning\">Daniel is one of the founders of Tangokompaniet. After touring around the world teaching tango during many years and teaching in over 20 countries Daniel decided to put more focus on making the Öresundtango grow in many aspects. For Daniel feeling, connection and creativity are the key words.</p>\r\n<p><strong>Nidia Martinez&nbsp;</strong><img alt=\"nidia\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/nidia-248x300.jpg\" width=\"248\" height=\"300\"><br>\r\nNidia is educated in contemporary / modern dance and works as a dancer, choreographer and teacher. She is also Pilate’s instructor. Nidia started dancing tango in Argentina and is interested in tango as social dance but also as a technique that makes her artistic expression richer. As a teacher, she focuses on body communication and awareness. She develops her training method for tango dancers with her knowledge of Pilates and Contact Improvisation (contemporary / modern dance).</p>\r\n<p>&nbsp;</p>\r\n<pre lang=\"en\"></pre>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p><b>Per Berseus&nbsp;</b><img class=\"alignnone size-medium wp-image-424\" alt=\"per.berseus\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/per.berseus.jpg\" width=\"212\" height=\"300\"></p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; -webkit-text-stroke: #000000}\r\nspan.s1 {font-kerning: none}\r\n--></style>\r\n<p>With one foot in musicianship and the other in movement practices, Per has an in-depth relationship with dancing and teaching. Ever since his childhood he has kept playing in a symphony orchestra, and he was immediately captured by the tango music when he started dancing in 2003. Over the last 10 years Per draws inspiration from movement disciplines such as yoga and Gyrotonic, and he teaches tango as an embodied experience of warm-hearted expression</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sonny La&nbsp;</strong><img class=\"alignnone size-medium wp-image-423\" alt=\"sonny\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/sonny-211x300.jpg\" width=\"232\" height=\"330\"><br>\r\nTango is for Sonny a dance of presence and musical expression. His dance can be described as conscious and playful. Sonny has a background in Chinese Kung Fu and Tai Chi, exhibiting both physical strength and soft dynamics. With his good educational ability, he inspires his students to dare to experiment and experiment with their dance.</p>\r\n<p><b>Tava Sieh&nbsp;</b><img alt=\"Tava\" src=\"https://festivalito.tangokompaniet.com/wp-content/uploads/Tava.jpg\" width=\"180\" height=\"240\"></p>\r\n<p>Tava’s love for dance and enthusiasm for teaching is informed by her experiences as a physiotherapist, massage therapist, and yoga practitioner. She began her Tango journey in Boulder, Colorado and the path lead quickly to Buenos Aires, and then onward Sweden where she has been teaching with Tangokompaniet since 2012.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>DJs</strong></p>\r\n<p>Per Berseus</p>\r\n<p>Johan Nordström</p>\r\n<p>Sten Odelberg</p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 23.0px Times; color: #454545; -webkit-text-stroke: #454545} span.s1 {font-kerning: none}\r\n--></style>\r\n\r\n				\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2019-09-23 14:19:28', NULL),
(209, 'Summer', 'Venues', 'EN', '<p>&nbsp;</p>\n<h1>Venues</h1>\n<p>The Summer Tango Malmö 2019 will be held at…</p>\n<p><strong>Stadsparken,&nbsp;Ringvägen 15, 222 23 Lund</strong></p>\n<p>an outdoor venue, under roof with wooden floor in a big beautiful park in Lund</p>\n<p>Click&nbsp;<a href=\"https://www.google.se/maps/place/Ringv%C3%A4gen+15,+222+25+Lund/@55.6957989,13.1832237,17z/data=!3m1!4b1!4m5!3m4!1s0x465397dd61b49607:0x560c7970fd485272!8m2!3d55.6957959!4d13.1854124\">here</a>&nbsp;to see the map!</p>\n<p><img alt=\"Stadsparken Summer 18\" height=\"163\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/Stadsparken-Summer-18-300x163.jpeg\" width=\"300\"/></p>\n<p><strong>Tangokompaniet studio, Fredriksbergsgatan 7,&nbsp;212 11 Malmö</strong></p>\n<p>is our home! Our studio and tango shop is a cool basement venue with sofas, a good dance floor and lot’s of ambience.</p>\n<p>Click&nbsp;<a href=\"https://www.google.se/maps/place/Fredriksbergsgatan+7,+212+11+Malm%C3%B6/@55.6076163,13.0171969,17z/data=!3m1!4b1!4m5!3m4!1s0x4653a3e6c24df25f:0x9320c6dfa0d87938!8m2!3d55.6076133!4d13.0193856\">here</a>&nbsp;to see the map!</p>\n<p><img alt=\"racing\" height=\"200\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/racing-300x200.jpeg\" width=\"300\"/></p>\n<p><strong>Outside Konsthallen, St Johannesgatan 7, 205 80 Malmö</strong></p>\n<p>where you can dance outdoors in good weather on a quite slippery &nbsp;stone platform, in the middle of the city, surrounded by people and &nbsp;parks</p>\n<p>Click&nbsp;<a href=\"https://www.google.se/maps/place/S:t+Johannesgatan+7,+211+46+Malm%C3%B6/@55.5950586,12.9970408,17z/data=!3m1!4b1!4m5!3m4!1s0x4653a150e5658a4d:0x710e8ebe42c0970e!8m2!3d55.5950556!4d12.9992295\">here</a>&nbsp;to see the map!</p>\n<p><img alt=\"konsthallen fb\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/konsthallen-fb-220x300.jpg\" width=\"220\"/></p>\n<p><strong>Barnens scen, Falsterbogatan 17,&nbsp;214 36 Malmö</strong></p>\n<p>which is a cosy wooden theatre with a round dance floor situated in Folkets park</p>\n<p>Click&nbsp;<a href=\"https://www.google.se/maps/place/Falsterbogatan+17,+214+36+Malm%C3%B6/@55.5926902,13.0118391,17z/data=!3m1!4b1!4m5!3m4!1s0x4653a15d0e6caf75:0xd5902061a8744b91!8m2!3d55.5926872!4d13.0140278\">here</a>&nbsp;to see the map!</p>\n<p><img alt=\"barnensscen2\" height=\"174\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/barnensscen2.jpg\" width=\"290\"/></p>\n<p><strong>Arriba tango,&nbsp;Adress: Limhamnsvägen 111F, 216 13 Limhamn (Malmö)</strong></p>\n<p>which is a dance studio with parket situated in an industrial area. Loads of parking places!</p>\n<p><strong>How to get there</strong></p>\n<p>You can easily get to the different venues with local och regional&nbsp;<strong>bus and train</strong>. You will find timetables and prices for the bus at <a href=\"http://www.skanetrafiken.se/\">www.skanetrafiken.se</a>&nbsp;A tip is to download their app and pay through that!</p>\n<p>You can also take a <strong>taxi</strong>&nbsp;with fixed prices in Malmö! Call +46 40 979797 Taxi 97.</p>', '2018-01-21 18:28:19', '2019-09-23 14:19:28', NULL),
(210, 'Summer', 'Prices', 'EN', '<p>&nbsp;</p>\n<h1>Prices and Payment</h1>\n<p>Packages</p>\n<p><strong>Take it all -&nbsp;package:</strong>&nbsp;SEK 2470 / € 240 -&nbsp;15 hours of choreography classes and as many of the other workshops as you want and&nbsp;all the milongas</p>\n<p><strong>Choreography package</strong>:&nbsp;SEK 2180 / € 220 – 15 hours of choreography classes and all the milongas</p>\n<p><strong>Diving in – package:&nbsp;</strong>SEK 1830 &nbsp;/ € 185 – Up to 10,5&nbsp;hours of classes and all the milongas</p>\n<p><strong>Summerpackage:</strong>&nbsp;SEK 1510 &nbsp;/ € 150 – Up to 7,5 hours of classes and all the milongas</p>\n<p><strong>Beginners package:&nbsp;</strong>SEK 500 / € 50 – Three classes (Tango basics) and all the social dancing (milongas) with shows and live music</p>\n<p><strong>Full Dance-package</strong>: SEK 550 / € 55 -&nbsp;All the milongas during the whole week</p>\n<p><strong>Weekend Dance-package:&nbsp;</strong>SEK 380 / € 40 – The milongas during the weekend; Friday to Sunday</p>\n<p>It is also possible to pay for a single workshop or milonga:</p>\n<p><strong>Tango basics workshop:&nbsp;</strong>SEK 200 / € 20 which includes one hour of dance class and the social dance after the class</p>\n<p><strong>Workshop/Seminar</strong>: SEK&nbsp;250 / € 25 per workshop of 1,5 &nbsp;h and SEK 350 / € 35 per seminar-part of 2 h (preregistration needed) &nbsp;The Stretch &amp; Massage workshop costs 200 SEK / € 20</p>\n<p><strong>Milongas: </strong>If you are coming to just a milonga, you pay at the door</p>\n<ul>\n  <li>Friday milonga with live music: SEK 200/€ 20 (Camarin members SEK 170/€ 17)</li>\n  <li>Saturday milonga with shows: SEK&nbsp;150/€ 15</li>\n  <li>Sunday milonga with surprise: SEK 80/€ 8</li>\n  <li>The milongas during the week cost SEK 60-80/€ 6-8</li>\n</ul>\n<p>Holders of Tangokompaniet Summer Card have free admission to the Wednesday and Sunday milonga.</p>\n<p><strong>PS!&nbsp;</strong>Malmö is in general full of restaurants, so you can also just go out and venture about!</p>\n<p><img alt=\"milonga\" height=\"200\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/milonga-300x200.jpg\" width=\"300\"/></p>\n<p><strong>Payment</strong></p>\n<p>If you have questions about booking and payments please contact Anna Sol at <a href=\"mailto:anna@tangokompaniet.com\" title=\"mailto:anna@tangokompaniet.com\">anna@tangokompaniet.com</a> or +46 (0)705 150345.</p>\n<p>Payment is done to Tangokompaniet Swish 123 173 30 05 or&nbsp;Bankgiro &nbsp;5532-8223 from Swedish banks or cash if you are living abroad. You pay &nbsp;after you get a confirmation email.</p>', '2019-09-23 12:11:32', '2019-09-23 14:19:28', NULL),
(218, 'Marathon', 'Contact Us', 'EN', '\r\n<h1>Contact infomation</h1>\r\n\r\nE-mail to Daniel: \r\n<a href=\'mailto:daniel@tangokompaniet.com\'>\r\ndaniel@tangokompaniet.com\r\n</a> \r\n<p/>\r\nPhone to Daniel: 0046-(0)73 6563609\r\n', '2018-01-21 18:28:19', '2019-09-23 14:20:18', NULL),
(219, 'Marathon', 'Other Info', 'EN', '<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n<h1>Other info</h1>\r\n<h3>Food and Beverages</h3>\r\n<p>Coffee, tea, coke, chocolate, fruits will be available. Malmoe has many good restaurants; so no need to be hungry!</p>\r\n<h3>TK-Tango-shop</h3>\r\n<p>Tangokompaniet offers many models from several different brands of good shoes for dancing – both classical and sneakers for both men and women in the studio at Fredriksbergsgatan 7. You can also find music, CDs, books and clothing! Some of our brands: Bandolera, Regina, Vikinga, Fabioshoes, DNI, Carlos Ferroni, Bloch, DSOL</p>\r\n<h3>Dancepartner</h3>\r\n<p>Please use Tangokompaniet Festivalito event on Facebook to search partner or Tangokompaniets Partnersearch on facebook. You can register without partner but it is easier with! We can help with partnersearch if you tried and didnt succeed !</p>\r\n<h3>Accomodation</h3>\r\n<p>Please search for local dancers that might take you in or look for youth hostels or hotels; you can find good deals at <a href=\"http://www.booking.com\" class=\"autohyperlink\" title=\"http://www.booking.com\">www.booking.com</a>. If nothing is found contact us !</p>\r\n<h3></h3>\r\n\r\n				\r\n			\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2019-09-23 14:20:18', NULL),
(220, 'Marathon', 'Payment', 'EN', '<img src=\\\'http://localhost:3000//images/festivalito.jpeg\\\'>', '2018-01-21 18:28:19', '2019-09-23 14:20:18', NULL),
(221, 'Marathon', 'Register', 'EN', '<p>&nbsp;</p>\n<h1>Malmö Tango Maraton Registration</h1>\n<p>The registration opens 20-th of October 2021, 12:00 CET! A form will then be visible below this text.</p>\n<p>The marathon is open for 150 dancers of all levels BUT we strongly &nbsp;recommend you to have done some miles. We know from our long experience &nbsp;as tango-marathon organizers that if you are very new in tango it can be a &nbsp;bit overwhelming… ; ) We believe that a good atmosphere arises from a &nbsp;mix of all kinds of people from near and afar and hope to see a long &nbsp;list of countries represented!</p>\n<p><img alt=\"babismaraton\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/babismaraton-300x199.jpg\" width=\"50%\"/></p>\n<h3>About the registration</h3>\n<p>You are welcome to register with or without partner. If you are a follower it might be a smart thing to catch a leader to register together with, since there are more followers that register than leaders and we take in an even amount of leaders and followers. Are you a dancer of both roles it is less important to register together with someone.</p>\n<p>Because of the situation around the pandemic we want all who participate at the maraton to either be vaccinated, have antibodies or have made a recent test to covid-19 upon arrival. This to make the event as safe as possible. We will check your payment and papers at the registration when you arrive.</p>\n<p>We sometimes get questions on how we select participants for the event. We don\'t. The clock does! &nbsp;We accept registrations based on the time when they were applying. It means that first come, first serve!</p>\n<p>When we have received your registration, we will send an email if you &nbsp;have got a guaranteed place at the marathon, or not. Give us some time &nbsp;to go through it… : ) If you have got a guaranteed place and you by any chance cannot come, please tell us as soon as possible!</p>\n<p>We hope to see a mix of locals and dancers from other cities and abroad to fill the &nbsp;dance floor during the weekend!&nbsp;</p>\n<p><strong>Payment: see&nbsp;</strong><a href=\"http://tangomaraton.tangokompaniet.com/prices/\" title=\"Prices\"><strong>Prices!</strong></a></p>\n<p>If you have little money but still want to participate, you can help out during the maraton as payment. E-mail us!</p>', '2018-01-21 18:28:19', '2019-09-23 14:20:18', NULL),
(222, 'Marathon', 'Schedule', 'EN', '<h1><br>\nMalmö Tango Marathon Schedule</h1>\n<h2>Friday</h2>\n<p>19:00-03.00 &nbsp;&nbsp;Registration, dinner and dancing to DJ &nbsp;</p>\n<h2>Saturday</h2>\n<p>11:30-14:00 &nbsp;&nbsp;&nbsp;Brunch &nbsp;</p>\n<p>12:00-14:00 &nbsp;&nbsp;Dancing to DJ - Alternative tango music &nbsp;</p>\n<p>14:00-20:00 &nbsp;Dancing to DJ&nbsp;</p>\n<p>17.00 Soup&nbsp;</p>\n<p>20:00 - 04:00 &nbsp;Dancing to DJ &nbsp;</p>\n<p>20:00-23:00 &nbsp;&nbsp;&nbsp;Dinner &nbsp;</p>\n<h2>Sunday</h2>\n<p>11:30-14:00 &nbsp;Brunch</p>\n<p>12:00-13:00 &nbsp;Dancing to DJ - Alternative tango music &nbsp;</p>\n<p>13:00-18:00 &nbsp;Dancing to DJ &nbsp;</p>\n<p>20:00-23:30 &nbsp;Afterparty with DJ at Tangokompaniet studio, Fredriksbergsgatan 7</p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>', '2018-01-21 18:28:19', '2019-09-23 14:20:18', NULL),
(223, 'Marathon', 'Teachers and DJs', 'EN', '\r\n\r\n<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n	\r\n					<h1>The crew</h1>\r\n<h1></h1>\r\n<p><strong style=\"color: black; font-family: Verdana, Arial, sans-serif; font-size: 11px;\">The teachers and performers</strong></p>\r\n<p>&nbsp;</p>\r\n<p><b>Anna Sol&nbsp;</b><img src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/anna.solakius.jpg\" width=\"212\" height=\"300\"><br>\r\nAnna teaches and organizes in Tangokompaniet since 2002. Her teaching offers the opportunity to explore her own body, the communication in dance and the expression in the music. Her dance expresses her person; energy, joy and the pursuit of consciousness. She is also a very active DJ, both regionally, nationally and internationally, and also hosts seminars on tango music and DJing.</p>\r\n<p><strong>Camila Holst-Viancos&nbsp;</strong><img class=\"alignnone size-medium wp-image-441\" alt=\"DSC_1302\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/DSC_1302-199x300.jpg\" width=\"199\" height=\"300\"></p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; -webkit-text-stroke: #000000}\r\nspan.s1 {font-kerning: none}\r\nspan.s2 {font: 12.0px \'Helvetica Neue\'; font-kerning: none}\r\n--></style>\r\n<p>Camila Viancos has a broad experience with teaching, dancing and performing from different dance styles such as salsa and modern dancing.&nbsp;Her focus in tango dancing is connection, musicality and body awareness. She is very passionated about teaching and she currently lives from teaching dance, yoga and pilates.&nbsp;Camila is also&nbsp;performing as a singer and teaches musicality for salsa dancers with live musicians.</p>\r\n<p><strong>Cecilia Warfvinge&nbsp;</strong><img alt=\"cecilia\" src=\"https://festivalito.tangokompaniet.com/wp-content/uploads/cecilia-248x300.jpeg\" width=\"248\" height=\"300\"></p>\r\n<p>For Cecilia, Tangon offers the opportuni