(342, 'PRESENCE', '2104111600SOGK2_7V2021-04-25', 'SV', 'Rep. Milonga: oval giro, zickzack, klockan. \nNytt. Sätta ihop figurerna.\nPoint dutt.\n\nRep tango fa  parada, ocho och utsmyckningar. \n\nNästa gång bakåtocho.  ', '2021-04-25 15:39:09', '2021-04-25 15:39:09', NULL),
(343, 'PRESENCE', '2103221730VGFK_11V2021-04-26', 'SV', 'Rep milonga, virvlande gång, oval giro, zickzack (la till rytmisering).\nLa till korslek.\nNytt; korsat grundsteg.  Korsad gång. \nNästa tillfälle; gungor i korsat system.', '2021-04-26 17:43:12', '2021-04-26 17:43:12', NULL),
(344, 'Course', 'TA_5V', 'SV', '<p>Tango Teknik för alla med Anna Sol</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker tangodansare. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå.&nbsp;</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som åtminstone går eller har gått en grundkurs i tango. OBS! Max 12 deltagare.</p>\n<p>Plats: På Tangokompaniet studio och online på Zoom. Vi ser varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.&nbsp;</p>\n<p>Pris: 875 kr</p>\n<p>Längd: 5 gånger, start 13e maj 2021, kl 20.30-22.00.</p>\n<p>Anmäl dig på <a href=\"http://tangokompaniet.com/?fbclid=IwAR3Nd6hdz1dLsyKJ2OSFFePQ_prxPMa45BV-FxUkduPacHG5tSX_JtoGWb4\" rel=\"nofollow noopener\" target=\"_blank\">tangokompaniet.com</a> Kontakta Anna Sol om du har några frågor på messenger eller anna@tangokompaniet.com eller 0705-150345. VÄLKOMMEN!</p>\n<p><a href=\"http://tangokompaniet.com/?fbclid=IwAR0ju9B3AbSP7p7ORHckBjPXb9cr419xmXlW7TtGvOEa9mpseaqY2FUO29s\" rel=\"nofollow noopener\" target=\"_blank\">tangokompaniet.com</a></p>\n<p>----------------------------------------</p>\n<p>Tango technique for all with Anna Sol</p>\n<p>This course is for you who wants to become a grounded, smooth and secure tango dancer. We are going to look in to techniques that will help you with exactly that. The course material suits both newer and more experienced tango dancers and everyone trains on their own level.</p>\n<p>You register without partner and the course is open for everyone who at least has or are taking a basic course in tango. OBS! Max 12 participants.</p>\n<p>Venue: At Tangokompaniet studio or online on Zoom. You download zoom on your computer och iPad and you get an invitation link to be able to participate. We can see and communicate with each other during the class. If you can not participate I will send you the class so you can do it on your own.</p>\n<p>Price: SEK 875<br>\nThe course goes over 5 lessons, starting the 13th of May 2021 at 20.30-22.00</p>\n<p>Register at <a href=\"http://tangokompaniet.com/?fbclid=IwAR0ybYmzRPiBbcI73m8OcEAeY42Kv2zFwQJFLI0h3KCayrBy4-_-Nnu_TRo\" rel=\"nofollow noopener\" target=\"_blank\">Tangokompaniet.com</a> and please contact Anna Sol if you have any questions; through messenger or at anna@tangokompaniet.com or 0705-150345. WELCOME!</p>\n<p><a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2Ftangokompaniet.com%2F%3Ffbclid%3DIwAR1MYQ_a22ja1Rq8uFJUSZsLhfzVyMVV6rDjDdCLHHKpK-OSGuIvdxYovNY&amp;h=AT0u-L2gThS9gvUu9oBaj1awk_Neliig8O8cTm9mr6Dtsax_TqidBh4X6bFLCI-tq00VxzPz11gXJLdBGtVtAWniqXg8W9-4S-sMnuVV8regMdRN4egHYZ13wrWK75orFRTW53o&amp;__tn__=q&amp;c[0]=AT3xaNO281trWq-5r_5IW52m-eeWDRAN_xsPc6DBOtBEQUH6Qf7o09a6-tEkgBxfdwR99PEptJVMPcJsY00qfEAI6X6-iyhdFp1YxmOfS0SDqkgh2Dq6RWaq8l04SOemdlhFg4FTNG1V7esdPZrMfJtSBQaYG5lkkjnwBfdxH_GRrgCsGw\" rel=\"nofollow noopener\" target=\"_blank\">tangokompaniet.com</a></p>', '2021-04-27 02:46:25', '2021-04-27 02:46:25', NULL),
(345, 'PRESENCE', '2101131730STF1_16V2021-04-28', 'SV', '<p>Repetera låg bakåtboleo</p>\n<p>Sacada, sacada, parada, sandwich.</p>\n<p><br></p>\n<p>Nästa vecka; sista lektionen. Lite rep, sedan fika och dans och show</p>', '2021-04-28 16:44:52', '2021-04-28 16:44:52', NULL),
