(350, 'PRESENCE', '2104111600SOGK2_7V2021-05-02', 'SV', 'Rep cirlulära moment. Rep gungor.\n\nBakåt ocho. Sandwich. Utgång i gunga.\n\nPlanering nästa veckan: utgång i giro. ', '2021-05-02 18:19:09', '2021-05-02 18:19:09', NULL),
(351, 'PRESENCE', '2103221730VGFK_11V2021-05-03', 'SV', 'Komma in i korsat system, följare resp förare tar extra steg. Gungor med vridning.\nNästa gång lägga till bakåtkors i utgången. Vals?', '2021-05-03 17:12:50', '2021-05-03 17:12:50', NULL),
(352, 'Course', 'VF', 'SV', '<p>Välkommen att dansa in våren tillsammans med oss på Tangokompaniet!</p>\n<p>Vi erbjuder en vårkurs på 5 veckor som går både i vår studio i Malmö och online. Du dansar enbart med din egen danspartner och vi håller oss till Länsstyrelsens bestämmelser angående pandemin.</p>\n<p>Onsdagar kl 19.00-20.30: Fortsättare</p>\n<p>Pris: 690 kr/person</p>\n<p>Du anmäler dig på hemsidan <a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2Ftangokompaniet.com%2F%3Ffbclid%3DIwAR3ompIvyg4mvXT6TRIdMAcMYx0kUk83LeoZ7ui-6EHBg1ejNK1hOl3WzQo&amp;h=AT3zfLiN6a3QMxlolNgdrULGtdwBwc7N8VVfGiuZ8NN5hb0uPgje8FjXy7a-Und1VBGFnnfKQvGkwwJ1zTHwy7XbamaGMgevzlcWYu0XFsVn4QFarUq5hLteNlmXjY1hIytiMKk&amp;__tn__=q&amp;c[0]=AT20j_QFrUb84IHg7SEW3TcJ0wI1u-XmJgM2Fj8D84ioI0KYiBRCvLbv4E6ihPhq9pYH_CXsQpuv0p_sXVf2miydcNP6P3OIukHYxuVFCPcECbrYyMRcNSBQL-T8rYK9zVoZUPDavhUSzMrBpKZoSgvl\" rel=\"nofollow noopener\" target=\"_blank\">tangokompaniet.com</a></p>\n<p>Frågor? Kontakta Anna Sol på anna@tangokompaniet.com eller på 0705150345</p>', '2021-05-03 20:49:58', '2021-05-03 20:49:58', NULL),
(353, 'Course', 'VE', 'SV', '<p>Välkommen att dansa in våren tillsammans med oss på Tangokompaniet!</p>\n<p>Vi erbjuder en vårkurs på 5 veckor som går både i vår studio i Malmö och online. Du dansar enbart med din egen danspartner och vi håller oss till Länsstyrelsens bestämmelser angående pandemin.<br>\nTorsdagar kl 19.00-20.30: Erfarna</p>\n<p>Pris: 690 kr/person</p>\n<p>Du anmäler dig på hemsidan <a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2Ftangokompaniet.com%2F%3Ffbclid%3DIwAR3ompIvyg4mvXT6TRIdMAcMYx0kUk83LeoZ7ui-6EHBg1ejNK1hOl3WzQo&amp;h=AT3zfLiN6a3QMxlolNgdrULGtdwBwc7N8VVfGiuZ8NN5hb0uPgje8FjXy7a-Und1VBGFnnfKQvGkwwJ1zTHwy7XbamaGMgevzlcWYu0XFsVn4QFarUq5hLteNlmXjY1hIytiMKk&amp;__tn__=q&amp;c[0]=AT20j_QFrUb84IHg7SEW3TcJ0wI1u-XmJgM2Fj8D84ioI0KYiBRCvLbv4E6ihPhq9pYH_CXsQpuv0p_sXVf2miydcNP6P3OIukHYxuVFCPcECbrYyMRcNSBQL-T8rYK9zVoZUPDavhUSzMrBpKZoSgvl\" rel=\"nofollow noopener\" target=\"_blank\">tangokompaniet.com</a></p>\n<p>Frågor? Kontakta Anna Sol på anna@tangokompaniet.com eller på 0705150345</p>', '2021-05-03 20:50:40', '2021-05-03 20:50:40', NULL),
(354, 'PRESENCE', '2103221730VGFK_11V2021-12-31', 'SV', '<p>Per Testar Continuation Mix</p>', '2021-05-04 14:38:21', '2021-05-04 14:38:21', NULL),
(355, 'Course', 'GKV', 'SV', '<p>För dig som har gått Grundkurs 1 eller 2 eller 3 eller alla kan nu vara med på vår Grundkurs Vår 2021! Tre stycken lektioner med lite roliga steg och trix för att fira att våren är här!</p>\n<p>Anmäl dig med fast partner.</p>\n<p>Pris: 390 kr/person</p>\n<p>Start 6/6, slut 20/6</p>\n<p>Frågor? Kontakta Anna Sol på anna@tangokompaniet.com eller 0705150345</p>', '2021-05-21 22:46:07', '2021-05-21 22:46:07', NULL),
(359, 'Course', '3_IN_1', 'SV', '<h1>Musikseminarie i två delar</h1>\n<h2>med Daniel Carlsson</h2>\n<p><br></p>\n<p>Under två söndagar dyker vi in i tangomusiken och fördjupar vår medvetenhet och kunskap. Vi tränar på att omvandla detta till tolkning av musiken i dansen i form av pauser rytmer och accentueringar. Vi lär oss om tangons puls, fraser, sektioner men vi tränar också på att dansa 10 vanliga rytmer i de viktigaste rörelserna som gång, salidas, ocho cortados och ochos. För de mer erfarna kollar vi på hur vi kan leka med musikalitet i ganchos och boleos.</p>\n<p><br></p>\n<p>Kursen passar dig på fortsättar/erfaren/avancerad nivå. Kursen är till för dig som redan dansar tango och alla jobbar på sin egen nivå. Det kommer finnas material för både lägre och högre dansnivå. Kursen tas med fördel med en partner men det går att tillgodogöra sig mycket av materialet solo.</p>\n<p>Har du ingen danspartner och vill gå med ngn kan du höra av dig till oss.</p>\n<p><br>\nMusikalitetsseminarium del 1, 2/1 och del, 2 9/1 14.30-17.30.<br>\n</p>\n<p>Efter registrering skickar Daniel ut ett material med vilket du förbereder dig.<br>\nUnder seminariets två delar som du kan ta själv men som jag rekommenderar att du tar med en partner kommer vi att träna på att röra oss till vanliga och mindre vanliga rytmer, framförallt i gången och på plats men även i enklare figurer .<br>\nVi kommer att kolla på tangons struktur och gå igenom allt från pulsen till fraserna, sektionerna, staccato o legato, marcato och synkoperingar. Vi kommer att titta på ett par vanliga rytmer och några rytmer som är mer typiska för specifika orkestrar. Vi kommer att ta oss tid till att dansa in dessa rytmer.<br>\n</p>\n<p>Priserna för deltagande på plats 500 kr per del eller 900 kr för båda tillfällena per person. Anmäl dig gärna i par men det går bra ta del av seminariet utan partner också även om tanken är att dansa musiken med en partner.<br>\nDeltagande via zoom 350 kr per del eller 700 kr för båda tillfällena.</p>\n<p><br></p>\n<h2>Schema:</h2>\n<p><br></p>\n<p><strong>Söndag 2/9 och 9/9</strong></p>\n<p><br></p>\n<p>14.30-17.30 Lektion inkl paus</p>\n<p><br></p>\n<p>Kursen sker i Tangokompaniet studio i Malmö och online via Zoom. Max antal deltagare i studion är 20 personer.</p>\n<p><br></p>\n<p><br></p>\n<h2>Hjärtligt välkommen!</h2>\n<p><br></p>\n<p>tangokompaniet.com</p>\n<p><br></p>\n<p><br></p>', '2021-09-29 07:38:51', '2021-09-29 07:38:51', NULL),
(364, 'MARATHON', 'MAILBODY', 'EN', '<p>Thank you for your registration . Your registration will be processed and we will get back to you as soon as possible. Have some great tangos until then.\n</p>\n<p/> \n<p>\nIf you need to contact us please email malmotangomaraton@gmail.com or call Anna Sol at +46705150345\n</p> \n', '2021-10-15 08:22:35', '2021-10-22 15:21:43', NULL),
