(378, 'WEEKEND', 'Start', 'SV', '<p>Musikalitetsseminarium &nbsp;del 1, 2/1 och del, 2 9/1 14.30-17.30. Efter registrering skickar Daniel ut ett material med vilket du &nbsp;förbereder dig. Under seminariets två delar som du kan ta själv men som jag &nbsp;rekommenderar att du tar med en partner kommer vi att träna på att röra &nbsp;oss till vanliga och mindre vanliga rytmer, framförallt i gången och på &nbsp;plats men även i enklare figurer . Vi kommer att kolla på tangons struktur och gå igenom allt från pulsen &nbsp;till fraserna, sektionerna, staccato o legato, marcato och &nbsp;synkoperingar. Vi kommer att titta på ett par vanliga rytmer och några &nbsp;rytmer som är mer typiska för specifika orkestrar. Vi kommer att ta oss &nbsp;tid till att dansa in dessa rytmer. Priserna för deltagande på plats 500 kr per del eller 900 kr för båda &nbsp;tillfällena per person. Anmäl dig gärna i par men det går bra ta del av &nbsp;seminariet utan partner också även om tanken är att dansa musiken med en &nbsp;partner. Deltagande via zoom 350 kr per del eller 700 kr för båda tillfällena.</p>', '2021-12-12 18:25:02', '2021-12-12 18:25:02', NULL),
(7, 'Course', 'AV1_16V', 'SV', '<h2>Kurserna vänder sig till dig</h2>\n<p>som har dansat tango en längre tid och som vill utveckla din tango till att bli ännu mer dynamisk och varierad. I dessa tider med COVID har vi ett lägre maxantal på kurserna och kör med fasta partners dvs inga parbyten.</p>\n<h3>Förkunskaper</h3>\n<p><strong>Tidsmässigt har du</strong></p>\n<p>- dansat tango i ett par eller många år och har spenderat en hel del tid på kurs och på det sociala dansgolvet<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du bra balans, du pivoterar lätt ståendes på en fot<br>\n&nbsp;</p>\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\n&nbsp;</p>\n<p>- du hinner med en utsmyckning på vägen mellan en rörelse och nästa<br>\n&nbsp;</p>\n<p>- du dansar i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\n&nbsp;</p>\n<p>- du kan musiken och har favoritorkestrar och -låtar<br>\n&nbsp;</p>\n<p>- du har förståelse för skapande och improvisation<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- självklart när det är festival i Sverige och någon gång även kanske utomlands &nbsp;<br>\n</p>\n<h3>KURSPLAN</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- teknik och kommunikation<br>\n&nbsp;</p>\n<p>- improvisation och struktur<br>\n&nbsp;</p>\n<p>- variation i stil<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<h3>Mål</h3>\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\n&nbsp;</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs.<br>\n</p>\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<h3>SCHEMA</h3>\n<p>&nbsp;Avancerade 1 Lund&nbsp;</p>\n<h2>Måndagar Lund</h2>\n<p>17 tillfällen ggr varav 14 lektioner + 2 lärarledda praktikor + 1 avslutningsfest &nbsp;</p>\n<p>Adress: Tornav. 17,<br>\n<strong>Lund</strong> <a href=\"&quot;&quot;&quot;http://hitta.se/Fredriksbersgatan&quot;&quot;&quot;\">Klicka här för karta</a> Lärare:<a href=\"&quot;&quot;&quot;https://www.tangokompaniet.com/lararna/#daniel&quot;&quot;&quot;\">Daniel</a> och <a href=\"&quot;&quot;&quot;https://www.tangokompaniet.com/lararna/#anna&quot;&quot;&quot;\">Anna</a> &nbsp;</p>\n<h2>För kursdeltagare erbjuder vi ett finfint&nbsp;rabatterat praktikakort för 750 kr för &nbsp;kursdeltagare (ord pris 1150 SEK)<br>\n</h2>\n<p>Om man missar en lektion kan man ta igen det i en annan grupp. &nbsp;&nbsp;<br>\n&nbsp;Om man vill hjälpa till eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! &nbsp;Skriv då detta i din anmälan.<br>\n&nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223<br>\n&nbsp;</p>\n<p>Skriv ditt namn och kurs.<br>\n&nbsp;</p>\n<h3>Välkommen med din anmälan!</h3>', '2019-01-02 09:32:05', '2022-01-21 09:32:00', 'AV1_16V'),
(8, 'Course', 'AV1_16V', 'ES', '<p>Los cursos son para ti</p>\n<p><br></p>\n<p>que han bailado tango durante mucho tiempo y que quieren desarrollar su tango para que sean aún más dinámicos y variados.</p>\n<p>Requisitos previos</p>\n<p><br></p>\n<p>En términos de tiempo, tienes</p>\n<p>- Bailaron tango por un par de años o muchos y pasé mucho tiempo en el curso y en la pista de baile social.</p>\n<p><br></p>\n<p>cognitivamente</p>\n<p>- Tienes buen equilibrio, puedes girar fácilmente de pie sobre un pie.</p>\n<p><br></p>\n<p>- Puedes hacer sacadas, giros, ochos, boleos y ganchos sin tener el apoyo de tu compañero.</p>\n<p><br></p>\n<p>- Tienes tiempo para una decoración en la carretera entre un movimiento y el siguiente.</p>\n<p><br></p>\n<p>- bailas tanto en abrazo abierto como cerrado y la dirección de la danza es para ti obvia</p>\n<p><br></p>\n<p>- Puedes escuchar música y tener orquestas y canciones favoritas.</p>\n<p><br></p>\n<p>- Tienes una comprensión de la creación y la improvisación.</p>\n<p><br></p>\n<p>Estas en la pista de baile</p>\n<p><br></p>\n<p>- Obviamente, cuando es festival en Suecia y en algún momento, incluso tal vez en el extranjero</p>\n<p><br></p>\n<p><br></p>\n<p>PROGRAMA</p>\n<p><br></p>\n<p>Vas a trabajar con</p>\n<p>- tecnología y comunicación</p>\n<p><br></p>\n<p>- improvisación y estructura.</p>\n<p><br></p>\n<p>- variación de estilo</p>\n<p><br></p>\n<p>- musica y ritmo</p>\n<p><br></p>\n<p><br></p>\n<p>objetivos</p>\n<p>En el curso, se abren nuevas puertas y se estiran las fronteras para que el tango siga siendo emocionante y desafiante en sus diversas formas. El objetivo del curso es que sientas que tu baile se hace más rico y que puedes adaptarte más fácilmente a diferentes parejas y estilos de baile y, por lo tanto, ser más libre en tu baile.</p>\n<p>¿Qué curso debo elegir?</p>\n<p>Si duda, a menudo es bueno elegir un nivel inferior. La repetición proporciona destreza, mientras que los desafíos difíciles pueden robar la alegría y la confianza en uno mismo. Siempre puede contactarnos en info@tangokompaniet.com y pedir ayuda cuando elija un curso.</p>\n<p><br></p>\n<p>¡También tienes la opción de obtener el doble del precio con descuento!</p>\n<p><br></p>\n<p><br></p>\n<p>HORARIO</p>\n<p>Avanzado 1 Lund</p>\n<p>Lunes lund</p>\n<p>Fecha de inicio: 4/2 2019</p>\n<p>tiempo del curso: 19: 00-20: 30</p>\n<p>Duración del curso: 18 veces, de las cuales 15 lecciones + 2 pasantes dirigidos por maestros + 1 fiesta de clausura</p>\n<p>Dirección: Tornav. 17,</p>\n<p>Lund Haga clic aquí para ver el mapa</p>\n<p>Maestra: Daniel y Anna</p>\n<p>precio</p>\n<p><br></p>\n<p>SEK 2230 para el curso de continuación 18 vy una tarjeta de pasantías con descuento para finetas (válida del 1 de enero al 1 de junio) por 750 SEK para los participantes del curso (precio de palabra 1150 SEK)</p>\n<p><br></p>\n<p>Si pierde una lección, puede recuperarla en otro grupo.</p>\n<p>¡Si quieres ayudar o si quieres ir a cursos dobles, te ofrecemos tarifas reducidas! Entonces escribe esto en tu aplicación.</p>\n<p><br></p>\n<p>El pago anticipado se realiza al giro bancario de Tangokompaniet 5532-8223.</p>\n<p><br></p>\n<p>Escribe tu nombre y curso.</p>\n<p>Bienvenido con su registro!</p>', '2019-01-22 08:13:19', '2022-01-21 09:32:00', 'AV1_16V');
INSERT INTO `tbl_text` (`id`, `groupId`, `textId`, `language`, `textBody`, `creaTimestamp`, `updTimestamp`, `textIdNew`) VALUES
(9, 'Course', 'AV1_16V', 'EN', '<p>The courses are for you</p>\n<p>who have danced tango for a long time and who want to develop your tango to become even more dynamic and varied.</p>\n<p><br></p>\n<p><br></p>\n<p>Previous knowledge</p>\n<p><br></p>\n<p>In terms of time, you have</p>\n<p>- Danced tango for a couple or many years and spent a lot of time on course and on the social dance floor</p>\n<p><br></p>\n<p>cognitively</p>\n<p>- you have good balance, you easily pivot standing on one foot</p>\n<p><br></p>\n<p>- you can do sacadas, giros, ochos, boleos and ganchos without taking the support of your partner</p>\n<p><br></p>\n<p>- You have time for a decoration on the road between a movement and the next</p>\n<p><br></p>\n<p>- you dance in both open and closed embrace and the dance direction is for you obvious</p>\n<p><br></p>\n<p>- you can music and have favorite orchestras and songs</p>\n<p><br></p>\n<p>- You have an understanding of creation and improvisation</p>\n<p><br></p>\n<p>You are on the dance floor</p>\n<p><br></p>\n<p>- obviously when it is festival in Sweden and sometime even maybe abroad</p>\n<p><br></p>\n<p><br></p>\n<p>SYLLABUS</p>\n<p><br></p>\n<p>You will work with</p>\n<p>- technology and communication</p>\n<p><br></p>\n<p>- improvisation and structure</p>\n<p><br></p>\n<p>- variation in style</p>\n<p><br></p>\n<p>- music and rhythm</p>\n<p><br></p>\n<p><br></p>\n<p>Goal</p>\n<p>On the course, new doors are opened and the borders stretched so that tango continues to be exciting and challenging in its various forms. The goal of the course is that you should feel that your dance becomes richer and that you can more easily adapt to different partners and dance styles and thereby become freer in your dance!</p>\n<p>Which course should I choose?</p>\n<p>If you hesitate, it is often good to choose a lower level. Repetition provides skill while for difficult challenges can steal one&#039;s joy and self-confidence. You can always contact us at info@tangokompaniet.com and ask for help when choosing a course.</p>\n<p><br></p>\n<p>You also have the option to go twice the discounted price!</p>\n<p><br></p>\n<p><br></p>\n<p>SCHEDULE</p>\n<p>Advanced 1 Lund</p>\n<p>Mondays Lund</p>\n<p>Starting date: 4/2 2019</p>\n<p>Course time: 19: 00-20: 30</p>\n<p>Course duration: 18 times, of which 15 lessons + 2 teacher-led interns + 1 closing party</p>\n<p>Address: Tornav. 17,</p>\n<p>Lund Click here for map</p>\n<p>Teacher: Daniel and Anna</p>\n<p>Price</p>\n<p><br></p>\n<p>SEK 2230 for continuation course 18 v and finfin discounted internship card (valid 1 Jan-1 June) for 750 SEK for course participants (word price 1150 SEK)</p>\n<p><br></p>\n<p>If you miss a lesson you can retrieve it in another group.</p>\n<p>If you want to help or if you want to go double courses we offer reduced course fees! Then write this in your application.</p>\n<p><br></p>\n<p>Prepayment is made to Tangokompaniet&#039;s bank giro 5532-8223</p>\n<p><br></p>\n<p>Write your name and course.</p>\n<p>Welcome with your registration!</p>', '2019-01-22 08:14:27', '2022-01-21 09:32:00', 'AV1_16V'),
(10, 'Course', 'AV2_16V', 'SV', '<h2>Kurserna vänder sig till dig</h2>\n<p>som har dansat tango en längre tid och som vill utveckla din tango till att bli ännu mer dynamisk och varierad. I dessa tider med COVID har vi ett lägre maxantal på kurserna och kör med fasta partners dvs inga parbyten.</p>\n<h3>Förkunskaper</h3>\n<p><strong>Tidsmässigt har du</strong></p>\n<p>- dansat tango i ett par eller många år och har spenderat en hel del tid på kurs och på det sociala dansgolvet<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du bra balans, du pivoterar lätt ståendes på en fot<br>\n&nbsp;</p>\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\n&nbsp;</p>\n<p>- du hinner med en utsmyckning på vägen mellan en rörelse och nästa<br>\n&nbsp;</p>\n<p>- du dansar i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\n&nbsp;</p>\n<p>- du kan musiken och har favoritorkestrar och -låtar<br>\n&nbsp;</p>\n<p>- du har förståelse för skapande och improvisation<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- självklart när det är festival i Sverige och någon gång även kanske utomlands &nbsp;<br>\n</p>\n<h3>KURSPLAN</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- teknik och kommunikation<br>\n&nbsp;</p>\n<p>- improvisation och struktur<br>\n&nbsp;</p>\n<p>- variation i stil<br>\n&nbsp;</p>\n<p>- musik och rytmik</p>\n<p><br></p>\n<p>17 tillfällen varav 14 lektioner + 2 lärarledda praktikor + 1 avslutningsfest &nbsp;Adress: Tangokompaniet studio, Fredriksbergsgatan 7, Malmö</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. &nbsp;<strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<h3>Välkommen med din anmälan!</h3>\n<h2>Pris</h2>\n<p>2230 kr för fortsättningskursen och finfin &nbsp;rabatterat praktikakort (giltigt 1 jan-1 juni) för&nbsp;750 kr för &nbsp;kursdeltagare (ord pris 1150 SEK) &nbsp;Om man missar en lektion kan man ta igen det i en annan grupp. &nbsp;Om man vill hjälpa till eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel! &nbsp;Förbetalning sker till Tangokompaniets bankgiro 5532-8223 &nbsp;Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl. &nbsp;Skriv ditt namn och kurs. &nbsp;</p>\n<h3>Välkommen med din anmälan!<br>\n&nbsp;</h3>\n<h3>Mål</h3>\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\n&nbsp;</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs.<br>\n</p>\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>', '2019-01-02 09:33:04', '2022-01-21 09:32:00', 'AV2_16V'),
(11, 'Course', 'AV2_16V', 'EN', '<p>The courses are for you</p>\n<p>who have danced tango for a long time and who want to develop your tango to become even more dynamic and varied.</p>\n<p><br></p>\n<p><br></p>\n<p>Previous knowledge</p>\n<p><br></p>\n<p>In terms of time, you have</p>\n<p>- Danced tango for a couple or many years and spent a lot of time on course and on the social dance floor</p>\n<p><br></p>\n<p>cognitively</p>\n<p>- you have good balance, you easily pivot standing on one foot</p>\n<p><br></p>\n<p>- you can do sacadas, giros, ochos, boleos and ganchos without taking the support of your partner</p>\n<p><br></p>\n<p>- You have time for a decoration on the road between a movement and the next</p>\n<p><br></p>\n<p>- you dance in both open and closed embrace and the dance direction is for you obvious</p>\n<p><br></p>\n<p>- you can music and have favorite orchestras and songs</p>\n<p><br></p>\n<p>- You have an understanding of creation and improvisation</p>\n<p><br></p>\n<p>You are on the dance floor</p>\n<p><br></p>\n<p>- obviously when it is festival in Sweden and sometime even maybe abroad</p>\n<p><br></p>\n<p><br></p>\n<p>SYLLABUS</p>\n<p><br></p>\n<p>You will work with</p>\n<p>- technology and communication</p>\n<p><br></p>\n<p>- improvisation and structure</p>\n<p><br></p>\n<p>- variation in style</p>\n<p><br></p>\n<p>- music and rhythm</p>\n<p><br></p>\n<p><br></p>\n<p>Goal</p>\n<p>On the course, new doors are opened and the borders stretched so that tango continues to be exciting and challenging in its various forms. The goal of the course is that you should feel that your dance becomes richer and that you can more easily adapt to different partners and dance styles and thereby become freer in your dance!</p>\n<p>Which course should I choose?</p>\n<p>If you hesitate, it is often good to choose a lower level. Repetition provides skill while for difficult challenges can steal one&#039;s joy and self-confidence. You can always contact us at info@tangokompaniet.com and ask for help when choosing a course.</p>\n<p><br></p>\n<p>You also have the option to go twice the discounted price!</p>', '2019-01-22 08:16:59', '2022-01-21 09:32:00', 'AV2_16V'),
