y la confianza en uno mismo. Siempre puede contactarnos en info@tangokompaniet.com y pedir ayuda cuando elija un curso.</p>\n<p><br></p>\n<p>¡También tienes la opción de obtener el doble del precio con descuento!</p>', '2019-01-22 08:18:07', '2022-01-21 09:32:00', 'AV2_16V'),
(356, 'Course', 'ERAV_ht21', 'SV', '<h1>Erfarna/Avancerade</h1>\n<h2>Längd:19 veckor Pris:2670 SEK</h2>\n<h1>Kursen vänder sig till dig</h1>\n<p>som har dansat tango ett tag och vill både utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt vill du känna att du dansar mer till musiken och känna dig säkrare i dina egna rörelser.&nbsp;</p>\n<h2>Mål</h2>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, musiken och din partner. du kommer få utforska både musik och repertoar på en djupare nivå samt lära dig fler tekniker som utmanar och lyfter din dans till mer dynamiska svängningar!</p>\n<p>&nbsp;I slutet av kursen kommer du ha fått nya redskap och ännu mer säkerhet. Vi ökar på din repertoar så att du känner dig friare att uttrycka dig genom fler möjligheter och variationer. På kursen arbetar vi också med att finslipa och ge tangotekniken den tid den behöver.</p>\n<p><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt hemifrån. Kontakta lärarna</strong></em></p>\n<h2>Förkunskaper</h2>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått ett par kurser i tango och dansar ofta ute på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du grundläggande element i ryggraden som att lyssna på musiken och din partner, hittat ett dansflöde, konsten att gå tillsammans både i parallell gång och i korsad gång. Du har även tränat på ochos, giros, sacadas, ganchos, boleos, rytmer osv<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- någon till några gånger i veckan<br>\n&nbsp;</p>\n<h2>Kursplan</h2>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar<br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<p><br></p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger färdighet medan för svåra utmaningar kan stjälpa ens glädje och självförtroende. Du kan alltid höra av dig till oss på info@tangokompaniet.com och be om hjälp när du ska välja kurs. <strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<p><br></p>\n<p><br></p>\n<p>SCHEMA</p>\n<p>Erfarna/Avancerade Malmö</p>\n<p>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor (varav en på en annan dag) + 1 avslutningsfest&nbsp;</p>\n<p>Adress Malmö: Tangokompaniet studio, Fredriksbergsgatan 7, Malmö</p>\n<p>Lärare: Daniel &amp; Anna</p>\n<p>Start: Torsdagen den 3/2 2022, kl 19.00-20.30.&nbsp;</p>\n<h3><br></h3>\n<h3><br></h3>\n<h3>ANMÄLAN</h3>\n<p>Du kan anmäla dig med eller utan danspartner i anmälningsformuläret nedan. Om du anmäler dig med en partner så ska det göras en anmälan för dig och en anmälan för din partner.</p>\n<h2><br></h2>\n<h2>Pris</h2>\n<p>2670 kr/person</p>\n<p>Om man vill hjälpa till med diverse saker på Tangokompaniet eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel på daniel@tangokompaniet.com! &nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller till vår Swish på 1231733005.. Skriv ditt namn och kurs. Anmälan är bindande. Avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart. Efter detta är du betalningsskyldig för hela kursen.</p>\n<p>Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl och ifall du har några frågor! &nbsp;&nbsp;&nbsp;</p>\n<h1>Välkommen med din anmälan!</h1>', '2021-07-05 16:22:53', '2022-01-21 09:32:00', 'ERAV_ht21'),
(149, 'Course', 'F1_ht21', 'SV', '<h1>Kursen vänder sig till dig</h1>\n<p>som har grunderna i tango och vill utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt vill du känna att du dansar mer till musiken och känna dig säkrare i dina egna rörelser.&nbsp;</p>\n<h3><br></h3>\n<h3>FÖRKUNSKAPER</h3>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått grundkurs i tango samt varit ute och kanske dansat några gånger på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken och din partner, hittat ett dansflöde. Du har även tränat på ochos, giros och gungor etc.<br>\n<br>\n&nbsp;</p>\n<h3>KURSPLAN</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar<br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<h3>MÅL</h3>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, musiken och din partner. Det kan kännas svårt att ha fokus på allt detta samtidigt och bibehålla ett flyt i dansen; på kursen bygger vi gradvis upp denna medvetenhet. Det är det som ger kvalitet i dansen och njutbara danser!</p>\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar tango och fått mer känsla av sammanhang och flyt. Vi ökar på din repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. Pä kursen arbetar vi med att få ett flyt i dansen genom att bli skickligare på grunderna och kombinera olika möjligheter. Orden blir till meningar!&nbsp;</p>\n<p><br></p>\n<p>Vilken kurs ska jag välja?</p>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger färdighet medan för svåra utmaningar kan stjälpa ens glädje och självförtroende. Du kan alltid höra av dig till oss på&nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<p><br></p>\n<p>SCHEMA</p>\n<p>Fortsättare 1 Malmö</p>\n<p>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor ( varav en på en annan dag) + 1 avslutningsfest&nbsp;</p>\n<p>Kursen slutar i slutet på maj.</p>\n<p><br></p>\n<p>Adress Malmö: Tangokompaniet studio, Fredriksbergsgatan 7, Malmö</p>\n<p>Lärare: Daniel &amp; Anna</p>\n<p>Start: Söndagen den 6/2 2022, kl 17.30-19.00.&nbsp;</p>\n<h2><br></h2>\n<h3>ANMÄLAN</h3>\n<p>Du kan anmäla dig med eller utan danspartner i anmälningsformuläret nedan. Om du anmäler dig med en partner så ska det göras en anmälan för dig och en anmälan för din partner.</p>\n<p><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt. Kontakta lärarna för mer information. Missar du en lektion så har du möjlighet att ta igen den i en annan grupp.</strong></em></p>\n<p><br></p>\n<h2>Pris</h2>\n<p>2670 kr/person</p>\n<p>Om man vill hjälpa till med diverse saker på Tangokompaniet eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel på daniel@tangokompaniet.com! &nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller till vår Swish på 1231733005. Skriv ditt namn och kurs. Anmälan är bindande. Avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart. Efter detta är du betalningsskyldig för hela kursen.</p>\n<p>Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl och ifall du har några frågor! Tänk på att tango gäller som friskvård, ifall du har friskvårdsbidrag från ditt jobb! &nbsp;&nbsp;</p>\n<p><br></p>\n<h2>HJÄRTLIGT VÄLKOMMEN PÅ KURS!</h2>\n<h3><br></h3>\n<h2><br></h2>\n<p><br></p>', '2019-01-22 08:04:26', '2022-01-21 09:32:00', 'F1_ht21'),
(150, 'Course', 'F1_ht21', 'ES', '<h2>El curso es para ti</h2>\n<p><br>\nQuienes tienen lo básico del tango y desean expandir su repertorio, obtener más tecnología y un contacto más seguro. Al mismo tiempo, quieres sentir que bailas más con la música y te sientes más seguro con tus propios movimientos.<br>\nRequisitos previos</p>\n<h3><br>\nLa experiencia te tiene</h3>\n<p><br>\n- Pasé el curso básico de tango y salí a bailar unas cuantas veces en practilongas y milongas.<br>\n</p>\n<h3>cognitivamente</h3>\n<p><br>\n- ¿Has aprendido algunos elementos básicos, como escuchar música y a tu pareja, encontrar un flujo de baile, el arte de caminar juntos en paralelo y cruzando? También has entrenado en ochos, giros y columpios, etc.<br>\n&nbsp;</p>\n<p>Estas en la pista de baile<br>\n- Alguien unas cuantas veces al mes.<br>\n&nbsp;</p>\n<h3>plan de estudios</h3>\n<p><br>\nVas a trabajar con<br>\n- ampliando tu repertorio<br>\n&nbsp;</p>\n<p>- capacidad de respuesta y equilibrio<br>\n&nbsp;</p>\n<p>- musica y ritmo<br>\n&nbsp;</p>\n<h3>objetivos</h3>\n<p><br>\nEl curso se enfoca en aumentar gradualmente tu conocimiento de la habitación, el cuerpo, la música y tu pareja. Puede sentirse difícil concentrarse en todo esto al mismo tiempo y mantener un flujo en el baile; En el curso, gradualmente construimos esta conciencia. ¡Eso es lo que da calidad en el baile y bailes agradables!<br>\n&nbsp;Al final del curso, te sentirás mucho más seguro cuando bailas tango y tengas más sentido del contexto y la fluidez. Incrementamos su repertorio para que se sienta más libre para expresarse a través de más posibilidades y variaciones. En el curso, trabajamos para obtener un flujo en el baile al ser más expertos en lo básico y combinar diferentes posibilidades. Las palabras se convierten en oraciones!<br>\n¿Qué curso debo elegir?<br>\nSi duda, a menudo es bueno elegir un nivel inferior. La repetición proporciona habilidad, mientras que los desafíos difíciles pueden robar la alegría y la confianza en uno mismo. Siempre puede contactarnos en info@tangokompaniet.com y pedir ayuda cuando elija un curso.<br>\n</p>\n<p>¡También tienes la oportunidad de ir a cursos dobles a un precio reducido!<br>\n¡Si quiere ayudar o si quiere hacer cursos dobles, le ofrecemos tarifas reducidas! ¡Ponte en contacto con Daniel!<br>\n&nbsp;</p>\n<p>El pago anticipado se realiza al giro bancario de Tangokompaniet 5532-8223.</p>', '2019-01-22 08:05:31', '2022-01-21 09:32:00', 'F1_ht21'),
(151, 'Course', 'F1_ht21', 'EN', '<h2>The course is for you</h2>\n<p><br>\nwho have the basics of tango and want to expand your repertoire, get more technology and a safer contact. At the same time, you want to feel that you dance more to the music and feel safer in your own movements.<br>\nPrevious knowledge<br>\nExperience has you<br>\n- passed basic course in tango and been out dancing a few times at practilongas and milongas<br>\n</p>\n<h3>cognitively</h3>\n<p><br>\n- Have you learned some basic elements such as listening to the music and your partner, finding a dance flow, the art of walking together both in parallel and crossing. You have also trained on ochos, giros and swings etc.<br>\n&nbsp;</p>\n<p>You are on the dance floor</p>\n<p><br>\n- Someone a few times a month<br>\n&nbsp;</p>\n<h3>Syllabus</h3>\n<p><br>\nYou will work with<br>\n- expanding your repertoire<br>\n&nbsp;</p>\n<p>- responsiveness and balance<br>\n&nbsp;</p>\n<p>- music and rhythm<br>\n&nbsp;</p>\n<h2>Goal</h2>\n<p><br>\nThe course focuses on gradually increasing your awareness of the room, the body, the music and your partner. It can feel difficult to focus on all this at the same time and maintain a flow in the dance; on the course, we gradually build up this awareness. That&#039;s what gives quality in the dance and enjoyable dances!<br>\n&nbsp;At the end of the course you will feel much safer when you dance tango and have more sense of context and flow. We increase your repertoire so that you feel freer to express yourself through more possibilities and variations. At the course, we work to get a flow in the dance by becoming more skilled at the basics and combining different possibilities. The words turn into sentences!<br>\nWhich course should I choose?<br>\nIf you hesitate, it is often good to choose a lower level. Repetition provides skill while for difficult challenges can steal one&#039;s joy and self-confidence. You can always contact us at info@tangokompaniet.com and ask for help when choosing a course.<br>\n</p>\n<p>You also have the opportunity to go for double courses at a discounted price!<br>\nIf you want to help or if you want to go double courses we offer reduced course fees! Contact Daniel!<br>\n&nbsp;</p>\n<p>Prepayment is made to Tangokompaniet&#039;s bank giro 5532-8223<br>\n&nbsp;</p>\n<p>It is possible to divide the payment, notify us of this case by email.</p>', '2019-01-22 08:06:25', '2022-01-21 09:32:00', 'F1_ht21'),
(152, 'Course', 'F2_ht21', 'SV', '<h1>Kursen vänder sig till dig</h1>\n<p>som har grunderna i tango och vill utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt &nbsp;vill du känna att du dansar mer till musiken och känna dig säkrare i &nbsp;dina egna rörelser.&nbsp;</p>\n<p><br></p>\n<h2>Mål</h2>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, &nbsp;musiken och din partner. Det kan kännas svårt att ha fokus på allt detta &nbsp;samtidigt och bibehålla ett flyt i dansen; på kursen bygger vi gradvis &nbsp;upp denna medvetenhet. Det är det som ger kvalitet i dansen och njutbara &nbsp;danser!</p>\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar &nbsp;tango och fått mer känsla av sammanhang och flyt. Vi ökar på din &nbsp;repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. Pä kursen &nbsp;arbetar vi med att få ett flyt i &nbsp;dansen genom att bli skickligare på grunderna och kombinera olika &nbsp;möjligheter. Orden blir till meningar!&nbsp;</p>\n<p><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt hemifrån genom Zoom.</strong></em></p>\n<h3><br></h3>\n<h2>Förkunskaper</h2>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått grundkurs i tango och kanske någon mer kurs samt varit ute och dansat några gånger på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken och din partner, hittat ett dansflöde, konsten att gå tillsammans både i parallell gång och i korsad gång. Du har även tränat på ochos, giros och gungor etc.<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- någon till några gånger i månaden<br>\n&nbsp;</p>\n<h3><br></h3>\n<h2>Kursplan</h2>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar<br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<p>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor + 1 avslutningsfest &nbsp;</p>\n<p><br></p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger färdighet medan för svåra utmaningar kan stjälpa ens glädje och självförtroende. Du kan alltid höra av dig till oss på info@tangokompaniet.com och be om hjälp när du ska välja kurs. <strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<p><br></p>\n<p>SCHEMA</p>\n<p>Fortsättare 2 Malmö&nbsp;</p>\n<p>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor (varav en på en annan dag) + 1 avslutningsfest&nbsp;</p>\n<p>Adress Malmö: Tangokompaniet studio, Fredriksbergsgatan 7, Malmö</p>\n<p>Lärare: Daniel &amp; Anna</p>\n<p>Start: Onsdagen den 2/2 2021, kl 17.30-19.00.&nbsp;</p>\n<h2><br></h2>\n<h3>ANMÄLAN</h3>\n<p>Du kan anmäla dig med eller utan danspartner i anmälningsformuläret nedan. Om du anmäler dig med en partner så ska det göras en anmälan för dig och en anmälan för din partner.</p>\n<p><br></p>\n<h2>Pris</h2>\n<p>2670 kr/person</p>\n<p>Om man vill hjälpa till med diverse saker på Tangokompaniet eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel på daniel@tangokompaniet.com! &nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller till vår Swish på 1231733005.. Skriv ditt namn och kurs. Anmälan är bindande. Avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart. Efter detta är du betalningsskyldig för hela kursen.</p>\n<p>Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl och ifall du har några frågor! &nbsp;&nbsp;&nbsp;</p>\n<h1>Välkommen med din anmälan!</h1>', '2019-01-22 08:04:26', '2022-01-21 09:32:00', 'F2_ht21'),
