(3, 'Companies', 'Text', 'EN', '<h1>Business events</h1>\n<h2>Proposal for events</h2>\n<p>Do you want to do something new and fun at the corporate party, team building or theme day? The Tango Company has long experience of holding events in Argentine Tango for companies - at company parties, theme days, kick-off&#039;s etc. Previous clients include Semcon, Nordea, Lund University, Anoto, Tlth, Liseberg, Lund Municipality- Healthcare, Bonniers, Vodaphone, the Employment Service, the Criminal Justice, Scout associations and staff associations, schools, etc. We offer teaching, demonstration, entertainment, lectures, communication exercises in a customized package just for you. Combine tango with supervision or tango with leadership lectures or with communication courses.</p>\n<h2>Estimate</h2>\n<p>Below are a number of price examples for tango arrangements. We can also tailor a solution for your event.Local and travel costs are added. We have an excellent room on Fredriksbergsgatan 7 which we rent for events up to 75 people.</p>\n<p><br></p>\n<h2>Basic package Tango, Lesson, presentation, 1 CD</h2>\n<p>1½ hours with 2 dance teachers</p>\n<p>Price: SEK 4000 excl. VAT (up to 30 participants)</p>\n<p><br></p>\n<h3>Basic package Tango for larger group, Lesson, presentation, 1 CD</h3>\n<p>1½ hours with 2 dance teachers</p>\n<p>Price: SEK 6000 excl. VAT (with 30 or more participants)</p>\n<p><br></p>\n<h3>Combo pack 2 different dances, Lesson, show, 1 CD</h3>\n<p>2 hours with 2 dance teachers in tango and 2 dance teachers in salsa for example</p>\n<p>Price: SEK 8000 excluding VAT (up to 30 participants), SEK 9000 for more than 50 participants</p>\n<p><br></p>\n<h3>Full Day Package</h3>\n<p>Full day 6 hours with tango concept lectures, dance lessons, communication exercises, body awareness exercises, focus, posture and a presentation</p>\n<p>Price: SEK 12000 excl. VAT</p>\n<p><br></p>\n<h3>Special package with finesse, Lesson, presentation, 1 CD</h3>\n<p>Choreography- we teach a group from the company a tango choreography and help with the performance of the show at the company party! We DJs with appropriate tango music during dinner and may also conduct a show and teaching session in conjunction with the party.</p>\n<p>Price: SEK 16000 excl. VAT</p>', '2018-01-25 12:56:47', '2019-01-22 09:00:55'),
(7, 'Course', 'AV1', 'SV', '<h2>Kurserna vänder sig till dig</h2>\n<p>som har dansat tango en längre tid och som vill utveckla din tango till att bli ännu mer dynamisk och varierad. I dessa tider med COVID har vi ett lägre maxantal på kurserna och kör med fasta partners dvs inga parbyten.</p>\n<h3>Förkunskaper</h3>\n<p><strong>Tidsmässigt har du</strong></p>\n<p>- dansat tango i ett par eller många år och har spenderat en hel del tid på kurs och på det sociala dansgolvet<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du bra balans, du pivoterar lätt ståendes på en fot<br>\n&nbsp;</p>\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\n&nbsp;</p>\n<p>- du hinner med en utsmyckning på vägen mellan en rörelse och nästa<br>\n&nbsp;</p>\n<p>- du dansar i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\n&nbsp;</p>\n<p>- du kan musiken och har favoritorkestrar och -låtar<br>\n&nbsp;</p>\n<p>- du har förståelse för skapande och improvisation<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- självklart när det är festival i Sverige och någon gång även kanske utomlands &nbsp;<br>\n</p>\n<h3>KURSPLAN</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- teknik och kommunikation<br>\n&nbsp;</p>\n<p>- improvisation och struktur<br>\n&nbsp;</p>\n<p>- variation i stil<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<h3>Mål</h3>\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\n&nbsp;</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs.<br>\n</p>\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<h3>SCHEMA</h3>\n<p>&nbsp;Avancerade 1 Lund&nbsp;</p>\n<h2>Måndagar Lund</h2>\n<p>17 tillfällen ggr varav 14 lektioner + 2 lärarledda praktikor + 1 avslutningsfest &nbsp;</p>\n<p>Adress: Tornav. 17,<br>\n<strong>Lund</strong> <a href=\"&quot;&quot;&quot;http://hitta.se/Fredriksbersgatan&quot;&quot;&quot;\">Klicka här för karta</a> Lärare:<a href=\"&quot;&quot;&quot;https://www.tangokompaniet.com/lararna/#daniel&quot;&quot;&quot;\">Daniel</a> och <a href=\"&quot;&quot;&quot;https://www.tangokompaniet.com/lararna/#anna&quot;&quot;&quot;\">Anna</a> &nbsp;</p>\n<h2>För kursdeltagare erbjuder vi ett finfint&nbsp;rabatterat praktikakort för 750 kr för &nbsp;kursdeltagare (ord pris 1150 SEK)<br>\n</h2>\n<p>Om man missar en lektion kan man ta igen det i en annan grupp. &nbsp;&nbsp;<br>\n&nbsp;Om man vill hjälpa till eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! &nbsp;Skriv då detta i din anmälan.<br>\n&nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223<br>\n&nbsp;</p>\n<p>Skriv ditt namn och kurs.<br>\n&nbsp;</p>\n<h3>Välkommen med din anmälan!</h3>', '2019-01-02 09:32:05', '2019-06-04 09:35:46'),
(8, 'Course', 'AV1', 'ES', '<p>Los cursos son para ti</p>\n<p><br></p>\n<p>que han bailado tango durante mucho tiempo y que quieren desarrollar su tango para que sean aún más dinámicos y variados.</p>\n<p>Requisitos previos</p>\n<p><br></p>\n<p>En términos de tiempo, tienes</p>\n<p>- Bailaron tango por un par de años o muchos y pasé mucho tiempo en el curso y en la pista de baile social.</p>\n<p><br></p>\n<p>cognitivamente</p>\n<p>- Tienes buen equilibrio, puedes girar fácilmente de pie sobre un pie.</p>\n<p><br></p>\n<p>- Puedes hacer sacadas, giros, ochos, boleos y ganchos sin tener el apoyo de tu compañero.</p>\n<p><br></p>\n<p>- Tienes tiempo para una decoración en la carretera entre un movimiento y el siguiente.</p>\n<p><br></p>\n<p>- bailas tanto en abrazo abierto como cerrado y la dirección de la danza es para ti obvia</p>\n<p><br></p>\n<p>- Puedes escuchar música y tener orquestas y canciones favoritas.</p>\n<p><br></p>\n<p>- Tienes una comprensión de la creación y la improvisación.</p>\n<p><br></p>\n<p>Estas en la pista de baile</p>\n<p><br></p>\n<p>- Obviamente, cuando es festival en Suecia y en algún momento, incluso tal vez en el extranjero</p>\n<p><br></p>\n<p><br></p>\n<p>PROGRAMA</p>\n<p><br></p>\n<p>Vas a trabajar con</p>\n<p>- tecnología y comunicación</p>\n<p><br></p>\n<p>- improvisación y estructura.</p>\n<p><br></p>\n<p>- variación de estilo</p>\n<p><br></p>\n<p>- musica y ritmo</p>\n<p><br></p>\n<p><br></p>\n<p>objetivos</p>\n<p>En el curso, se abren nuevas puertas y se estiran las fronteras para que el tango siga siendo emocionante y desafiante en sus diversas formas. El objetivo del curso es que sientas que tu baile se hace más rico y que puedes adaptarte más fácilmente a diferentes parejas y estilos de baile y, por lo tanto, ser más libre en tu baile.</p>\n<p>¿Qué curso debo elegir?</p>\n<p>Si duda, a menudo es bueno elegir un nivel inferior. La repetición proporciona destreza, mientras que los desafíos difíciles pueden robar la alegría y la confianza en uno mismo. Siempre puede contactarnos en info@tangokompaniet.com y pedir ayuda cuando elija un curso.</p>\n<p><br></p>\n<p>¡También tienes la opción de obtener el doble del precio con descuento!</p>\n<p><br></p>\n<p><br></p>\n<p>HORARIO</p>\n<p>Avanzado 1 Lund</p>\n<p>Lunes lund</p>\n<p>Fecha de inicio: 4/2 2019</p>\n<p>tiempo del curso: 19: 00-20: 30</p>\n<p>Duración del curso: 18 veces, de las cuales 15 lecciones + 2 pasantes dirigidos por maestros + 1 fiesta de clausura</p>\n<p>Dirección: Tornav. 17,</p>\n<p>Lund Haga clic aquí para ver el mapa</p>\n<p>Maestra: Daniel y Anna</p>\n<p>precio</p>\n<p><br></p>\n<p>SEK 2230 para el curso de continuación 18 vy una tarjeta de pasantías con descuento para finetas (válida del 1 de enero al 1 de junio) por 750 SEK para los participantes del curso (precio de palabra 1150 SEK)</p>\n<p><br></p>\n<p>Si pierde una lección, puede recuperarla en otro grupo.</p>\n<p>¡Si quieres ayudar o si quieres ir a cursos dobles, te ofrecemos tarifas reducidas! Entonces escribe esto en tu aplicación.</p>\n<p><br></p>\n<p>El pago anticipado se realiza al giro bancario de Tangokompaniet 5532-8223.</p>\n<p><br></p>\n<p>Escribe tu nombre y curso.</p>\n<p>Bienvenido con su registro!</p>', '2019-01-22 08:13:19', '2019-06-04 09:35:46'),
(9, 'Course', 'AV1', 'EN', '<p>The courses are for you</p>\n<p>who have danced tango for a long time and who want to develop your tango to become even more dynamic and varied.</p>\n<p><br></p>\n<p><br></p>\n<p>Previous knowledge</p>\n<p><br></p>\n<p>In terms of time, you have</p>\n<p>- Danced tango for a couple or many years and spent a lot of time on course and on the social dance floor</p>\n<p><br></p>\n<p>cognitively</p>\n<p>- you have good balance, you easily pivot standing on one foot</p>\n<p><br></p>\n<p>- you can do sacadas, giros, ochos, boleos and ganchos without taking the support of your partner</p>\n<p><br></p>\n<p>- You have time for a decoration on the road between a movement and the next</p>\n<p><br></p>\n<p>- you dance in both open and closed embrace and the dance direction is for you obvious</p>\n<p><br></p>\n<p>- you can music and have favorite orchestras and songs</p>\n<p><br></p>\n<p>- You have an understanding of creation and improvisation</p>\n<p><br></p>\n<p>You are on the dance floor</p>\n<p><br></p>\n<p>- obviously when it is festival in Sweden and sometime even maybe abroad</p>\n<p><br></p>\n<p><br></p>\n<p>SYLLABUS</p>\n<p><br></p>\n<p>You will work with</p>\n<p>- technology and communication</p>\n<p><br></p>\n<p>- improvisation and structure</p>\n<p><br></p>\n<p>- variation in style</p>\n<p><br></p>\n<p>- music and rhythm</p>\n<p><br></p>\n<p><br></p>\n<p>Goal</p>\n<p>On the course, new doors are opened and the borders stretched so that tango continues to be exciting and challenging in its various forms. The goal of the course is that you should feel that your dance becomes richer and that you can more easily adapt to different partners and dance styles and thereby become freer in your dance!</p>\n<p>Which course should I choose?</p>\n<p>If you hesitate, it is often good to choose a lower level. Repetition provides skill while for difficult challenges can steal one&#039;s joy and self-confidence. You can always contact us at info@tangokompaniet.com and ask for help when choosing a course.</p>\n<p><br></p>\n<p>You also have the option to go twice the discounted price!</p>\n<p><br></p>\n<p><br></p>\n<p>SCHEDULE</p>\n<p>Advanced 1 Lund</p>\n<p>Mondays Lund</p>\n<p>Starting date: 4/2 2019</p>\n<p>Course time: 19: 00-20: 30</p>\n<p>Course duration: 18 times, of which 15 lessons + 2 teacher-led interns + 1 closing party</p>\n<p>Address: Tornav. 17,</p>\n<p>Lund Click here for map</p>\n<p>Teacher: Daniel and Anna</p>\n<p>Price</p>\n<p><br></p>\n<p>SEK 2230 for continuation course 18 v and finfin discounted internship card (valid 1 Jan-1 June) for 750 SEK for course participants (word price 1150 SEK)</p>\n<p><br></p>\n<p>If you miss a lesson you can retrieve it in another group.</p>\n<p>If you want to help or if you want to go double courses we offer reduced course fees! Then write this in your application.</p>\n<p><br></p>\n<p>Prepayment is made to Tangokompaniet&#039;s bank giro 5532-8223</p>\n<p><br></p>\n<p>Write your name and course.</p>\n<p>Welcome with your registration!</p>', '2019-01-22 08:14:27', '2019-06-04 09:35:46'),
(10, 'Course', 'AV2', 'SV', '<h2>Kurserna vänder sig till dig</h2>\n<p>som har dansat tango en längre tid och som vill utveckla din tango till att bli ännu mer dynamisk och varierad. I dessa tider med COVID har vi ett lägre maxantal på kurserna och kör med fasta partners dvs inga parbyten.</p>\n<h3>Förkunskaper</h3>\n<p><strong>Tidsmässigt har du</strong></p>\n<p>- dansat tango i ett par eller många år och har spenderat en hel del tid på kurs och på det sociala dansgolvet<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du bra balans, du pivoterar lätt ståendes på en fot<br>\n&nbsp;</p>\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\n&nbsp;</p>\n<p>- du hinner med en utsmyckning på vägen mellan en rörelse och nästa<br>\n&nbsp;</p>\n<p>- du dansar i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\n&nbsp;</p>\n<p>- du kan musiken och har favoritorkestrar och -låtar<br>\n&nbsp;</p>\n<p>- du har förståelse för skapande och improvisation<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- självklart när det är festival i Sverige och någon gång även kanske utomlands &nbsp;<br>\n</p>\n<h3>KURSPLAN</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- teknik och kommunikation<br>\n&nbsp;</p>\n<p>- improvisation och struktur<br>\n&nbsp;</p>\n<p>- variation i stil<br>\n&nbsp;</p>\n<p>- musik och rytmik</p>\n<p><br></p>\n<p>17 tillfällen varav 14 lektioner + 2 lärarledda praktikor + 1 avslutningsfest &nbsp;Adress: Tangokompaniet studio, Fredriksbergsgatan 7, Malmö</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. &nbsp;<strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<h3>Välkommen med din anmälan!</h3>\n<h2>Pris</h2>\n<p>2230 kr för fortsättningskursen och finfin &nbsp;rabatterat praktikakort (giltigt 1 jan-1 juni) för&nbsp;750 kr för &nbsp;kursdeltagare (ord pris 1150 SEK) &nbsp;Om man missar en lektion kan man ta igen det i en annan grupp. &nbsp;Om man vill hjälpa till eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel! &nbsp;Förbetalning sker till Tangokompaniets bankgiro 5532-8223 &nbsp;Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl. &nbsp;Skriv ditt namn och kurs. &nbsp;</p>\n<h3>Välkommen med din anmälan!<br>\n&nbsp;</h3>\n<h3>Mål</h3>\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\n&nbsp;</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs.<br>\n</p>\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>', '2019-01-02 09:33:04', '2019-06-04 09:35:46'),
(11, 'Course', 'AV2', 'EN', '<p>The courses are for you</p>\n<p>who have danced tango for a long time and who want to develop your tango to become even more dynamic and varied.</p>\n<p><br></p>\n<p><br></p>\n<p>Previous knowledge</p>\n<p><br></p>\n<p>In terms of time, you have</p>\n<p>- Danced tango for a couple or many years and spent a lot of time on course and on the social dance floor</p>\n<p><br></p>\n<p>cognitively</p>\n<p>- you have good balance, you easily pivot standing on one foot</p>\n<p><br></p>\n<p>- you can do sacadas, giros, ochos, boleos and ganchos without taking the support of your partner</p>\n<p><br></p>\n<p>- You have time for a decoration on the road between a movement and the next</p>\n<p><br></p>\n<p>- you dance in both open and closed embrace and the dance direction is for you obvious</p>\n<p><br></p>\n<p>- you can music and have favorite orchestras and songs</p>\n<p><br></p>\n<p>- You have an understanding of creation and improvisation</p>\n<p><br></p>\n<p>You are on the dance floor</p>\n<p><br></p>\n<p>- obviously when it is festival in Sweden and sometime even maybe abroad</p>\n<p><br></p>\n<p><br></p>\n<p>SYLLABUS</p>\n<p><br></p>\n<p>You will work with</p>\n<p>- technology and communication</p>\n<p><br></p>\n<p>- improvisation and structure</p>\n<p><br></p>\n<p>- variation in style</p>\n<p><br></p>\n<p>- music and rhythm</p>\n<p><br></p>\n<p><br></p>\n<p>Goal</p>\n<p>On the course, new doors are opened and the borders stretched so that tango continues to be exciting and challenging in its various forms. The goal of the course is that you should feel that your dance becomes richer and that you can more easily adapt to different partners and dance styles and thereby become freer in your dance!</p>\n<p>Which course should I choose?</p>\n<p>If you hesitate, it is often good to choose a lower level. Repetition provides skill while for difficult challenges can steal one&#039;s joy and self-confidence. You can always contact us at info@tangokompaniet.com and ask for help when choosing a course.</p>\n<p><br></p>\n<p>You also have the option to go twice the discounted price!</p>', '2019-01-22 08:16:59', '2019-06-04 09:35:46'),
(12, 'Course', 'AV2', 'ES', '<p>Los cursos son para ti</p>\n<p>que han bailado tango durante mucho tiempo y que quieren desarrollar su tango para que sean aún más dinámicos y variados.</p>\n<p><br></p>\n<p>Requisitos previos</p>\n<p><br></p>\n<p>En términos de tiempo, tienes</p>\n<p>- Bailaron tango por un par de años o muchos y pasé mucho tiempo en el curso y en la pista de baile social.</p>\n<p><br></p>\n<p>cognitivamente</p>\n<p>- Tienes buen equilibrio, puedes girar fácilmente de pie sobre un pie.</p>\n<p><br></p>\n<p>- Puedes hacer sacadas, giros, ochos, boleos y ganchos sin tener el apoyo de tu compañero.</p>\n<p><br></p>\n<p>- Tienes tiempo para una decoración en la carretera entre un movimiento y el siguiente.</p>\n<p><br></p>\n<p>- bailas tanto en abrazo abierto como cerrado y la dirección de la danza es para ti obvia</p>\n<p><br></p>\n<p>- Puedes escuchar música y tener orquestas y canciones favoritas.</p>\n<p><br></p>\n<p>- Tienes una comprensión de la creación y la improvisación.</p>\n<p><br></p>\n<p>Estas en la pista de baile</p>\n<p><br></p>\n<p>- Obviamente, cuando es festival en Suecia y en algún momento, incluso tal vez en el extranjero</p>\n<p><br></p>\n<p><br></p>\n<p>PROGRAMA</p>\n<p><br></p>\n<p>Vas a trabajar con</p>\n<p>- tecnología y comunicación</p>\n<p><br></p>\n<p>- improvisación y estructura.</p>\n<p><br></p>\n<p>- variación de estilo</p>\n<p><br></p>\n<p>- musica y ritmo</p>\n<p><br></p>\n<p><br></p>\n<p>objetivos</p>\n<p>En el curso, se abren nuevas puertas y se estiran las fronteras para que el tango siga siendo emocionante y desafiante en sus diversas formas. El objetivo del curso es que sientas que tu baile se hace más rico y que puedes adaptarte más fácilmente a diferentes parejas y estilos de baile y, por lo tanto, ser más libre en tu baile.</p>\n<p>¿Qué curso debo elegir?</p>\n<p>Si duda, a menudo es bueno elegir un nivel inferior. La repetición proporciona destreza, mientras que los desafíos difíciles pueden robar la alegría y la confianza en uno mismo. Siempre puede contactarnos en info@tangokompaniet.com y pedir ayuda cuando elija un curso.</p>\n<p><br></p>\n<p>¡También tienes la opción de obtener el doble del precio con descuento!</p>', '2019-01-22 08:18:07', '2019-06-04 09:35:46'),
(19, 'Course', 'ER1', 'SV', '<h2>Kursen vänder sig till dig</h2>\n<p>som har god balans och dansar till musiken men vill utveckla din &nbsp;kontakt, hållning och abrazo (kram) ytterligare och få mer variation i &nbsp;din dans. I dessa tider med COVID har vi ett lägre maxantal på kurserna och kör med fasta partners dvs inga parbyten.</p>\n<p><br></p>\n<p><em><strong>I dessa tider med COVID har vi ett lägre maxantal på kurserna och kör med fasta partners dvs inga parbyten. Vi ber dig också att stanna hemma från kursen om du inte känner dig frisk.</strong></em> <em><strong>Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt hemifrån genom Zoom.</strong></em></p>\n<p><br></p>\n<h3>Förkunskaper</h3>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått flera kurser och workshops samt dansat regelbundet på practilongas och milongas, festivaler och kanske ngt maraton. &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken &nbsp;och din partner, hittat ett dansflöde, konsten att gå tillsammans både i &nbsp;parallell gång och i korsad gång. Du har även tränat på ochos, giros &nbsp;och gungor. Du kan sacadas, boleos och ganchos och du har provat att &nbsp;dansa med mycket kroppskontakt i en omfamning. Du kan pivotera med god &nbsp;balans. Du kan de sociala koderna och du har en del favoriter bland &nbsp;tangomusiken.<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- minst ett par gånger i månaden<br>\n&nbsp;</p>\n<h3>Kursplan</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<p>- kram och posture<br>\n&nbsp;</p>\n<h3>Mål</h3>\n<p>Kursen fokuserar på att kunna dansa tango i en omfamning. Vi utvecklar &nbsp;också din medvetenhet om rummet, kroppen, musiken och din partner. Det &nbsp;kan kännas svårt att ha fokus på allt detta samtidigt och bibehålla ett &nbsp;flyt i dansen; på kursen bygger vi gradvis upp denna medvetenhet. Det är &nbsp;det som ger kvalitet i dansen och njutbara danser!</p>\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar &nbsp;tango och fått mer känsla av sammanhang och flyt. Vi ökar på din &nbsp;repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. Pä kursen &nbsp;arbetar vi med att få ett flyt i &nbsp;dansen genom att bli skickligare på grunderna och kombinera olika &nbsp;möjligheter. Orden blir till meningar!&nbsp;</p>\n<h3><br></h3>\n<h3>SCHEMA</h3>\n<p>Erfarna Malmö/Lund</p>\n<p>17 tillfällen varav 14 lektioner + 2 lärarledda praktikor + 1 avslutningsfest &nbsp;</p>\n<p>Adress Malmö: Tangokompaniet studio, Fredriksbergsgatan 7,<br>\n<strong>Malmö</strong> <a href=\"&quot;http://kartor.eniro.se/&quot;\">Klicka här för karta</a> &nbsp;Lärare: Daniel &amp; Anna</p>\n<p>Adress Lund: Västgöta nation, Lund&nbsp;</p>\n<p>Lärare: Daniel &amp; Anna<br>\n&nbsp;</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs.<br>\n</p>\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<h3>Välkommen med din anmälan!</h3>\n<h2>Pris</h2>\n<p>2230 kr för fortsättningskursen och finfin &nbsp;rabatterat praktikakort (giltigt 1 sep-31 dec 2020) för&nbsp;? kr för &nbsp;kursdeltagare (ord pris ? SEK)<br>\n</p>\n<p>Om man missar en lektion kan man ta igen det i en annan grupp. &nbsp;Om man vill hjälpa till eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel!<br>\n&nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223<br>\n&nbsp;</p>\n<p>Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl.<br>\n&nbsp;</p>\n<p>Skriv ditt namn och kurs. OBS! Anmälan endast med fast danspartner; en anmälan för dig och en för din partner. (Har du ingen danspartner så hjälper vi gärna dig att finna en; hör av dig till daniel@tangokompaniet.com)<br>\n&nbsp;</p>\n<h3>Välkommen med din anmälan!</h3>', '2019-01-02 09:30:50', '2019-06-04 09:35:46'),
(20, 'Course', 'ER1', 'EN', '<p>The course is for you<br>\n<br>\nwho has good balance and dances to the music but wants to develop your contact, attitude and abrazo (hug) further and get more variety in your dance<br>\n<br>\n<br>\nPrevious knowledge<br>\n<br>\nExperience has you<br>\n- attended several courses and workshops and regularly danced at practilongas and milongas, festivals and maybe ngt marathons.<br>\n<br>\ncognitively<br>\n- Have you learned some basic elements such as listening to the music and your partner, finding a dance flow, the art of walking together both in parallel and crossing. You have also trained on ochos, giros and swings. You can sacadas, boleos and ganchos and you have tried to dance with a lot of body contact in an embrace. You can pivot with good balance. You can have the social codes and you have some favorites among the tango music.<br>\n<br>\nYou are on the dance floor<br>\n- at least a couple of times a month<br>\n<br>\n<br>\nSyllabus<br>\n<br>\nYou will work with<br>\n- expanding your repertoire<br>\n<br>\n- music and rhythm<br>\n<br>\n- hug and posture<br>\n<br>\n<br>\n<br>\nGoal<br>\n<br>\nThe course focuses on being able to dance tango in an embrace. We also develop your awareness of the room, the body, the music and your partner. It can feel difficult to focus on all this at the same time and maintain a flow in the dance; on the course, we gradually build up this awareness. That&#039;s what gives quality in the dance and enjoyable dances!<br>\n<br>\nAt the end of the course you will feel much safer when you dance tango and have more sense of context and flow. We increase your repertoire so that you feel freer to express yourself through more possibilities and variations. On the course, we work to get a flow in the dance by becoming more skilled at the basics and combining different possibilities. The words turn into sentences!<br>\nSCHEDULE<br>\n<br>\n<br>\n<br>\nYou also have the option to go twice the discounted price!<br>\n<br>\nWelcome with your registration!<br>\n<br>\nPrice<br>\n<br>\nSEK 2230 for continuation course 18 v and finfin discounted internship card (valid 1 Jan-1 June) for 750 SEK for course participants (word price 1150 SEK)</p>', '2019-01-22 08:09:15', '2019-06-04 09:35:46'),
(21, 'Course', 'ER1', 'ES', '<p>El curso es para ti</p>\n<p><br></p>\n<p>que tiene buen equilibrio y baila con la música, pero quiere desarrollar más su contacto, actitud y abrazo y obtener más variedad en su baile.</p>\n<p><br></p>\n<p><br></p>\n<p>Requisitos previos</p>\n<p><br></p>\n<p>La experiencia te tiene</p>\n<p>- Asistí a varios cursos y talleres y bailé regularmente en practilongas y milongas, festivales y tal vez maratones.</p>\n<p><br></p>\n<p>cognitivamente</p>\n<p>- ¿Ha aprendido algunos elementos básicos, como escuchar música y a su pareja, encontrar un flujo de baile, el arte de caminar juntos en paralelo y cruzando? También has entrenado en ochos, giros y columpios. Puedes sacadas, boleos y ganchos y has tratado de bailar con mucho contacto corporal en un abrazo. Puedes pivotar con buen equilibrio. Puedes tener los códigos sociales y tienes algunos favoritos entre la música de tango.</p>\n<p><br></p>\n<p>Estas en la pista de baile</p>\n<p>- Al menos un par de veces al mes.</p>\n<p><br></p>\n<p><br></p>\n<p>plan de estudios</p>\n<p><br></p>\n<p>Vas a trabajar con</p>\n<p>- ampliando tu repertorio</p>\n<p><br></p>\n<p>- musica y ritmo</p>\n<p><br></p>\n<p>- abrazo y postura</p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p>objetivos</p>\n<p><br></p>\n<p>El curso se enfoca en poder bailar tango en un abrazo. También desarrollamos tu conciencia de la habitación, el cuerpo, la música y tu pareja. Puede ser difícil concentrarse en todo esto al mismo tiempo y mantener un flujo en el baile; En el curso, gradualmente construimos esta conciencia. ¡Eso es lo que da calidad en el baile y bailes agradables!</p>\n<p><br></p>\n<p>Al final del curso, te sentirás mucho más seguro cuando bailas tango y tengas más sentido del contexto y la fluidez. Incrementamos su repertorio para que se sienta más libre para expresarse a través de más posibilidades y variaciones. En el curso, trabajamos para obtener un flujo en el baile al ser más hábiles en lo básico y combinar diferentes posibilidades. Las palabras se convierten en oraciones!</p>\n<p>HORARIO</p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p>¡También tienes la opción de obtener el doble del precio con descuento!</p>\n<p><br></p>\n<p>Bienvenido con su registro!</p>\n<p><br></p>\n<p>precio</p>\n<p><br></p>\n<p>SEK 2230 para el curso de continuación 18 vy una tarjeta de pasantías con descuento para finetas (válida del 1 de enero al 1 de junio) por 750 SEK para los participantes del curso (precio de palabra 1150 SEK)</p>\n<p><br></p>\n<p>Si pierde una lección, puede recuperarla en otro grupo. ¡Si quieres ayudar o si quieres ir a cursos dobles, te ofrecemos tarifas reducidas! ¡Ponte en contacto con Daniel!</p>\n<p><br></p>\n<p>El pago anticipado se realiza al giro bancario de Tangokompaniet 5532-8223.</p>\n<p><br></p>\n<p>Es posible dividir el pago, notificarnos de este caso por correo electrónico.</p>\n<p><br></p>\n<p>Escribe tu nombre y curso.</p>\n<p>Bienvenido con su registro!</p>', '2019-01-22 08:09:48', '2019-06-04 09:35:46'),
(24, 'Course', 'F12', 'SV', '<h2>Kursen vänder sig till dig</h2>\n<p>som har grunderna i tango och vill &nbsp;utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt &nbsp;vill du känna att du dansar mer till musiken och känna dig säkrare i &nbsp;dina egna rörelser.&nbsp;</p>\n<h3>Förkunskaper</h3>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått grundkurs i tango samt varit ute och dansat några gånger på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken &nbsp;och din partner, hittat ett dansflöde, konsten att gå tillsammans både i &nbsp;parallell gång och i korsad gång. Du har även tränat på ochos, giros &nbsp;och gungor etc. <br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- någon till några gånger i månaden <br>\n&nbsp;</p>\n<h3>Kursplan</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar <br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<h3>Mål</h3>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, &nbsp;musiken och din partner. Det kan kännas svårt att ha fokus på allt detta &nbsp;samtidigt och bibehålla ett flyt i dansen; på kursen bygger vi gradvis &nbsp;upp denna medvetenhet. Det är det som ger kvalitet i dansen och njutbara &nbsp;danser!</p>\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar &nbsp;tango och fått mer känsla av sammanhang och flyt. Vi ökar på din &nbsp;repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. Pä kursen &nbsp;arbetar vi med att få ett flyt i &nbsp;dansen genom att bli skickligare på grunderna och kombinera olika &nbsp;möjligheter. Orden blir till meningar!&nbsp;</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\n</p>\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>', '2019-01-22 08:04:26', '2019-06-04 09:35:46'),
(25, 'Course', 'F12', 'ES', '<p>El curso es para ti</p>\n<p>Quienes tienen lo básico del tango y quieren expandir su repertorio, obtener más tecnología y un contacto más seguro. Al mismo tiempo, quieres sentir que bailas más con la música y te sientes más seguro con tus propios movimientos.</p>\n<p>Requisitos previos</p>\n<p>La experiencia te tiene</p>\n<p>- Pasé el curso básico de tango y salí a bailar algunas veces en practilongas y milongas.</p>\n<p><br></p>\n<p>cognitivamente</p>\n<p>- ¿Ha aprendido algunos elementos básicos, como escuchar música y a su pareja, encontrar un flujo de baile, el arte de caminar juntos en paralelo y cruzando? También has entrenado en ochos, giros y columpios, etc.</p>\n<p><br></p>\n<p>Estas en la pista de baile</p>\n<p>- Alguien unas cuantas veces al mes.</p>\n<p><br></p>\n<p><br></p>\n<p>plan de estudios</p>\n<p><br></p>\n<p>Vas a trabajar con</p>\n<p>- ampliando tu repertorio</p>\n<p><br></p>\n<p>- capacidad de respuesta y equilibrio</p>\n<p><br></p>\n<p>- musica y ritmo</p>\n<p><br></p>\n<p><br></p>\n<p>objetivos</p>\n<p><br></p>\n<p>El curso se enfoca en aumentar gradualmente tu conocimiento de la habitación, el cuerpo, la música y tu pareja. Puede ser difícil concentrarse en todo esto al mismo tiempo y mantener un flujo en el baile; En el curso, gradualmente construimos esta conciencia. ¡Eso es lo que da calidad en el baile y bailes agradables!</p>\n<p><br></p>\n<p>Al final del curso, te sentirás mucho más seguro cuando bailas tango y tengas más sentido del contexto y la fluidez. Incrementamos su repertorio para que se sienta más libre para expresarse a través de más posibilidades y variaciones. En el curso, trabajamos para obtener un flujo en el baile al ser más hábiles en lo básico y combinar diferentes posibilidades. Las palabras se convierten en oraciones!</p>\n<p><br></p>\n<p>¿Qué curso debo elegir?</p>\n<p>Si duda, a menudo es bueno elegir un nivel inferior. La repetición proporciona destreza, mientras que los desafíos difíciles pueden robar la alegría y la confianza en uno mismo. Siempre puede contactarnos en info@tangokompaniet.com y pedir ayuda cuando elija un curso.</p>\n<p><br></p>\n<p>¡También tienes la oportunidad de ir a cursos dobles a un precio reducido!</p>', '2019-01-22 08:05:31', '2019-06-04 09:35:46'),
(26, 'Course', 'F12', 'EN', '<p>The course is for you</p>\n<p>who have the basics of tango and want to expand your repertoire, get more technology and a safer contact. At the same time, you want to feel that you dance more to the music and feel safer in your own movements.</p>\n<p><br></p>\n<p><br></p>\n<p>Previous knowledge</p>\n<p><br></p>\n<p>Experience has you</p>\n<p>- passed basic course in tango and been out dancing a few times at practilongas and milongas</p>\n<p><br></p>\n<p>cognitively</p>\n<p>- Have you learned some basic elements such as listening to the music and your partner, finding a dance flow, the art of walking together both in parallel and crossing. You have also trained on ochos, giros and swings etc.</p>\n<p><br></p>\n<p>You are on the dance floor</p>\n<p>- Someone a few times a month</p>\n<p><br></p>\n<p><br></p>\n<p>Syllabus</p>\n<p><br></p>\n<p>You will work with</p>\n<p>- expanding your repertoire</p>\n<p><br></p>\n<p>- responsiveness and balance</p>\n<p><br></p>\n<p>- music and rhythm</p>\n<p><br></p>\n<p><br></p>\n<p>Goal</p>\n<p><br></p>\n<p>The course focuses on gradually increasing your awareness of the room, the body, the music and your partner. It can feel difficult to focus on all this at the same time and maintain a flow in the dance; on the course, we gradually build up this awareness. That&#039;s what gives quality in the dance and enjoyable dances!</p>\n<p><br></p>\n<p>At the end of the course you will feel much safer when you dance tango and have more sense of context and flow. We increase your repertoire so that you feel freer to express yourself through more possibilities and variations. On the course, we work to get a flow in the dance by becoming more skilled at the basics and combining different possibilities. The words turn into sentences!</p>\n<p><br></p>\n<p>Which course should I choose?</p>\n<p>If you hesitate, it is often good to choose a lower level. Repetition provides skill while for difficult challenges can steal one&#039;s joy and self-confidence. You can always contact us at info@tangokompaniet.com and ask for help when choosing a course.</p>\n<p><br></p>\n<p>You also have the option to go twice the discounted price!</p>', '2019-01-22 08:06:25', '2019-06-04 09:35:46'),
(28, 'Course', 'FT1', 'SV', '<p>Följarteknik 1 - starten<br>\n</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå.&nbsp;</p>\n<p>I denna kurs kommer vi kika på hållning, steg, gång, olika riktningar och tempoväxlingar samt dissociation och pivoteringar.<br>\n</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som åtminstone går eller har gått en grundkurs i tango.<br>\n</p>\n<p>Plats: Tangokompaniet studio, Fredriksbergsgatan 7 i Malmö<br>\n<br>\n</p>\n<p>För frågor kontakta Anna på <a href=\"mailto:anna@tangokompaniet.com\">anna@tangokompaniet.com</a> eller 0705-150345. VÄLKOMMEN!<br>\n</p>\n<p><a href=\"http://tangokompaniet.com/\">tangokompaniet.com</a><br>\n</p>\n<p>----------------------------------------------------------------<br>\n</p>\n<p>Followers technique 1 - the start<br>\n</p>\n<p>This course is for you who wants to become a grounded, smooth and secure follower in tango. We are going to look in to techniques that will help you with exactly that. The course material suits both newer and more experienced tango dancers and everyone trains on their own level.</p>\n<p>In this course we will look at posture, stepping, walking, different directions and tempo changes plus dissociation and pivots.<br>\n</p>\n<p>You register without partner and the course is open for everyone who at least has or are taking a basic course in tango.<br>\n</p>\n<p>Venue: Tangokompaniet studio, Fredriksbergsgatan 7 in Malmö<br>\n<br>\n</p>\n<p>For questions please contact Anna at <a href=\"mailto:anna@tangokompaniet.com\">anna@tangokompaniet.com</a> or 0705-150345. WELCOME!<br>\n</p>\n<p><a href=\"http://tangokompaniet.com/\">tangokompaniet.com</a></p>\n<p><br></p>\n<img \n  src=\"https://www.tangokompaniet.com/app/slim/public/user/anna/images/följarteknikspegel.jpg\" \n  width=\'45%\'\n  style=\"display:block; margin-left:auto; margin-right:auto;\"\n/>\n', '2019-01-02 09:33:45', '2019-06-04 09:35:46'),
(29, 'Course', 'FT1', 'EN', '<p>Follow-up Technology &amp; Driver Technology, CEO 2019</p>\n<p>with Anna Sol &amp; Daniel Carlsson</p>\n<p><br></p>\n<p><br></p>\n<p>Follow-up &amp; Driver Technology I - The Basics</p>\n<p><br></p>\n<p>It will be every two weeks follow-up technique and every two weeks Driver&#039;s technology. The course is for those who want to learn the most important tricks to become both founded, smooth and safe in tango. We look at techniques that help you develop this. The course material fits both experienced and newer dancers and all train at their own level.</p>\n<p><br></p>\n<p>You sign up without a partner and the course is open to everyone.</p>\n<p><br></p>\n<p>Time: Wednesdays at 17: 30-19: 00.</p>\n<p>Location: Tangokompaniet studio, Fredriksbergsgatan 7 in Malmö</p>\n<p>Price: 800kr (if you already take a semester course at Tangokompaniet - SEK 100 discount)</p>\n<p>Duration: 4 weeks, every other week starts 30/1. Follow-up technology will be on 30/1, 13/2, 27/2 and 13/3. Driver technology will be on 6/2, 20/2, 6/3 and 20/3. It also includes a teacher-led practica and the closing party.</p>\n<p><br></p>\n<p>For questions and registration for Follow-up Technique, contact Anna at anna@tangokompaniet.com or 0705-150345. For questions and registration, please contact Daniel at daniel@tangokompaniet.com or 0736-563609. Welcome!</p>', '2019-01-22 08:20:54', '2019-06-04 09:35:46'),
(30, 'Course', 'FT1', 'ES', '<p>Tecnología de seguimiento y tecnología de conductor, CEO 2019</p>\n<p>con Anna Sol y Daniel Carlsson</p>\n<p><br></p>\n<p><br></p>\n<p>Tecnología de seguimiento y conducción I - Lo básico</p>\n<p><br></p>\n<p>Será cada dos semanas, una técnica de seguimiento y cada dos semanas, la tecnología de Driver. El curso es para aquellos que quieren aprender los trucos más importantes para que el tango se funda, sea suave y seguro. Observamos técnicas que te ayudan a desarrollar esto. El material del curso se adapta a bailarines experimentados y nuevos, y todos entrenan a su propio nivel.</p>\n<p><br></p>\n<p>Te registras sin compañero y el curso está abierto a todos.</p>\n<p><br></p>\n<p>Hora: miércoles a las 17: 30-19: 00.</p>\n<p>Ubicación: estudio Tangokompaniet, Fredriksbergsgatan 7 en Malmö</p>\n<p>Precio: 800kr (si ya tomas un curso de un semestre en Tangokompaniet - descuento de 100 SEK)</p>\n<p>Duración: 4 semanas, cada dos semanas comienza 30/1. La tecnología de seguimiento será el 30/1, 13/2, 27/2 y 13/3. La tecnología de controladores estará en 6/2, 20/2, 6/3 y 20/3. También incluye una práctica dirigida por el profesor y la fiesta de clausura.</p>\n<p><br></p>\n<p>Para preguntas e inscripción para la técnica de seguimiento, comuníquese con Anna en anna@tangokompaniet.com o al 0705-150345. Para preguntas e inscripciones, contacte a Daniel en daniel@tangokompaniet.com o al 0736-563609. BIENVENIDOS!No translation to english yet</p>', '2019-01-22 08:22:03', '2019-06-04 09:35:46'),
(31, 'Course', 'GK1_SHORT', 'SV', '<h3>GRUNDKURS 1 (snabbspår i 5 veckor)</h3>\n<h3>Kursen vänder sig till dig</h3>\n<p>som är nybörjare eller du som vill repetera tangons grunder!&nbsp;</p>\n<p>Tips! I din kurs ingår det gratis träningstillfällen; sk practilongas! Ta chansen att sätta stegen och ha kul redan från början! Förutom våra grundkurser har vi även under festivaler helgkurser för nya tangodansare, se <a href=&quot;http://www.festivalito.tangokompaniet.com/&quot;>&nbsp;våra Tangofestivaler i Malmö</a> &nbsp;<br>\n&nbsp;</p>\n<h3>KURSPLAN</h3>\n<p>På kursen tränar du element som <br>\n&nbsp;</p>\n<p>- grundrytm &amp; musik<br>\n&nbsp;</p>\n<p>- dansfattning &amp; hållning<br>\n&nbsp;</p>\n<p>- steg &amp; kommunikation<br>\n&nbsp;</p>\n<p>- caminada, ocho, giro, salida &nbsp;</p>\n<h3>MåL</h3>\n<p>På Grundkurs I lär du dig grunderna i argentinsk tango. Du kommer kunna &nbsp;röra dig tillsammans med en partner till musiken och kunna dansa de &nbsp;vanligaste stegkombinationerna. Under kursen kommer du även fått &nbsp;tillfälle att tillsammans med gruppen och lärarna dansa socialt på en &nbsp;tangokväll. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<h2>Pris</h2>\n<p>Dennna grundkurs varar i 5 &nbsp;veckor. Därefter erbjuder vi fortsättningen grundkurs 2. Priset för denna förkortade grundkurs 1 är 600 kr. Tar man båda grundkurserna och betalar för båda &nbsp;före grundkurs 1 startar får man det fördelaktiga priset 1200 kr &nbsp;(ordpris 1450 kr)<br>\n</p>', '2019-01-02 09:29:00', '2019-06-04 09:35:46'),
(32, 'Course', 'GK1', 'SV', '<h2>Kursen vänder sig till dig</h2>\n<p>som är nybörjare eller du som vill repetera tangons grunder!&nbsp;</p>\n<p><br></p>\n<h3>KURSPLAN</h3>\n<p>På kursen tränar du element som</p>\n<p>- att hitta pulsen, fraserna, vissa rytmer och känslan i musiken</p>\n<p>- dansfattning &amp; hållning</p>\n<p>- steg &amp; kommunikation&nbsp;</p>\n<p>- tangons grundrörelser som caminada, ocho, giro, salida mm</p>\n<p><br></p>\n<h3>Mål</h3>\n<p>På Grundkurs 1 lär du dig grunderna i argentinsk tango. Du kommer kunna röra dig tillsammans med din danspartner till musiken och kunna dansa de vanligaste stegkombinationerna. Under kursen kommer du även fått&nbsp;tillfälle att tillsammans med gruppen och lärarna dansa socialt på en tangokväll. &nbsp;</p>\n<h3><br></h3>\n<h3>Pris</h3>\n<p>Priset för en Grundkurs är 950 kr.</p>\n<p>De flesta grundkurser börjar i januari/februari och i september och varar 7 veckor varpå vi erbjuder fortsättningen Grundkurs 2. Anmäler man sig till både Grundkurs 1 och Grundkurs 2 och betalar för båda&nbsp;före Grundkurs 1 startar, får man det fördelaktiga priset 1700 kr (ordpris 1900 kr)<br>\n&nbsp;</p>\n<p>Kursen omfattar 7 lektioner och som bonus kan du även delta gratis på våra socialdanser på måndagar i Lund och söndagar i Malmö! OBS! Om du vill träna mer så kan du gå Grundkurs 1/2 &nbsp;två ggr/vecka - jättebra för inlärningen! Då betalar du endast halva priset för den extra kursen! Detta ger snabbare resultat, flyt och trygghet.&nbsp;</p>\n<p><br></p>\n<h3>Anmälan&nbsp;</h3>\n<p>Du anmäler dig med eller utan en danspartner genom att klicka på knapparna nedan. Om du inte har någon danspartner och vill ha hjälp med att finna en; kontakta oss på daniel@tangokompaniet.com</p>\n<p><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt. Kontakta lärarna för mer information. Missar du en lektion så har du möjlighet att ta igen den i en annan grupp.</strong></em></p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller via Swish. Anmälan är bindande och avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart.<br>\nSkriv ditt namn och kurs i betalningen.&nbsp;&nbsp;</p>\n<h2>Hjärtligt välkommen in i tangons förtrollande värld!&nbsp;</h2>', '2019-01-02 09:30:05', '2019-06-04 09:35:46'),
(33, 'Course', 'GK1', 'ES', '<p>El curso es para ti</p>\n<p>Un curso basico sirve para los que no probaron tango antes, pero tambien para los que quieren volver a repetir y pulir lo mas fundamental del tango.</p>\n<p>Extra ! En tu curso, hay sesiones de entrenamiento gratuitas; sk practilongas! ¡Aprovecha la oportunidad de poner los pasos y diviértete desde el principio! Además de nuestros cursos básicos, también tenemos cursos los fines de semana para nuevos bailarines de tango durante los festivalitos, vea nuestros festivales de tango en Malmö</p>\n<p><br></p>\n<p>PROGRAMA</p>\n<p>En el curso entrenas elementos como</p>\n<p><br></p>\n<p>- Ritmo básico y música.</p>\n<p><br></p>\n<p>- Retrato y actitud de baile.</p>\n<p><br></p>\n<p>- pasos y comunicación</p>\n<p><br></p>\n<p>- caminada, ocho, giro, salida</p>\n<p>OBJETIVOS</p>\n<p><br></p>\n<p>En el Curso Básico aprendes lo básico del tango argentino. Podrás moverte junto con un compañero a la música y bailar las combinaciones de pasos más comunes. Durante el curso también tendrás la oportunidad, junto con el grupo y los maestros, de bailar socialmente en una noche de tango.</p>\n<p>La mayoría de los cursos básicos comienzan en enero y septiembre y duran 7 semanas, después de lo cual ofrecemos la continuación del curso básico 2. El precio de un curso básico es de 850 SEK. Si toma ambos cursos básicos y paga ambos antes del curso básico 1, obtiene el ventajoso precio de 1500 SEK (precio de palabra 1700 SEK)</p>\n<p>El curso consta de 7 lecciones y pasantías / noches de baile. Puedes pagar 250 SEK extra y podras tomar 2 cursos basicos del mismo nivel o sea 2 basico 1 o dos basico 2. Escribe tu nombre y curso.</p>\n<p><br></p>', '2019-01-22 07:56:45', '2019-06-04 09:35:46'),
(34, 'Course', 'GK1', 'EN', '<p>The course is for you</p>\n<p>who is a beginner or you want to repeat the tango\'s basics!</p>\n<p>Tip! In your course, there are free training sessions; so called practilongas! Take the chance to put the steps and have fun right from the start! In addition to our basic courses, we also have weekend courses for new tango dancers during festivals, see our Tango festivals in Malmö</p>\n<p><br></p>\n<p>SYLLABUS</p>\n<p>On the course you train elements as</p>\n<p><br></p>\n<p>- basic rhythm &amp; music</p>\n<p><br></p>\n<p>- dance portrait &amp; attitude</p>\n<p><br></p>\n<p>- steps &amp; communication</p>\n<p><br></p>\n<p>- caminada, ocho, giro, salida</p>\n<p>Goal</p>\n<p><br></p>\n<p>At Basic Course I will teach you the basics of Argentine tango. You will be able to move along with a partner to the music and be able to dance the most common step combinations. During the course you will also have the opportunity, together with the group and the teachers, to dance socially on a tango night.</p>\n<p>Price</p>\n<p><br></p>\n<p>Most basic courses begin in January and September and last for 7 weeks, after which we offer the continuation of the basic course 2. The price for a basic course is 850 SEK. If you take both basic courses and pay for both before the basic course 1, you get the advantageous price 1500 SEK (word price 1700 SEK)</p>\n<p>The course comprises 7 lessons and internships / dance nights. You can pay 250 SEK extra and then you can take 2 basic courses 1 at the same time. (in the same way, you can pay 250 SEK extra and take 2 basic courses 2).</p>\n<p>Prepayment is made to Tangokompaniet\'s bank giro 5532-8223.</p>\n<p>Write your name and course.</p>\n<p><br></p>', '2019-01-22 07:58:26', '2019-06-04 09:35:46');
INSERT INTO `tbl_text_21Jan22` (`id`, `groupId`, `textId`, `language`, `textBody`, `creaTimestamp`, `updTimestamp`) VALUES
(35, 'Course', 'GK2', 'SV', '<h2>Kursen vänder sig till dig</h2>\n<p>som är nybörjare och gått Grundkurs 1 eller du som vill repetera tangons grunder!&nbsp;För att gå grundkurs 2 behöver du minst ha gått en grundkurs 1 och kanske dansat på någon social dans.<br>\n</p>\n<h3>KURSPLAN</h3>\n<p>På kursen tränar du vidare på musiken, dansfattningen, hållningen och kommunikationen, samt bygger vi vidare på repertoaren, så du får en mer fulländad dans.&nbsp;<br>\n</p>\n<h3>Mål</h3>\n<p>På Grundkurs 2 lär du dig grunderna i argentinsk tango. Du kommer kunna röra dig tillsammans med din danspartner till musiken och kunna dansa de vanligaste stegkombinationerna. Under kursen kommer du även fått&nbsp;tillfälle att tillsammans med gruppen och lärarna dansa socialt på en tangokväll.&nbsp;</p>\n<p><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt hemifrån. Kontakta lärarna</strong></em></p>\n<h3>Pris</h3>\n<p>Priset för en grundkurs är 950 kr.</p>\n<p>De flesta grundkurser börjar i januari och i september och varar 7 veckor varpå vi erbjuder fortsättningen grundkurs 2. Tar man både Gk1 och Gk2 och betalar för båda&nbsp;före grundkurs 1 startar, får man det fördelaktiga priset 1700 kr (ordpris 1900 kr)<br>\n&nbsp;</p>\n<p>Kursen omfattar 7 lektioner och som bonus kan du även delta gratis på våra socialdanser på söndagarna! OBS! Om du vill träna mer så kan du gå grundkurs 1/2 &nbsp;två ggr/vecka - jättebra för inlärningen! Då betalar du endast halva priset för den extra kursen! Detta ger snabbare resultat, flyt och trygghet.&nbsp;<br>\n</p>\n<h3>Anmälan&nbsp;</h3>\n<p>Du anmäler dig med eller utan en danspartner genom att klicka på knapparna nedan. Om du inte har någon danspartner och vill ha hjälp med att finna en; kontakta oss på daniel@tangokompaniet.com</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller via Swish. Anmälan är bindande och avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart.<br>\nSkriv ditt namn och kurs. &nbsp;&nbsp;</p>\n<h2>Hjärtligt välkommen in i tangons förtrollande värld!&nbsp;</h2>', '2019-01-22 08:00:22', '2019-06-04 09:35:46'),
(36, 'Course', 'GK2', 'EN', '<p>Goal</p>\n<p>At Basic Course II you get some more material for your basic technique in tango. You try more new steps and combine them with more flow in the dance.</p>\n<p>Price</p>\n<p><br></p>\n<p>Basic course II starts after basic course I and normally lasts 7 weeks. The basic course costs 850 SEK. If you take both basic courses and pay for both before the basic course 1, you get the advantageous price 1500 SEK (word price 1700 SEK)</p>\n<p>The course comprises 7 lessons and interns. Dancing more eg by taking several Basic courses II at the same time each week and paying only SEK 250 extra. This results in faster results, flow and security.</p>\n<p>Payment is made to Tangokompaniet&#039;s bank giro 5532-8223.</p>\n<p>Write your name and course.</p>', '2019-01-22 08:01:36', '2019-06-04 09:35:46'),
(37, 'Course', 'GK2', 'ES', '<p>OBJETIVOS</p>\n<p>En el Curso Básico II obtienes más material para tu técnica básica en el tango. Intenta más pasos nuevos y los combina con más fluidez en el baile.</p>\n<p>precio</p>\n<p><br></p>\n<p>El curso básico II comienza después del curso básico I y normalmente dura 7 semanas. El curso básico cuesta 850 SEK. Si toma ambos cursos básicos y paga ambos antes del curso básico 1, obtiene el ventajoso precio de 1500 SEK (precio de palabra 1700 SEK)</p>\n<p>El curso consta de 7 lecciones y pasantes. Bailar más, por ejemplo, tomando 2 cursos Básicos II al mismo tiempo cada semana y pagando solo 250 SEK adicionales. Esto resulta en resultados más rápidos, flujo y seguridad.</p>\n<p>El pago se realiza al giro bancario de Tangokompaniet 5532-8223.</p>\n<p>Escribe tu nombre y curso.</p>', '2019-01-22 08:02:16', '2019-06-04 09:35:46'),
(38, 'Course', 'IN_DEPTH', 'SV', '<h3>Kurserna vänder sig till&nbsp;</h3>\r\n<p>de mest inbitna tangodansaren i &nbsp;regionen! Du vill få utmaningar i din tango och tycker sällan att något &nbsp;är för svårt. Tangon är en självklar del i din livsstil!</p>\r\n<h3>Förkunskaper</h3>\r\n<p><strong>Tidsmässigt har du</strong></p>\r\n<p>- dansat tango i många år och flera kvällar i veckan <br>\r\n&nbsp;</p>\r\n<p><strong>Kunskapsmässigt</strong></p>\r\n<p>- har du riktigt bra balans, du pivoterar lätt ståendes på en fot <br>\r\n&nbsp;</p>\r\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\r\n&nbsp;</p>\r\n<p>- hinner du lätt med en utsmyckning på vägen mellan en rörelse och nästa<br>\r\n&nbsp;</p>\r\n<p>- dansar du i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\r\n&nbsp;</p>\r\n<p>- kan du musiken och har favoritorkestrar och -låtar<br>\r\n&nbsp;</p>\r\n<p>- har du förståelse för skapande och improvisation <br>\r\n&nbsp;</p>\r\n<p><strong>På dansgolvet befinner du dig</strong></p>\r\n<p>- frekvent både på practilongas och milongas i regionen <br>\r\n&nbsp;</p>\r\n<p>- självklart när det är festival eller maraton i Sverige och då och då runtom i Europa<br>\r\n&nbsp;</p>\r\n<h3>Kursplan</h3>\r\n<p>Kursen är 19 veckor lång men vid behov kan vi avtala att ngn går en &nbsp;del av den tex vid utlandsresor mm annars kan man ta igen missade &nbsp;lektioner på andra kurser. <br>\r\n&nbsp;</p>\r\n<h3>Mål</h3>\r\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\r\n&nbsp;</p>\r\n<h2>Vilken kurs ska jag välja?</h2>\r\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\r\n</p>\r\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\r\n\r\n', '2018-01-24 10:20:30', '2019-01-22 09:00:55'),
(39, 'Course', 'MI_4GGR', 'SV', '<h3>Milonga kurs i Lund med Anna och Daniel</h3>\n<p>Välkommen till en kurs milonga över 3 måndagar kl 19.00-20.30 på Michael &nbsp;hansens kollegiums gillestuga i Lund, Dag Hammarskjölds Väg 4. <br>\n&nbsp;</p>\n<ul>\n  <li>Känner du dig trygg när det kommer en tango men mer osäker när det kommer en milonga?</li>\n  <li>Undrar du vilka steg som passar i milongan och vilka som kanske passar mindre bra?</li>\n  <li>Vill du förstå hur danstekniken förändras när vi går från tango till milonga?</li>\n</ul>\n<p>&nbsp;Om du svarat ja på någon av dessa frågor är detta rätt kurs för dig.<br>\n</p>\n<p>&nbsp;Vi kommer att gå igenom teknik, repertoar, musikalitet och stil. Det &nbsp;kommer att finnas viktiga element för dig som dansat länge och för dig &nbsp;som inte dansat riktigt lika länge.<br>\n</p>\n<p>&nbsp;Kursen passar för dig som har en hyggligt god dansvana och som dansar på fortsättningsnivå.<br>\n</p>\n<p>&nbsp;&nbsp;Anmälan sker till <a href=&quot;mailto:info@tangokompaniet.com&quot;>info@tangokompaniet.com</a>. Det går bra att anmäla sig i par eller som singel men lättare om Ni anmäler er i par. &nbsp;</p>\n<h2>Pris</h2>\n<p>Pris: 450 kr/person för TK-elever, annars 500 kr/person Du kan anmäla dig med eller utan partner till daniel@tangokompaniet.com &nbsp;Frågor? Kontakta daniel@tangokompaniet.com eller 0736563609 <br>\n&nbsp;</p>', '2019-01-02 09:34:58', '2019-01-22 09:00:55'),
(40, 'Course', 'MI_4GGR', 'ES', '<p>Curso de milonga en Lund con Anna y Daniel.</p>\n<p><br></p>\n<p>Bienvenido a un curso de milonga de más de 3 lunes de 19:00 a 20:30 en el salón de recreación de Michael Hansen en Lund, Dag Hammarskjölds Väg 4.</p>\n<p><br></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;¿Te sientes seguro cuando se trata de un tango pero más incierto cuando se trata de una milonga?</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;¿Se pregunta qué pasos son apropiados para el milongan y cuáles pueden ser menos adecuados?</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;¿Quieres entender cómo cambia la tecnología de baile cuando vamos del tango a la milonga?</p>\n<p><br></p>\n<p>Si respondió sí a cualquiera de estas preguntas, este es el curso correcto para usted.</p>\n<p><br></p>\n<p>Pasaremos por la tecnología, el repertorio, la musicalidad y el estilo. Habrá elementos importantes para aquellos que han bailado durante mucho tiempo y para aquellos que no han bailado durante tanto tiempo.</p>\n<p><br></p>\n<p>El curso es adecuado para aquellos que tienen una experiencia de baile decente y que están bailando al nivel continuo.</p>\n<p><br></p>\n<p>El registro es a info@tangokompaniet.com. Es posible registrarse en parejas o como un solo pero más fácil si se registra en parejas.</p>\n<p><br></p>\n<p>precio</p>\n<p><br></p>\n<p>Precio: 450 SEK / persona para estudiantes de TK; de lo contrario, SEK 500 / persona. Puede inscribirse con o sin un socio en daniel@tangokompaniet.com. ¿Preguntas? Póngase en contacto con daniel@tangokompaniet.com o 0736563609</p>', '2019-01-22 08:24:16', '2019-01-22 09:00:55'),
(41, 'Course', 'MI_4GGR', 'EN', '<p>Milonga course in Lund with Anna and Daniel</p>\n<p><br></p>\n<p>Welcome to a course milonga over 3 Mondays from 19.00-20.30 at Michael Hansen&#039;s college&#039;s recreation room in Lund, Dag Hammarskjölds Väg 4.</p>\n<p><br></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;Do you feel confident when it comes to a tango but more uncertain when it comes to a milonga?</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;Do you wonder what steps are appropriate for the milongan and which ones may be less suitable?</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;Do you want to understand how dance technology changes when we go from tango to milonga?</p>\n<p><br></p>\n<p>If you answered yes to any of these questions, this is the right course for you.</p>\n<p><br></p>\n<p>We will go through technology, repertoire, musicality and style. There will be important elements for those who have long danced and for those who have not danced for as long.</p>\n<p><br></p>\n<p>The course is suitable for those who have a decent dance experience and who are dancing at the continuing level.</p>\n<p><br></p>\n<p>Registration is to info@tangokompaniet.com. It is possible to register in pairs or as a single but easier if you register in pairs.</p>\n<p><br></p>\n<p>Price</p>\n<p><br></p>\n<p>Price: 450 SEK / person for TK students, otherwise SEK 500 / person You can register with or without a partner to daniel@tangokompaniet.com Questions? Contact daniel@tangokompaniet.com or 0736563609</p>', '2019-01-22 08:24:56', '2019-01-22 09:00:55'),
(42, 'Course', 'TANGO_TOOLS', 'SV', '<p>Daniel måste fylla i här.</p>', '2018-05-14 17:12:55', '2019-01-22 09:00:55'),
(43, 'Course', 'TopText', 'ES', '<p>Tangokompaniet tiene cursos y talleres de tango en todos niveles. Tambien ofrecemos cursos y talleres con temas, por ejemplo milonga, vals criollo, tecnica, musicalidad y chacarera. Para más detalles y horarios, haga clic para ver los cursos que le interesan.</p>', '2018-05-12 07:13:57', '2019-01-22 09:00:55'),
(44, 'Course', 'TopText', 'EN', '<p>Tangokompaniet offers many courses and workshops for different levels of experience in Argentine tango. For information about courses, click buttons in the menu. We do encourage partnershifts due to the increased learning curve and the social aspect of dancing, but of course you can choose not to. For those who want more variation and the challenge you have when you change partner when it comes to listening and adapting. We also offer lessons via zoom if you live far away, or if you are sick etc. Ready to register ? Click &nbsp;buttons to register &nbsp;with or without a dancepartner! Don\'t you have a dancepartner ? Seek for a dance partner in Tangokompaniets partnersearch at Facebook <a href=\"https://www.facebook.com/groups/501494573205992\">here!</a> You can also contact us and we can try and help or answer further questions. Welcome !</p>', '2018-05-12 07:15:16', '2019-01-22 09:00:55'),
(45, 'Course', 'TopText', 'SV', '<p>Tangokompaniet har ett brett utbud av kurser och workshops i argentinsk tango, på alla nivåer. För information om respektive kurstyp och kurs kan du klicka på knapparna i menyn till vänster. VI har under hösten 2021 börjat med parbyten igen men vår idé är att för allas trygghet se till att samtliga kursdeltagare har en danspartner och att vi gör cirka ett parbyte per lektion för att sen byta tillbaks. Det kan också vara så att man har olika danspartners olika veckor. För de som vill dansa med bara en danspartner kommer detta att vara helt ok. För de som vill få lite variation och testa sin lyhördhet, tydlighet och anpassningsförmåga är det bra att komma igång med få parbyten till att börja med. Vi kommer att föra kontroll av närvaro på lektionera så att vi kan informera om det visar sig att ngn kommit till lektionen med Coronaviruset. Vi har satt gränsen för antalet deltagare relativt lågt och vi kommer att ha med handsprit mm på lektionerna även i höst och självklart kommer alla friska, symptomfria, vaccinerade eller nyligen testade. I Skåne har över 80 procent av den vuxna befolkningen vaccinerat sig och vi har skäl att tro att det är en högre andel bland tangodansarna. Vi följer utvecklingen och för er som tex är sjuka eller inte kan närvara finns det möjligheter att ta lektioner tex via zoom eller se videosammanfattningar i efterhand.</p>\n<p>Är du redo att anmäla dig? Klicka på registreringsknapparna för respektive kurs och anmäl dig med en danspartner! Har du ingen danspartner? Sök efter en danspartner genom att skriva ett inlägg i Tangokompaniet partnersearch på Facebook <a href=\"https://www.facebook.com/groups/501494573205992\">här!</a> Finner du ingen så kontakta gärna den kursansvarige och se om hen har några tips! Har du ytterligare frågor angående vårt kursutbud, tveka inte att kontakta oss. Välkommen!</p>', '2018-12-19 10:33:14', '2019-01-22 09:00:55'),
(46, 'Course', 'TUF', 'SV', '<p>Fråga Daniel Carlsson om Tango Ur Fox&nbsp;</p>', '2019-01-02 09:35:52', '2019-06-04 09:37:41'),
(47, 'Course', 'TUF', 'EN', '<p>No description in english yet.</p>', '2019-01-22 08:28:15', '2019-06-04 09:37:54'),
(48, 'Course', 'TUF', 'ES', '<p>Aún no hay traducción al español</p>', '2019-01-22 08:30:15', '2019-06-04 09:38:09'),
(49, 'Course', 'VMMM', 'SV', '<h3>Tangokompaniet welcomes you to</h3>\n<h1>Tango Easter Festival in Malmö</h1>\n<h2>Workshops, live music, shows and lots of social dancing. We also &nbsp;&nbsp;offer intro-classes for complete beginners, so everyone can join!</h2>\n<p>There will be many different themes of workshops. Guest teachers from &nbsp;&nbsp;Buenos Aires will inspire us together with TKcrew. José Fernandez y &nbsp;&nbsp;Martina Waldman, Cecilia Piccinni and Daniel Carlsson will teach and &nbsp;&nbsp;perform for us and Tangarte will be playing live music this year which &nbsp;&nbsp;fits very well with their celebrating 20 years anniversary. Tommy &nbsp;&nbsp;Selggren, Gabriela Castro and Camila Holst-Viancos will give &nbsp;&nbsp;introclasses Friday, Saturday and Sunday.</p>\n<p><img alt=\"Festivalito\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/unspecified-2.jpeg\" width=\"228\" height=\"320\"/></p>\n<p><br></p>\n<p>Här kan man skrivs en massa :)</p>', '2019-01-18 17:50:56', '2019-01-22 09:00:55'),
(66, 'Help', 'HelpText1', 'EN', '<h2>So far no help text.</h2>\n<ul>\n  <li>Some must decide what you want here.It is possible to edit this text if you login under Admin.</li>\n</ul>', '2018-04-17 13:42:47', '2019-01-22 09:00:55'),
(67, 'Home', 'CardText', 'EN', '<p>Tangokompaniet is the largest tangoschool in Sweden. We arrange courses, workshops, festivals, maratons and a diversity of other tango events for private persons in all ages. We also make arrangements for companies. Tangokompaniet is located in Malmö and in Lund. We have customers allover the globe, but our focus is on the Öresund region. Our teachers are frequently invited as guest teachers and for shows in Sweden and abroad.</p>', '2018-01-25 15:24:28', '2019-01-22 09:00:55'),
(77, 'Home', 'HomeText', 'SV', '<p>Tangokompaniet är Sveriges största tangoskola och arrangerar kurser, workshops och olika tangoevenemang för företag och privatpersoner i alla åldrar. Vi finns främst i Lund, Malmö och runtom i Öresunds- regionen men vi bjuds även in som gästlärare runtom i världen. Vi ser fram emot att se dig på dansgolvet!</p>', '2018-10-11 15:53:10', '2019-01-22 09:00:55'),
(80, 'Home', 'HomeText', 'ES', '<p>Tangokompaniet es la escuela de tango más grande de Suecia y organiza cursos, talleres y diversos eventos de tango para empresas y personas de todas las edades. Estamos ubicados principalmente en Lund, Malmö y en la región de Öresund, pero también estamos invitados para dar workshops y shows en todo el mundo.</p>', '2018-12-19 10:36:02', '2019-01-22 09:00:55'),
(82, 'Home', 'HomeText', 'EN', '<p>Tangokompaniet is Sweden\'s largest tango school and organizes courses, workshops and various tango events for companies and individuals of all ages. We are located in Lund, Malmö and around the Öresund region, but we are also invited as guest teachers around the world.</p>', '0000-00-00 00:00:00', '2019-01-22 09:00:55'),
(91, 'PrivateLessons', 'General', 'EN', '<h2><br></h2>\n<h1>Privatle lessons</h1>\n<h2>General</h2>\n<p>Tangokompaniet offers private lessons - whether you never danced tango before, or if you have years of experience. Private lessons are the most effective teaching method because you get the teacher\'s full attention. However, if you only take private lessons you lose social contact with other students. Therefore we recommend you combine both forms of teaching.&nbsp;</p>', '2018-01-25 13:20:01', '2019-01-22 09:00:55'),
(92, 'PrivateLessons', 'General', 'SV', '<h1>Privatlektioner</h1>\n<h2>Allmänt</h2>\n<p>Tangokompaniet erbjuder privatlektioner – oavsett om du aldrig dansat tango tidigare, eller om du har flera års erfarenhet. Privatlektioner är den effektivaste undervisningsmetoden eftersom man får lärarens hela uppmärksamhet. Man mister dock den sociala kontakten med sina kursare om man endast tar privatlektioner och därför rekommenderar vi er att kombinera dessa två undervisningsformer.Under en privatlektion kan du utveckla din:teknik, balans, hållningkommunikationkänsla för musiken och rytmflyt i dansenimprovisationsförmåga i olika lägenvariation i stil och rytm…och mycket mer</p>', '2018-01-25 15:05:20', '2019-01-22 09:00:55'),
(93, 'PrivateLessons', 'Prices', 'SV', '<h1>Priser</h1>\n<p>Fråga gärna läraren om priset för det kan variera ngt mellan lärarna och i vilket land och på vilken ort lektionen ges. I Malmö i studion kostar lektionerna 650 kr - 850 kr beroende på hur många man tar. 850 kr för första men 650kr/st om man bokar och betalar 10 st under ett år.</p>\n<p>När vi är ute och reser är priset 700 kr - 1100 SEK beroende på lokalhyra, lärare, hur många lektioner du bokar och i vilket land lektionen ges. Köper du 10 lektioner som används inom ett år får du ofta ett lägre timpris. En lektion är normalt 60 min men man kan komma överens med lärare om kortare eller längre lektioner. Daniel erbjuder tex 30 min privatlektion under vissa practilongor tex onsdagar och tisdagar men ger de flesta lektionerna 60 min långa i TKstudio dagtid då den ofta är ledig då och lärarna också oftast är lediga dagtid. Vissa helger kan också bokas och vissa enstaka timmar före tangokurserna är ofta också lediga.</p>', '2018-01-25 15:22:28', '2019-01-22 09:00:55'),
(94, 'PrivateLessons', 'Teachers', 'EN', '<h2>Teachers that give private lessons</h2>', '2018-01-25 15:10:07', '2020-07-27 14:15:47'),
(95, 'PrivateLessons', 'Teachers', 'SV', '<h2>Lärare som ger privatlektioner</h2>', '2018-01-25 15:22:23', '2020-07-27 14:15:47'),
(96, 'Schedule2', 'Info', 'EN', '<p>&nbsp;To register on a course click the button of the course you desire to put it in the shopping cart shown above this text. Green button means that there is space available on the course. Yellow button means that gender imbalance and you will be put on waiting list. Orange button means that course is full and you will be put on a list waiting for cancellation.</p>', '2018-05-14 16:19:37', '2019-01-22 09:00:55'),
(97, 'Schedule2', 'Info', 'ES', '<p>Para registrarse en un curso, haga clic en el botón del curso que desea colocar en el carrito de compras que se muestra arriba de este texto. El botón verde significa que hay espacio disponible en el curso. El botón amarillo significa que el desequilibrio de género y se le pondrá en la lista de espera. El botón naranja significa que el curso está lleno y se te colocará en una lista esperando la cancelación.</p>', '2018-05-23 15:26:05', '2019-01-22 09:00:55'),
(98, 'Show', 'Text', 'EN', '<h1>Tango show</h1>\n<p>A tango show is the normal performance of a good couple who shows in fine attire doing three to four show dances for about 20 minutes. Tangokompaniet has showcases and shows for reasonable compensation.</p>', '2018-01-25 12:50:37', '2019-01-22 09:00:55'),
(99, 'Show', 'Text', 'SV', '<h1>Tangoshow</h1>\n<p>En tangoshow är normalt uppvisning av ett duktigt par som visar i fin klädsel gör tre till fyra uppvisningsdanser under cirka 20 minuter. Tangokompaniet har uppvisningspar och gör shower mot rimlig ersättning.</p>', '2018-01-25 12:51:38', '2019-01-22 09:00:55'),
(108, 'Teacher', 'A', 'EN', '<p>Anna teaches and organizes in Tangokompaniet since 2002. Her teaching offers the opportunity to explore her own body, the communication in dance and the expression in the music. Her dance expresses her person; energy, joy and the pursuit of consciousness. She is also a very active DJ, both regionally, nationally and internationally,                and also hosts seminars on tango music and DJing.</p>', '2018-05-02 13:12:26', '2019-01-22 09:00:55'),
(109, 'Teacher', 'A', 'SV', '<p>Anna undervisar och arrangerar i Tangokompaniet sedan 2002. Hennes undervisning ger möjlighet att utforska den egna kroppen, kommunikationen i dansen och uttrycket i musiken. Hennes dans uttrycker hennes person; energi, glädje och strävan efter medvetenhet. Hon är också en mycket aktiv DJ både regionalt nationellt och internationellt och håller även seminarier om tangomusik och DJing.</p>', '2018-05-02 13:12:26', '2019-01-22 09:00:55'),
(110, 'Teacher', 'A', 'ES', '<p>Anna enseña y organiza en Tangokompaniet desde 2002. Su enseñanza ofrece la oportunidad de explorar su propio cuerpo, la comunicación en la danza y la expresión en la música. Su danza expresa su persona; Energía, alegría y búsqueda de la conciencia. También es una DJ muy activa, tanto a nivel nacional como internacional, y también organiza seminarios sobre música de tango y DJ.</p>', '2018-05-02 13:12:26', '2019-01-22 09:00:55'),
(111, 'Teacher', 'C', 'EN', '<p>\r\nFor Cecilia the tango offers the opportunity to express dynamic musicality, and her dance has been described as elegant and musical.                 She has a background in classical music, and therefore has a deep understanding of                 the different expressions of music.                 Cecilia is inspired by her interest in fitness and Chinese Tai Chi, and advocates bodily control and playfulness in the dance.\r\n</p>', '2018-05-02 13:13:05', '2019-01-22 09:00:55'),
(112, 'Teacher', 'C', 'SV', '<p>\r\nFör Cecilia erbjuder tangon möjlighet att uttrycka dynamisk musikalitet,                 och hennes dans har beskrivits som elegant och musikalisk. Hon har en bakgrund inom klassisk musik,                 och har därför djup förståelse för musikens olika uttryck.                Cecilia inspireras av sitt intresse för fitness och kinesisk Tai Chi,                 och förespråkar kroppslig kontroll och lekfullhet i dans och rörelser.\r\n</p>', '2018-05-02 13:13:05', '2019-01-22 09:00:55'),
(113, 'Teacher', 'C', 'ES', '<p>Para Cecilia, Tangon ofrece la oportunidad de expresar una musicalidad dinámica, y su baile ha sido descrito como elegante y musical. Ella tiene experiencia en música clásica y, por lo tanto, tiene una comprensión profunda de las diferentes expresiones de la música. Cecilia se inspira en su interés por el fitness y el Tai Chi chino, y aboga por el control corporal y la diversión en la danza y el movimiento.</p>', '2018-05-02 13:13:05', '2019-01-22 09:00:55'),
(114, 'Teacher', 'CH', 'EN', '<p>\r\nCamila Viancos has a broad experience with teaching, dancing and performing from different dance styles such as salsa and modern dancing. Her focus in tango dancing is connection, musicality             and body awareness. She is very passionated about teaching and she currently lives from teaching dance,             yoga and pilates. Camila is also performing as a singer and teaches musicality for salsa dancers             with live musicians.\r\n<p>', '2018-05-02 13:13:12', '2019-01-22 09:00:55'),
(115, 'Teacher', 'CH', 'SV', 'Camila Viancos har stor erfarenhet av dans.', '2018-05-02 13:13:12', '2019-01-22 09:00:55'),
(116, 'Teacher', 'CH', 'ES', 'No hay descripción em espanol :(', '2018-05-02 13:13:12', '2019-01-22 09:00:55'),
(117, 'Teacher', 'D', 'SV', '<p>Daniel, en &nbsp;av Tangokompaniets grundare. Efter att ha tangoturnerat i världen vill han satsa på att få Öresundstangon att växa snabbare. Flyt, fokus och fantasi! Trevligt, inspirerande och väldigt givande brukar kommentarerna vara efteråt. Andra har sagt att Daniel har en otrolig förmåga att efter ett par blickar eller beröringar kunna ge en väldigt konkret plan på vad privateleven bör jobba vidare med.</p>', '2018-01-25 15:03:27', '2019-01-22 09:00:55'),
(118, 'Teacher', 'D', 'EN', '<p>Daniel is one of the founders of Tangokompaniet. After touring around the world teaching tango during many years and teaching in over 20 countries Daniel decided to put more focus on making the Öresundtango grow in many aspects. For Daniel feeling, connection and creativity are the key words.</p>', '2018-05-02 13:12:52', '2019-01-22 09:00:55'),
(119, 'Teacher', 'D', 'ES', '<p>Daniel, uno de los fundadores de Tangokompani. Después del torneo de tango en el mundo, quiere que el stangon Öresund crezca más rápido. ¡Muévete, concéntrate e imaginación!</p>', '2018-05-02 13:12:52', '2019-01-22 09:00:55'),
(120, 'Teacher', 'N', 'EN', '<p>Nidia is educated in contemporary modern dance and works as a dancer,             choreographer and teacher. She is also Pilate’s instructor. Nidia started dancing tango in Argentina and is interested in tango as social dance but also as a technique that makes her artistic expression richer. As a teacher, she focuses on body communication and awareness. She develops her training method for tango dancers with her knowledge of Pilates and ContactImprovisation (contemporary / modern dance).\r\n</p>', '2018-05-02 13:13:18', '2019-01-22 09:00:55'),
(121, 'Teacher', 'N', 'SV', '<p>Nidia &nbsp;är utbildad i modern modern dans och arbetar som dansare, koreograf och &nbsp;lärare. Hon är också Pilates instruktör. Nidia började dansa tango i &nbsp;sitt hemland Argentina och är intresserad av tango som social dans men &nbsp;även en teknik som gör hennes konstnärliga uttryck som dansare rikare. &nbsp;Som lärare fokuserar hon på kroppskommunikation och medvetenhet. Nidia &nbsp;nyttjar sina erfarenheter från Pilates och Contact Improvisation för att &nbsp;utveckla träningsmetoder för tangodansare .</p>', '2018-05-02 13:13:18', '2019-01-22 09:00:55'),
(122, 'Teacher', 'N', 'ES', '<p>Nidia se educa en danza moderna moderna y trabaja como bailarina, coreógrafa y profesora. Ella también es instructora de Pilatos. Nidia comenzó a bailar tango en su país natal, Argentina, y está interesada en el tango como baile social, pero también en una técnica que enriquece su expresión artística como bailarina. Como maestra, se enfoca en la comunicación corporal y la conciencia. Nidia utiliza sus experiencias de Pilates y Contact Improvisation para desarrollar métodos de entrenamiento para bailarines de tango.</p>', '2018-05-02 13:13:18', '2019-01-22 09:00:55'),
(123, 'Teacher', 'P', 'EN', 'With one foot in musicianship and the other in movement practices,                 Per has an in-depth relationship with dancing and teaching. Ever since his childhood he has                 kept playing in a symphony orchestra, and he was immediately captured by the tango music when                 he started dancing in 2003. Over the last 10 years Per draws inspiration from movement                 disciplines such as yoga and Gyrotonic, and he teaches tango as an embodied experience                 of warm-hearted expression', '2018-05-02 13:13:25', '2019-01-22 09:00:55'),
(124, 'Teacher', 'P', 'SV', '<p>Per undervisar på Tangokompaniet sedan 2005 och har gett lektioner på spännande platser som Island, Thailand och Argentina. Han har spelat klassisk trumpet i tjugofem år och jobbar gärna med musikalitet i dansen. Per inspireras också av yoga och hur man där arbetar med både sin kropp och sina attityder.</p>', '2018-05-02 13:13:25', '2019-01-22 09:00:55'),
(125, 'Teacher', 'P', 'ES', '<p>Per ha enseñado en Tangokompaniet desde 2005 y ha impartido clases en lugares interesantes como Islandia, Tailandia y Argentna. Tocó la trompeta clásica durante veinticinco años y está feliz de trabajar con la musicalidad en el baile. Per también está inspirado en el yoga y cómo trabajar con su cuerpo y sus actitudes.</p>', '2018-05-02 13:13:25', '2019-01-22 09:00:55'),
(126, 'Teacher', 'S', 'EN', 'Tango is for Sonny a dance of presence and musical expression. His dance can be described             is conscious and playful. Sonny has a background in Chinese Kung Fu and Tai Chi,             exhibiting both physical strength and soft dynamics. With his good educational ability,             he inspires his students to dare to experiment and experiment with their dance.', '2018-05-02 13:13:32', '2019-01-22 09:00:55'),
(128, 'Teacher', 'S', 'ES', '<p>El tango es para Sonny un baile de presencia y expresión musical. Su baile puede ser descrito como consciente y juguetón. Sonny tiene experiencia en el kung fu chino y el tai chi, exhibiendo fuerza física y dinámica suave. Con su buena capacidad educativa, inspira a sus alumnos a atreverse a experimentar y experimentar con su baile.</p>', '2018-05-02 13:13:32', '2019-01-22 09:00:55'),
(129, 'Teacher', 'S', 'SV', '<p>Tango &nbsp;är för Sonny en dans med närvaro och musikaliskt uttryck. Hans dans kan &nbsp;beskrivas som medveten och lekfull. Sonny har en bakgrund i kinesiska &nbsp;Kung Fu och Tai Chi, vilka både nyttjar fysisk styrka och mjuk dynamik. &nbsp;Med sin goda pedagogiska förmåga inspirerar och uppmuntrar han sina &nbsp;elever att våga experimentera med sin dans.</p>', '2018-12-17 15:36:50', '2019-01-22 09:00:55'),
(130, 'Teacher', 'TS', 'EN', 'Tava’s love for dance and enthusiasm for teaching is informed by her experiences as a physiotherapist,                 massage therapist, and yoga practitioner. She began her Tango journey in Boulder, Colorado and the path lead                 quickly to Buenos Aires, and then onward Sweden where she has been teaching with Tangokompaniet since 2012', '2018-05-02 13:13:38', '2019-01-22 09:00:55'),
(132, 'Teacher', 'TS', 'ES', '<p>El amor de Tava por la danza y el entusiasmo por la enseñanza se basan en sus experiencias como fisioterapeuta, masajista y practicante de yoga. Comenzó su viaje de Tango en Boulder, Colorado y el camino lo llevó rápidamente a Buenos Aires, y luego a Suecia, donde ha estado enseñando con Tangokompaniet desde 2012</p>', '2018-05-02 13:13:38', '2019-01-22 09:00:55'),
(133, 'Teacher', 'TS', 'SV', '<p>Tavas kärlek till dans och entusiasm för undervisning är inspirerad av &nbsp;hennes erfarenheter som fysioterapeut, massage terapeut och &nbsp;yoga-utövare. Hon började sin tangoresa i Boulder, Colorado och vägen &nbsp;ledde snabbt till Buenos Aires och sedan vidare till Sverige där hon &nbsp;&nbsp;undervisat med Tangokompaniet sedan 2012.</p>', '2018-12-17 15:40:04', '2019-01-22 09:00:55'),
(134, 'Weekly', 'Text', 'SV', '<h1>Social dans</h1>\n<p>Tangokompaniet anordnar reguljära sociala danskvällar året runt i Malmö och Lund.</p>\n<p>Practilonga är en blandning där man kommer överens med varje danspartner om man vill träna eller dansa. Under vår- och höstterminerna anordnar Tangokompaniet practilonga på tisdagar i Lund på Västgöta Nation.&nbsp;</p>\n<p>Milonga är en danskväll där man spelar tango, tangovals, elller milonga.&nbsp;I den traditionella terminologin betecknar milonga en danskväll där man inte som på en praktika då och då avbryter sin dans för att öva på stegsekvenser. Milonga är ett festligt tillfälle då man gärna klär upp sig. Tangokompaniets milonga äger rum söndag kväll i Malmö.</p>\n<p>Beroende på säsong ser schemat olika ut. Du kan alltid se vad som händer i vår kalender ovan!</p>\n<p><br></p>\n<p><strong>TANGOKOMPANIET HÖSTPROGRAM</strong></p>\n<p><br></p>\n<p><strong>- Måndagar: Tangokompaniet practica i Lund, 6/9-13/12 2021</strong></p>\n<p>Välkommen till TANGOKOMPANIET PRACTICA I LUND!</p>\n<p>I höst kommer du kunna socialdans på Västgöta nation i Lund på måndagar kl 19.00-20.30.</p>\n<p>Vi rekommenderar att du gör få parbyten och kommer vaccinerad eller nyligen testad. Det får max vistas 50 personer samtidigt på dansgolvet.</p>\n<p>För att deltaga anmäler du dig med eller utan partner i vår kalender här på hemsidan.</p>\n<p>Entré: 60 kr</p>\n<p>Frågor? Kontakta Daniel Carlsson på daniel@tangokompaniet.com eller 0736-563609</p>\n<p><br></p>\n<p><br></p>\n<p><strong>- Söndagar: Tangokompaniet milonga i Malmö, 22/8-26/12 2021</strong></p>\n<p>Välkommen till Tangokompaniet Milonga! <br>\nKom och dansa på mysiga Tangokompaniet studio på Fredriksbergsgatan 7 varje söndag i höst.<br>\nTangokompaniet shop är också öppen där du finner ett stort urval av tangoskor för både förare och följare.&nbsp;</p>\n<p>Vi håller oss till de rådande restriktionerna dvs lägre maxantal. Vi rekommenderar få parbyten och att man är vaccinerad eller nyligen testad för att tryggt kunna byta partner.</p>\n<p>För att deltaga anmäler du dig med eller utan partner i vår kalender här på hemsidan.</p>\n<p>Pris: 80 kr/person<br>\nSwisha gärna vid anmälan till Tangokompaniet Swish nr är: 123 173 30 05&nbsp;</p>\n<p>Frågor? Kontakta Daniel Carlsson på daniel@tangokompaniet.com eller 0736563609<br>\n<a href=\"http://www.tangokompaniet.com/?fbclid=IwAR1wwFlasGbt_2aFod4QeR66ZbxhElaJcStRI-QH9c_dIakEfzxI3W2mwts\" rel=\"nofollow noopener\" target=\"_blank\">www.tangokompaniet.com</a></p>\n<p>----------------------------------------</p>\n<p>Welcome to Tangokompaniet Milonga! Come and dance at cosy Tangokompaniet studio at Fredriksbergsgatan 7, every Sunday this autumn. <br>\nTangokompaniet shop is also open during the practilonga, where you can buy tango shoes both for leaders and followers.</p>\n<p>We keep the restrictions of a lower number of participants. We recommend that you dance with few dance partners and if you change that you are vaccinated or tested.</p>\n<p>To attend you register in our calendar here on the website.</p>\n<p>Admission: SEK 80/person</p>\n<p>If possible please pay by Swish when you regsister to nr: 123 173 30 05<br>\nYou can also pay cash and upon arrival.</p>\n<p>Questions? Contact Daniel Carlsson at daniel@tangokompaniet.com or at +46736563609</p>\n<p><a href=\"http://www.tangokompaniet.com/?fbclid=IwAR1DaG7t8QLsArjwv3yLT8nl9qSVF1g5h_DWHM_CXQjl8fZPYR8H5pwyzwM\" rel=\"nofollow noopener\" target=\"_blank\">www.tangokompaniet.com</a></p>\n<p>Welcome !</p>\n<p><br></p>\n<p><br></p>', '2019-01-30 10:11:01', '2019-01-30 10:11:01'),
(135, 'Weekly', 'Text', 'EN', '<h2>Dance during the week<br>\n</h2>\n<p>At the moment we focus on Sunday evenings and we will return with some Tuesday practilongas during autumn.</p>\n<h3>Practica (Tuesday in Lund and Wednesday in Malmö)</h3>\n<p><br>\nPractice is a term for an informal dance performance for Argentine tango. It is similar to a milonga but a milonga is more formal. On a practical, you can practice newly learned movements, sequences and steps. Each school usually has at least one practical per week. We normally organize a practica on Tuesdays in Lund, one on Wednesdays in Malmö and tangobrunches on Sundays. Due to COVID and restrictions we are now focusing on the milonga Sunday evenings in Malmö and we will start doing some Tuesdays again during autumn 2020.</p>\n<p>Milonga is both the name of a place where we dance tango, a rythm and dancestyle. Milonga is a couple dance and music style, sprung from Río de la Plata\'s major cities of Buenos Aires and Montevideo. The music is characterized by a moving and evenly syncopated bass line, and is played in most cases by tango orchestras. The dance is one of tango\'s predecessors, and the two dances are intimately associated with each other, both in theory, because the movement is based on the same principles, and in practice, because the dances are alternately played at the same times. In addition, most of those who have attended the milonga have done so as part of a tango course. T</p>\n<h3>Tango Brunch (Every second sunday in Malmö) is cancelled during COVID until further notice.</h3>\n<p>Tango brunch is a milonga combined with brunch. Children and families are also welcome here. Tang company has this event every other Sunday between 13:15-15:45</p>', '2019-01-30 10:13:06', '2019-01-30 10:13:06'),
(136, 'Weekly', 'Text', 'ES', '<h2>Bailar durante la semana</h2>\n<p>Durante el verano:</p>\n<p><br>\n<strong>Los domingos</strong> bailamos en Konsthallen en junio y julio 19.00-21.30 y en Västra hamnen, Scaniaplatsen en augosto 19.00-21.30. Si llueve bailamos en nuestro estudio Tangokompaniet en Fredriksbergsgatan 7. Nuestra decision basada en el prognostico se publica en facebook y en el calendario en esta pagina.</p>\n<p><strong>Los lunes </strong>hasta el 2 de augosto en Lund en Stadsparken atras de Mejeriet. 18.30 Intro a tango. 19.10-21.00 Baile social, tango&nbsp;</p>\n<p><strong>Los martes</strong> hasta el 10 de augosto bailamos en Ribersborg en Malmö por Kallbadhusets dansbana. Intro 18.30 y baile 19.00-21.30. SI llueve se cancela.</p>\n<p><br></p>', '2019-01-30 10:19:44', '2019-01-30 10:19:44'),
(137, 'Help', 'Text', 'EN', '<h2>Help</h2>\n<h3>Help button</h3>\n<p>The text Tangokompaniet at the top bar is the home button. Press it and you will go to first page.</p>\n<h3>Language buttons</h3>\n<p>You can choose language with the language buttons att the bottom of each page.</p>\n<p><br></p>', '2019-01-30 14:43:34', '2019-01-30 14:43:34'),
(138, 'Help', 'Text', 'SV', '<h2>Hjälp</h2>\n<h3>Home knappen</h3>\n<p>Tangokompaniet överst till vänster är home knappen. Trycker du på denna kommer du till första sidan.</p>\n<h3>Språk knappar</h3>\n<p>Du kan välja språk med språkknapparna SVENSKA, ENGLISH och ESPANOL längst nere på varje sida. Eftersom TK inte haft tid att översätts samtliga sidor finns en del bara på svenska eller och svenska och engelska.&nbsp;</p>\n<h3>Browsers pil-knappar &lt;- och -&gt;</h3>\n<p>Du använder din web-browsers pil knappar till att bläddra dig framåt eller bakåt ibland sidorna sidorna. Vissa bilder är klickbara och leder dig logiskt vidare eller tillbaka ibland sidorna.&nbsp;</p>\n<p><br></p>\n<p><br></p>', '2019-01-30 14:44:46', '2019-01-30 14:44:46'),
(139, 'Help', 'Text', 'ES', '<h2>Ayudar</h2>\n<h3>Botón de inicio</h3>\n<p>La compañía de tango en la parte superior izquierda es el botón de inicio. Si presionas esto llegarás a la primera página.</p>\n<h3>Botones de idioma</h3>\n<p>Puede seleccionar el idioma con los botones de idioma SWEDISH, ENGLISH y ESPANOL en la parte inferior de cada página.</p>', '2019-01-30 14:45:07', '2019-01-30 14:45:07'),
(140, 'Studio', 'Text', 'EN', '<h2>Party room / Dance Local</h2>\n<h3><br>\nAddress</h3>\n<p><br>\nFredriksbergsgatan 7, Malmö. The venue is located below the Big Bowl near Värnhemstorget.<br>\n</p>\n<h3>General</h3>\n<p><br>\nDo you need a room for dancing, rehearsals, meetings or parties? - Then our cozy studio is something for you!</p>\n<h3><br>\n<em>… As a training and meeting room…</em></h3>\n<p><br>\n... the studio has many opportunities! It is ideal for all kinds of cultural activities; dance, singing, music, theater, study circles, etc. It is easily furnished and if you need floor space you have about 120 m2 to use for what you need. Sound, light and large mirror wall are in place to be used! For meetings and similar gatherings you can, for example, use the café section and gladly use our internet!</p>\n<h3><br>\n<em>… As a party room…</em></h3>\n<p><br>\n… The studio is perfect! It is possible to dress up for 75 people and if you just want to have mingle it is just as good! Fully equipped kitchen allows for cooking and all crockery and cutlery are in place. After the food, just start the disco ball and the music is the party in full swing! Opportunity to borrow our mattresses beds blankets and air mattresses sheets and towels for only 100 SEK per guest so they can sleep over</p>\n<h3>Description of the party room/dance hall&nbsp;</h3>\n<ul>\n<li>Area: approximately 200 m<sup>2</sup></li>\n<li>Room: Elevator / stairwell, entrance, 2 toilets, café part, kitchen, bar, hall, stage.Number of people: Max 80</li>\n<li>Technique: Light and sound for different moods. Internet wireless, video projector</li>\n<li>Furniture: 13 oblong tables, 3 other tables + a few small tables, about 70 folding chairs,\n 11 simple armchairs, 4 large armchairs, 6 sofas 2 benches, Mirror wall of 7 x 2 m. Laminate floor.</li>\n<li>Kitchen: equipped with microwave, larger oven and cooker, coffee maker, kettle, 80 wine glasses, 60 champagne glasses, cutlery for 70 people, coffee cups and tea towels for 70 persons, smaller snaps glass, plenty of kitchen utensils, bowls and dishes, plenty of hot candle holders + lots of other kitchen utensils but you bring garbage bags and heat candles.</li>\n</ul>', '2019-02-25 13:30:10', '2019-02-25 13:30:10'),
(141, 'Studio', 'Text', 'SV', '<h1>Festlokal/Danslokal</h1>\n<h3>Adress</h3>\n<p>Fredriksbergsgatan 7, Malmö.&nbsp;Lokalen ligger nära Big Bowl mellan Värnhemstorget och Drottningtorget. Se kartan till vänster (eller nedanför på mobil).</p>\n<h3>Allmänt</h3>\n<p>Behöver du en lokal för dans, repetitioner, möte eller fest ?<br>\nDå är vår mysiga studio något för dig !</p>\n<h3><em>… som tränings- och möteslokal …</em></h3>\n<p>...har studion många möjligheter! Den passar utmärkt till all form av kulturell verksamhet såsom dans, sång, musik, teater, studiecirklar osv. Den är lättmöblerad och med golvyta på ca 140 m2 att disponera. Lokalen har Ljud, ljus samt en stor spegelvägg att nyttjas efter behov. För möten och liknande sammankomster kan man tex använda cafédelen och gärna använda vårt wi-fi internet.&nbsp;</p>\n<p><em><strong>… som festlokal </strong></em><strong>är studion perfekt ...</strong><br>\n<br>\nFullt utrustat kök som inkluderar servis ger och bestick ger möjlighet till matlagning och uppdukning. Efter maten är det bara att sätta igång discokulan och musiken så är festen i full gång. Våra madrasser, sängar. filtar, luftmadrasser, lakan och handdukar uthyres för endast 100 kr per gäst. Detta gör möjlighet till övernattning i lokalen.&nbsp;</p>\n<h3>Beskrivning av lokalen</h3>\n<ul>\n  <li>Yta: ca 200 m2&nbsp;</li>\n  <li>Rum: Hiss/trapphus, entré, 2 toaletter, cafédel, kök, bar, sal, scen.</li>\n  <li>Antal personer: Max 70 (NOTERA: Nedsatt maxgräns till 50 pga COVID-19)</li>\n  <li>Teknik: Ljus och ljud för olika stämningar. Internet trådlöst, videoprojektor</li>\n  <li>Möblemang: 13 avlånga bord, 3 andra bord + några småbord, cirka 70 klappstolar,, 11 enkla fåtföljer, 4 stora fåtöljer, 6 soffor 2 bänkar, Spegelvägg på 7 x 2 m. Laminatgolv.</li>\n  <li>Kök: utrustat med mikrovågsugn, större ugn och spis, kaffekokare, vattenkokare, 80 vinglas, 60 champagneglas, bestick till 70 personer, kaffekoppar och temuggar till 70 pers, mindre snapsglas, gott om köksredskap, skålar och fat, gott om varmeljushållare + mycket annat köksutrustning Vi står för disktabletter och toapapper men ni tar med sopsäckar och värmeljus.</li>\n</ul>\n<h3>Tider för uthyrning</h3>\n<p>Normal uthyrningstid är ca kl 12:00 – 01:30. Andra tider bokas efter överenskommelse.</p>\n<h3>Krav från oss, grannar och myndigheter</h3>\n<p>Lokalen ligger mitt inne i ett bostadsområde och våra grannar önskar inte att bli störda. Därför har vi krav att musikvolymen sänks kl 01:00 och stängs 01:30 och gäster som är ute och röker eller luftar sig måste prata med låg volym efter kl 22:00. Vi har en rökruta däruppe med ett lås så man kan kontrollera vem som kommer in. I studion bakom scenen har vi en branddörr. Denna är är kopplad till securitas som larmas när dörren öppnas. Ni blir ersättningskyldiga för alla eventuella kostnader som Securitas belastar oss på grund av att larmet går under hyrtiden. Vid skadegörelse är ni skyldiga att ersätta skadan.</p>\n<h3>Åldersgräns</h3>\n<p>Vi hyr ut enbart ut till personer som är 25 år gamla och uppåt. Krav på giltig identitetshandling kräves.</p>\n<h3>Priser</h3>\n<p>Vi beräknar priserna på antal tillfällen och timmar lokalen hyrs ut. Vi har en hel del obokade timmar dagtid och även kvällstider tex på sommaren. Kontakta oss angående dina önskemål! Priset vid festuthyrning vilket inkluderar möblemang och glas, bestick och porslin, ljud och ljus samt professionell städning är 5900 kr för fredagar och 6900 kr för lördagar som betalas när ni bokat, skrivit kontrakt och fått bekräftat bokningen till bankgiro: 5532-8223. Barnkalas eller tillställningar där man endast ska använda lokalen dagtid kan vi erbjuda billigare beroende på tider mm. Halloween och nyår är hyran 7900 kr inkl möblemang och glas, bestick och porslin, ljud och ljus samt professionell städning.</p>\n<h3>Betalning</h3>\n<p>Kontraktskrivning, nyckelhämtning och kontant depostion på mellan 1500 och 3000 kr beroende på vilken typ av fest ni ska ha, sköts samma vecka som uthyrning. Sedan sker det en check och återbetalning ngn dag efter uthyrning.Om inget annat överenskommits så är bokningen bindande. Vid avbokning senast 2 månader i förväg betalas halva hyran. Avbokar man när det är mindre än 2 månader kvar utgår hyran – städkostnad. Avbokar man sista veckan betalar man 4900 kr då städningen redan är bokad.Betalning sker på bankgiro 5532-8223 3 månader före uthyrning; kvitto ska visas upp vid kontraktsskrivning.</p>\n<h3>Kontakt</h3>\n<p>Du är hjärtligt välkommen på besök för att se hur studion ser ut. Bäst är om du kan komma onsdagar kl 21-22 då någon ansvarig normalt befinner sig i lokalen. Alternativt kom på söndagar eller efter överenskommelse med Daniel. För att hyra tangokompaniets festlokal/dansstudio vänligen kontakta Daniel med kontaktuppgifter nedan:</p>\n<p><strong>Notera: Under perioden med COVID-19 gäller speciella restriktioner. Kontakta därför Daniel för att ta reda på exakt vad som gäller angående besöktstider och maximal storlek på sammankomster.</strong></p>\n<p><br></p>', '2019-05-14 10:44:30', '2019-05-14 10:44:30'),
(142, 'Studio', 'Text', 'ES', '<h1>Sala de fiestas / Dance local<br>\n</h1>\n<h2>Dirección</h2>\n<p><br>\nFredriksbergsgatan 7, Malmö.</p>\n<h3>&nbsp;El lugar se encuentra debajo del Big Bowl cerca de Värnhemstorget.<br>\ngeneral<br>\n<br>\n¿Necesitas una sala para bailar, ensayos, reuniones o fiestas?</h3>\n<p>&nbsp;- ¡Entonces nuestro acogedor estudio es algo para ti!</p>\n<h3><br>\n... Como sala de entrenamiento y reunión ...<br>\n<br>\n... el estudio tiene muchas oportunidades!&nbsp;</h3>\n<p>Es ideal para todas las formas de actividad cultural; Baile, canto, música, teatro, círculos de estudio, etc. Es fácil de amueblar y si necesita espacio en el piso tiene aproximadamente 120 m2 para usar para lo que necesita. ¡El sonido, la luz y la gran pared de espejo están en su lugar para ser utilizados! Para reuniones y reuniones similares, puede, por ejemplo, usar la sección de cafetería y con gusto usar nuestro Internet.<br>\n... como una sala de fiestas ...</p>\n<h3><br>\n… ¡El estudio es perfecto!&nbsp;</h3>\n<p>Es posible vestir a 75 personas y si solo quieres mezclarte, ¡es igual de bueno! La cocina totalmente equipada permite cocinar y toda la vajilla y los cubiertos están en su lugar. Después de la comida, simplemente comience la bola de discoteca y la música es la fiesta en pleno apogeo. Oportunidad de pedir prestado nuestros colchones, mantas y colchones de aire, sábanas y toallas por solo 100 SEK por huésped para que puedan dormir más. Descripción de la habitación: Área: aprox. 200 m2 Habitación: Ascensor / escalera, entrada, 2 baños, parte de cafetería, cocina, bar, hall, escenario. Número de personas: Max 80Technik: Luz y sonido para diferentes estados de ánimo. Internet inalámbrico, video proyector. Muebles: 13 mesas alargadas, otras 3 mesas + algunas mesas pequeñas, aproximadamente 70 sillas plegables, 11 sillones simples, 4 sillones grandes, 6 sofás 2 bancos, pared de espejo de 7 x 2 m. Piso laminado. Cocina: equipada con microondas, más grande horno y vitrocerámica, cafetera, hervidor de agua, 80 copas de vino, 60 copas de champán, cubiertos para 70 personas, tazas de café y paños de cocina para 70 personas, vasos pequeños, gran cantidad de utensilios de cocina, tazones y platos, gran cantidad de calentadores de candelabros y muchos otros utensilios de cocina Pero traes bolsas de basura y calientas velas.</p>\n<h2>Tiempos de alquiler:</h2>\n<p><br>\nEl tiempo normal de alquiler es alrededor de las 12:00 - 08:00. Otras veces se reservan por acuerdo.<br>\nRequisitos de nosotros, vecinos y autoridades:</p>', '2019-05-14 10:51:17', '2019-05-14 10:51:17');
INSERT INTO `tbl_text_21Jan22` (`id`, `groupId`, `textId`, `language`, `textBody`, `creaTimestamp`, `updTimestamp`) VALUES
(143, 'ScheduleSingleCourse', 'Info', 'SV', '<p><br></p>', '2019-05-17 10:12:11', '2019-05-17 10:12:11'),
(144, 'Course', 'GR', 'SV', '<p>Grundkurser är till för dig som är nybörjare eller om du som redan dansar tango önskar repetera tangons grunder. När du tar en eller flera grundkurser ingår även socialdanser som vi anordnar på måndagar i Lund och på söndagar i Malmö, som en bonus! Grunder lärs även ut på våra årliga festivaler på påsken och under sommaren och hösten. Hjärtlig välkommen att anmäla dig till någon av våra grundkurser och kom in i tangons förtrollande värld!</p>', '2019-05-17 11:16:35', '2019-05-17 11:16:35'),
(145, 'Course', 'FK1', 'SV', '<p>Fortsättningskurser &nbsp;vänder sig till dig som dansat en tid och har god balans, dansar till &nbsp;musiken och ytterligare vill utveckla din&nbsp;kontakt, hållning och abrazo &nbsp;(kram). Du kanske också känner att du vill lära dig lite nya rörellser &nbsp;och kombiationer samt få mer variation i din dans.</p>', '2019-05-17 11:17:15', '2019-06-04 09:39:29'),
(146, 'Course', 'AV', 'SV', '<p>Avancerade &nbsp;kurser är till för dig som dansat tango en längre tid och nu vill &nbsp;utveckla din dans till att bli ännu mer dynamisk och varierad. &nbsp;Tidsmässigt har du dansat tango i ett par eller många år och spenderat &nbsp;en hel del tid såväl på kurs som på dansgolvet. <br>\n&nbsp;</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>&nbsp;har du bra balans, du pivoterar lätt ståendes på en fot&nbsp;</p>\n<ul>\n  <li>kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner</li>\n  <li>du hinner med en utsmyckning på vägen mellan en rörelse och nästa</li>\n  <li>du dansar i både öppen och sluten omfamning och dansriktingen är för dig självklar</li>\n  <li>du kan musiken och har favoritorkestrar och -låtar</li>\n  <li>du har förståelse för skapande och improvisation <br>\n&nbsp;</li>\n</ul>', '2019-05-17 11:17:40', '2019-05-17 11:17:40'),
(147, 'Course', 'TE', 'SV', '<p><em><strong>Temakurser </strong></em>är till för dig som vill förfina din teknik och känsla inom ett begränsat område inom tangon. För att gå en temakurs bör du har dansat en tid så att du vet att temat är det rätta för dig och det är hör du vill höja ribban ytterligare en nivå. Vi har i dag teman som teknik för förarare och följare. På dessa kurser behöver du inte ha någon danspartner. Vidare har även temakurs i milonga som är en snabbare och lekfullare dans som vi ibland kallar tangons glada syster.</p>', '2019-05-17 11:18:29', '2019-05-17 11:18:29'),
(148, 'Course', 'XX', 'SV', '<p>Kategorin Okänd kurstyp uppstår på grund av att main vid definitionen av kurser &nbsp;inte valt något av de kända värdena (GR, FK, AV, SP, TE) i fältet för kurs typen (courseType) i databas tabellen tbl_course_def.</p>', '2019-06-04 08:34:21', '2019-06-04 08:34:21'),
(149, 'Course', 'F1', 'SV', '<h1>Kursen vänder sig till dig</h1>\n<p>som har grunderna i tango och vill utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt vill du känna att du dansar mer till musiken och känna dig säkrare i dina egna rörelser.&nbsp;</p>\n<h3><br></h3>\n<h3>FÖRKUNSKAPER</h3>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått grundkurs i tango samt varit ute och kanske dansat några gånger på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken och din partner, hittat ett dansflöde. Du har även tränat på ochos, giros och gungor etc.<br>\n<br>\n&nbsp;</p>\n<h3>KURSPLAN</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar<br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<h3>MÅL</h3>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, musiken och din partner. Det kan kännas svårt att ha fokus på allt detta samtidigt och bibehålla ett flyt i dansen; på kursen bygger vi gradvis upp denna medvetenhet. Det är det som ger kvalitet i dansen och njutbara danser!</p>\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar tango och fått mer känsla av sammanhang och flyt. Vi ökar på din repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. Pä kursen arbetar vi med att få ett flyt i dansen genom att bli skickligare på grunderna och kombinera olika möjligheter. Orden blir till meningar!&nbsp;</p>\n<p><br></p>\n<p>Vilken kurs ska jag välja?</p>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger färdighet medan för svåra utmaningar kan stjälpa ens glädje och självförtroende. Du kan alltid höra av dig till oss på&nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<p><br></p>\n<p>SCHEMA</p>\n<p>Fortsättare 1 Malmö</p>\n<p>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor ( varav en på en annan dag) + 1 avslutningsfest&nbsp;</p>\n<p>Kursen slutar i slutet på maj.</p>\n<p><br></p>\n<p>Adress Malmö: Tangokompaniet studio, Fredriksbergsgatan 7, Malmö</p>\n<p>Lärare: Daniel &amp; Anna</p>\n<p>Start: Söndagen den 30/1 2022, kl 17.30-19.00.&nbsp;</p>\n<h2><br></h2>\n<h3>ANMÄLAN</h3>\n<p>Du kan anmäla dig med eller utan danspartner i anmälningsformuläret nedan. Om du anmäler dig med en partner så ska det göras en anmälan för dig och en anmälan för din partner.</p>\n<p><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt. Kontakta lärarna för mer information. Missar du en lektion så har du möjlighet att ta igen den i en annan grupp.</strong></em></p>\n<p><br></p>\n<h2>Pris</h2>\n<p>2670 kr/person</p>\n<p>Om man vill hjälpa till med diverse saker på Tangokompaniet eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel på daniel@tangokompaniet.com! &nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller till vår Swish på 1231733005. Skriv ditt namn och kurs. Anmälan är bindande. Avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart. Efter detta är du betalningsskyldig för hela kursen.</p>\n<p>Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl och ifall du har några frågor! Tänk på att tango gäller som friskvård, ifall du har friskvårdsbidrag från ditt jobb! &nbsp;&nbsp;</p>\n<p><br></p>\n<h2>HJÄRTLIGT VÄLKOMMEN PÅ KURS!</h2>\n<h3><br></h3>\n<h2><br></h2>\n<p><br></p>', '2019-01-22 08:04:26', '2019-06-04 09:35:46'),
(150, 'Course', 'F1', 'ES', '<h2>El curso es para ti</h2>\n<p><br>\nQuienes tienen lo básico del tango y desean expandir su repertorio, obtener más tecnología y un contacto más seguro. Al mismo tiempo, quieres sentir que bailas más con la música y te sientes más seguro con tus propios movimientos.<br>\nRequisitos previos</p>\n<h3><br>\nLa experiencia te tiene</h3>\n<p><br>\n- Pasé el curso básico de tango y salí a bailar unas cuantas veces en practilongas y milongas.<br>\n</p>\n<h3>cognitivamente</h3>\n<p><br>\n- ¿Has aprendido algunos elementos básicos, como escuchar música y a tu pareja, encontrar un flujo de baile, el arte de caminar juntos en paralelo y cruzando? También has entrenado en ochos, giros y columpios, etc.<br>\n&nbsp;</p>\n<p>Estas en la pista de baile<br>\n- Alguien unas cuantas veces al mes.<br>\n&nbsp;</p>\n<h3>plan de estudios</h3>\n<p><br>\nVas a trabajar con<br>\n- ampliando tu repertorio<br>\n&nbsp;</p>\n<p>- capacidad de respuesta y equilibrio<br>\n&nbsp;</p>\n<p>- musica y ritmo<br>\n&nbsp;</p>\n<h3>objetivos</h3>\n<p><br>\nEl curso se enfoca en aumentar gradualmente tu conocimiento de la habitación, el cuerpo, la música y tu pareja. Puede sentirse difícil concentrarse en todo esto al mismo tiempo y mantener un flujo en el baile; En el curso, gradualmente construimos esta conciencia. ¡Eso es lo que da calidad en el baile y bailes agradables!<br>\n&nbsp;Al final del curso, te sentirás mucho más seguro cuando bailas tango y tengas más sentido del contexto y la fluidez. Incrementamos su repertorio para que se sienta más libre para expresarse a través de más posibilidades y variaciones. En el curso, trabajamos para obtener un flujo en el baile al ser más expertos en lo básico y combinar diferentes posibilidades. Las palabras se convierten en oraciones!<br>\n¿Qué curso debo elegir?<br>\nSi duda, a menudo es bueno elegir un nivel inferior. La repetición proporciona habilidad, mientras que los desafíos difíciles pueden robar la alegría y la confianza en uno mismo. Siempre puede contactarnos en info@tangokompaniet.com y pedir ayuda cuando elija un curso.<br>\n</p>\n<p>¡También tienes la oportunidad de ir a cursos dobles a un precio reducido!<br>\n¡Si quiere ayudar o si quiere hacer cursos dobles, le ofrecemos tarifas reducidas! ¡Ponte en contacto con Daniel!<br>\n&nbsp;</p>\n<p>El pago anticipado se realiza al giro bancario de Tangokompaniet 5532-8223.</p>', '2019-01-22 08:05:31', '2019-06-04 09:35:46'),
(151, 'Course', 'F1', 'EN', '<h2>The course is for you</h2>\n<p><br>\nwho have the basics of tango and want to expand your repertoire, get more technology and a safer contact. At the same time, you want to feel that you dance more to the music and feel safer in your own movements.<br>\nPrevious knowledge<br>\nExperience has you<br>\n- passed basic course in tango and been out dancing a few times at practilongas and milongas<br>\n</p>\n<h3>cognitively</h3>\n<p><br>\n- Have you learned some basic elements such as listening to the music and your partner, finding a dance flow, the art of walking together both in parallel and crossing. You have also trained on ochos, giros and swings etc.<br>\n&nbsp;</p>\n<p>You are on the dance floor</p>\n<p><br>\n- Someone a few times a month<br>\n&nbsp;</p>\n<h3>Syllabus</h3>\n<p><br>\nYou will work with<br>\n- expanding your repertoire<br>\n&nbsp;</p>\n<p>- responsiveness and balance<br>\n&nbsp;</p>\n<p>- music and rhythm<br>\n&nbsp;</p>\n<h2>Goal</h2>\n<p><br>\nThe course focuses on gradually increasing your awareness of the room, the body, the music and your partner. It can feel difficult to focus on all this at the same time and maintain a flow in the dance; on the course, we gradually build up this awareness. That&#039;s what gives quality in the dance and enjoyable dances!<br>\n&nbsp;At the end of the course you will feel much safer when you dance tango and have more sense of context and flow. We increase your repertoire so that you feel freer to express yourself through more possibilities and variations. At the course, we work to get a flow in the dance by becoming more skilled at the basics and combining different possibilities. The words turn into sentences!<br>\nWhich course should I choose?<br>\nIf you hesitate, it is often good to choose a lower level. Repetition provides skill while for difficult challenges can steal one&#039;s joy and self-confidence. You can always contact us at info@tangokompaniet.com and ask for help when choosing a course.<br>\n</p>\n<p>You also have the opportunity to go for double courses at a discounted price!<br>\nIf you want to help or if you want to go double courses we offer reduced course fees! Contact Daniel!<br>\n&nbsp;</p>\n<p>Prepayment is made to Tangokompaniet&#039;s bank giro 5532-8223<br>\n&nbsp;</p>\n<p>It is possible to divide the payment, notify us of this case by email.</p>', '2019-01-22 08:06:25', '2019-06-04 09:35:46'),
(152, 'Course', 'F2', 'SV', '<h1>Kursen vänder sig till dig</h1>\n<p>som har grunderna i tango och vill utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt &nbsp;vill du känna att du dansar mer till musiken och känna dig säkrare i &nbsp;dina egna rörelser.&nbsp;</p>\n<p><br></p>\n<h2>Mål</h2>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, &nbsp;musiken och din partner. Det kan kännas svårt att ha fokus på allt detta &nbsp;samtidigt och bibehålla ett flyt i dansen; på kursen bygger vi gradvis &nbsp;upp denna medvetenhet. Det är det som ger kvalitet i dansen och njutbara &nbsp;danser!</p>\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar &nbsp;tango och fått mer känsla av sammanhang och flyt. Vi ökar på din &nbsp;repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. Pä kursen &nbsp;arbetar vi med att få ett flyt i &nbsp;dansen genom att bli skickligare på grunderna och kombinera olika &nbsp;möjligheter. Orden blir till meningar!&nbsp;</p>\n<p><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt hemifrån genom Zoom.</strong></em></p>\n<h3><br></h3>\n<h2>Förkunskaper</h2>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått grundkurs i tango och kanske någon mer kurs samt varit ute och dansat några gånger på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken och din partner, hittat ett dansflöde, konsten att gå tillsammans både i parallell gång och i korsad gång. Du har även tränat på ochos, giros och gungor etc.<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- någon till några gånger i månaden<br>\n&nbsp;</p>\n<h3><br></h3>\n<h2>Kursplan</h2>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar<br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<p>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor + 1 avslutningsfest &nbsp;</p>\n<p><br></p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger färdighet medan för svåra utmaningar kan stjälpa ens glädje och självförtroende. Du kan alltid höra av dig till oss på info@tangokompaniet.com och be om hjälp när du ska välja kurs. <strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<p><br></p>\n<p>SCHEMA</p>\n<p>Fortsättare 2 Malmö&nbsp;</p>\n<p>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor (varav en på en annan dag) + 1 avslutningsfest&nbsp;</p>\n<p>Adress Malmö: Tangokompaniet studio, Fredriksbergsgatan 7, Malmö</p>\n<p>Lärare: Daniel &amp; Anna</p>\n<p>Start: Onsdagen den 2/2 2021, kl 17.30-19.00.&nbsp;</p>\n<h2><br></h2>\n<h3>ANMÄLAN</h3>\n<p>Du kan anmäla dig med eller utan danspartner i anmälningsformuläret nedan. Om du anmäler dig med en partner så ska det göras en anmälan för dig och en anmälan för din partner.</p>\n<p><br></p>\n<h2>Pris</h2>\n<p>2670 kr/person</p>\n<p>Om man vill hjälpa till med diverse saker på Tangokompaniet eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel på daniel@tangokompaniet.com! &nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller till vår Swish på 1231733005.. Skriv ditt namn och kurs. Anmälan är bindande. Avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart. Efter detta är du betalningsskyldig för hela kursen.</p>\n<p>Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl och ifall du har några frågor! &nbsp;&nbsp;&nbsp;</p>\n<h1>Välkommen med din anmälan!</h1>', '2019-01-22 08:04:26', '2019-06-04 09:35:46'),
(153, 'Course', 'F2', 'ES', '<p>El curso es para ti</p>\r\n<p>Quienes tienen lo básico del tango y quieren expandir su repertorio, obtener más tecnología y un contacto más seguro. Al mismo tiempo, quieres sentir que bailas más con la música y te sientes más seguro con tus propios movimientos.</p>\r\n<p>Requisitos previos</p>\r\n<p>La experiencia te tiene</p>\r\n<p>- Pasé el curso básico de tango y salí a bailar algunas veces en practilongas y milongas.</p>\r\n<p><br></p>\r\n<p>cognitivamente</p>\r\n<p>- ¿Ha aprendido algunos elementos básicos, como escuchar música y a su pareja, encontrar un flujo de baile, el arte de caminar juntos en paralelo y cruzando? También has entrenado en ochos, giros y columpios, etc.</p>\r\n<p><br></p>\r\n<p>Estas en la pista de baile</p>\r\n<p>- Alguien unas cuantas veces al mes.</p>\r\n<p><br></p>\r\n<p><br></p>\r\n<p>plan de estudios</p>\r\n<p><br></p>\r\n<p>Vas a trabajar con</p>\r\n<p>- ampliando tu repertorio</p>\r\n<p><br></p>\r\n<p>- capacidad de respuesta y equilibrio</p>\r\n<p><br></p>\r\n<p>- musica y ritmo</p>\r\n<p><br></p>\r\n<p><br></p>\r\n<p>objetivos</p>\r\n<p><br></p>\r\n<p>El curso se enfoca en aumentar gradualmente tu conocimiento de la habitación, el cuerpo, la música y tu pareja. Puede ser difícil concentrarse en todo esto al mismo tiempo y mantener un flujo en el baile; En el curso, gradualmente construimos esta conciencia. ¡Eso es lo que da calidad en el baile y bailes agradables!</p>\r\n<p><br></p>\r\n<p>Al final del curso, te sentirás mucho más seguro cuando bailas tango y tengas más sentido del contexto y la fluidez. Incrementamos su repertorio para que se sienta más libre para expresarse a través de más posibilidades y variaciones. En el curso, trabajamos para obtener un flujo en el baile al ser más hábiles en lo básico y combinar diferentes posibilidades. Las palabras se convierten en oraciones!</p>\r\n<p><br></p>\r\n<p>¿Qué curso debo elegir?</p>\r\n<p>Si duda, a menudo es bueno elegir un nivel inferior. La repetición proporciona destreza, mientras que los desafíos difíciles pueden robar la alegría y la confianza en uno mismo. Siempre puede contactarnos en info@tangokompaniet.com y pedir ayuda cuando elija un curso.</p>\r\n<p><br></p>\r\n<p>¡También tienes la oportunidad de ir a cursos dobles a un precio reducido!</p>', '2019-01-22 08:05:31', '2019-06-04 09:35:46'),
(154, 'Course', 'F2', 'EN', '<p>The course is for you</p>\n<p>who have the basics of tango and want to expand your repertoire, get more technology and a safer contact. At the same time, you want to feel that you dance more to the music and feel safer in your own movements.</p>\n<p>Typically this course consists of about 14 lessons, 2 teacherled practicas and 1 end of semester party/milonga.</p>\n<p><br></p>\n<p>Previous knowledge</p>\n<p><br></p>\n<p>Experience has you</p>\n<p>- passed basic course in tango and been out dancing a few times at practilongas and milongas</p>\n<p><br></p>\n<p>cognitively</p>\n<p>- Have you learned some basic elements such as listening to the music and your partner, finding a dance flow, the art of walking together both in parallel and crossing. You have also trained on ochos, giros and swings etc.</p>\n<p><br></p>\n<p>You are on the dance floor</p>\n<p>- Someone a few times a month</p>\n<p><br></p>\n<p><br></p>\n<p>Syllabus</p>\n<p><br></p>\n<p>You will work with</p>\n<p>- expanding your repertoire</p>\n<p><br></p>\n<p>- responsiveness and balance</p>\n<p><br></p>\n<p>- music and rhythm</p>\n<p><br></p>\n<p><br></p>\n<p>Goal</p>\n<p><br></p>\n<p>The course focuses on gradually increasing your awareness of the room, the body, the music and your partner. It can feel difficult to focus on all this at the same time and maintain a flow in the dance; on the course, we gradually build up this awareness. That\'s what gives quality in the dance and enjoyable dances!</p>\n<p><br></p>\n<p>At the end of the course you will feel much safer when you dance tango and have more sense of context and flow. We increase your repertoire so that you feel freer to express yourself through more possibilities and variations. On the course, we work to get a flow in the dance by becoming more skilled at the basics and combining different possibilities. The words turn into sentences!</p>\n<p><br></p>\n<p>Which course should I choose?</p>\n<p>If you hesitate, it is often good to choose a lower level. Repetition provides skill while for difficult challenges can steal one\'s joy and self-confidence. You can always contact us at info@tangokompaniet.com and ask for help when choosing a course.</p>\n<p><br></p>\n<p>You also have the option to go twice the discounted price!</p>', '2019-01-22 08:06:25', '2019-06-04 09:35:46'),
(155, 'Course', 'GR', 'ES', '<p>Los cursos básicos son para principiantes o si los bailarines anteriores desean repetir los tonos del tango. Cuando toma uno o más cursos básicos, también hay sesiones de práctica en las llamadas clases prácticas. También se imparten cursos básicos en nuestros festivales, Festivalito, que una vez en el otoño y una vez en la primavera.</p>', '2019-06-05 12:24:00', '2019-06-05 12:24:00'),
(156, 'Course', 'GR', 'EN', '<p>Basic courses are for those who are beginners or if previous dancers wish to repeat the tones of tango. When you take one or more basic courses, there are also practice sessions on so-called practical classes. Basic courses are also given at our festivals, Festivalito, which we once in the fall and once in the spring.</p>', '2019-06-05 12:25:21', '2019-06-05 12:25:21'),
(157, 'Course', 'FK', 'SV', '<p><em><strong>Forsättningskurser &nbsp;</strong></em>vänder sig till dig som har grunderna i tango eller lite mer och vill utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt&nbsp;vill du känna att du dansar mer till musiken och känna dig säkrare i dina egna rörelser.&nbsp;</p>\n<p><em><strong>Erfarenhetsmässigt</strong></em><strong> </strong>har du gått grundkurs i tango eller mer, samt varit ute och dansat några gånger på practicas och milongas. &nbsp;&nbsp;</p>\n<p><em><strong>Kunskapsmässigt</strong></em> har du lärt dig vissa grundläggande element som att lyssna på&nbsp;musiken och din partner, hittat ett dansflöde, konsten att gå&nbsp;tillsammans både i parallell gång och i korsad gång. Du har även tränat på ochos, giros och gungor etc. På dansgolvet befinner du dig någon till några gånger i månaden.</p>\n<p>Hjärtligt välkommen att anmäla dig med en partner till någon av våra fortsättningskurser!<br>\n&nbsp;</p>', '2019-06-05 12:28:59', '2019-06-05 12:28:59'),
(158, 'Course', 'FK', 'EN', '<p><em><strong>Supplementary</strong></em> <em><strong>courses </strong></em>are aimed at those who have the basics of tango and want to expand your repertoire, get more technology and a safer contact. At the same time, you want to feel that you dance more to the music and feel safer in your own movements.<br>\n<br>\n<em><strong>Experience-wise</strong></em>, you have taken a basic course in tango and been out dancing a few times at practilongas and milongas.<br>\n<br>\n<em><strong>Knowledge-wise</strong></em>, you have learned some basic elements such as listening to the music and your partner, finding a dance flow, the art of walking together both in parallel and crossing. You have also trained on ochos, giros and swings etc. On the dance floor you find yourself somebody a few times a month</p>', '2019-06-05 12:30:47', '2019-06-05 12:30:47'),
(159, 'Course', 'FK', 'ES', '<p><em><strong>Los cursos de continuación </strong></em>están dirigidos a aquellos que tienen los conceptos básicos del tango y desean ampliar su repertorio, obtener más tecnología y un contacto más seguro. Al mismo tiempo, quieres sentir que bailas más con la música y te sientes más seguro con tus propios movimientos.<br>\n<br>\n<em><strong>En cuanto a la experiencia</strong></em>, has tomado un curso básico de tango y has salido a bailar unas cuantas veces en practilongas y milongas.<br>\n<br>\n<em><strong>Desde el punto de vista del conocimiento</strong></em>, has aprendido algunos elementos básicos, como escuchar la música y su pareja, encontrar un flujo de baile, el arte de caminar juntos en paralelo y cruzado. También conoces bien los ochos, giros y salidas. En la pista de baile bailas varias veces al mes.</p>', '2019-06-05 12:31:43', '2019-06-05 12:31:43'),
(160, 'Course', 'AV', 'EN', '<p><em><strong>Advanced courses</strong></em> are for you who danced tango for a long time and now want to develop your dance to become even more dynamic and varied. In terms of time, you have danced tango for a couple or many years and spent a lot of time both on course and on the dance floor.<br>\n&nbsp;</p>\n<p><em><strong>Cognitively</strong></em>, if you have good balance, you easily pivot standing on one foot<br>\n</p>\n<p>You can make sacadas, giros, ochos, boleos and ganchos without the support of your partner</p>\n<ul>\n  <li>You have time to decorate the road between a movement and the next</li>\n  <li>You dance in both open and closed embrace and the dance direction is for you obvious</li>\n  <li>You can music and have favorite orchestras and songs</li>\n  <li>You have an understanding of creation and improvisation</li>\n</ul>', '2019-06-05 12:35:04', '2019-06-05 12:35:04'),
(161, 'Course', 'AV', 'ES', '<p><em><strong>Los cursos avanzados</strong></em> son para ti, que bailaste tango durante mucho tiempo y ahora quieres desarrollar tu baile para que sea más dinámico y variado. En términos de tiempo, has bailado tango por un par o muchos años y pasaste mucho tiempo en el curso y en la pista de baile.</p>\n<p><em><strong>Cognitivamente, </strong></em>si tiene un buen equilibrio, puede girar fácilmente de pie sobre un pie.</p>\n<ul>\n  <li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Puedes hacer sacadas, giros, ochos, boleos y ganchos sin el apoyo de tu pareja.</li>\n  <li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Tienes tiempo para decorar el camino entre un movimiento y el siguiente.</li>\n  <li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;bailas tanto en abrazo abierto como cerrado y la dirección de la danza es para ti obvia</li>\n  <li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Puedes escuchar música y tener orquestas y canciones favoritas.</li>\n  <li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Tienes una comprensión de la creación y la improvisación.</li>\n</ul>', '2019-06-05 12:36:45', '2019-06-05 12:36:45'),
(162, 'Course', 'TE', 'EN', '<p>Speciality courses are for those who want to refine your technique and feeling within a limited area within the tango. To go for a theme course you should have danced for a while so that you know that the theme is the right one for you and it is hear you want to raise the bar another level. Today we have themes such as technology for drivers and followers. On these courses you do not need to have a dance partner. Furthermore, the theme course in milonga which is a faster and more playful form of tango in double stroke.</p>', '2019-06-05 12:47:57', '2019-06-05 12:47:57'),
(163, 'Course', 'TE', 'ES', '<p><em><strong>Los cursos temáticos</strong></em> son para aquellos que desean refinar su técnica y sentimiento dentro de un área limitada dentro del tango. Para ir a un curso temático, deberías haber bailado durante un tiempo para que sepas que el tema es el adecuado para ti y para escuchar que quieres subir el nivel a otro nivel. Hoy tenemos temas como la tecnología para conductores y seguidores. En estos cursos no es necesario tener un compañero de baile. Además, el curso temático en milonga, que es una forma más rápida y juguetona de tango en doble golpe.</p>', '2019-06-05 12:48:56', '2019-06-05 12:48:56'),
(164, 'Order', 'SwishOpen', 'SV', '<p>\r\nVänligen öppna din SWISH application och utför betalning till Tangokompaniet.\r\n</p>', '2019-06-05 12:48:56', '2019-08-16 19:13:07'),
(165, 'Order', 'SwishOpen', 'EN', '<p>\r\nPlease open your SWISH application and execute the payment to Tangokompaniet.\r\n</p>', '2019-06-05 12:48:56', '2019-08-16 19:13:07'),
(166, 'Order', 'SwishOpen', 'ES', '<p>\r\nAbra su aplicación SWISH y realice el pago a Tango Company.\r\n</p>', '2019-06-05 12:48:56', '2019-08-16 19:13:07'),
(167, 'PrivateLessons', 'Prices', 'EN', '<h2>Prices</h2>\n<p>In Sweden 600 SEK per lesson of 60 minutes INKL local rent - ie if you buy 5 or more private lessons. 700 SEK if you are two pupils and one teacher. When teaching abroad other prices apply: 600 DKK in Denmark, 700 NOK in Norway. 100 CHF in Switzerland. 70 EUR in France, 80 EUR in Moscow, 85 USD in the US.</p>\n<p>If canceled the lesson is cancelled later than 48 hours before start of the lesson is charged 1/4 of the lesson price. When buying several lessons at the same time, all lessons should be taken within one year from the first lesson opportunity.</p>', '2019-09-19 16:16:42', '2019-09-19 16:16:42'),
(168, 'Companies', 'Text', 'SV', '<h1>Företagsarrangemang</h1>\n<h2>Förslag på arrangemang</h2>\n<p>Vill &nbsp;ni göra något nytt och kul på företagsfesten, på teambuildingen eller &nbsp;på temadagen? Tangokompaniet har lång erfarenhet av att hålla &nbsp;arrangemang i Argentinsk Tango till företag – vid firmafester, &nbsp;temadagar, kick-off:s mm. Tidigare kunder är bland annat Semcon, Nordea, &nbsp;Lunds Universitet, Anoto, Tlth, Liseberg, Lunds kommun- Sjukvården, &nbsp;Bonniers, Vodaphone, Arbetsförmedlingen, Kriminalvården, Scoutföreningar &nbsp;samt personalföreningar, skolor mm. Vi erbjuder undervisning, &nbsp;uppvisning, underhållning, föredrag, kommunikationsövningar i ett &nbsp;skräddarsydda paket just till er. Kombinera tango med handledning eller &nbsp;tango med ledarskapsföredrag eller med kommunikationskurser.</p>\n<h2>Kostnadsförslag</h2>\n<p>Nedan följer ett antal prisexempel på för tangoarrangemang. Vi kan även skräddarsy en lösning till din tillställning.</p>\n<p><em>Lokal- &nbsp;och resekostnad tillkommer. Vi har en utmärkt lokal på &nbsp;Fredriksbergsgatan 7 som vi hyr ut för tillställningar upp till 75 &nbsp;personer.</em></p>\n<h3>Grundpaket Tango, Lektion, uppvisning, 1 CD</h3>\n<p>1½ timme med 2 danslärare<br>\nPris: 4000 kr exkl moms (upp till 30 deltagare)</p>\n<h3>Grundpaket Tango till större grupp, Lektion, uppvisning, 1 CD</h3>\n<p>1½ timme med 2 danslärare<br>\nPris: 6000 kr exkl moms (vid 30 eller fler deltagare)</p>\n<h3>Kombipaket 2 olika danser, Lektion, uppvisning, 1 CD</h3>\n<p>2 timmar med 2 danslärare i tango och 2 danslärare i till exempel salsa<br>\nPris: 8000 kr exkl moms (upp till 30 deltagare), 9000 kr vid fler än 50 deltagare</p>\n<h3>Heldagspaket</h3>\n<p>Heldag &nbsp;6 timmar med tangokoncept- föredrag, dansundervisning, &nbsp;kommunikationsövningar, kroppsmedvetenhetsövningar, fokus, hållning och &nbsp;en uppvisning<br>\nPris: 12000 kr exkl moms</p>\n<h3>Specialpaket med finess, Lektion, uppvisning, 1 CD</h3>\n<p>Koreografi- &nbsp;vi lär en grupp från företaget en tangokoreografi och hjälper till med &nbsp;uppförandet av showen på firmafesten! Vi DJar med passande tangomusik &nbsp;under middagen och kan eventuellt även genomföra en uppvisning och &nbsp;undervisningstimme i samband med festen.<br>\nPris: 16000 kr exkl moms</p>', '2019-09-19 16:20:33', '2019-09-19 16:20:33'),
(169, 'Companies', 'Text', 'ES', '<h1>Eventos de negocios</h1>\n<h2>Propuesta de eventos</h2>\n<p>¿Quieres hacer algo nuevo y divertido en la fiesta corporativa, el trabajo en equipo o el día temático? The Tango Company tiene una larga experiencia en la celebración de eventos en Tango argentino para empresas, en fiestas de empresa, días temáticos, patadas de lanzamiento, etc. Los clientes anteriores incluyen Semcon, Nordea, Lund University, Anoto, Tlth, Liseberg, Lund Municipality- Healthcare, Bonniers, Vodaphone, el Servicio de Empleo, Justicia Criminal, asociaciones Scout y asociaciones de personal, escuelas, etc. Ofrecemos enseñanza, demostración, entretenimiento, conferencias, ejercicios de comunicación en un paquete personalizado solo para usted. Combine el tango con supervisión o el tango con conferencias de liderazgo o con cursos de comunicación.</p>\n<h2>ESTIMACIÓN</h2>\n<p>A continuación hay una serie de ejemplos de precios para arreglos de tango. También podemos adaptar una solución para su evento.</p>\n<p><br></p>\n<p>Se agregan los costos locales y de viaje. Tenemos una excelente sala en Fredriksbergsgatan 7 que alquilamos para eventos de hasta 75 personas.</p>\n<p>Paquete básico Tango, Lección, presentación, 1 CD</p>\n<p><br></p>\n<p>1½ horas con 2 profesores de baile</p>\n<p>Precio: 4000 SEK sin IVA (hasta 30 participantes)</p>\n<p>Paquete básico Tango para grupos grandes, Lección, presentación, 1 CD</p>\n<p><br></p>\n<p>1½ horas con 2 profesores de baile</p>\n<p>Precio: 6000 SEK sin IVA (con 30 o más participantes)</p>\n<p>Paquete combinado 2 bailes diferentes, Lección, espectáculo, 1 CD</p>\n<p><br></p>\n<p>2 horas con 2 profesores de baile en tango y 2 profesores de baile en salsa, por ejemplo</p>\n<p>Precio: 8000 SEK sin IVA (hasta 30 participantes), 9000 SEK para más de 50 participantes.</p>\n<p>El paquete de todo el día</p>\n<p><br></p>\n<p>Día completo 6 horas con conferencias de concepto de tango, clases de baile, ejercicios de comunicación, ejercicios de conciencia corporal, enfoque, postura y una presentación.</p>\n<p>Precio: 12000 SEK sin IVA</p>\n<p>Paquete especial con delicadeza, Lección, presentación, 1 CD</p>\n<p><br></p>\n<p>Coreografía: ¡enseñamos a un grupo de la compañía una coreografía de tango y ayudamos con la presentación del espectáculo en la fiesta de la compañía! Tenemos DJs con música de tango apropiada durante la cena y también podemos llevar a cabo un espectáculo y una sesión de enseñanza junto con la fiesta.</p>\n<p>Precio: 16000 SEK sin IVA</p>', '2019-09-19 16:28:27', '2019-09-19 16:28:27'),
(170, 'Show', 'Text', 'ES', '<p>No translation to english yet</p>', '2019-09-19 16:35:15', '2019-09-19 16:35:15'),
(188, 'Festivalito', 'Contact Us', 'EN', '\r\n<h1>Contact infomation</h1>\r\n\r\nE-mail to Daniel: \r\n<a href=\'mailto:daniel@tangokompaniet.com\'>\r\ndaniel@tangokompaniet.com\r\n</a> \r\n<p/>\r\nPhone to Daniel: 0046-(0)73 6563609\r\n', '2018-01-21 18:28:19', '2019-09-23 14:15:13'),
(189, 'Festivalito', 'Other Info', 'EN', '<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n<h1>Other info</h1>\r\n<h3>Food and Beverages</h3>\r\n<p>Coffee, tea, coke, chocolate, fruits will be available. Malmoe has many good restaurants; so no need to be hungry!</p>\r\n<h3>TK-Tango-shop</h3>\r\n<p>Tangokompaniet offers many models from several different brands of good shoes for dancing – both classical and sneakers for both men and women in the studio at Fredriksbergsgatan 7. You can also find music, CDs, books and clothing! Some of our brands: Bandolera, Regina, Vikinga, Fabioshoes, DNI, Carlos Ferroni, Bloch, DSOL</p>\r\n<h3>Dancepartner</h3>\r\n<p>Please use Tangokompaniet Festivalito event on Facebook to search partner or Tangokompaniets Partnersearch on facebook. You can register without partner but it is easier with! We can help with partnersearch if you tried and didnt succeed !</p>\r\n<h3>Accomodation</h3>\r\n<p>Please search for local dancers that might take you in or look for youth hostels or hotels; you can find good deals at <a href=\"http://www.booking.com\" class=\"autohyperlink\" title=\"http://www.booking.com\">www.booking.com</a>. If nothing is found contact us !</p>\r\n<h3></h3>\r\n\r\n				\r\n			\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2019-09-23 14:15:13'),
(190, 'Festivalito', 'Payment', 'EN', '<img src=\\\'http://localhost:3000//images/festivalito.jpeg\\\'>', '2018-01-21 18:28:19', '2019-09-23 14:15:13'),
(191, 'Festivalito', 'Register', 'EN', '<h1>Register</h1>\n<p>You welcome to register per e-mail: <a href=\"mailto:daniel@tangokompaniet.com\" title=\"mailto:daniel@tangokompaniet.com\">daniel@tangokompaniet.com</a> after choosing your package and follow payments instructions at “Prices”. Once you have paid you are registered!</p>\n<p>You do not need to register with a partner, but to be more sure that you get a place in the workshops it will help if you do. We have a&nbsp;<a title=\"TK partnership on facebook\" href=\"https://www.facebook.com/groups/501494573205992/\" target=\"_blank\">“Tangokompaniet – partnersearch”</a>&nbsp;on facebook!&nbsp;are also willing to assist you on this matter if needed.</p>\n<p>Workshops get full quite fast and registration is binding if you unregister later than a week before the festival.&nbsp;If you have registered and are not able to participate contact us as soon as possible.</p>\n<p><strong>WELCO TO THE FESTIVAL!</strong></p>', '2018-01-21 18:28:19', '2019-09-23 14:15:13'),
(192, 'Festivalito', 'Schedule', 'EN', '', '2018-01-21 18:28:19', '2019-09-23 14:15:13'),
(193, 'Festivalito', 'Teachers and DJs', 'EN', '\r\n\r\n<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n	\r\n					<h1>The crew</h1>\r\n<h1></h1>\r\n<p><strong style=\"color: black; font-family: Verdana, Arial, sans-serif; font-size: 11px;\">The teachers and performers</strong></p>\r\n<p>&nbsp;</p>\r\n<p><b>Anna Sol&nbsp;</b><img src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/anna.solakius.jpg\" width=\"212\" height=\"300\"><br>\r\nAnna teaches and organizes in Tangokompaniet since 2002. Her teaching offers the opportunity to explore her own body, the communication in dance and the expression in the music. Her dance expresses her person; energy, joy and the pursuit of consciousness. She is also a very active DJ, both regionally, nationally and internationally, and also hosts seminars on tango music and DJing.</p>\r\n<p><strong>Camila Holst-Viancos&nbsp;</strong><img class=\"alignnone size-medium wp-image-441\" alt=\"DSC_1302\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/DSC_1302-199x300.jpg\" width=\"199\" height=\"300\"></p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; -webkit-text-stroke: #000000}\r\nspan.s1 {font-kerning: none}\r\nspan.s2 {font: 12.0px \'Helvetica Neue\'; font-kerning: none}\r\n--></style>\r\n<p>Camila Viancos has a broad experience with teaching, dancing and performing from different dance styles such as salsa and modern dancing.&nbsp;Her focus in tango dancing is connection, musicality and body awareness. She is very passionated about teaching and she currently lives from teaching dance, yoga and pilates.&nbsp;Camila is also&nbsp;performing as a singer and teaches musicality for salsa dancers with live musicians.</p>\r\n<p><strong>Cecilia Warfvinge&nbsp;</strong><img alt=\"cecilia\" src=\"https://festivalito.tangokompaniet.com/wp-content/uploads/cecilia-248x300.jpeg\" width=\"248\" height=\"300\"></p>\r\n<p>For Cecilia, Tangon offers the opportunity to express dynamic musicality, and her dance has been described as elegant and musical. She has a background in classical music, and therefore has a deep understanding of the different expressions of music. Cecilia is inspired by her interest in fitness and Chinese Tai Chi, and advocates bodily control and playfulness in the dance.</p>\r\n<p><b>Daniel Carlsson&nbsp;</b><img class=\"alignnone size-medium wp-image-426\" alt=\"daniel.carlsson\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/daniel.carlsson.jpg\" width=\"212\" height=\"300\"></p>\r\n<div id=\"tw-target-text-container\">\r\n<p dir=\"ltr\" id=\"tw-target-text\" data-placeholder=\"Översättning\">Daniel is one of the founders of Tangokompaniet. After touring around the world teaching tango during many years and teaching in over 20 countries Daniel decided to put more focus on making the Öresundtango grow in many aspects. For Daniel feeling, connection and creativity are the key words.</p>\r\n<p><strong>Nidia Martinez&nbsp;</strong><img alt=\"nidia\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/nidia-248x300.jpg\" width=\"248\" height=\"300\"><br>\r\nNidia is educated in contemporary / modern dance and works as a dancer, choreographer and teacher. She is also Pilate’s instructor. Nidia started dancing tango in Argentina and is interested in tango as social dance but also as a technique that makes her artistic expression richer. As a teacher, she focuses on body communication and awareness. She develops her training method for tango dancers with her knowledge of Pilates and Contact Improvisation (contemporary / modern dance).</p>\r\n<p>&nbsp;</p>\r\n<pre lang=\"en\"></pre>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p><b>Per Berseus&nbsp;</b><img class=\"alignnone size-medium wp-image-424\" alt=\"per.berseus\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/per.berseus.jpg\" width=\"212\" height=\"300\"></p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; -webkit-text-stroke: #000000}\r\nspan.s1 {font-kerning: none}\r\n--></style>\r\n<p>With one foot in musicianship and the other in movement practices, Per has an in-depth relationship with dancing and teaching. Ever since his childhood he has kept playing in a symphony orchestra, and he was immediately captured by the tango music when he started dancing in 2003. Over the last 10 years Per draws inspiration from movement disciplines such as yoga and Gyrotonic, and he teaches tango as an embodied experience of warm-hearted expression</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sonny La&nbsp;</strong><img class=\"alignnone size-medium wp-image-423\" alt=\"sonny\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/sonny-211x300.jpg\" width=\"232\" height=\"330\"><br>\r\nTango is for Sonny a dance of presence and musical expression. His dance can be described as conscious and playful. Sonny has a background in Chinese Kung Fu and Tai Chi, exhibiting both physical strength and soft dynamics. With his good educational ability, he inspires his students to dare to experiment and experiment with their dance.</p>\r\n<p><b>Tava Sieh&nbsp;</b><img alt=\"Tava\" src=\"https://festivalito.tangokompaniet.com/wp-content/uploads/Tava.jpg\" width=\"180\" height=\"240\"></p>\r\n<p>Tava’s love for dance and enthusiasm for teaching is informed by her experiences as a physiotherapist, massage therapist, and yoga practitioner. She began her Tango journey in Boulder, Colorado and the path lead quickly to Buenos Aires, and then onward Sweden where she has been teaching with Tangokompaniet since 2012.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>DJs</strong></p>\r\n<p>Per Berseus</p>\r\n<p>Johan Nordström</p>\r\n<p>Sten Odelberg</p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 23.0px Times; color: #454545; -webkit-text-stroke: #454545} span.s1 {font-kerning: none}\r\n--></style>\r\n\r\n				\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2019-09-23 14:15:13'),
