(239, 'Easter', 'Venues', 'EN', '<p><br></p>\n<p>We will have to make this festival online - facebook and zoom. It might be good to dowload zoom allready now. https://zoom.us/download#client_4meeting Once you register you will get passwords and meetingIDs and more information. Some workshops will be for couples and some for solodancers.</p>', '2018-01-21 18:28:19', '2019-09-23 14:20:56'),
(240, 'Easter', 'Prices', 'EN', '<p>Prices:&nbsp;</p>\n<p>150 SEK per workshop&nbsp;</p>\n<p>Beginners is for free but donations are most welcome</p>\n<p>Milonga 20.00-23.00 with small instruction at 19.45. You are mot welcome and you pay what you want -per donation</p>', '2019-09-23 12:11:32', '2019-09-23 14:20:56'),
(248, 'Festivalito', 'Start', 'EN', '<p><br></p>', '2019-09-23 14:31:23', '2019-09-24 13:38:09'),
(249, 'Summer', 'Start', 'EN', '<p>&nbsp;</p>\n<h1>Tangokompaniet invites you to Tango Summer Festival Malmö</h1>\n<h2>1st – 7th of July 2019 in Malmö, Sweden</h2>\n<p>Welcome to a week full of, first of all tango, good classes, live &nbsp;music, performances, lots of dancing, playful exploration and cosy and &nbsp;beautiful surroundings!</p>\n<p>Take inspiring workshops in tango with Anna Sol, Martin Nymann, &nbsp;Daniel Carlsson &amp; Linnéa Andersson. You can come as a beginner or &nbsp;experienced dancer; there is something for everyone! We offer different &nbsp;packages or you pick the modules that fit you.</p>\n<p>The milongas in the evenings will have great tango music for you to &nbsp;dance to and there will be performances of the teachers and also from &nbsp;the choreography group of the festival. Also we have a live set being &nbsp;played by Bandonegro Tango Orquesta during the festival!</p>\n<p>This year we are also offering a tango DJ Seminar with Per Berseus for you who want to learn to tango DJ.</p>\n<p>And last but not least we hopefully end the week with a beautiful sunset and outdoor milonga! Come and enjoy tango; 100%!</p>\n<p><strong>Welcome dear dancer!</strong></p>\n<p><img alt=\"FB Banner Summer Tango\" height=\"100%\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/FB-Banner-Summer-Tango-300x168.png\" width=\"100%\"/></p>\n<p>In collaboration with</p>\n<p>Medborgarskolan</p>\n<p><img alt=\"mebo\" widtht=\"20%\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/mebo-300x120.jpg\" width=\"20%\"/></p>\n<p>Camarin</p>\n<p><img alt=\"camarin\" width=\"20%\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/camarin-300x284.jpg\" width=\"300\"/></p>\n<p>Malmö Stad</p>\n<p><img alt=\"Logotype Malmö stad\" width=\"20%\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/Logotype-Malmö-stad-300x177.jpg\" width=\"20%\"/></p>\n<p>Arriba Tango</p>\n<p><img alt=\"arriba tango\" width=\"20%\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/arriba-tango-300x300.jpg\" width=\"20%\"/></p>\n<p>Street Tango</p>\n<p><img alt=\"street tango\" width=\"20%\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/street-tango-300x300.jpg\" width=\"20%\"/></p>', '2019-09-23 14:31:41', '2019-09-24 13:39:08'),
(250, 'Marathon', 'Start', 'EN', '<h3>Tangokompaniet welcomes you to</h3>\n<h1>Tango Marathon Festival in Malmö</h1>\n<h2>Workshops, live music, shows and lots of social dancing. We also &nbsp;&nbsp;offer intro-classes for complete beginners, so everyone can join!</h2>\n<p>There will be many different themes of workshops. Guest teachers from &nbsp;&nbsp;Buenos Aires will inspire us together with TKcrew. José Fernandez y &nbsp;&nbsp;Martina Waldman, Cecilia Piccinni and Daniel Carlsson will teach and &nbsp;&nbsp;perform for us and Tangarte will be playing live music this year which &nbsp;&nbsp;fits very well with their celebrating 20 years anniversary. Tommy &nbsp;&nbsp;Selggren, Gabriela Castro and Camila Holst-Viancos will give &nbsp;&nbsp;introclasses Friday, Saturday and Sunday.</p>\n<p><img alt=\"Festivalito\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/unspecified-2.jpeg\" width=\"228\" height=\"320\"/><img src=\"\"/></p>\n<p>Come and learn all the good stuff in tango so that you can enjoy this &nbsp;&nbsp;wonderful dance even more and be inspired by their performances in the &nbsp;&nbsp;evenings.</p>\n<h3><img alt=\"tangarte\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/tangarte-500x281.jpg\" width=\"500\" height=\"281\"/></h3>\n<p>Behind the wheels of the music machine we have really good DJs like &nbsp;&nbsp;Tommy Selggren, Anita Doby doing their absolute best to keep you &nbsp;dancing &nbsp;all the time on the wonderful&nbsp;dance floors&nbsp;of Barnens Scen &nbsp;and&nbsp;at&nbsp;<strong>Tangokompaniet.</strong></p>\n<p><strong>We look forward to meet all of you at this wonderful week of tango in Malmö!</strong></p>\n<p><img alt=\"pichi dani 2\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/pichi-dani-2-466x700.jpg\" width=\"466\" height=\"700\"/></p>\n<p>I samarbete med</p>\n<p><img alt=\"mebo\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/mebo-300x119.jpg\" width=\"300\" height=\"119\"/></p>\n<p>och med stöd av</p>\n<h3><img alt=\"Malmostad_logo_webb_svartvit\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/Malmostad_logo_webb_svartvit.jpg\" width=\"142\" height=\"190\"/></h3>', '2019-09-23 14:31:58', '2019-09-24 13:39:08'),
(253, 'Festivalito', 'Teachers', 'SV', '<h1>Lärare</h1>\n<p><strong>Anna Sol</strong>&nbsp;</p>\n<p>Anna Sol har dansat och undervisat argentinsk tango i över 20 år. Hon har utforskat många olika områden i form av både den sociala dansen men också den mer sceniska formen av tangon som konstuttryck. Hon har ett skarpt öga när det kommer till teknik men är också väldigt inspirerad av vad musiken har att ge dansen, vilket hon ser som en av huvudingredienserna för att uppleva en härlig dans och vara i kontakt med tangon och sin partner.&nbsp;</p>\n<p>Anna undervisar till vardags på Tangokompaniet och M2 Tangostudio och turnerar för jämnan med sina danspartners i Skandinavien, där hon delar med sig av sin undervisning och sina uppträden.</p>\n<p><br></p>\n<p><strong>Daniel Carlsson</strong></p>\n<p>Daniel Carlsson har dansat tango i 28 år. Daniel brinner för undervisningen. Han har undervisat 10.000-tals personer i cirka &nbsp;trettio länder. Numera fokuserar Daniel på att bygga upp tangon igen \"efter pandemin\". Daniel brinner för att se alltfler bitas av tango och han älskar att se dansare utvecklas. Daniel är en av grundarna av tangokompaniet som är verksamt dels i Öresund men turnerar med tango på helgerna.</p>\n<p><br></p>\n<p><strong>Eva Lehrman</strong></p>\n<p>Eva Lehrman är både som dansare och lärare väldigt fokuserad på kontakten. Hon har en speciell förmåga att vara närvarande i mötet och delar frikostigt med sig av sina bästa tips i ett behagligt tempo.</p>\n<p><strong>Ida Carnerup</strong></p>\n<p>Ida har djupa insikter i hur kroppen fungerar då hon arbetar som sjukgymnast. Ida är bra på att möta eleverna där de är i sin utveckling och strävar efter att kontinuerligt utveckla sig själv både som dansare och lärare.</p>\n<p><strong>Martin Pedersen</strong></p>\n<p>Martin N.&nbsp;aka DJ El Diego är en kreativ, dynamisk dansare. Han gillar att lägga upp till det lekande och experimenterande. Han söker på nyskapande sätt att fylla yt ramerna för tät omfamning med ett traditionsrikt estetiskt formspråk. Martin är en dedikerad, inspirerande&nbsp;undervisare med fokus på succéupplevelser i det sociala rummet som tangon också är. Han er desuden optaget af analysen af&nbsp;kroppens muligheder og af præcision, kontakt og udviklingen af et smukt og harmonisk udtryk i dansen.</p>\n<p>Martin underviser hold på alle niveauer niveauer og er desuden meget efterspurgt til&nbsp;privatundervisning.</p>\n<p><strong>Tommy Leite</strong></p>\n<p>Tommy Leite har en god kroppskännedom och älskar att se dansarna utvecklas och hitta glädje i sin tango. Hållning och stabilitet är några av Tommys styrkor.&nbsp;</p>\n<h2>Tango-DJs&nbsp;</h2>\n<p>Johan Nordström är fredagens TDJ</p>\n<p>Luis Cono är lördagens TDJ</p>\n<p>Per Berseus är söndagens TDJ</p>\n<p><br></p>\n<h2>Orkester</h2>\n<p>Quinteto Tangarte</p>\n<p>Orquesta Tangarte är en argentinsk-svensk tangoorkester som grundades i Malmö 1999 av bandoneonisten Juanjo Passo med syftet att framföra och sprida tangomusiken från dess födelseplats, Rio de la Plata. Tangartes musik är framför allt den rioplatensiska tangon, med en stor och varierad repertoar från tangons olika stilar och epoker, och spelar både konserter och till dans. &nbsp;&nbsp;&nbsp;<br>\n &nbsp;Tangarte har genom åren uppträtt på tillställningar av vitt skilda slag, stort som smått: tangofestivaler, musikfestivaler, konserter och milongas från norr till söder i Sverige, Skandinavien och på en hel del olika platser runt om i världen. <br>\n &nbsp;Orkestern bjuder regelbundet in gästartister och har samarbetat med bandoneonisterna Juan José Mosalini, Luis Stazo (Sexteto Mayor), Santiago Cimadevilla och Marcelo Mercadante, pianisterna Juan Esteban Cuacci, Gustavo Beytelmann, Cristian Zarate, Luciano Supervielle, kontrabasisten Ignacio Varchausky samt sångerskorna Claudia Pannone, Susanna Levonen och Marianne Maans. Orquesta Tangarte har också gjort konserter tillsammans med både blås- och symfoniorkestrar. <br>\n &nbsp;Orquesta Tangarte har tidigare haft sångarna Juan José Passo (grundare av Tangarte) och Sofia Álvarez Tidstrand, som båda har betytt mycket för bandets framgång och utveckling sedan starten. <br>\n &nbsp;Välkommen att luta er tillbaka och låta er svepas in i \"Orquesta Tangarte\"s olika känslostämningar - från det meditativa till det exalterade och brutala - och låt dess magi föra dig in i musikens hjärta och själ. &nbsp;&nbsp;&nbsp;<br>\n &nbsp;Under Festivalito 2021 så gästas Tangarte av den argentinska sångerska Claudia Pannone. &nbsp;&nbsp;<br>\n &nbsp;A Bailar! <br>\n &nbsp;Orquesta Tangarte: Juanjo Passo – bandoneon, musical director | Garik Binder – piano | Jakob Gerhardsson – double bass | Hedda Heiskanen – violin | Irina Binder – violin | Per Tidstrand – violoncello&nbsp;</p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p>© 2010-2021 Tangokompaniet</p>', '2019-09-23 14:47:24', '2019-09-23 15:06:39'),
(254, 'Summer', 'Teachers', 'SV', '<h1>The crew</h1>\r\n<p><strong>The teachers and performers</strong></p>\r\n<p>From Buenos Aires we have <strong>Jose and Martina</strong>. A dynamic and fantastic tangocouple who dances all styles and they have a solid background in escenario tango.</p>\r\n<p><strong>Cecilia Piccinni and Daniel Carlsson will again teach together</strong><br>\r\n&nbsp;</p>\r\n<div style={{marginLeft=\'auto, marginRight=\'auto\'}}>\r\n<p><img alt=\"Cecilia Piccinni\" width=\'60%\' src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/Cecilia-Piccinni1-199x300.jpg\" width=\'60%\'/></p>\r\n<p><br></p>\r\n</div>\r\n<p><strong>Cecilia &nbsp;Piccinni</strong> started to dance ballet when she was a child. In her teens, &nbsp;she studied drama theatre as well. Nearing the end of this artistic &nbsp;adolescence, she started tango. For a couple of years, she was &nbsp;performing and training in her city, while in the meantime she was &nbsp;finishing her degree in Foreign Trade at the University and working in a &nbsp;multinational company. She also studied contemporary dance, contact &nbsp;improvisation, folk, jazz, etc. She’s nowadays focused on Ashtanga Yoga. &nbsp;&nbsp;She has also worked in many festivals around the world from 2009 &nbsp;until today in the UK, Germany, Denmark, Portugal, Russia, France, in &nbsp;the US and in Sweden etc. &nbsp;&nbsp;</p>\r\n<p><img alt=\"Daniel Anreas Carlsson\" width=\'60%\' src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/daniel.carlsson.jpg\" width=\'60%\'/></p>\r\n<p><strong>Daniel Carlsson</strong> is one of the pioneers who together with others built &nbsp;the European tangoscene in the 90s and onward. With a mixed &nbsp;Swedish-Danish-Argentinean background he came in contact with tango &nbsp;through his parents and family. After some years of teaching tango &nbsp;Daniel Carlsson started teaching tango fulltime and touring around the &nbsp;world. Daniel Carlsson has taught tango in 25 different countries and &nbsp;has danced tango regularly for almost 25 years. Students say he is a &nbsp;fantastic teacher, enthusiastic and with an enormous repertoir of &nbsp;material, excercices and possibilities.</p>\r\n<p>Daniel Carlsson and Cecilia Piccinni met in festivals dancing about &nbsp;ten years ago and met for practising a few times. They decided to work &nbsp;together in Europe and this is the third year Cecilia Piccinni visits &nbsp;and works with Tangokompaniet touring with Daniel Carlsson.</p>\r\n<p><br>\r\n <img alt=\"cecilia\" width=\'50%\' src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/cecilia-248x300.jpeg\" width=\'50%\'/></p>\r\n<p><br>\r\n<strong>Cecilia Warfvinge</strong> is a dedicated enthusiastic teacher with a musical background and a strong analytical sense.<br>\r\n&nbsp;</p>\r\n<p><img alt=\"gabriela\" width=\"40%\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/gabriela-137x300.jpg\" width=\'50%\'/></p>\r\n<p>To <strong>Gabriela Castro </strong>the tango is communication without words, &nbsp;sometimes difficult but full of joy – it never ends, there is always &nbsp;more to explore. &nbsp;&nbsp;</p>\r\n<p><br>\r\n <img alt=\"linnea\" width=\'50%\'\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/linnea-300x300.jpg\" width=\'50%\'/><br>\r\n<strong>Linnea Andersson</strong> has studied classical ballet, tango and alot of different &nbsp;movement forms. She loves to teach and share her insights with you.</p>\r\n<p><br></p>\r\n<h1><img alt=\"sonny\" width=\'50%\' src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/sonny-211x300.jpg\" width=\'50%\'/></h1>\r\n<p><strong>Sonny La</strong> has many years of experience from both tango and kung fu. He has developed great body awareness and can help you in that direction.</p>\r\n<p><strong>Tommy Selggren</strong><br>\r\nWith many years of experience from both tango and martial arts Tommy can &nbsp;help you develop more control over your movements and your balance.</p>\r\n<p><br></p>\r\n<p>© 2010-2012 Tangokompaniet</p>', '2019-09-23 14:47:24', '2019-09-23 15:06:39');
INSERT INTO `tbl_text_21Jan22` (`id`, `groupId`, `textId`, `language`, `textBody`, `creaTimestamp`, `updTimestamp`) VALUES
(259, '', 'Start', 'SV', '<h3>Tangokompaniet welcomes you to the</h3>\n<h1>Tango Easter Festival in Malmö</h1>\n<h2>Workshops, live music, shows and lots of social dancing. We also &nbsp;&nbsp;offer intro-classes for complete beginners, so everyone can join!</h2>\n<p>There will be many different themes of workshops. Guest teachers from &nbsp;&nbsp;Buenos Aires will inspire us together with TKcrew. José Fernandez y &nbsp;&nbsp;Martina Waldman, Cecilia Piccinni and Daniel Carlsson will teach and &nbsp;&nbsp;perform for us and Tangarte will be playing live music this year which &nbsp;&nbsp;fits very well with their celebrating 20 years anniversary. Tommy &nbsp;&nbsp;Selggren, Gabriela Castro and Camila Holst-Viancos will give &nbsp;&nbsp;introclasses Friday, Saturday and Sunday.</p>\n<p><img alt=\"Festivalito\" height=\"320\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/unspecified-2.jpeg\" width=\"228\"/></p>\n<p>Come and learn all the good stuff in tango so that you can enjoy this &nbsp;&nbsp;wonderful dance even more and be inspired by their performances in the &nbsp;&nbsp;evenings.</p>\n<h3><img alt=\"tangarte\" height=\"281\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/tangarte-500x281.jpg\" width=\"500\"/></h3>\n<p>Behind the wheels of the music machine we have really good DJs like &nbsp;&nbsp;Tommy Selggren, Anita Doby doing their absolute best to keep you &nbsp;dancing &nbsp;all the time on the wonderful&nbsp;dance floors&nbsp;of Barnens Scen &nbsp;and&nbsp;at&nbsp;<strong>Tangokompaniet.</strong></p>\n<p><strong>We look forward to meet all of you at this wonderful week of tango in Malmö!</strong></p>\n<p><img alt=\"pichi dani 2\" height=\"700\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/pichi-dani-2-466x700.jpg\" width=\"466\"/></p>\n<p>I samarbete med</p>\n<p><img alt=\"mebo\" height=\"119\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/mebo-300x119.jpg\" width=\"300\"/></p>\n<p>och med stöd av</p>\n<h3><img alt=\"Malmostad_logo_webb_svartvit\" height=\"190\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/Malmostad_logo_webb_svartvit.jpg\" width=\"142\"/>No translation to english yet</h3>', '2019-10-02 06:19:41', '2019-10-02 06:19:41'),
(260, '', 'Contact Us', 'SV', '<p>Register or send questions to Daniel@tangokompaniet.com or call him at 0046-(0)736563609</p>', '2019-10-02 06:19:51', '2019-10-02 06:19:51'),
(265, '', 'Prices', 'SV', '<p>XxxNo translation to english yet</p>', '2019-10-02 06:29:07', '2019-10-02 06:29:07'),
(266, 'Marathon', 'Contact us', 'SV', '<p>&nbsp;</p>\n<h1>Contact us</h1>\n<h2>Before the marathon</h2>\n<p>Before the marathon we can be contacted on e-mail</p>\n<p><a href=\"mailto:malmotangomaraton@gmail.com?subject=MTM question\">\nmalmotangomaraton@gmail.com</a></p>\n<h2>During the marathon</h2>\n<p>We will check our e-mail during the marathon, but you can also reach us on our phones:</p>\n<p>+46 705 150345 (Anna)<br>\n+46 736 563609 (Daniel)</p>\n<p><img alt=\"danielannanskratt\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/danielannanskratt-300x200.jpg\" width=\"300\" height=\"200\"/></p>\n<p><br></p>', '2019-10-15 12:47:00', '2019-10-15 12:47:00'),
(267, 'Marathon', 'The concept', 'SV', '<h1><strong>MALMÖ TANGO MARATON MOVED TO 10-12 JUNE</strong></h1>\n<h2>The concept of our tango marathon is gathering devoted tango dancers both from far away and locally to spend a weekend together in the name of tango and friendship. And this year it is the 17th edition!</h2>\n<p>The next Malmö Tangomaraton is due to COVID restrictions moved to Friday 10th- Sunday 12th of June 2022!</p>\n<p>We will dance, talk, embrace, smile, eat, laugh, and enjoy the warm atmosphere in doors in contrast to the cold and maybe snowy winter outside… &nbsp;Simply, spend a lovely &nbsp;tango weekend together!</p>\n<p>The maraton starts on Friday evening with dancing and goes on until Sunday evening. There will be some breaks to rest and feed our bodies; &nbsp;you can find the details in the program! For those staying until Monday; there is an afterparty on Sunday night.</p>\n<h1>WE HOPE TO SEE YOU HERE!</h1>\n<p>/Anna Sol &amp; Daniel Carlsson</p>\n<p><br></p>\n<p><img alt=\"maratonannadaniel\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/maratonannadaniel-300x200.jpg\" width=\"300\" height=\"200\"/></p>\n<p>For further information contact us at: <a href=\"mailto:malmotangomaraton@gmail.com?subject=MTM question\">malmotangomaraton@gmail.com</a></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>', '2019-10-15 12:47:45', '2019-10-15 12:47:45'),
(268, 'Marathon', 'DJs', 'SV', '<h1>DJs</h1>\n<p>So who will be our beloved DJs of this year? Here we present our &nbsp;music crew in alphabetical order.&nbsp;</p>\n<ul>\n  <li>DJ Kristian Andersen</li>\n  <li>DJ Brian Falk</li>\n  <li>DJ Daniel Carlsson</li>\n  <li>DJ Ina Eriksen</li>\n  <li>DJ Morten Wadström</li>\n</ul>', '2019-10-15 12:48:53', '2019-10-15 12:48:53'),
(269, 'Marathon', 'Agents and helpers', 'SV', '<p>&nbsp;</p>\n<h1>Agents</h1>\n<p>Do you want to become a Malmö Tango Maraton agent? Good! This means that you have a big chance of participating at the maraton for free!</p>\n<p>As and agent you will be the promoter in your city, region or country. You spread information about the maraton through your social media chanels, hand out flyers and talk with your tango friends about of course joining Malmö Tango Maraton!</p>\n<p>For every couple (one follower and one leader) that registers through you, you get a discount of € 15/couple on your admission fee.</p>\n<p>Interested? Send us and email or contact us on Facebook!</p>\n<p><img alt=\"maratonagents2\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/maratonagents2-200x300.jpg\" width=\"200\" height=\"300\"/></p>\n<h1>Helpers</h1>\n<p>Do you want to become a Malmö Tango Maraton helper? Great! This means that you can participate in the maraton for free!</p>\n<p>As a helper you will help with different practical things before, during and after the Malmö Tango Maraton. Dues like, cleaning, making the breakfast, being the bartender, shopping etc will be part of the duties.</p>\n<p>Every year we are in need of a couple of helpers who will work 10 hours, and therefore will not pay the maraton fee. Sometimes there is &nbsp;the opportunity to work a bit less, but this is our second hand choice.</p>\n<p>If you are interested in being part of the helpers team, send us an email or contact us on Facebook!</p>\n<p><br></p>', '2019-10-15 12:49:21', '2019-10-15 12:49:21'),
(270, 'Marathon', 'The venue', 'SV', '<h1>The venue</h1>\n<p>The venue we will dance, eat and chat at is <a href=\"https://goo.gl/maps/mHQhAkbcPhiEvN3w6\">Barnens scen</a>, Falsterbogatan 17, 214 36 Malmö)</p>\n<p>Barnens scen is a cosy children’s theater with great wooden dance floor and has frequently been used for tango during many years. We are proud to organize Malmö Tango Maraton there!</p>\n<p><img alt=\"barnens scen\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/barnens-scen-300x205.jpg\" width=\"300\" height=\"205\"/></p>\n<p><img alt=\"maraton 17 fb\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/maraton-17-fb-300x199.jpg\" width=\"300\" height=\"199\"/></p>\n<p><br></p>', '2019-10-15 12:50:15', '2019-10-15 12:50:15'),
(271, 'Marathon', 'Getting there', 'SV', '<p>&nbsp;</p>\n<h1>Getting to the Malmö Tango Maraton</h1>\n<p>The Tango maraton takes place at \n<a href=\"https://goo.gl/maps/p6mkmhiRrpmMQEnB7\">Barnens Scen</a>, Falsterbogatan 17, 214 36 Malmö, Sweden.\n</p>\n<p>If you are flying from abroad, Copenhagen Airport (Kastrup), in Denmark is the closest airport. There are direct trains to Malmö from &nbsp;the airport. Other possibilities are Malmö Airport (Sturup) and &nbsp;Gothenburg Airport (Göteborg City Airport).</p>\n<p>To the venue you can easily take bus no 5 from the central station, direction “Stenkällan” and get off at “Malmö Folkets park”. The trips &nbsp;takes about 7 minutes. From the busstop you walk straight on a couple of &nbsp;100 m, and you will find Falsterbogatan and turn right. After a couple of 100 m more you find barnens scen on your right hand side. It is part of the park Folkets park. Remember that you can not pay in cash on the &nbsp;bus, we recommend you to either buy a weekend buscard at the &nbsp;Centralstation or download the app and buy your tickets there. You will &nbsp;find the information you need about buses at <a href=\"https://www.skanetrafiken.se/templates/StartPage.aspx?id=16125&amp;epslanguage=EN\">Skånetrafiken.</a></p>\n<p>You can also call a taxi on +46 40 232323 – Taxiverket or +46 40 &nbsp;979797 Taxi 97. The price is around SEK 60 – SEK 120, depending on the &nbsp;time of day you travel.</p>\n<p>We recommend you to google map your travel in Malmö!&nbsp;<a href=\"https://goo.gl/maps/p6mkmhiRrpmMQEnB7\">Google maps with Barnens Scen</a> marked as a red pinpoint.</p>\n<p><img alt=\"barnens scen 2\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/barnens-scen-2-225x300.jpg\" width=\"225\" height=\"300\"/></p>\n<p><br></p>', '2019-10-15 12:50:40', '2019-10-15 12:50:40'),
(272, 'Marathon', 'Sleeping', 'SV', '<p>&nbsp;</p>\n<h1>Sleeping</h1>\n<h2>For sleeping there are a couple of alternatives.</h2>\n<p>Alternative 1. Don’t, just dance! : )</p>\n<p>Alternative 2. Book a hotel or bed and breakfast in Malmö at <a href=\"http://www.booking.com/\">booking.com</a></p>\n<p>Alternative 3. Ask a participating Malmöresident to host you!</p>\n<p>(If you are a helper you have the option to be hosted in our sleeping place.)</p>\n<h1>What to bring</h1>\n<p>In general bring warm shoes and clothes since it is quite cold in &nbsp;Sweden in January. Don’t forget dancing shoes, of course, and a good &nbsp;spirit!</p>\n<p>We also ask you to bring your own mug! Then you can easier locate it. : )</p>\n<p><img alt=\"annajul\" height=\"198\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/annajul-300x198.jpg\" width=\"300\"/></p>\n<p><br></p>', '2019-10-15 12:51:07', '2019-10-15 12:51:07'),
(273, 'Marathon', 'Eating and drinking', 'SV', '<h1>Eating and drinking at the Malmö Tango Maraton</h1>\n<p>Food is essential for a maraton and there will be brunch, dinner and &nbsp;nightmeal served every day. There will also be snacks and drinks during the whole maraton.</p>\n<p>We are using a great catering, that we have been using for years – delicous food!</p>\n<p>If you are a vegetarian or allergic to any specific food please let us know in the registration, thank you!</p>\n<p><img alt=\"brunch\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/brunch-300x200.jpg\" width=\"300\" height=\"200\"/></p>', '2019-10-15 12:51:56', '2019-10-15 12:51:56'),
(274, 'Marathon', 'Past marathons', 'SV', '<p>&nbsp;</p>\n<h1>Past Malmö Tango Maratons</h1>\n<p>Here you find photos and other information about the earlier tango marathons!</p>\n<p><img alt=\"ninadaniel\" src=\"http://tangomaraton.tangokompaniet.com/wp-content/uploads/ninadaniel-300x199.jpg\" width=\"300\" height=\"199\"/></p>\n<h3>December 2006</h3>\n<p>Over 120 people gathered in December 2006 for over 60 hours of non-stop tango music and dancing.</p>\n<p><a href=\"http://www.unmomento.net/thumbnails.php?album=149\">Fredis fotos</a></p>\n<h3>July 2007</h3>\n<p>Over 120 people gathered in July 2007 for over 60 hours of non-stop tango in Lomma.</p>\n<p><a href=\"http://www.unmomento.net/thumbnails.php?album=171\">Fredis fotos</a></p>\n<h3>December 2007</h3>\n<p><a href=\"http://lavatop.com/loberod/index1.html\">Lauras fotos from December 2007 in Löberöd</a></p>\n<h3>December 2008 &amp; January 2009</h3>\n<p>We made two maratons with about 100 dancers in each one. There are some videos on youtube&nbsp;<a href=\"http://www.youtube.com/watch?v=53vBF8wWLyc\">here,</a> <a href=\"http://www.youtube.com/watch?v=bLA_QQZHzw0&amp;feature=related\">here,</a> <a href=\"http://www.youtube.com/watch?v=yrhZr7-t_9g&amp;feature=related\">and here!</a></p>\n<h3>December 2009</h3>\n<p>Facebook took over and many photos can be found on facebook and videos on youtube.</p>\n<h3>December 2010</h3>\n<p>Put your photos on facebook and if you have something really nice we can put it here on the homepage too !</p>\n<h3><strong>December 2011</strong></h3>\n<p>You can find many nice photos in our Facebook group&nbsp;<a href=\"http://www.facebook.com/groups/24322371703/\">Tangokompaniet</a>&nbsp;!</p>\n<h3><strong>December 2012</strong></h3>\n<p><a href=\"https://www.facebook.com/media/set/?set=a.194373753985203.43924.102114856544427&amp;type=3\">Here</a>&nbsp;you find nice pics from this years event!</p>\n<h3><strong>December 2013</strong></h3>\n<p>We have some really nice pics from last years maraton <a href=\"https://www.facebook.com/media/set/?set=a.559787980777110.1073741847.102114856544427&amp;type=1\" title=\"here\">here</a>&nbsp;and <a href=\"https://www.facebook.com/oli.greder/media_set?set=a.10202709863292833.1073741830.1386555217&amp;type=1\" title=\"here\">here</a>!</p>\n<h3><strong>December 2014</strong></h3>\n<p>Mr Marcus Hast took great pics during last years event <a href=\"https://www.facebook.com/marcushast/media_set?set=a.10153088287913949.1073741835.623713948&amp;type=3\" title=\"here!\">here!</a></p>\n<h3><strong>January 2016</strong></h3>\n<p>We changed from organizing in December and did it instead in January and you can see the memories <a href=\"https://www.facebook.com/marcushast/media_set?set=a.10154019323348949.1073741864.623713948&amp;type=3\">here,</a> <a href=\"https://www.facebook.com/marcushast/media_set?set=a.10154025289463949.1073741865.623713948&amp;type=3\">here</a> and <a href=\"https://www.facebook.com/marcushast/media_set?set=a.10154025289463949.1073741865.623713948&amp;type=3\">here!&nbsp;</a></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><br></p>', '2019-10-15 12:54:05', '2019-10-15 12:54:05'),
(275, 'Summer', 'Seminar', 'SV', '<p>&nbsp;</p>\n<h1>DJ-WORKSHOP: Grunderna</h1>\n<h3>[Info in English below]</h3>\n<p>Lär dig grunderna i att DJ:a för tango!<br>\n - Allt du behöver veta för att börja en spännande utmaning att sätta musik till tangoevenemang.</p>\n<p>Vi kommer att gå igenom:<br>\n * De viktigaste orkestrarna att ha med, och vilken stämning de tar fram hos dansarna<br>\n * Hur man kombinerar rätt orkestrar i en sekvens av tandor och cortinor under ett DJ-pass, både i teorin och med övningar<br>\n * Rekommenderarde musikspelare för Windows och Mac<br>\n * Vilken information du ska be om av arrangören innan du DJ:ar, och vad du bör tänka på i samband med dina första gig.</p>\n<p>Seminariet är tänkt för dig som ännu inte har börjat DJ:a men är &nbsp;intresserad att prova, och för dig som redan har prövat några gånger men &nbsp;vill ha mer kött på benen. Vi rekommenderar att du som vill börja DJ:a &nbsp;på Tangokompaniets praktilongor går workshopen, men det är öppet för &nbsp;alla som vill komma!</p>\n<p>Kombinera gärna med DJ-WORKSHOP: FÖRDJUPNING för att få en helhetsbild av hur du blir en uppskattad tango-DJ.</p>\n<p>Språket blir svenska eller engelska beroende på deltagare.</p>\n<p>Lärare är Per Berséus, som undervisar i tango på Tangokompaniet sedan &nbsp;2005 och DJ:ar på små och stora evenemang (t.ex. tangomaraton i New &nbsp;York och Puerto Rico, Köpenhamns Tangofestival, och såklart &nbsp;Tangokompaniets Festivalito). Per spelar också trumpet i Lunds &nbsp;Stadsorkester och har lång erfarenhet av att lyssna till och skapa &nbsp;musik.</p>\n<p>——————————<br>\n DJ WORKSHOP: THE BASICS</p>\n<p>Learn the basics of tango DJ:ing!<br>\n - Everything you need to know in order to embark on an exciting journey setting music to tango events.</p>\n<p>The session will cover:<br>\n * Major orchestras to include and what mood they set for the dancers<br>\n * How to combine the right orchestras into a sequence of tandas and &nbsp;cortinas during a DJ set, in theory and in practical exercises<br>\n * Recommended music playing software on Windows and Mac computers<br>\n * What information to ask the organizer for before you arrive, and what you need to think about for your first few gigs</p>\n<p>The workshop is intended for you who are not yet a DJ but are &nbsp;interested to give it a go, and for you who already tried DJing a few &nbsp;times but want to dig deeper. We recommend that you who want to start &nbsp;DJing at Tangokompaniet’s practilongas take the seminar, but it is open &nbsp;for anyone to attend!</p>\n<p>Combine with DJ WORKSHOP: GOING DEEPER in order to get a complete picture of how to become an appreciated tango DJ.</p>\n<p>Language will be English or Swedish depending on the participants.</p>\n<p>Your teacher is Per Berséus, who has been teaching tango at &nbsp;Tangokompaniet since 2005 and DJing at smaller and bigger events (e.g. &nbsp;tango marathons in New York and Puerto Rico, Copenhagen Tango Festival, &nbsp;and of course Tangokompaniet’s Festivalito). Per also plays the trumpet &nbsp;in Lund City Orchestra and has a solid background in the listening and &nbsp;creation of music.</p>\n<p>——————————</p>\n<p>DJ-WORKSHOP: FÖRDJUPNING</p>\n<p>[Info in English below]</p>\n<p>Dags för dig som redan har koll på grunderna att ta ditt tango-DJ:ande till nästa nivå!</p>\n<p>Under denna workshop fördjupar vi oss både i det konstnärliga hantverket och i de mer tekniska bitarna.</p>\n<p>Vi kommer att gå igenom:<br>\n * Hur man placerar olika låtar inom en tanda, så att dansarna känner både tillit och lust att dansa<br>\n * Hur man anpassar musiken efter vad dansarna behöver för stunden, och &nbsp;några exempel på vad som kan skilja en bra DJ från en dålig DJ<br>\n * Hur man bygger upp och systematiserar en egen samling med tangomusik<br>\n * Vad som behövs för att lyssna på andra låtar samtidigt som man spelar, &nbsp;vilka kablar du behöver ta med, backup-lösningar, hur man gör när &nbsp;uppvisningsparet kommer med en ipod, etc.</p>\n<p>Fördjupningen är tänkt för dig som har gått DJ-WORKSHOP: GRUNDERNA, &nbsp;eller har motvarande kunskaper. Det går utmärkt att ta bägge &nbsp;workshoparna under samma helg.</p>\n<p>Språket blir svenska eller engelska beroende på deltagare.</p>\n<p>Lärare är Per Berséus, som undervisar i tango på Tangokompaniet sedan &nbsp;2005 och DJ:ar på små och stora evenemang (t.ex. tangomaraton i New &nbsp;York och Puerto Rico, Köpenhamns Tangofestival, och såklart &nbsp;Tangokompaniets Festivalito). Per spelar också trumpet i Lunds &nbsp;Stadsorkester och har lång erfarenhet av att lyssna till och skapa &nbsp;musik.</p>\n<p>——————————-<br>\n DJ WORKSHOP: GOING DEEPER</p>\n<p>If you already know some of the basics of DJing for tango, this is where we take it to the next level!</p>\n<p>This workshop will have you going deeper into both the artful craftsmanship and the technical aspects.</p>\n<p>The session will cover:<br>\n * How to sequence songs within a tanda, so that you gain the trust of the dancers and boost their dancing joy<br>\n * How to adjust the music according to what the dancers need at the &nbsp;moment, and some examples on how a good DJ may differ from a bad one<br>\n * How to build up and organize a collection of tango music<br>\n * What is needed for listening to other songs that the one currently &nbsp;played for the dancers, what cables you need to bring, back-up &nbsp;solutions, what to do when the show couple comes with an iPod, etc.</p>\n<p>The workshop is ideal for you who already took DJ WORKSHOP: THE &nbsp;BASICS, or you may have similar knowledge. It works great to take both &nbsp;workshops on the same week-end.</p>\n<p>Language will be English or Swedish depending on the participants.</p>\n<p>Your teacher is Per Berséus, who has been teaching tango at &nbsp;Tangokompaniet since 2005 and DJing at smaller and bigger events (e.g. &nbsp;tango marathons in New York and Puerto Rico, Copenhagen Tango Festival, &nbsp;and of course Tangokompaniet’s Festivalito). Per also plays the trumpet &nbsp;in Lund City Orchestra and has a solid background in the listening and &nbsp;creation of music.</p>', '2019-10-15 14:23:55', '2019-10-15 14:23:55'),
(276, 'Summer', 'Crew', 'SV', '<h1>Crew</h1>\n<p>This year the crew that will be keeping the tango spirits high are…</p>\n<h1>Teachers</h1>\n<p><img alt=\"AnnaMartin4\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/AnnaMartin4-198x300.jpeg\" width=\"198\"/></p>\n<p><strong>Anna Sol &amp; Martin Nymann Pedersen</strong> are one of &nbsp;Scandinavias most experienced tango- dancers and teachers, working more &nbsp;than 20 years in the field. They teach regularly together &nbsp;in Copenhagen &nbsp;and tour around the globe. Their teaching is based on comfortability, &nbsp;musicality and presence and so does their dance, which also includes a &nbsp;bit of dramatical flair.</p>\n<p>Click <a href=\"https://www.youtube.com/watch?v=81BSaMwHwdU\">here</a> to see a performance with Anna &amp; Martin!</p>\n<p><img alt=\"daniel\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/daniel1-292x300.jpg\" width=\"292\"/> <img alt=\"linnea\" height=\"200\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/linnea-300x200.jpg\" width=\"300\"/></p>\n<p><strong>Daniel Carlsson &amp; Linnéa Andersson&nbsp;</strong>have deep &nbsp;knowledge in tango and movement and have been working together at &nbsp;Tangokompaniet a couple of years. We are glad to have them teaching and &nbsp;performing for the first time together at Tango Summer Festival Malmö &nbsp;2019!</p>\n<p><strong>Per Berseus</strong> is holding a tango DJ seminar in two &nbsp;parts during the festival. He has very good knowledge about music and &nbsp;tango DJing and will share his tips and tricks for you who want to &nbsp;become or be a better tango DJ.</p>\n<h1>DJs</h1>\n<p>Here is the line up of wonderful DJs during Summer Tango Malmö festival, who will keep you spirits high and your feet moving!</p>\n<p><strong>Monday – DJ Daniel Carlsson</strong></p>\n<p><img alt=\"daniel-dj-summer\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/daniel-dj-summer-300x300.jpg\" width=\"300\"/></p>\n<p><strong>Wednesday – DJ Johan Nordström</strong></p>\n<p><img alt=\"dj-johan\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/dj-johan-199x300.jpg\" width=\"199\"/></p>\n<p><strong>Thursday – DJ Micael Gonzalez Alonso &amp; Koki Lacherre</strong></p>\n<p><img alt=\"dj micael &amp; koki\" height=\"128\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/dj-micael-koki-300x128.jpg\" width=\"300\"/></p>\n<p><strong>Friday – DJ Per Berseus</strong></p>\n<p><img alt=\"summerper\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/summerper-300x300.jpg\" width=\"300\"/></p>\n<p><strong>Saturday – DJ Luis Cono</strong></p>\n<p><img alt=\"dj cono summer\" height=\"200\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/dj-cono-summer-300x200.jpg\" width=\"300\"/></p>\n<p><strong>Sunday – DJ Anita Doby</strong></p>\n<p><img alt=\"summeranita\" height=\"199\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/summeranita-300x199.jpg\" width=\"300\"/></p>\n<h1>Musicians</h1>\n<p>During the Thursday milonga we will have <strong>Carlos Quilici</strong> playing his bandeonon and <strong>Cipriano Calonico</strong> singing and playing guitar. Don’t miss this unique chance to hear and dance to their music!</p>\n<p><img alt=\"carlos-summer\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/carlos-summer-245x300.jpg\" width=\"245\"/><img alt=\"cipriano\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/cipriano-225x300.jpg\" width=\"225\"/></p>\n<p>Once again we have the fabulous <strong>Bandonegro Tango Orchestra</strong> &nbsp;at Summer Tango Malmö; we are SO looking forward to hearing and dancing &nbsp;to these very talented musicians! They will be playing during the &nbsp;Friday milonga.</p>\n<p><img alt=\"bandonegro\" height=\"170\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/bandonegro-300x170.jpg\" width=\"300\"/></p>\n<p>Click <a href=\"https://www.youtube.com/watch?v=Ih2HqWXDZeE\">here</a> to see a video with Bandonegro Tango Orchestra!</p>\n<p>And last but not least we have <strong>Pasaje Noruega </strong>from Argentina coming to play for us; don’t miss their presence!</p>\n<p><img alt=\"pasaje\" height=\"225\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/pasaje-300x225.jpg\" width=\"300\"/></p>', '2019-10-15 14:24:32', '2019-10-15 14:24:32'),
(277, 'Summer', 'Other information', 'SV', '<p>&nbsp;</p>\n<h1>Other information</h1>\n<h3>TK-Shop</h3>\n<p>Tangokompaniet has a wide variety of danceshoes; classical as well as &nbsp;sneakers. You can also find CDs and a collection of tangoclothing! The &nbsp;shop is situated at Tangokompaniet studio at Fredriksbergsgatan 7 in &nbsp;Malmö, which will be open during the Sunday of the event.</p>\n<h3><img alt=\"tkshop\" height=\"225\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/tkshop-300x225.jpg\" width=\"300\"/></h3>\n<h3>Accomodation</h3>\n<p>You can stay comfortable at one of Malmös many hotels. For prices and offers please check the site <a href=\"http://booking.com/\" title=\"http://booking.com\">booking.com</a></p>\n<p>For you who want more of a budget version, you can stay in our &nbsp;sleeping hall at Rörsjögatan 6 for a price of SEK 100- €10/night which &nbsp;includes a thick air mattress. You bring your own sleeping bag and &nbsp;towel. Don’t forget to register to get a spot!</p>\n<h3>Food and drinks</h3>\n<p>Malmö is the city in Sweden which has most restaurants and is known &nbsp;for being quite cheap! Wonder around and see what you can find and of &nbsp;course don’t forget to have a falafel!</p>', '2019-10-15 14:27:15', '2019-10-15 14:27:15'),
(278, 'Summer', 'Contact us', 'SV', '<p>&nbsp;</p>\n<h1>Contact</h1>\n<p>Please feel free to contact us if you have any questions:</p>\n<p>E-mail:&nbsp;<a href=\"mailto:anna@tangokompaniet.com\" title=\"mailto:anna@tangokompaniet.com?subject=SUMMER FESTIVAL question\">anna@tangokompaniet.com</a>&nbsp;or call at +46 (0)705 150345 .<br>\n (If you cannot get in touch with Anna call Daniel if necessary on +46 (0) 736 563609.</p>\n<p><img alt=\"danielannaskjorta\" height=\"300\" src=\"http://summer.tangokompaniet.com/wp-content/uploads/danielannaskjorta-200x300.jpg\" width=\"200\"/></p>', '2019-10-15 14:27:49', '2019-10-15 14:27:49'),
(279, 'About', 'Text', 'SV', '<p>Tangokompaniets hemsida är utvecklad av Per Gustav Eskilson.&nbsp;</p>\n<p>Har ni förslag på förbättringar eller hittar ni något fel så kontakta Per E på mobil 0733-780749 eller skicka email till &nbsp;paelsis@hotmail.com.</p>\n<p>Användargränssnittet är utvecklat med Facebooks populära javascript biblotek React JS (redux, material-ui). Detta användes även för utveckling av Facebook, Instagram, AirBnB och Uber. Backend systemet är utvecklat utvecklad i SLIM 3 som är ett PHP-ramverk med MySql database. Servern kör som en REST server.&nbsp;</p>', '2019-11-19 15:03:00', '2019-11-19 15:03:00'),
(283, 'PrivateLessons', 'General', 'ES', '<h1>Clases Particulares</h1>\n<p><br></p>\n<h2>General<br>\n</h2>\n<p>La compañía de tango ofrece clases privadas, ya sea que nunca antes haya bailado tango o que tenga años de experiencia. Las lecciones privadas son el método de enseñanza más efectivo porque se obtiene toda la atención del maestro. Sin embargo, pierde el contacto social con sus estudiantes si solo toma clases privadas y, por lo tanto, le recomendamos que combine estas dos formas de enseñanza. ritmo ... y mucho más</p>', '2019-12-15 07:20:36', '2019-12-15 07:20:36'),
(284, 'PrivateLessons', 'Prices', 'ES', '<h2>Precios</h2>\n<p><br>\nEn Suecia 600 SEK por lección de 60 minutos de alquiler local de INKL, es decir, si compra 5 o más lecciones privadas. 700 SEK si son dos alumnos y un maestro. Al enseñar en el extranjero se aplican otros precios: 600 DKK en Dinamarca700 NOK en Noruega100 CHF en Suiza70 EUR en Francia.80 EUR en Moscú85 USD en los EE. UU. Si se cancela más de 48 horas antes de que se cobre la clase 1 / 4 del precio de la lección. Al comprar varias lecciones al mismo tiempo, todas las lecciones deben tomarse dentro de un año desde la primera oportunidad de la lección.</p>\n<p>&nbsp;</p>', '2019-12-15 07:22:16', '2019-12-15 07:22:16'),
(285, 'Course', 'FT2', 'SV', '<h1>Förarteknik</h1>\n<p>Ingen planerad för tillfället men om du önskar dig detta eller andra teman så skriv gärna till Daniel.</p>', '2019-12-15 07:31:49', '2019-12-15 07:31:49'),
(286, 'EASTER', 'Start', 'SV', '\n\n<h3>Tangokompaniet welcomes you to the</h3>\n<h1>Tango Easter Festival in Malmö</h1>\n<p>THIS YEAR THE FESTIVAL WILL ONLY BE ONLINE DUE TO OUTBREAK OF THE COVID-VIRUS.</p>\n<p>During 10th to 12th of April 2020, we make a miniversion of the festival online, where you can imagine the rest of the festival. The space full of tango in many forms; dance, music, hugs and meetings. A celebration of tango life!</p>\n<p>Come and learn all the good stuff in tango so that you can enjoy this &nbsp;&nbsp;wonderful dance even more and be inspired by their performances in the &nbsp;&nbsp;evenings.</p>\n<p><br></p>\n<p><strong>We look forward to meet all of you at this wonderful week of tango online!</strong></p>\n<p><img alt=\"pichi dani 2\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/pichi-dani-2-466x700.jpg\" width=\"90%\" /></p>\n<p>I samarbete med</p>\n<p><img alt=\"mebo\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/mebo-300x119.jpg\" width=\"20%\"/></p>\n<p>och med stöd av</p>\n<h3><img alt=\"Malmostad_logo_webb_svartvit\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/Malmostad_logo_webb_svartvit.jpg\" width=\"10%\"/></h3>\n', '2020-01-27 06:25:40', '2020-01-27 06:25:40'),
(287, 'About', 'Text', 'ES', '<p>El sitio web de Tangkompaniet está desarrollado por Per Eskilson.<br>\n<br>\nSi tiene alguna sugerencia sobre cosas que deberían cambiarse o encuentra algo mal, llame a Per E al teléfono móvil 0733-780749 o envíe un correo electrónico a paelsis@hotmail.com.<br>\n<br>\nEl sitio web está desarrollado en React JS (redux, material-ui). El sistema de back-end se ejecuta en un servidor RESTLESS escrito en PHP con el marco SLIM 3. Los datos se almacenan en una base de datos MySql.</p>', '2020-02-04 10:24:51', '2020-02-04 10:24:51'),
(288, 'About', 'Text', 'EN', '<p>This website is developed by Per Eskilson.<br>\n<br>\nIf you have any suggestions on things that should be changed or find something wrong, call Per E on mobile 0733-780749 or send an email to paelsis@hotmail.com.<br>\n<br>\nThe website is developed in React JS (redux, material-ui). The backend system runs on a RESTLESS server written in PHP with SLIM 3 framework. The data is stored in a MySql database.</p>', '2020-02-04 10:25:48', '2020-02-04 10:25:48'),
(289, 'EASTER', 'Schedule', 'SV', '<h1>Schedule of Tango Easter Festival Malmö Online 2020</h1>\n<p><br></p>\n<h2>Friday 10th of April 2020, Online via Zoom<br>\n</h2>\n<p>18.00 - 19.30 ws 1. Leaders technique - ideas about leading and some practical excercices to do regularly at home (all levels - solo registration, 12 pers max)<br>\n</p>\n<p>20.45-21.00 &nbsp;Free instructions - How to invite and dance virtually / instruction to the virtual milonga<br>\n</p>\n<p>21.00-23.00 Milonga online (zoom/facebook) &nbsp;DJ Sten Odelberg</p>\n<p><br>\n</p>\n<h2>Saturday 11th of April 2020, Online via Zoom<br>\n</h2>\n<p>15.00-16.30 ws 2. Musicality in tango with Daniel - we will take a few songs analyzing them and looking at some rhythms (all levels - solo registration, 12 pers max)<br>\n</p>\n<p>17.00-18.00 ws 3. Intro for beginners with Anna &amp; Daniel - free and per donations (beg - no registration, via Facebook live)<br>\n</p>\n<p>18.10-19.40 &nbsp;ws 4. Kitchen tango with Anna &amp; Daniel, techniques and combinations for tango on smaller dance floor<br>\n(all levels - couple registration, 10 couples max)<br>\n</p>\n<p>19.45-20.00 &nbsp;Free instructions - How to invite and dance virtually / instruction to the virtual milonga<br>\n</p>\n<p>20.00-23.00 Milonga online (zoom/facebook) &nbsp;DJ Daniel &amp; DJ Anna&nbsp;</p>\n<p><br>\n</p>\n<h2>Sunday 12th of April 2020, &nbsp;Online via Zoom<br>\n</h2>\n<p>11.00-12.30 ws 5. Followers technique with Anna - &nbsp;ideas about following and some practical excercices to do regularly at home (all levels - solo registration, 12 pers max)<br>\n</p>\n<p>13.00-14.30 ws 6. Milonga aerobics with Anna - dancing solo milonga and having fun with steps and music</p>\n<p><img alt=\"pichi dani 2\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/pichi-dani-2-466x700.jpg\" width=\"466\" height=\"700\"/></p>\n<p>I samarbete med</p>\n<p><img alt=\"mebo\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/mebo-300x119.jpg\" width=\"300\" height=\"119\"/></p>\n<p>och med stöd av</p>\n<h3><img alt=\"Malmostad_logo_webb_svartvit\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/Malmostad_logo_webb_svartvit.jpg\" width=\"142\" height=\"190\"/></h3>', '2020-02-09 01:36:13', '2020-02-09 01:36:13'),
(290, 'EASTER', 'Schedule', 'ES', '<p><strong>Levels &amp; teachers:</strong> <em>beg</em>: Beginners in tango, totally new dancers <em>all levels</em>: All levels of dancers, intermediate to advanced, except complete beginners <em>exp/adv</em>: Only for experienced and advanced dancers. All venues are in Malmö&nbsp;</p>\n<h2>Friday 10th of April 2020, Online via Zoom</h2>\n<ul>\n  <li>18.00 - 19.30 ws 1. Leaders technique, ideas about leading and some practical excercices to do regularly at home<em>&nbsp;(all levels)</em></li>\n  <li>21.00 - 23.00 Milonga per FBlive and Zoom with DJ Sten</li>\n</ul>\n<h2>Saturday 11th of April 2020,&nbsp;Online via Zoom</h2>\n<ul>\n  <li>15.00-16.30 ws 2. Musicality in tango with Daniel&nbsp;(we will take a few songs analyzing them and looking at some rhythms)</li>\n  <li>17.00-18.00 ws 3. Intro for beginners - free and per donations</li>\n  <li>18.10-19.40 &nbsp;ws 4. Kitchen tango, techniques and combinations for tango on smaller dancefloor.</li>\n  <li>19.45-20.00 &nbsp;Free instructions - How to invite and dance virtually / instruction to the virtual milonga</li>\n  <li>20.00-23.00&nbsp;Milonga online (zoom/facebook) maybe live music and DJ Daniel and DJ Anna&nbsp;</li>\n</ul>\n<h2>Sunday 12th of April 2020, &nbsp;Online via Zoom</h2>\n<ul>\n  <li>11.00-12.30 ws 5. Followers technique&nbsp;</li>\n  <li>13.00-14.30 ws 6. Milonga aerobics</li>\n</ul>', '2020-02-09 01:36:28', '2020-02-09 01:36:28'),
(291, 'EASTER', 'Teachers', 'SV', '<p>Daniel and Anna runs Tangokompaniet together with some other dancers.<img src=\"http://www.theheartofgold.org/floyfloy/tangocamp/IMG_2079.jpg\" width=\"400\" height=\"600\"/></p>\n<p>Daniel Carlsson grew up in Malmö with a tangosinging mother. As a teenager he started dancing and was training o a daily basis with his sister the first years. &nbsp;After some years of dancing and teaching they started Tangokompaniet. They toured and later Daniel travelled to many maratons and about 20 times to Buenos Aires. Tango filled his life. Daniel toured with other dancers like Sigrid, Maria, Anna. In 2014 (becoming a father Daniel decided to work more in Scandinavia with Tangokompaniet. Daniel met Eva in different milongas and the dancing clicked.&nbsp;</p>\n<p><br></p>\n<p>Anna has been teaching and dancing tango for 20 years and is currently teaching regularly at tangokompaniet and m2 and travels giving workshops in the weekends.</p>', '2020-02-10 13:46:37', '2020-02-10 13:46:37'),
(292, 'EASTER', 'Teachers', 'EN', '<p>Daniel Carlsson grew up in Malmö with a tangosinging mother. As a teenager he started dancing and was training o a daily basis with his sister the first years. &nbsp;After some years of dancing and teaching they started Tangokompaniet. They toured and later Daniel travelled to many maratons and about 20 times to Buenos Aires. Tango filled his life. Daniel toured with other dancers like Sigrid, Maria, Anna. In 2014 (becoming a father Daniel decided to work more in Scandinavia with Tangokompaniet. Daniel met Eva in different milongas and the dancing clicked.&nbsp;</p>\n<p>Anna has been teaching and dancing tango for 20 years and is currently teaching regularly at tangokompaniet and m2 and travels giving workshops in the weekends.</p>', '2020-02-10 13:46:56', '2020-02-10 13:46:56'),
(293, 'REGISTRATION', 'LEGAL', 'ES', '<p>El registro de este curso es vinculante en el sentido de que debe pagar el curso incluso si no asiste. Tienes dos semanas para cancelar si aún no has comenzado el curso.</p>', '2019-01-22 08:02:16', '2020-02-11 15:28:35'),
(294, 'REGISTRATION', 'LEGAL', 'EN', '<p>This registration is binding. This means that you have to pay for the course/workshop even if you do not attend it. You have two weeks to cancel this registration if you have not already started the course.</p>', '2019-01-22 08:02:16', '2020-10-17 07:17:36'),
(295, 'REGISTRATION', 'LEGAL', 'SV', '<p>Denna anmälan är bindande, vilket innebär att du måste betala för kursen/eventet även om du inte dyker upp. Du har två veckor på dig om du vill cancellera anmälan såvida inte kursen/eventet redan startat.</p>', '2019-01-22 08:02:16', '2020-07-16 13:36:56'),
(296, 'REGISTRATION', 'IF_NO_MAIL', 'SV', '<p>Vänligen kontrollera din email och din skräpmail så att din bokning är bekräftad. Om så ej är fallet kontakta Tangokompaniet via email eller per telefon.</p>', '2019-01-22 08:02:16', '2020-07-16 13:35:55'),
(297, 'REGISTRATION', 'IF_NO_MAIL', 'EN', '<p>Please check your mailbox ans spam-mailbox to ensure that you have recived a confirmation on your registration confirmed. If not, please contact Tangkokompaniet by phone or mail.</p>', '2019-01-22 08:02:16', '2020-02-11 09:59:05'),
(298, 'REGISTRATION', 'IF_NO_MAIL', 'ES', '<p>Verifique su buzón y el buzón de correo no deseado para asegurarse de haber recibido una confirmación de su registro confirmado. De lo contrario, comuníquese con Tangkokompaniet por teléfono o correo.</p>', '2019-01-22 08:02:16', '2020-02-11 09:58:50'),
(299, 'EASTER', 'Prices', 'SV', '<p>Prices:&nbsp;</p>\n<p>150 SEK per workshop&nbsp;</p>\n<p>Beginners is for free but donations are most welcome</p>\n<p>Milonga in the evening but online 20.00-23.00. You are most welcome to join us live on facebook and you pay what you want -per donation. For a more complete experience we recommend to go to the milonga via zoom where you will be able to see each other and maybe even dance together. For registering to the milonga on zoom we will charge entry fee of 20 SEK and when you register we send you meetingID and password to keep it very secure.</p>\n<p>Before the milonga we will make a small instruction at 19.45 on zoom (you send a message to Daniel@tangokompaniet.com and get a zoom-password, entry fee will then be 20 SEK)</p>', '2020-04-01 10:43:04', '2020-04-01 10:43:04'),
(300, 'EASTER', 'Register', 'SV', '<p>Anmäl dig så snart du kan i formuläret nedan. Har du frågor så kontakta Daniel på email \n<a href=\"mailto:Daniel@tangokompaniet.com?subject=Påskfestival fråga\">Daniel@tangokompaniet.com</a>, eller via telefon 0736-563609.</p>', '2020-04-01 10:45:02', '2021-10-27 08:24:06'),
(301, 'EASTER', 'Venues', 'SV', '<p>We will have to make this festival online - facebook and zoom. It might be good to dowload zoom allready now. https://zoom.us/download#client_4meeting Once you register you will get passwords and meetingIDs and more information. Some workshops will be for couples and some for solodancers.</p>', '2020-04-01 10:45:39', '2020-04-01 10:45:39'),
(302, 'EASTER', 'Contact Us', 'SV', '<h1>Contact infomation</h1>\n\n<p>E-mail to Daniel: <a href=\"mailto:daniel@tangokompaniet.com?subject=EASTER FESTIVAL - fråga från kund\">daniel@tangokompaniet.com</a></p>\n\n<p>Phone to Daniel: 0046-(0)73 6563609</p>', '2020-04-01 10:46:53', '2020-04-01 10:46:53'),
(303, 'EASTER', 'Contact Us', 'ES', '<p>E-mail to Daniel: <a href=\"mailto:daniel@tangokompaniet.com\">daniel@tangokompaniet.com</a></p>\n<h1>Contact infomation</h1>\n<p>Phone to Daniel: 0046-(0)73 6563609</p>', '2020-04-01 10:47:00', '2020-04-01 10:47:00'),
(304, 'EASTER', 'Venues', 'ES', '<p><br></p>\n<p>We will have to make this festival online - facebook and zoom. It might be good to dowload zoom allready now. https://zoom.us/download#client_4meeting Once you register you will get passwords and meetingIDs and more information. Some workshops will be for couples and some for solodancers.</p>', '2020-04-01 10:47:31', '2020-04-01 10:47:31'),
(306, 'EASTER', 'Prices', 'ES', '<p>Prices:&nbsp;</p>\n<p>150 SEK per workshop&nbsp;</p>\n<p>Beginners is for free but donations are most welcome</p>\n<p>Milonga 20.00-23.00 with small instruction at 19.45. You are mot welcome and you pay what you want -per donation</p>', '2020-04-01 10:48:21', '2020-04-01 10:48:21'),
(307, 'EASTER', 'Teachers', 'ES', '<p>Daniel Carlsson grew up in Malmö with a tangosinging mother. As a teenager he started dancing and was training o a daily basis with his sister the first years. &nbsp;After some years of dancing and teaching they started Tangokompaniet. They toured and later Daniel travelled to many maratons and about 20 times to Buenos Aires. Tango filled his life. Daniel toured with other dancers like Sigrid, Maria, Anna. In 2014 (becoming a father Daniel decided to work more in Scandinavia with Tangokompaniet. Daniel met Eva in different milongas and the dancing clicked.&nbsp;</p>\n<p>Anna has been teaching and dancing tango for 20 years and is currently teaching regularly at tangokompaniet and m2 and travels giving workshops in the weekends.</p>', '2020-04-01 10:48:46', '2020-04-01 10:48:46'),
(308, 'EASTER', 'Start', 'ES', '<h3>Tangokompaniet welcomes you to the</h3>\n<h1>Tango Easter Festival in Malmö</h1>\n<p>THIS YEAR THE FESTIVAL WILL ONLY BE ONLINE DUE TO OUTBREAK OF THE COVID-VIRUS.</p>\n<p>During 10th to 12th of April 2020, we make a miniversion of the festival online, where you can imagine the rest of the festival. The space full of tango in many forms; dance, music, hugs and meetings. A celebration of tango life!</p>\n<p>Come and learn all the good stuff in tango so that you can enjoy this &nbsp;&nbsp;wonderful dance even more and be inspired by their performances in the &nbsp;&nbsp;evenings.</p>\n<p><br></p>\n<p><strong>We look forward to meet all of you at this wonderful week of tango online!</strong></p>\n<p><img alt=\"pichi dani 2\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/pichi-dani-2-466x700.jpg\" width=\"466\" height=\"700\"/></p>\n<p>I samarbete med</p>\n<p><img alt=\"mebo\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/mebo-300x119.jpg\" width=\"300\" height=\"119\"/></p>\n<p>och med stöd av</p>\n<h3><img alt=\"Malmostad_logo_webb_svartvit\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/Malmostad_logo_webb_svartvit.jpg\" width=\"142\" height=\"190\"/></h3>', '2020-04-01 10:51:05', '2020-04-01 10:51:05'),
(309, 'DanielNews', 'Column1', 'SV', '<h2>Nyheter från Daniel</h2>\n<p>Vårens kurser är planerade! Vi skjuter upp kursstarten för Lund. Vi startar kurserna i Malmö med lägre maxantal och fasta partners. Vi rekommenderar alla som kan attta lektionerna online. Vi skjuter upp festivaler och maraton tillsvidare. Har du frågor är det bara att höra av sig. I studion har vi dessutom en skobutik med tangoskor och vi hyr ut studion till events. Kanske planerar du för ngt event i sommar eller höst ?Allt detta hittar du här på sidan !</p>', '2020-05-29 16:36:51', '2020-05-29 16:36:51'),
(310, 'DanielNews', 'Column2', 'SV', '<h2>Tabell</h2>\n<table>\n   <thead>\n      <td>Kolumn 1</td>\n      <td>Kolumn 2</td>\n      <td>Kolumn 3 </td>\n   </thead>\n   <tbody>\n      <tr>\n         <td>Värde (1,1)</td>\n         <td>Värde (1,2)</td>\n         <td>Värde (1,3)</td>\n      </tr>\n      <tr>\n         <td>Värde (2,1)</td>\n         <td>Värde (2,2)</td>\n         <td>Värde (2,3)</td>\n      </tr>\n      <tr>\n         <td>Värde (3,1)</td>\n         <td>Värde (3,2)</td>\n         <td>Värde (3,3)</td>\n      </tr>\n   </tbody>\n</table>', '2020-05-29 16:36:52', '2020-05-29 16:36:52'),
(311, 'DanielNews', 'Column3', 'SV', '<h2>Tabell</h2>\n<table>\n   <thead>\n      <td>Kolumn 1</td>\n      <td>Kolumn 2</td>\n      <td>Kolumn 3 </td>\n   </thead>\n   <tbody>\n      <tr>\n         <td>Värde (1,1)</td>\n         <td>Värde (1,2)</td>\n         <td>Värde (1,3)</td>\n      </tr>\n      <tr>\n         <td>Värde (2,1)</td>\n         <td>Värde (2,2)</td>\n         <td>Värde (2,3)</td>\n      </tr>\n      <tr>\n         <td>Värde (3,1)</td>\n         <td>Värde (3,2)</td>\n         <td>Värde (3,3)</td>\n      </tr>\n   </tbody>\n</table>', '2020-05-29 16:36:54', '2020-05-29 16:36:54'),
(312, 'Teacher', 'IC', 'SV', '<p>Ida undervisar på Tangokompaniet sedan några år tillbaka.</p>', '2020-06-01 05:18:48', '2020-06-01 05:18:48'),
(316, 'REGISTRATION', 'PAYMENT', 'ES', '<p>If payment made via internet (SWISH or Bank) please put the order number (orderId) into the message field.</p>', '2019-01-22 08:02:16', '2020-02-11 15:28:35'),
(317, 'REGISTRATION', 'PAYMENT', 'EN', '<p>If payment made via internet (SWISH or Bank) please put the order number (orderId) into the message field.</p>', '2019-01-22 08:02:16', '2020-02-11 15:28:35'),
(318, 'REGISTRATION', 'PAYMENT', 'SV', '<p>Vid betalning via SWISH eller banggiro, ange order nummer (orderId) i meddelande fältet</p>', '2019-01-22 08:02:16', '2020-02-11 15:28:35');
INSERT INTO `tbl_text_21Jan22` (`id`, `groupId`, `textId`, `language`, `textBody`, `creaTimestamp`, `updTimestamp`) VALUES
(319, 'Course', 'ONL_FT', 'SV', '<p>Tango Följarteknik 2 &amp; 3 - fortsättningen<br>\n</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå.<br>\n</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har gått Tango följarteknik 1. OBS! Max 12 deltagare.<br>\n</p>\n<p>Plats: Online på Zoom eller på plats i Tangokompaniet studio. Väljer du att vara med online använder vi oss av programmet Zoom. Vi ser vi varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.<br>\n</p>\n<p>Pris: 1750 kr. Från Sverige betalar du genom Swish till Anna Solakius på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com&nbsp;</p>\n<p>Längd: 10 gånger, start 14e januari 2021, kl 20.30-22.00. Denna kurs går på torsdagar.</p>\n<p><br>\nFör frågor kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345. VÄLKOMMEN!</p>\n<p><br>\n<a href=\"http://tangokompaniet.com/?fbclid=IwAR1KrmV4FwELxu-6FHEC4EkfLHQ9wkPjW61KpKScFGNZLpevO3UEHMn16ZM\" rel=\"nofollow noopener\" target=\"_blank\">tangokompaniet.com</a></p>\n<p><br></p>\n<p>---------------------------------------------------------------------------------------------------</p>\n<p>Tango Training Online - teknik &amp; koreografi / technique &amp; choreo - with Anna Sol</p>\n<p><br></p>\n<p>This course is for you who wants to train your tango as a follower, practicing both technique and small sequences. We are going to look in to techniques, movements, mechanics, concept, musicality and that through practicing our tango technique and small sequences, steps, choreographies.</p>\n<p><br></p>\n<p>The course material suits more experienced tango followers and it\'s a plus if you have taken the Tango Followers Technique 1, 2 and 3 to participate.</p>\n<p><br></p>\n<p>You register without partner on Tangokompaniet.com. OBS! Max 12 participants.</p>\n<p><br></p>\n<p>Venue: At home online on Zoom. You download zoom on your computer or iPad and you get an invitation link to be able to participate. We can see and communicate with each other during the class.</p>\n<p><br></p>\n<p>Price: SEK 1750&nbsp;</p>\n<p>The course goes over 10 lessons, starting the 18th of January 2021 at 19.00-20.30. From Sweden you pay through Swish to Anna Solakius on 0705150345. From abroad you pay through PayPal to anna@tangokompaniet.com&nbsp;</p>\n<p><br></p>\n<p>Questions? Please contact Anna Sol through messenger or at anna@tangokompaniet.com or 0705-150345.&nbsp;</p>\n<p><br></p>\n<p>WELCOME!</p>\n<p><br></p>\n<p>tangokompaniet.com</p>\n<p><br></p>\n<p>-------------------------------------------------------------</p>\n<p><br></p>\n<p>Tango Träning Online - teknik &amp; koreografi - med Anna Sol&nbsp;</p>\n<p><br></p>\n<p>Kursen är till för dig som vill lära dig som vill träna din tango på djupet. Vi kommer träna teknik, rörelse, titta på mekanik, musik, olika koncept genom att träna både vår tangoteknik och små stegkombinationer/koreografi.&nbsp;</p>\n<p><br></p>\n<p>Kursens material passar erfarna följare. Det är av fördel att ha gått Tango Följarteknik 1, 2 och 3.</p>\n<p><br></p>\n<p>Du anmäler dig utan partner på tangokompaniet.com. OBS! Max 12 deltagare.&nbsp;</p>\n<p><br></p>\n<p>Plats: Online på Zoom. Vi ser varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.&nbsp;</p>\n<p><br></p>\n<p>Pris: 1750 kr.</p>\n<p>&nbsp;Från Sverige betalar du genom Swish till Anna Solakius på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com&nbsp;</p>\n<p><br></p>\n<p>Längd: 10 gånger, start 18e januari 2021, kl 19.00-20.30.</p>\n<p><br></p>\n<p>Frågor? Kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345.&nbsp;</p>\n<p><br></p>\n<p>VÄLKOMMEN!</p>\n<p><br></p>\n<p>tangokompaniet.com</p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p><img src=\"http://tk.local:8080/user/anna/images/följarteknikspegel.jpg\"/></p>', '2020-07-22 06:56:58', '2020-07-22 06:56:58'),
(320, 'Course', 'ONL_FK', 'SV', '<p>Vill du träna tango skönt och avslappnat hemma i ditt eget vardagsrum? Då har du chansen att vara med på Tangokompaniets Onlinekurs med Anna Sol &amp; Daniel Carlsson!<br>\n</p>\n<p>Det du behöver är en danspartner, en dator/platta och en schysst internetuppkoppling. Ett vardagsrumsgolv räcker gott och väl som plats.<br>\n</p>\n<p>Kursen vänder sig till dig som är fortsättare i tango, dvs har sina grunder och har dansat ett tag. Tillsammans kommer vi göra övningar, öva steg och kommunikation i dansen, gå in i musiken och köra teknik. Vi kommer se och kunna kommunicera med varandra under hela lektionen, precis som på en vanlig lektion. Max antal deltagande par; 10 st.<br>\n</p>\n<p>Vi kommer använda oss av programmet Zoom. Vi hjälper dig installera och guida dig så du vet hur det fungerar, om du behöver det.<br>\n</p>\n<p>Kursen kostar 2625 kr/person och innehåller 15 lektioner a 1,5 h. Det finns också tillgängligt videomaterial som sammanfattar alla lektionerna.<br>\n</p>\n<p>För anmälan vänligen gå in på länken nedan!<br>\n</p>\n<p>Har du några frågor så kontakta Anna Sol på anna@tangokompaniet.com eller 0705-150345<br>\n</p>\n<p>Hjärtligt välkommen!<br>\n</p>', '2020-07-22 06:58:07', '2020-07-22 06:58:07'),
(321, 'PrivateLessons', 'Teachers', 'ES', '<h2>Que imparten clases particulare</h2>', '2018-01-25 15:22:23', '2020-07-27 14:15:47'),
(322, 'SUMMER', 'Start', 'SV', '<p>Sommarfestivalen ställdes in pga COVID !</p>', '2020-07-31 23:07:39', '2020-07-31 23:07:39'),
(323, 'FESTIVALITO', 'Start', 'SV', '<p>Välkommen till Tangokompaniet höstfestival; <strong>TANGO FESTIVALITO MALMÖ 3-5 december 2021.</strong></p>\n<p>En helg full av intressanta workshops, milongas, shows och tango för alla!</p>\n<p>Observera att Sverige har nya regler fr o m 1 december 2021 som innebär att fredag och lördag kväll på Festivalito kräver vaccinpass som visar att man tagit 2 vaccindoser.</p>\n<p><br></p>\n<p><img src=\"https://www.tangokompaniet.com/app/slim/public/user/../images/festivalito/tangarte-500x281.jpg\" width=\"500\" height=\"281\"/></p>\n<p>Våra lärare denna helg; Anna Sol &amp; Martin Pedersen och Eva Lehrman &amp; Daniel Carlsson kommer att ge workshops och tangouppvisningar. Vi har Tangarte som spelar till dans i form av kvintett med sångerska. Det ska bli fantastiskt fint med dans till levande musik.</p>\n<p><br></p>\n<p>Vi ser fram till att se dig!</p>\n<p><br></p>\n<p><br></p>', '2020-07-31 23:08:26', '2020-07-31 23:08:26'),
(324, 'FESTIVALITO', 'Schedule', 'SV', '<p><br>\n</p>\n<h1><strong>Schema TANGO FESTIVALITO MALMÖ 3-5 december 2021.</strong></h1>\n<p><br></p>\n<p><strong>Nivåer:</strong></p>\n<h3><em><strong>Tango Basics är för dig som är helt ny eller som vill repetera de första grunderna.</strong></em></h3>\n<p><em><strong>All levels är för dig som är fortsättare och uppåt.</strong></em></p>\n<p><em><strong>Erfarna/Avancerade är för just denna nivå.</strong></em></p>\n<p><br></p>\n<p><em><strong>Schema:</strong></em></p>\n<h3>Fredagen 3/12 dansar vi på <a href=\"https://goo.gl/maps/p6mkmhiRrpmMQEnB7\">Barnens Scen</a>, Falsterbogatan 5 inne i Folkets Park i Malmö.</h3>\n<p>Kl 17.00-18.30: <strong>Workshop: Abrazo, kontakt och musikalitet</strong> med Daniel och Eva <em>(all levels) </em>Utforska omfamningen, hur vi skapar kontakt i paret och kopplar det till tangomusiken.</p>\n<p>Kl 18.30-19.45: <strong>Tango Basics</strong> med Anna och Daniel - tangoklass för dig som är ny i tango</p>\n<p>Kl 19.30-01.00: <strong>Tangokväll</strong> med Quinteto Tangarte och sångerska, show med Anna Sol &amp; Daniel Carlsson och TDJ Johan Nordström spelar till dans.&nbsp;</p>\n<p><br></p>\n<h3>Lördag 4/12 dansar vi i Limhamn där vi samarbetar med <a href=\"https://goo.gl/maps/9yBMfWr17zPsgBru9\">Arriba Tango</a>, Limhamnsvägen 111 F</h3>\n<p>Kl 12.00-13.30: <strong>Workshop: &nbsp;Volcadas</strong> med Daniel och Eva. Vi leker med framåtlutningar och det fria benet. För er som har dansat en del och bland annat känner er bekväma i tät omfamning.</p>\n<p>Kl 13.30-15.00: <strong>Workshop: Colgadas</strong> med Daniel och Eva. Vi leker med att ta vår balans \"ur axel\" och finner härliga kombinationer. För er som har dansat mycket tango och känner att ni har lätt för att känna av partnern och hitta er balansaxel samt byta kontaktpunkter.</p>\n<p>Kl 15.15-18.15: <strong>Workshop: Milonga</strong> med Daniel och Eva <em>(all levels - dubbelworkshop)</em>. Låt oss dansa milonga! Vi tränar på rytmer och allt smått och gott och vanligt i milongan, så vi har en bra bas och flyt till musiken. Kanske vi får in några finurligheter på köpet också!</p>\n<p>Denna workshop anmäler du dig tillsammans med en partner till. Vi gör inga partnerbyten under lektionen. Vi tar en liten paus mitt i workshopen.</p>\n<p>Kl 18.15-19.30 <strong>Tango Basics</strong> med Anna och Tommy - tangoklass för dig som är ny i tango</p>\n<p>Kl 19.30-01.00 <strong>Tangokväll </strong>med TDJ Luis Cono och show med Daniel Carlsson och Eva Lehrmann</p>\n<p><br></p>\n<h3>Söndag 5/12 dansar vi på <a href=\"https://goo.gl/maps/AFAjdRwVWsWMANfLA\">Tangokompaniets Studio</a> på Fredriksbergsgatan 7, Malmö</h3>\n<p>Kl 13.00 - 14.30: <strong>Vals</strong> med Anna o Martin <em>(all levels) </em>Vi dyker in i den härliga tangovalsen med dess rytmik och hittar passande och fartfyllda kombinationer.</p>\n<p>Kl 14.30 - 17.30: <strong>Dramatic moves</strong> med Anna o Martin <em>(all levels - dubbelworkshop)</em> Upplev att kunna tolka den dramatiska delen av tangon, med både dess explosivitet och subtilitet. Vi tränar på tekniker som låter oss få tillgång till ett stort spektra av möjligheter att tolka denna slags musik och härliga, lyxiga rörelser som passar denna drama! Vi tar en liten paus mitt i workshopen.</p>\n<p>Kl 17.30-19.00: <strong>Tango Basics</strong> med Daniel och Ida - tangoklass för dig som är ny i tango</p>\n<p>Kl 19.00-22.30: <strong>Tangokväll </strong>med TDJ Per Berseus och show med Anna Sol och Martin Nymann Pedersen</p>', '2020-10-13 22:11:21', '2020-10-13 22:11:21'),
(325, 'FESTIVALITO', 'Prices', 'SV', '<h2>Priser</h2>\n<p>Workshops och seminarier kostar mellan 100-250 kr/st beroende på hur mycket du bokar.&nbsp;</p>\n<p>En enskild workshop om 1,5 h kostar 250 kr, En dubbelworkshop varar 3 h och det räknas som 2 workshops.&nbsp;</p>\n<p>Vi har ett <em>litet workshoppaket</em> om 4 ws dvs 6 h undervisning för 800 kr</p>\n<p>Vi har ett <em>&nbsp;festivalpaket</em> om 6 ws dvs 9 h undervisning inkl all socialdans för 1250 kr</p>\n<p>Vi har det Lyx festival paketet där du kan gå allt du vill dvs välj mellan 8 workshops, 3 basic lektioner och alla danskvällar för 1500 kr.</p>\n<p>En introklass/basic med efterföljande danskväll kostar 250 kr. Bokar du alla tre basic med efterföljande tre danskvällar får du mängdrabatt och betalar 500 kr.</p>\n<p>Tangokväll med levande musik och show av Anna och Daniel på fredagen kostar 180 kr (150 kr för Camarins medlemmar, brorabatt till danskar, Tks terminskursdeltagare)</p>\n<p>Tangokväll med show på lördagen: 110 kr show av Eva och Daniel</p>\n<p>Tangokväll med överraskning på söndagen: 110 kr show av Anna och Martin</p>\n<p>Du kan boka alla tre kvällarna i ett <em>danspaket</em> för 300 kr.&nbsp;</p>\n<p><br></p>\n<p>Allt betalas efter anmälan i vår kalender här på hemsidan. Anmäler du dig till mer än en sak räknar du samman summan och betalar allt på en gång. Skriv ”Festivalito” som meddelande. Betalningsinfo kommer i email i bekräftelsemej.</p>\n<p>Har du några frågor så kontakta Daniel Carlsson på daniel@tangokompaniet.com eller 0736563609</p>', '2020-10-13 22:12:34', '2020-10-13 22:12:34'),
(326, 'FESTIVALITO', 'Venues', 'SV', '<p>Fredagen är vi på <a href=\"https://goo.gl/maps/p6mkmhiRrpmMQEnB7\">Barnens scen</a>, Folkets park i Malmö, lördagen är på <a href=\"https://goo.gl/maps/9yBMfWr17zPsgBru9\">Arriba</a> på Limhamnsvägen 111 och på söndagen är vi på <a href=\"https://goo.gl/maps/AFAjdRwVWsWMANfLA\">Tangokompaniet studio</a> på Fredriksbergsgatan 7. Hela helgen i Malmö</p><p/>Om du klickar på understrukna länkarna i texten så kommer du till google maps karta med platserna.\n', '2020-10-13 22:13:05', '2020-10-13 22:13:05'),
(327, 'FESTIVALITO', 'Contact Us', 'SV', '<p>Har du frågor eller funderingar så kontakta Daniel Carlsson på \n<a href=\"mailto:daniel@tangokompaniet.com?subject=Customer question Festivalito\">daniel@tangokompaniet.com</a> eller mobil 0736-563609.</p>', '2020-10-13 22:13:15', '2020-10-13 22:13:15'),
(328, 'FESTIVALITO', 'Register', 'SV', '<p>Anmäl dig så snart du kan i formuläret nedan. Har du frågor så kontakta Daniel på email <a href=\"mailto:Daniel@tangokompaniet.com?subject=Festivalito fråga\">Daniel@tangokompaniet.com</a>, eller via telefon 0736-563609.&nbsp;</p>\n<p>Viktig nyhet !!</p>\n<p>Vaccinationsbevis</p>\n<p>På två av våra programpunkter under Festivalito kommer det att krävas vaccinationsbevis för alla besökare. Fredag kväll på Barnens scen och lördag kväll på Limhamnsvägen 111. Dessa två kvällar har möjlighet att ta emot fler än 100 besökare. Enligt de nya regler som börjar gälla 1/12 2021 för events utan fasta sittplatser och där man beräknar att man har mer än 100 besökare inomhus ska man begära Covidbevis som i Sverige kommer att innebära att man visar att man fått sina vaccindoser. Har du e-legitimation går detta snabbt. Har du inte e-legitimation rekommenderar vi dig att skaffa detta snarast möjligt. Det är Europeiska vaccinpass som godkänns.&nbsp;</p>\n<p>Övriga punkter på Festivalitoprogrammet riktar sig till färre personer än 100 och omfattas därför inte av dessa regler. Då alla övriga programpunkter har maxantal är det bra om du föranmäler dig så att du är säker på att få delta.&nbsp;</p>\n<p>Vi förutsätter att alla som kommer är friska och att de som har symptom testar sig. Föranmälan sker på <a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2FTangokompaniet.com%2Ffestivalito%3Ffbclid%3DIwAR3MdLuWNMQvwQbGTQxQgcH649juixLsyYIjdXKOiSFR4V7UncM9ip55Spw&amp;h=AT0J7xP8NA28c_-Bsr_GNMJ3o_N59CEdiRh2Wwfs1q8kyVtYLj450vi1B-n799FzDU4DN0uEFp2t7FNJ1CIJfZdvGtQVieNE7rMB-qgiMWeZb0EQ_nk3MhuWGTnAfHrbzw6KEtA&amp;__tn__=-UK-R&amp;c[0]=AT2Hnvg1t5Ch-5d-zmLHahyjUupHTameM8fv0IQDgjXW4epg3VgpAE4yoT3_FH0hLHr0YWFnjumUJVXyOOqVZFW8r4_oVcoV9miSjN1NReFrkuYfUSfCsUYdrdoJ1z5woy6stBRGb5rTPyMPUq1z3gaXkkPVPPz4UyVSdRYo0ffDZG4M0LPUHfKAj3Q\" rel=\"nofollow noopener\" target=\"_blank\">Tangokompaniet.com/festivalito</a> . Är det så att du har medicinska intyg på varför du inte kunnat slutföra din vaccination ska detta godtas enligt de nya reglerna. Är det så att du pga dessa nya regler behöver ställa in ditt deltagande behöver du kontakta Daniel@tangokompaniet.com asap, senast 1 december.</p>\n<p>På regeringen.se står det bland annat <br>\n\"Vaccinationsbevis kan beställas på <a href=\"http://www.covidbevis.se/?fbclid=IwAR0WsrRvtMAROfQF3WhNaM0vgyEWXxZ2fiItxhNtqbTafB4rfrmoBRysYLs\" rel=\"nofollow noopener\" target=\"_blank\">www.covidbevis.se</a></p>\n<p>För personer utan e-legitimation tar det längre tid att beställa ett vaccinationsbevis eftersom det blir fler manuella moment för att säkerställa att alla vaccinationsbevis hamnar hos rätt personer. Så är det redan idag och det kan bli ännu längre väntetider nu när vaccinationsbeviset ska användas nationellt. Om du inte vill vänta i onödan uppmanar vi dig som ännu inte har skaffat e-legitimation att göra detta, till exempel i form av ett mobilt bank-ID. Då kan du beställa ditt vaccinationsbevis på bara några minuter.\"</p>\n<p>Förbered gärna dina handlingar i god tid.</p>\n<p>Välkomna !</p>', '2020-10-20 16:29:28', '2020-10-20 16:29:28'),
(329, 'Course', 'ONL_FT5', 'SV', '<p>Tango Följarteknik 1 - basen<br>\n</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå.<br>\n</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som åtminstone har gått en grundkurs i tango eller mer. OBS! Max 12 deltagare.<br>\n</p>\n<p>Plats: Online genom Zoom. Vi ser vi varandra och kan kommunicera genom datorn/plattan. Du laddar ner programmet på din dator/platta och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.<br>\n</p>\n<p>Pris: 895 kr. Från Sverige betalar du genom Swish till Anna Solakius på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com&nbsp;</p>\n<p><br></p>\n<p>Längd: 5 gånger</p>\n<p><br></p>\n<p>Schema:</p>\n<p>Måndagar: Gå kursen på måndagar start 6e september 2021, kl 17.30-19.00.&nbsp;</p>\n<p>Torsdagar: Gå kursen på torsdagar start den 2e september 2021, kl 20.30-22.00&nbsp;</p>\n<p>För frågor kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345.&nbsp;</p>\n<p>VÄLKOMMEN!</p>\n<p>Anmäl dig längst ner på sidan!</p>\n<p><br></p>\n<p><br></p>\n<p><br></p>\n<p>Tango Följarteknik 2 - fortsättningen<br>\n</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå.<br>\n</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har gått Tango följarteknik 1. OBS! Max 12 deltagare.<br>\n</p>\n<p>Plats: Online på Zoom eller på plats i Tangokompaniet studio. Väljer du att vara med online använder vi oss av programmet Zoom. Vi ser vi varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.<br>\n</p>\n<p>Pris: 895 kr. Från Sverige betalar du genom Swish till Anna Solakius på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com&nbsp;</p>\n<p><br></p>\n<p>Längd: 5 gånger</p>\n<p><br></p>\n<p>Måndagar: Gå kursen på måndagar start 11e oktober 2021, kl 17.30-19.00.&nbsp;</p>\n<p>Torsdagar: Gå kursen på torsdagar start den 7e oktober 2021, kl 20.30-22.00&nbsp;</p>\n<p>För frågor kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345.&nbsp;</p>\n<p>VÄLKOMMEN!</p>\n<p>Anmäl dig längst ner på sidan!</p>\n<p><br></p>\n<p><br></p>\n<p>Tango Följarteknik 3 - rebotes &amp; boleos&nbsp;</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå.&nbsp;</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har sina grunder i argentinsk tango och det är ett pluss om man gått Tango följarteknik 1 och 2. OBS! Max 12 deltagare.</p>\n<p>Plats: Online på Zoom. Vi ser varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.&nbsp;</p>\n<p>Pris: 895 kr. Från Sverige betalar du genom Swish på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com</p>\n<p><br></p>\n<p>Längd: 5 gånger</p>\n<p><br></p>\n<p>Måndagar: Gå kursen på måndagar start 15e november 2021, kl 17.30-19.00.&nbsp;</p>\n<p>Torsdagar: Gå kursen på torsdagar start den 18e november 2021, kl 20.30-22.00&nbsp;</p>\n<p>För frågor kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345.&nbsp;</p>\n<p>VÄLKOMMEN!</p>\n<p>Anmäl dig längst ner på sidan!</p>\n<p><br></p>\n<p>Tango Följarteknik 4 - sacadas &amp; ganchos&nbsp;</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå.&nbsp;</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har sina grunder i argentinsk tango och det är ett pluss om man gått Tango följarteknik 1 och 2. OBS! Max 12 deltagare.</p>\n<p>Plats: Online på Zoom. Vi ser varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.&nbsp;</p>\n<p>Pris: 895 kr. Från Sverige betalar du genom Swish på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com</p>\n<p>Längd: 5 gånger</p>\n<p>Kursen har ingen planerad startpunkt just nu.</p>\n<p>För frågor och anmälan kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345. VÄLKOMMEN!</p>\n<p><a href=\"http://tangokompaniet.com/?fbclid=IwAR0KZiqSQj8r9vmu7gWlGRIkCOpkofD3RyhUd6soZxo33x4CnsmhfFUjoKY\" rel=\"nofollow noopener\" target=\"_blank\">tangokompaniet.com</a></p>\n<p><br></p>\n<p>Schema:</p>\n<p>Torsdagar: Gå kursen på KVÄLLSTID på torsdagar start 8e april 2021, kl 20.30-22.00.&nbsp;</p>\n<p><br></p>\n<p>PYNTA DIN TANGO - utsmyckningar för följare</p>\n<p>Vill du uttrycka dig mer till musiken som följare i tango och bli säkrare på dina adornos/utsmyckningar? Låt oss pynta vår dans tillsammans och med musiken!</p>\n<p>Vi tränar på olika pynt och kikar på både den tekniska och musikaliska aspekten. Kursen passar dig på fortsättar/erfaren nivå i argentinsk tango.</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har sina grunder i argentinsk tango. OBS! Max 12 deltagare.</p>\n<p>Plats: Online via Zoom. Vi ser varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.</p>\n<p>Pris: 895 kr. Från Sverige betalar du genom Swish på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com</p>\n<p>Längd: 5 gånger, start 3e maj 2021, kl 19.15-20.45.<br>\nFör frågor och anmälan kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345. VÄLKOMMEN!</p>\n<p><br></p>\n<p>PYNTA DIN TANGO 2 - utsmyckningar för följare - fortsättningen</p>\n<p>Vill du uttrycka dig mer till musiken som följare i tango och bli säkrare på dina adornos/utsmyckningar? Låt oss pynta vår dans tillsammans och med musiken!</p>\n<p>Vi tränar på olika pynt och kikar på både den tekniska och musikaliska aspekten. Kursen passar dig på fortsättar/erfaren nivå i argentinsk tango.</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har sina grunder i argentinsk tango. OBS! Max 12 deltagare.</p>\n<p>Plats: Online via Zoom. Vi ser varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.</p>\n<p>Pris: 895 kr. Från Sverige betalar du genom Swish på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com</p>\n<p>Längd: 5 gånger, måndagar start 6e september 2021, kl 19.15-20.45.</p>\n<p><br>\nFör frågor och anmälan kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345. VÄLKOMMEN!</p>\n<p><br></p>\n<p><br></p>', '2021-01-07 18:52:58', '2021-01-07 18:52:58'),
(330, 'Covid19', 'Column1', 'SV', '<h2>Information om COVID-19</h2>\n<p>Vi följer utvecklingen vad gäller COVID-19 och anpassar verksamheten löpande till gällande föreskrifter. Dansa gärna hemifrån och med en fast partner.</p>', '2021-01-12 14:46:47', '2021-01-12 14:46:47'),
(331, 'Covid19', 'Column1', 'EN', '<h2>Information about COVID-19</h2>\n<p><br></p>\n<p>We follow developments with regard to COVID-19 and continuously adapt our operations to current regulations. &nbsp;Feel free to dance at home with a regular partner.</p>\n<p><br></p>\n<p><br></p>', '2021-01-12 14:48:20', '2021-01-12 14:48:20'),
(332, 'Covid19', 'Column1', 'ES', '<h2>Información sobre COVID-19</h2>\n<p>Seguimos la evolución de COVID-19 y adaptamos continuamente nuestras operaciones a la normativa vigente. &nbsp;Siéntete libre de bailar desde casa y con una pareja habitual.</p>', '2021-01-12 14:49:23', '2021-01-12 14:49:23'),
(333, 'Course', 'FMIX', 'SV', '<h1>TANGOKOMPANIET FORTSÄTTARE MIX (Fortsättare 2-3)</h1>\n<p><br></p>\n<h1>Kursen vänder sig till dig</h1>\n<p>som har grunderna i tango och vill utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt &nbsp;vill du känna att du dansar mer till musiken och känna dig säkrare i &nbsp;dina egna rörelser.&nbsp;</p>\n<h2><br></h2>\n<h2>Mål</h2>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, musiken och din partner. Det kan kännas svårt att ha fokus på allt detta samtidigt och bibehålla ett flyt i dansen; på kursen bygger vi gradvis upp denna medvetenhet. Det är det som ger kvalitet i dansen och njutbara danser!</p>\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar tango och fått mer känsla av sammanhang och flyt. Vi ökar på din repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. På kursen arbetar vi med att få ett flyt i &nbsp;dansen genom att bli skickligare på grunderna, lära oss nya saker och musiktolkning och kombinera olika möjligheter. Orden blir till meningar!&nbsp;</p>\n<h3><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt hemifrån. Kontakta lärarna.</strong></em></h3>\n<h2>Förkunskaper</h2>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått grundkurs i tango och någon mer kurs samt varit ute och dansat några gånger på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken och din partner, hittat ett dansflöde, konsten att gå tillsammans både i parallell gång och i korsad gång. Du har även tränat på ochos, giros och gungor etc.<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- någon till några gånger i månaden<br>\n&nbsp;</p>\n<h2><br></h2>\n<h2>Kursplan</h2>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar<br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;&nbsp;</p>\n<h2><br></h2>\n<p>SCHEMA</p>\n<p>Fortsättare Mix Lund</p>\n<p><strong>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor (varav en på en annan dag) + 1 avslutningsfest&nbsp;</strong></p>\n<p>Adress: Västgöta Nation, Tornavägen 17, Lund (källarplan)</p>\n<p>Lärare: Anna &amp; Daniel</p>\n<p>Start: Måndagen den 7/2 2022, kl 17.30-19.00.</p>\n<h2><br></h2>\n<h2><strong>Pris</strong></h2>\n<p><strong>2670 kr/person</strong></p>\n<p><strong>Om man vill hjälpa till med diverse saker på Tangokompaniet eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel på daniel@tangokompaniet.com! &nbsp;</strong></p>\n<p><strong>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller till vår Swish på 1231733005.. Skriv ditt namn och kurs. Anmälan är bindande. Avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart. Efter detta är du betalningsskyldig för hela kursen.</strong></p>\n<p><strong>Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl och ifall du har några frågor! &nbsp;&nbsp;&nbsp;</strong></p>\n<h1>Välkommen med din anmälan!</h1>', '2021-03-19 22:08:10', '2021-03-19 22:08:10'),
(334, 'Course', 'GK3', 'SV', '<h2>Denna kurs har paus just nu! Har du gått Grundkurs 1 och 2 så anmäl dig till Fortsättare 1!</h2>', '2021-03-21 20:07:42', '2021-03-21 20:07:42'),
