(337, 'PRECENSE', '2101131730STF1_16V2021-04-21', 'SV', '<p>Continuation 1 &nbsp;&nbsp;Daniel &amp; Anna &nbsp;&nbsp;Malmö &nbsp;&nbsp;Wednesday &nbsp;&nbsp;2021-04-21 &nbsp;&nbsp;17:30 &nbsp;&nbsp;(13)</p>', '2021-04-21 18:13:26', '2021-04-21 18:13:26'),
(338, 'PRESENCE', '2103032030SOGK2_7V2021-04-21', 'SV', '<p>Basic 2 &nbsp;&nbsp;Daniel &amp; Anna &nbsp;&nbsp;Malmö &nbsp;&nbsp;Wednesday &nbsp;&nbsp;2021-04-21 &nbsp;&nbsp;20:30 &nbsp;&nbsp;(12)</p>', '2021-04-21 18:15:00', '2021-04-21 18:15:00'),
(339, 'PRESENCE', '2101131730STF1_16V2021-04-21', 'SV', '<p>Rep. musikalitet i lyrisk och rytmisk tango, korsat grundsteg</p>\n<p>Nytt: låg boleo</p>', '2021-04-21 20:06:47', '2021-04-21 20:06:47'),
(340, 'PRESENCE', '2101131900STF2_16V2021-04-21', 'SV', '<p>Rep: dark side sacada med kors, upprepat</p>\n<p>Nytt. volcada</p>', '2021-04-21 20:09:28', '2021-04-21 20:09:28'),
