(349, 'PRESENCE', '2104111415SOGK1_7V2021-05-02', 'SV', 'Rep boxar. Ocho. \nIntro giro i båda riktningar.', '2021-05-02 13:14:45', '2021-05-02 13:14:45'),
(350, 'PRESENCE', '2104111600SOGK2_7V2021-05-02', 'SV', 'Rep cirlulära moment. Rep gungor.\n\nBakåt ocho. Sandwich. Utgång i gunga.\n\nPlanering nästa veckan: utgång i giro. ', '2021-05-02 18:19:09', '2021-05-02 18:19:09'),
(351, 'PRESENCE', '2103221730VGFK_11V2021-05-03', 'SV', 'Komma in i korsat system, följare resp förare tar extra steg. Gungor med vridning.\nNästa gång lägga till bakåtkors i utgången. Vals?', '2021-05-03 17:12:50', '2021-05-03 17:12:50'),
(352, 'Course', 'VF', 'SV', '<p>Välkommen att dansa in våren tillsammans med oss på Tangokompaniet!</p>\n<p>Vi erbjuder en vårkurs på 5 veckor som går både i vår studio i Malmö och online. Du dansar enbart med din egen danspartner och vi håller oss till Länsstyrelsens bestämmelser angående pandemin.</p>\n<p>Onsdagar kl 19.00-20.30: Fortsättare</p>\n<p>Pris: 690 kr/person</p>\n<p>Du anmäler dig på hemsidan <a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2Ftangokompaniet.com%2F%3Ffbclid%3DIwAR3ompIvyg4mvXT6TRIdMAcMYx0kUk83LeoZ7ui-6EHBg1ejNK1hOl3WzQo&amp;h=AT3zfLiN6a3QMxlolNgdrULGtdwBwc7N8VVfGiuZ8NN5hb0uPgje8FjXy7a-Und1VBGFnnfKQvGkwwJ1zTHwy7XbamaGMgevzlcWYu0XFsVn4QFarUq5hLteNlmXjY1hIytiMKk&amp;__tn__=q&amp;c[0]=AT20j_QFrUb84IHg7SEW3TcJ0wI1u-XmJgM2Fj8D84ioI0KYiBRCvLbv4E6ihPhq9pYH_CXsQpuv0p_sXVf2miydcNP6P3OIukHYxuVFCPcECbrYyMRcNSBQL-T8rYK9zVoZUPDavhUSzMrBpKZoSgvl\" rel=\"nofollow noopener\" target=\"_blank\">tangokompaniet.com</a></p>\n<p>Frågor? Kontakta Anna Sol på anna@tangokompaniet.com eller på 0705150345</p>', '2021-05-03 20:49:58', '2021-05-03 20:49:58'),
(353, 'Course', 'VE', 'SV', '<p>Välkommen att dansa in våren tillsammans med oss på Tangokompaniet!</p>\n<p>Vi erbjuder en vårkurs på 5 veckor som går både i vår studio i Malmö och online. Du dansar enbart med din egen danspartner och vi håller oss till Länsstyrelsens bestämmelser angående pandemin.<br>\nTorsdagar kl 19.00-20.30: Erfarna</p>\n<p>Pris: 690 kr/person</p>\n<p>Du anmäler dig på hemsidan <a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2Ftangokompaniet.com%2F%3Ffbclid%3DIwAR3ompIvyg4mvXT6TRIdMAcMYx0kUk83LeoZ7ui-6EHBg1ejNK1hOl3WzQo&amp;h=AT3zfLiN6a3QMxlolNgdrULGtdwBwc7N8VVfGiuZ8NN5hb0uPgje8FjXy7a-Und1VBGFnnfKQvGkwwJ1zTHwy7XbamaGMgevzlcWYu0XFsVn4QFarUq5hLteNlmXjY1hIytiMKk&amp;__tn__=q&amp;c[0]=AT20j_QFrUb84IHg7SEW3TcJ0wI1u-XmJgM2Fj8D84ioI0KYiBRCvLbv4E6ihPhq9pYH_CXsQpuv0p_sXVf2miydcNP6P3OIukHYxuVFCPcECbrYyMRcNSBQL-T8rYK9zVoZUPDavhUSzMrBpKZoSgvl\" rel=\"nofollow noopener\" target=\"_blank\">tangokompaniet.com</a></p>\n<p>Frågor? Kontakta Anna Sol på anna@tangokompaniet.com eller på 0705150345</p>', '2021-05-03 20:50:40', '2021-05-03 20:50:40'),
(354, 'PRESENCE', '2103221730VGFK_11V2021-12-31', 'SV', '<p>Per Testar Continuation Mix</p>', '2021-05-04 14:38:21', '2021-05-04 14:38:21'),
(355, 'Course', 'GKV', 'SV', '<p>För dig som har gått Grundkurs 1 eller 2 eller 3 eller alla kan nu vara med på vår Grundkurs Vår 2021! Tre stycken lektioner med lite roliga steg och trix för att fira att våren är här!</p>\n<p>Anmäl dig med fast partner.</p>\n<p>Pris: 390 kr/person</p>\n<p>Start 6/6, slut 20/6</p>\n<p>Frågor? Kontakta Anna Sol på anna@tangokompaniet.com eller 0705150345</p>', '2021-05-21 22:46:07', '2021-05-21 22:46:07'),
(356, 'Course', 'ERAV', 'SV', '<h1>Erfarna/Avancerade</h1>\n<h2>Längd:19 veckor Pris:2670 SEK</h2>\n<h1>Kursen vänder sig till dig</h1>\n<p>som har dansat tango ett tag och vill både utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt vill du känna att du dansar mer till musiken och känna dig säkrare i dina egna rörelser.&nbsp;</p>\n<h2>Mål</h2>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, musiken och din partner. du kommer få utforska både musik och repertoar på en djupare nivå samt lära dig fler tekniker som utmanar och lyfter din dans till mer dynamiska svängningar!</p>\n<p>&nbsp;I slutet av kursen kommer du ha fått nya redskap och ännu mer säkerhet. Vi ökar på din repertoar så att du känner dig friare att uttrycka dig genom fler möjligheter och variationer. På kursen arbetar vi också med att finslipa och ge tangotekniken den tid den behöver.</p>\n<p><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt hemifrån. Kontakta lärarna</strong></em></p>\n<h2>Förkunskaper</h2>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått ett par kurser i tango och dansar ofta ute på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du grundläggande element i ryggraden som att lyssna på musiken och din partner, hittat ett dansflöde, konsten att gå tillsammans både i parallell gång och i korsad gång. Du har även tränat på ochos, giros, sacadas, ganchos, boleos, rytmer osv<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- någon till några gånger i veckan<br>\n&nbsp;</p>\n<h2>Kursplan</h2>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar<br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<p><br></p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger färdighet medan för svåra utmaningar kan stjälpa ens glädje och självförtroende. Du kan alltid höra av dig till oss på info@tangokompaniet.com och be om hjälp när du ska välja kurs. <strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<p><br></p>\n<p><br></p>\n<p>SCHEMA</p>\n<p>Erfarna/Avancerade Malmö</p>\n<p>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor (varav en på en annan dag) + 1 avslutningsfest&nbsp;</p>\n<p>Adress Malmö: Tangokompaniet studio, Fredriksbergsgatan 7, Malmö</p>\n<p>Lärare: Daniel &amp; Anna</p>\n<p>Start: Torsdagen den 3/2 2022, kl 19.00-20.30.&nbsp;</p>\n<h3><br></h3>\n<h3><br></h3>\n<h3>ANMÄLAN</h3>\n<p>Du kan anmäla dig med eller utan danspartner i anmälningsformuläret nedan. Om du anmäler dig med en partner så ska det göras en anmälan för dig och en anmälan för din partner.</p>\n<h2><br></h2>\n<h2>Pris</h2>\n<p>2670 kr/person</p>\n<p>Om man vill hjälpa till med diverse saker på Tangokompaniet eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel på daniel@tangokompaniet.com! &nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller till vår Swish på 1231733005.. Skriv ditt namn och kurs. Anmälan är bindande. Avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart. Efter detta är du betalningsskyldig för hela kursen.</p>\n<p>Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl och ifall du har några frågor! &nbsp;&nbsp;&nbsp;</p>\n<h1>Välkommen med din anmälan!</h1>', '2021-07-05 16:22:53', '2021-07-05 16:22:53');
