(357, 'Course', 'FT5V', 'SV', '<p><strong>TANGO FÖLJARTEKNIK med Anna Sol</strong>&nbsp;</p>\n<p>Vill du bli en säkrare och mer uttrycksfull följare i tango? Då är mina tango följarteknikkurser något för dig! Jag bjuder in dig till ett gediget förlopp där du får tid att träna på alla de viktiga tekniska detaljerna som kommer ta dig till nästa nivå i din dans. Du kan anmäla dig till teknikkurserna 1-3 som en enhet och få 10% rabatt eller så är du välkommen att anmäla dig till enstaka kurser.&nbsp;</p>\n<p>Vissa kurser sker endast online via Zoom och andra sker både i vår studio Tangokompaniet och online. Om du har några frågor så kontakta mig gärna på anna@tangokompaniet.com eller på 0705-150345. Hjärtligt välkommen!</p>\n<p><em><strong>/Anna</strong></em></p>\n<p><br></p>\n<p><strong>TANGO FÖLJARTEKNIK 1 - BASEN</strong> &nbsp;</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå. &nbsp;</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som åtminstone har gått en grundkurs i tango eller mer. Max 15 deltagare. &nbsp;</p>\n<p><strong>Plats: Online genom Zoom</strong>. Vi ser vi varandra och kan kommunicera genom datorn/plattan. Du laddar ner programmet på din dator/platta och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning. &nbsp;</p>\n<p><strong>Pris: 895 kr.</strong> Från Sverige betalar du genom Swish till Anna Solakius på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com&nbsp;</p>\n<p>Längd: 5 gånger</p>\n<p><strong>Schema:</strong></p>\n<p><strong>Just nu är denna kurs ej planerad.</strong></p>\n<p>För frågor kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345&nbsp;</p>\n<p><strong>VÄLKOMMEN!</strong></p>\n<p><em><strong>Anmäl dig längst ner på sidan!</strong></em></p>\n<p><br></p>\n<p>------------------------------------------------</p>\n<p><br></p>\n<p><strong>TANGO FÖLJARTEKNIK 2 - DET CIRKULÄRA</strong> &nbsp;</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå. &nbsp;</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har gått Tango följarteknik 1. Max 15 deltagare. &nbsp;</p>\n<p><strong>Plats: Online på Zoom eller på plats i Tangokompaniet studio.</strong> Väljer du att vara med online använder vi oss av programmet Zoom. Vi ser vi varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning. &nbsp;</p>\n<p><strong>Pris: 895 kr.</strong> Från Sverige betalar du genom Swish till Anna Solakius på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com&nbsp;</p>\n<p>Längd: 5 gånger</p>\n<p><br></p>\n<p><strong>Schema:</strong></p>\n<p><strong>Just nu är denna kurs ej planerad.</strong></p>\n<p>För frågor kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345</p>\n<p><strong>VÄLKOMMEN!</strong></p>\n<p><em><strong>Anmäl dig längst ner på sidan!</strong></em></p>\n<p><br></p>\n<p>-----------------------------------------------------------</p>\n<p><br></p>\n<p><strong>TANGO FÖLJARTEKNIK 3 - REBOTES &amp; BOLEOS</strong>&nbsp;</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå.&nbsp;</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har sina grunder i argentinsk tango och det är ett pluss om man gått Tango följarteknik 1 och 2. Max 15 deltagare.</p>\n<p><strong>Plats: Online på Zoom.</strong> Vi ser varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.&nbsp;</p>\n<p><strong>Pris: 895 kr.</strong> Från Sverige betalar du genom Swish på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com</p>\n<p>Längd: 5 gånger</p>\n<p><br></p>\n<p><strong>Schema:</strong></p>\n<p><strong>Just nu är denna kurs ej planerad.</strong></p>\n<p>För frågor kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345&nbsp;</p>\n<p><strong>VÄLKOMMEN!</strong></p>\n<p><em><strong>Anmäl dig längst ner på sidan!</strong></em></p>\n<p><br></p>\n<p>------------------------------------------------</p>\n<p><br></p>\n<p><strong>TANGO FÖLJARTEKNIK 4 - SACADAS &amp; GANCHOS</strong>&nbsp;</p>\n<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att bli både en grundad, smidig och säker följare i tango. Vi tittar på tekniker som hjälper dig att utveckla just detta. Kursens material passar både erfarna och nyare dansare och alla tränar på sin egen nivå.&nbsp;</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har sina grunder i argentinsk tango och det är ett pluss om man gått Tango följarteknik 1 och 2. Max 15 deltagare.</p>\n<p><strong>Plats: Online på Zoom.</strong> Vi ser varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.&nbsp;</p>\n<p><strong>Pris: 895 kr.</strong> Från Sverige betalar du genom Swish på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com</p>\n<p>Längd: 5 gånger</p>\n<p><strong>Kursen har ingen planerad startpunkt just nu.</strong></p>\n<p>För frågor och anmälan kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345. VÄLKOMMEN!</p>\n<p><br></p>\n<p>-------------------------------------------------------</p>\n<p><br></p>\n<p><strong>PYNTA DIN TANGO - utsmyckningar för följare</strong></p>\n<p>Vill du uttrycka dig mer till musiken som följare i tango och bli säkrare på dina adornos/utsmyckningar? Låt oss pynta vår dans tillsammans och med musiken!</p>\n<p>Vi tränar på olika pynt och kikar på både den tekniska och musikaliska aspekten. Kursen passar dig på fortsättar/erfaren nivå i argentinsk tango.</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har sina grunder i argentinsk tango. OBS! Max 15 deltagare.</p>\n<p><strong>Plats: Tangokompaniet studio och online via Zoom.</strong> Via Zoom ser vi varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.</p>\n<p><strong>Pris: 895 kr.</strong> Från Sverige betalar du genom Swish på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com</p>\n<p>Längd: 5 gånger</p>\n<p><strong>Schema:</strong></p>\n<p>Onsdagar: Gå kursen på onsdagar start 15e september 2021, kl 17.30-19.00&nbsp;</p>\n<p>För frågor och anmälan kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345. <strong>VÄLKOMMEN!</strong></p>\n<p><em><strong>Anmäl dig längst ner på sidan!</strong></em></p>\n<p>------------------------------------------------</p>\n<p><br></p>\n<p><strong>PYNTA DIN TANGO 2 - utsmyckningar för följare - fortsättningen</strong></p>\n<p>Vill du uttrycka dig mer till musiken som följare i tango och bli säkrare på dina adornos/utsmyckningar? Låt oss pynta vår dans tillsammans och med musiken!</p>\n<p>Vi tränar på olika pynt och kikar på både den tekniska och musikaliska aspekten. Kursen passar dig på fortsättar/erfaren nivå i argentinsk tango.</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla som har sina grunder i argentinsk tango. Max 15 deltagare.</p>\n<p><strong>Plats: Tangokompaniet studio och online via Zoom.</strong> Via Zoom ser vi varandra och kan kommunicera genom datorn. Du laddar ner programmet på din dator och får en inbjudningsslänk av mig för att deltaga. Om du missar en lektion så får du lektionen i sin helhet tillskickad dig till nerladdning.</p>\n<p><strong>Pris: 895 kr</strong>. Från Sverige betalar du genom Swish på 0705150345. Ifrån utlandet betalar du genom PayPal till anna@tangokompaniet.com</p>\n<p>Längd: 5 gånger</p>\n<p><strong>Schema:&nbsp;</strong></p>\n<p>Onsdagar start 20e oktober 2021, kl 17.30-19.00 (OBS! Vi tar paus onsdagen den 3/11)</p>\n<p>För frågor och anmälan kontakta Anna Sol på messenger eller anna@tangokompaniet.com eller 0705-150345. <strong>VÄLKOMMEN!</strong></p>\n<p><em><strong>Anmäl dig på sidan för \"kursanmälan\"!</strong></em></p>', '2021-07-05 17:32:34', '2021-07-05 17:32:34'),
(358, 'Course', 'F3', 'SV', '<h1>Kursen vänder sig till dig</h1>\n<p>som har grunderna i tango och vill utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt &nbsp;vill du känna att du dansar mer till musiken och känna dig säkrare i &nbsp;dina egna rörelser.&nbsp;</p>\n<h2>Mål</h2>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, &nbsp;musiken och din partner. Det kan kännas svårt att ha fokus på allt detta &nbsp;samtidigt och bibehålla ett flyt i dansen; på kursen bygger vi gradvis &nbsp;upp denna medvetenhet. Det är det som ger kvalitet i dansen och njutbara &nbsp;danser!</p>\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar &nbsp;tango och fått mer känsla av sammanhang och flyt. Vi ökar på din &nbsp;repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. Pä kursen &nbsp;arbetar vi med att få ett flyt i &nbsp;dansen genom att bli skickligare på grunderna och kombinera olika &nbsp;möjligheter. Orden blir till meningar!&nbsp;</p>\n<p><em><strong>Vi ber dig att stanna hemma från kursen om du inte känner dig frisk. Vi erbjuder också våra kursdeltagare att ta del av undervisningen digitalt hemifrån genom Zoom.</strong></em></p>\n<h2>Förkunskaper</h2>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått några terminskurser i tango samt varit ute och dansat en del gånger på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken och din partner, hittat ett dansflöde, konsten att gå tillsammans både i parallell gång och i korsad gång. Du har även tränat på ochos, giros och gungor och fler element såsom alteratoioner, boleos och gauchos.<br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- någon till några gånger i månaden<br>\n&nbsp;</p>\n<h2>Kursplan</h2>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar<br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp; &nbsp;</p>\n<h2><br></h2>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger färdighet medan för svåra utmaningar kan stjälpa ens glädje och självförtroende. Du kan alltid höra av dig till oss på info@tangokompaniet.com och be om hjälp när du ska välja kurs. <strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<p><br></p>\n<p>SCHEMA</p>\n<p>Fortsättare 3 Malmö</p>\n<p>19 tillfällen varav 16 lektioner + 2 lärarledda praktikor (varav en på en annan dag) + 1 avslutningsfest</p>\n<p>Adress Malmö: Tangokompaniet studio, Fredriksbergsgatan 7, Malmö</p>\n<p>Lärare: Daniel &amp; Anna</p>\n<p>Start: Onsdagen den 26/1 2022, kl 19.00-20.30.&nbsp;</p>\n<h3><br></h3>\n<h3><br></h3>\n<h3>ANMÄLAN</h3>\n<p>Du kan anmäla dig med eller utan danspartner i anmälningsformuläret nedan. Om du anmäler dig med en partner så ska det göras en anmälan för dig och en anmälan för din partner.</p>\n<h2><br></h2>\n<h2><br></h2>\n<h2>Pris</h2>\n<p>2670 kr/person</p>\n<p>Om man vill hjälpa till med diverse saker på Tangokompaniet eller om man vill gå dubbla kurser erbjuder vi reducerade kursavgifter! Kontakta Daniel på daniel@tangokompaniet.com! &nbsp;</p>\n<p>Förbetalning sker till Tangokompaniets bankgiro 5532-8223 eller till vår Swish på 1231733005.. Skriv ditt namn och kurs. Anmälan är bindande. Avanmälan ska ske senast 2 veckor efter din anmälan och före kursstart. Efter detta är du betalningsskyldig för hela kursen.</p>\n<p>Det går bra att dela upp betalningen, meddela oss detta isåfall per mejl och ifall du har några frågor! &nbsp;&nbsp;&nbsp;</p>\n<h1>Välkommen med din anmälan!</h1>', '2021-07-07 18:28:31', '2021-07-07 18:28:31'),
(359, 'Course', '3_IN_1', 'SV', '<h1>Musikseminarie i två delar</h1>\n<h2>med Daniel Carlsson</h2>\n<p><br></p>\n<p>Under två söndagar dyker vi in i tangomusiken och fördjupar vår medvetenhet och kunskap. Vi tränar på att omvandla detta till tolkning av musiken i dansen i form av pauser rytmer och accentueringar. Vi lär oss om tangons puls, fraser, sektioner men vi tränar också på att dansa 10 vanliga rytmer i de viktigaste rörelserna som gång, salidas, ocho cortados och ochos. För de mer erfarna kollar vi på hur vi kan leka med musikalitet i ganchos och boleos.</p>\n<p><br></p>\n<p>Kursen passar dig på fortsättar/erfaren/avancerad nivå. Kursen är till för dig som redan dansar tango och alla jobbar på sin egen nivå. Det kommer finnas material för både lägre och högre dansnivå. Kursen tas med fördel med en partner men det går att tillgodogöra sig mycket av materialet solo.</p>\n<p>Har du ingen danspartner och vill gå med ngn kan du höra av dig till oss.</p>\n<p><br>\nMusikalitetsseminarium del 1, 2/1 och del, 2 9/1 14.30-17.30.<br>\n</p>\n<p>Efter registrering skickar Daniel ut ett material med vilket du förbereder dig.<br>\nUnder seminariets två delar som du kan ta själv men som jag rekommenderar att du tar med en partner kommer vi att träna på att röra oss till vanliga och mindre vanliga rytmer, framförallt i gången och på plats men även i enklare figurer .<br>\nVi kommer att kolla på tangons struktur och gå igenom allt från pulsen till fraserna, sektionerna, staccato o legato, marcato och synkoperingar. Vi kommer att titta på ett par vanliga rytmer och några rytmer som är mer typiska för specifika orkestrar. Vi kommer att ta oss tid till att dansa in dessa rytmer.<br>\n</p>\n<p>Priserna för deltagande på plats 500 kr per del eller 900 kr för båda tillfällena per person. Anmäl dig gärna i par men det går bra ta del av seminariet utan partner också även om tanken är att dansa musiken med en partner.<br>\nDeltagande via zoom 350 kr per del eller 700 kr för båda tillfällena.</p>\n<p><br></p>\n<h2>Schema:</h2>\n<p><br></p>\n<p><strong>Söndag 2/9 och 9/9</strong></p>\n<p><br></p>\n<p>14.30-17.30 Lektion inkl paus</p>\n<p><br></p>\n<p>Kursen sker i Tangokompaniet studio i Malmö och online via Zoom. Max antal deltagare i studion är 20 personer.</p>\n<p><br></p>\n<p><br></p>\n<h2>Hjärtligt välkommen!</h2>\n<p><br></p>\n<p>tangokompaniet.com</p>\n<p><br></p>\n<p><br></p>', '2021-09-29 07:38:51', '2021-09-29 07:38:51'),
(360, 'Course', 'HK', 'SV', '<p><br>\nMusikalitetsseminarium del 1, 2/1 och del, 2 9/1 14.30-17.30.<br>\n</p>\n<p>Efter registrering skickar Daniel ut ett material med vilket du förbereder dig.<br>\nUnder seminariets två delar som du kan ta själv men som jag rekommenderar att du tar med en partner kommer vi att träna på att röra oss till vanliga och mindre vanliga rytmer, framförallt i gången och på plats men även i enklare figurer .<br>\nVi kommer att kolla på tangons struktur och gå igenom allt från pulsen till fraserna, sektionerna, staccato o legato, marcato och synkoperingar. Vi kommer att titta på ett par vanliga rytmer och några rytmer som är mer typiska för specifika orkestrar. Vi kommer att ta oss tid till att dansa in dessa rytmer.<br>\n</p>\n<p>Priserna för deltagande på plats 500 kr per del eller 900 kr för båda tillfällena per person. Anmäl dig gärna i par men det går bra ta del av seminariet utan partner också även om tanken är att dansa musiken med en partner.<br>\nDeltagande via zoom 350 kr per del eller 700 kr för båda tillfällena. Anmälan göres under menypunkten ”Musikalitet”, längst ned på sidan.</p>', '2021-09-29 07:45:28', '2021-09-29 07:45:28'),
(364, 'MARATHON', 'MAILBODY', 'EN', '<p>Thank you for your registration . Your registration will be processed and we will get back to you as soon as possible. Have some great tangos until then.\n</p>\n<p/> \n<p>\nIf you need to contact us please email malmotangomaraton@gmail.com or call Anna Sol at +46705150345\n</p> \n', '2021-10-15 08:22:35', '2021-10-22 15:21:43'),
(365, 'MARATHON', 'MAILSUBJECT', 'EN', 'Malmö Tangomarathon - registration confirmation', '2021-10-15 08:22:35', '2021-10-22 11:38:50'),
(366, 'FESTIVALITO', 'MAILBODY', 'EN', '<p>Thank you for your registration to Festivalito. Your registration will be processed and we will get back to you as soon as possible. Have some great tangos until then.</p>\n<p/>\n<p>\nIf you need to contact us please email daniel@tangokompaniet.com or call Daniel on 0736-563609\n</p>\"\n    ', '2021-10-15 08:26:00', '2021-11-19 21:38:36'),
(367, 'FESTIVALITO', 'MAILSUBJECT', 'EN', 'Malmö Festivalito - registration confirmation', '2021-10-15 08:22:35', '2021-10-15 08:29:00'),
(368, 'SUMMER', 'MAILSUBJECT', 'EN', 'Malmö Summer - registration confirmation', '2021-10-15 08:22:35', '2021-10-15 08:29:00'),
(369, 'SUMMER', 'MAILBODY', 'EN', '<p>Thank you for your registration to Malm Summer. Your registration will be processed and we will get back to you as soon as possible. Have some great tangos until then.</p>\r\n<p/>\r\n<p>\r\nIf you need to contact us please email malmotangomaraton@gmail.com or call Anna Sol at +46705150345\r\n</p>\"\r\n    ', '2021-10-15 08:26:00', '2021-10-15 08:29:40'),
(370, 'EASTER', 'MAILSUBJECT', 'EN', 'Malmö Easter Festivalito - registration confirmation', '2021-10-15 08:22:35', '2021-10-15 08:29:00'),
(371, 'MALMÖ', 'EASTER', 'EN', '<p>Thank you for your registration to Malm Easter Festivalito. Your registration will be processed and we will get back to you as soon as possible. Have some great tangos until then.</p>\r\n<p/>\r\n<p>\r\nIf you need to contact us please email malmotangomaraton@gmail.com or call Anna Sol at +46705150345\r\n</p>\"\r\n    ', '2021-10-15 08:26:00', '2021-10-15 08:29:40'),
(372, 'FESTIVALITO', 'LEGAL', 'EN', '<p>This registration is binding. This means that you have to pay for the workshops even if you do not attend to them. You have two weeks to cancel this registration if you have not already started at the workshops.</p>', '2019-01-22 08:02:16', '2020-10-17 07:17:36'),
(373, 'EASTER', 'LEGAL', 'EN', '<p>This registration is binding. This means that you have to pay for the workshops even if you do not attend to them. You have two weeks to cancel this registration if you have not already started at the workshops.</p>', '2019-01-22 08:02:16', '2020-10-17 07:17:36'),
(374, 'SUMMER', 'LEGAL', 'EN', '<p>This registration is binding. This means that you have to pay for the event even if you do not attend to them. You have two weeks to cancel this registration if you have not already started at the event.</p>', '2019-01-22 08:02:16', '2020-10-17 07:17:36'),
(375, 'MARATHON', 'LEGAL', 'EN', '<p>This registration is not binding until you are accepted by the Malmö Tango Marathon team.</p>', '2019-01-22 08:02:16', '2020-10-17 07:17:36'),
(376, 'FESTIVALITO', 'Teachers', 'EN', '<p><br></p>', '2021-10-23 12:50:57', '2021-10-23 12:50:57'),
(377, 'Course', 'TEK', 'SV', '<p>Daniel kommer att ge teknikklasser under jullovet.<br>\nTotalt 6 lektioner blir det. Du kan betala 150 kr per gång eller 600 kr för alla.<br>\n</p>\n<p>Datum för teknikworkshops söndag 26/12, onsdag 29/12, söndag 2/1, söndag 9/1, torsdag 13/1, söndag 23/1. Teknikklasser kl 18-19.<br>\nDet går bra att maila Daniel för att anmäla dig\n150 kr per lektion eller köp alla för 600 kr. (500 kr för deltagande via zoom upp till 6 ggr)</p>', '2021-12-12 02:41:30', '2021-12-12 02:41:30'),
(378, 'WEEKEND', 'Start', 'SV', '<p>Musikalitetsseminarium &nbsp;del 1, 2/1 och del, 2 9/1 14.30-17.30. Efter registrering skickar Daniel ut ett material med vilket du &nbsp;förbereder dig. Under seminariets två delar som du kan ta själv men som jag &nbsp;rekommenderar att du tar med en partner kommer vi att träna på att röra &nbsp;oss till vanliga och mindre vanliga rytmer, framförallt i gången och på &nbsp;plats men även i enklare figurer . Vi kommer att kolla på tangons struktur och gå igenom allt från pulsen &nbsp;till fraserna, sektionerna, staccato o legato, marcato och &nbsp;synkoperingar. Vi kommer att titta på ett par vanliga rytmer och några &nbsp;rytmer som är mer typiska för specifika orkestrar. Vi kommer att ta oss &nbsp;tid till att dansa in dessa rytmer. Priserna för deltagande på plats 500 kr per del eller 900 kr för båda &nbsp;tillfällena per person. Anmäl dig gärna i par men det går bra ta del av &nbsp;seminariet utan partner också även om tanken är att dansa musiken med en &nbsp;partner. Deltagande via zoom 350 kr per del eller 700 kr för båda tillfällena.</p>', '2021-12-12 18:25:02', '2021-12-12 18:25:02');
INSERT INTO `tbl_text_new` (`id`, `routeId`, `groupId`, `textId`, `label`, `language`, `textBody`, `creaTimestamp`, `updTimestamp`) VALUES
(NULL, 'Event', 'Easter', 'Contact Us', 'Contact Us', 'EN', '\r\n<h1>Contact infomation</h1>\r\n\r\nE-mail to Daniel: \r\n<a href=\'mailto:daniel@tangokompaniet.com\'>\r\ndaniel@tangokompaniet.com\r\n</a> \r\n<p/>\r\nPhone to Daniel: 0046-(0)73 6563609\r\n', '2018-01-21 18:28:19', '2019-09-23 14:20:56'),
(NULL, 'Event', 'Easter', 'Other Info', 'Other Info', 'EN', '<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n<h1>Other info</h1>\r\n<h3>Food and Beverages</h3>\r\n<p>Coffee, tea, coke, chocolate, fruits will be available. Malmoe has many good restaurants; so no need to be hungry!</p>\r\n<h3>TK-Tango-shop</h3>\r\n<p>Tangokompaniet offers many models from several different brands of good shoes for dancing – both classical and sneakers for both men and women in the studio at Fredriksbergsgatan 7. You can also find music, CDs, books and clothing! Some of our brands: Bandolera, Regina, Vikinga, Fabioshoes, DNI, Carlos Ferroni, Bloch, DSOL</p>\r\n<h3>Dancepartner</h3>\r\n<p>Please use Tangokompaniet Festivalito event on Facebook to search partner or Tangokompaniets Partnersearch on facebook. You can register without partner but it is easier with! We can help with partnersearch if you tried and didnt succeed !</p>\r\n<h3>Accomodation</h3>\r\n<p>Please search for local dancers that might take you in or look for youth hostels or hotels; you can find good deals at <a href=\"http://www.booking.com\" class=\"autohyperlink\" title=\"http://www.booking.com\">www.booking.com</a>. If nothing is found contact us !</p>\r\n<h3></h3>\r\n\r\n				\r\n			\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2019-09-23 14:20:56'),
(NULL, 'Event', 'Easter', 'Payment', 'Payment', 'EN', '<img src=\\\'http://localhost:3000//images/festivalito.jpeg\\\'>', '2018-01-21 18:28:19', '2019-09-23 14:20:56'),
(NULL, 'Event', 'Easter', 'Register', 'Register', 'EN', '<h1>Register</h1>\n<p>You welcome to register per e-mail: <a href=\"mailto:daniel@tangokompaniet.com\" title=\"mailto:daniel@tangokompaniet.com\">daniel@tangokompaniet.com</a> after choosing your package and follow payments instructions at “Prices”. Once you have paid you are registered!</p>\n<p>You do not need to register with a partner, but to be more sure that you get a place in the workshops it will help if you do. We have a&nbsp;<a title=\"TK partnership on facebook\" href=\"https://www.facebook.com/groups/501494573205992/\" target=\"_blank\">“Tangokompaniet – partnersearch”</a>&nbsp;on facebook!&nbsp;are also willing to assist you on this matter if needed.</p>\n<p>Workshops get full quite fast and registration is binding if you unregister later than a week before the festival.&nbsp;If you have registered and are not able to participate contact us as soon as possible.</p>\n<p><strong>WELCO TO THE FESTIVAL!</strong></p>', '2018-01-21 18:28:19', '2019-09-23 14:20:56'),
(NULL, 'Event', 'Easter', 'Schedule', 'Schedule', 'EN', '<p><br>\n<strong>Levels &amp; teachers:</strong><br>\n <em>beg</em>: Beginners in tango, totally new dancers <br>\n <em>all levels</em>: All levels of dancers, intermediate to advanced, except complete beginners<br>\n <em>exp/adv</em>: Only for experienced and advanced dancers<br>\n&nbsp;</p>\n<h2>Thursday 18/4 - Workshop at TKstudio, Fredriksbergsgatan 7, Malmoe, Excursion to Copenhagen</h2>\n<p>TimeThemeVenue &nbsp;&nbsp;</p>\n<p>18.00 - 19.30 <strong>Ws1 Musicality</strong> all levels <em>&nbsp;C &amp; D </em>&nbsp;&nbsp;Fredriksbergsgatan 7, TKstudio &nbsp;</p>\n<p>19.30 - &nbsp;<strong>Meeting for excursion to Copenhagen 19.45 in the studio</strong> <em>&nbsp;Daniel Carlsson</em> &nbsp;&nbsp;Fredriksbergsgatan 7 Malmoe and Copenhagen &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>20.30 - 00.30 <strong>Milonga with show in Copenhagen, we &nbsp;take the train and the metro to VanlÃ¶se station in Copenhagen. Milonga &nbsp;in VanlÃ¸se Kulturstation, Frode Jacobsens Plads 4 which is open &nbsp;21.00-01.00</strong> &nbsp;&nbsp;&nbsp;&nbsp;</p>\n<h2>Friday 19/4, Barnens scen, Falsterbogatan 17, Malmoe</h2>\n<p>&nbsp;TimeThemeVenue &nbsp;&nbsp;</p>\n<p>12.00 - 13.30 <strong>Ws2: Technique ws (individual &amp; for couples)</strong> all levels <em>&nbsp;J&amp;M</em> &nbsp;&nbsp;Falsterbogatan 17 &nbsp;&nbsp;</p>\n<p>13.45 - 15.15 &nbsp;<strong>Ws3: Change of direction (space and form)</strong> <em>&nbsp;all levels, J&amp;M</em> &nbsp;&nbsp;Falsterbogatan 17 &nbsp;&nbsp;&nbsp;</p>\n<p>15.30 - 17.00 <strong>Ws4: Vals seminar part 1</strong> <em>all levels</em> C &amp; D &nbsp;Falsterbogatan 17&nbsp;</p>\n<p>17.15 - 18.45 <strong>Ws5: Vals seminar 2</strong> <em>exp /adv </em>&nbsp;C &amp; D &nbsp;Falsterbogatan 17&nbsp;</p>\n<p>19.00 - 20.15 <strong>Intro class</strong> <em>&nbsp;beg </em>&nbsp;&nbsp;Falsterbogatan 17&nbsp;</p>\n<p>20.15- 02.00 <strong>Milonga with 2 DJs coorganized with &nbsp;Camarin, DJ Tommy Selggren and DJ Yoga Magdalena / show with Martina &nbsp;Waldman &amp; Jose Fernandez</strong> &nbsp;&nbsp;&nbsp;Falsterbogatan 17 &nbsp;</p>\n<h2>Saturday 20/4 at Barnens scen, Falsterbogatan 17 Malmoe</h2>\n<p>&nbsp;TimeThemeVenue &nbsp;</p>\n<p>12.00 - 13.30 <strong>Ws6: Milonga seminar part 1 &nbsp;</strong><em>&nbsp;all levels, C &amp; D </em>&nbsp;Barnens scen, Falsterbogatan 17 Malmoe &nbsp;</p>\n<p>13.45 - 15.15 <strong>Ws7: Milonga seminar part 2 &nbsp;</strong><em>&nbsp;all levels, C &amp; D </em>&nbsp;Barnens scen, Falsterbogatan 17 Malmoe &nbsp;&nbsp;&nbsp;</p>\n<p>15.30 - 17.00 <strong>Ws8: Tools for improvisation</strong> <em>all levels </em>&nbsp;J &amp; M &nbsp;Falsterbogatan 17&nbsp;</p>\n<p>17.15 - 18.45 <strong>Ws9: Choreographic vocabulary</strong> <em>&nbsp;Exp/adv </em>&nbsp;C&amp;D &nbsp;Falsterbogatan 17&nbsp;</p>\n<p>19.00 - 20.15 <strong>Intro class</strong> <em>&nbsp;beg </em>&nbsp;&nbsp;Falsterbogatan 17&nbsp;</p>\n<p>20.15- 02.00 <strong>Tangodancing with DJ Sten Odelberg / Live music with Orquesta Tangarte</strong> &nbsp;&nbsp;&nbsp;Falsterbogatan 17 &nbsp;</p>\n<h2>Sunday 21/4 April at Barnens scen, Falsterbogatan 17 Malmoe</h2>\n<p>&nbsp;TimeThemeVenue &nbsp;</p>\n<p>&nbsp;11.30 - 14.00 <strong>Tangobrunch, food and dancing</strong><em> DJ Daniel</em> Barnens scen, Falsterbogatan 17 &nbsp;</p>\n<p>14.00 - 15.30 <strong>Ws10: Combinations of circular movements (giros,boloeos, calesitas, sacadas) </strong>&nbsp;<em>&nbsp;all levels, C &amp; D </em>Barnens scen &nbsp;&nbsp;15.45 - 17.15 <strong>Ws11: Building structures from the simple to the complex </strong>&nbsp;<em>exp/adv, J &amp; M</em> Barnens scen &nbsp;&nbsp;</p>\n<p>17.30 - 19.00 <strong>Ws12: Rythmic games</strong> <em>&nbsp;all levels, J &amp; M</em> Barnens scen &nbsp;&nbsp;19.00 - 20.15 <strong>Intro class to tango</strong> <em>&nbsp;beg, </em>&nbsp;Barnens scen &nbsp;</p>\n<p>20.15 - 02.00 <strong>Milonga - danceevening</strong> <strong>show with Cecilia and Daniel</strong> <em>DJ Johan Nordstrom &nbsp;</em>&nbsp;Barnens scen &nbsp;</p>\n<h2>Monday 21/4 Tangokompaniet studio, Fredriksbergsgatan 7 Malmoe</h2>\n<p>&nbsp;TimeThemeVenue &nbsp;12.00 - 15.45 <strong>Tango Brunch med DJ Anita Doby &nbsp;&nbsp;&nbsp;</strong>TKstudio &nbsp;</p>\n<p>&nbsp;</p>', '2018-01-21 18:28:19', '2019-09-23 14:20:56'),
(NULL, 'Event', 'Easter', 'Teachers and DJs', 'Teachers and DJs', 'EN', '\r\n\r\n<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n	\r\n					<h1>The crew</h1>\r\n<h1></h1>\r\n<p><strong style=\"color: black; font-family: Verdana, Arial, sans-serif; font-size: 11px;\">The teachers and performers</strong></p>\r\n<p>&nbsp;</p>\r\n<p><b>Anna Sol&nbsp;</b><img src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/anna.solakius.jpg\" width=\"212\" height=\"300\"><br>\r\nAnna teaches and organizes in Tangokompaniet since 2002. Her teaching offers the opportunity to explore her own body, the communication in dance and the expression in the music. Her dance expresses her person; energy, joy and the pursuit of consciousness. She is also a very active DJ, both regionally, nationally and internationally, and also hosts seminars on tango music and DJing.</p>\r\n<p><strong>Camila Holst-Viancos&nbsp;</strong><img class=\"alignnone size-medium wp-image-441\" alt=\"DSC_1302\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/DSC_1302-199x300.jpg\" width=\"199\" height=\"300\"></p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; -webkit-text-stroke: #000000}\r\nspan.s1 {font-kerning: none}\r\nspan.s2 {font: 12.0px \'Helvetica Neue\'; font-kerning: none}\r\n--></style>\r\n<p>Camila Viancos has a broad experience with teaching, dancing and performing from different dance styles such as salsa and modern dancing.&nbsp;Her focus in tango dancing is connection, musicality and body awareness. She is very passionated about teaching and she currently lives from teaching dance, yoga and pilates.&nbsp;Camila is also&nbsp;performing as a singer and teaches musicality for salsa dancers with live musicians.</p>\r\n<p><strong>Cecilia Warfvinge&nbsp;</strong><img alt=\"cecilia\" src=\"https://festivalito.tangokompaniet.com/wp-content/uploads/cecilia-248x300.jpeg\" width=\"248\" height=\"300\"></p>\r\n<p>For Cecilia, Tangon offers the opportunity to express dynamic musicality, and her dance has been described as elegant and musical. She has a background in classical music, and therefore has a deep understanding of the different expressions of music. Cecilia is inspired by her interest in fitness and Chinese Tai Chi, and advocates bodily control and playfulness in the dance.</p>\r\n<p><b>Daniel Carlsson&nbsp;</b><img class=\"alignnone size-medium wp-image-426\" alt=\"daniel.carlsson\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/daniel.carlsson.jpg\" width=\"212\" height=\"300\"></p>\r\n<div id=\"tw-target-text-container\">\r\n<p dir=\"ltr\" id=\"tw-target-text\" data-placeholder=\"Översättning\">Daniel is one of the founders of Tangokompaniet. After touring around the world teaching tango during many years and teaching in over 20 countries Daniel decided to put more focus on making the Öresundtango grow in many aspects. For Daniel feeling, connection and creativity are the key words.</p>\r\n<p><strong>Nidia Martinez&nbsp;</strong><img alt=\"nidia\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/nidia-248x300.jpg\" width=\"248\" height=\"300\"><br>\r\nNidia is educated in contemporary / modern dance and works as a dancer, choreographer and teacher. She is also Pilate’s instructor. Nidia started dancing tango in Argentina and is interested in tango as social dance but also as a technique that makes her artistic expression richer. As a teacher, she focuses on body communication and awareness. She develops her training method for tango dancers with her knowledge of Pilates and Contact Improvisation (contemporary / modern dance).</p>\r\n<p>&nbsp;</p>\r\n<pre lang=\"en\"></pre>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p><b>Per Berseus&nbsp;</b><img class=\"alignnone size-medium wp-image-424\" alt=\"per.berseus\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/per.berseus.jpg\" width=\"212\" height=\"300\"></p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; -webkit-text-stroke: #000000}\r\nspan.s1 {font-kerning: none}\r\n--></style>\r\n<p>With one foot in musicianship and the other in movement practices, Per has an in-depth relationship with dancing and teaching. Ever since his childhood he has kept playing in a symphony orchestra, and he was immediately captured by the tango music when he started dancing in 2003. Over the last 10 years Per draws inspiration from movement disciplines such as yoga and Gyrotonic, and he teaches tango as an embodied experience of warm-hearted expression</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sonny La&nbsp;</strong><img class=\"alignnone size-medium wp-image-423\" alt=\"sonny\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/sonny-211x300.jpg\" width=\"232\" height=\"330\"><br>\r\nTango is for Sonny a dance of presence and musical expression. His dance can be described as conscious and playful. Sonny has a background in Chinese Kung Fu and Tai Chi, exhibiting both physical strength and soft dynamics. With his good educational ability, he inspires his students to dare to experiment and experiment with their dance.</p>\r\n<p><b>Tava Sieh&nbsp;</b><img alt=\"Tava\" src=\"https://festivalito.tangokompaniet.com/wp-content/uploads/Tava.jpg\" width=\"180\" height=\"240\"></p>\r\n<p>Tava’s love for dance and enthusiasm for teaching is informed by her experiences as a physiotherapist, massage therapist, and yoga practitioner. She began her Tango journey in Boulder, Colorado and the path lead quickly to Buenos Aires, and then onward Sweden where she has been teaching with Tangokompaniet since 2012.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>DJs</strong></p>\r\n<p>Per Berseus</p>\r\n<p>Johan Nordström</p>\r\n<p>Sten Odelberg</p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 23.0px Times; color: #454545; -webkit-text-stroke: #454545} span.s1 {font-kerning: none}\r\n--></style>\r\n\r\n				\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2019-09-23 14:20:56'),
(NULL, 'Event', 'Easter', 'Venues', 'Venues', 'EN', 'Tangokompaniet welcomes you to\r\nTango Easter Festival in Malmö\r\nWorkshops, live music, shows and lots of social dancing. We also offer intro-classes for complete beginners, so everyone can join!\r\n\r\nThere will be many different themes of workshops. Guest teachers from Buenos Aires will inspire us together with TKcrew. José Fernandez y Martina Waldman, Cecilia Piccinni and Daniel Carlsson will teach and perform for us and Tangarte will be playing live music this year which fits very well with their celebrating 20 years anniversary. Tommy Selggren, Gabriela Castro and Camila Holst-Viancos will give introclasses Friday, Saturday and Sunday.\r\n\r\nunspecified-2\r\n\r\nCome and learn all the good stuff in tango so that you can enjoy this wonderful dance even more and be inspired by their performances in the evenings.\r\ntangarte\r\n\r\nBehind the wheels of the music machine we have really good DJs like Tommy Selggren, Anita Doby doing their absolute best to keep you dancing all the time on the wonderful dance floors of Barnens Scen and at Tangokompaniet.\r\n\r\nWe look forward to meet all of you at this wonderful week of tango in Malmö!\r\n\r\npichi dani 2\r\n\r\n \r\n\r\nI samarbete med\r\n\r\nmebo\r\n\r\noch med stöd av\r\nMalmostad_logo_webb_svartvit\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n', '2018-01-21 18:28:19', '2019-09-23 14:20:56'),
(NULL, 'Event', 'Easter', 'Prices', 'No Label', 'EN', '<p>&nbsp;</p>\n<h1>Prices and Payment</h1>\n<p>Payment is done to bankgiro 5532-8223; please write “Easter” in the &nbsp;message. If you don’t have a Swedish bank you pay cash upon arrival, &nbsp;please then send an email about that.</p>\n<p><strong>Early Bird:</strong></p>\n<p>When booking a package and paying at least 1 month before the &nbsp;festival you qualify as an Early Bird and you get a discount of 100 SEK &nbsp;on any package with workshops. For single workshops you get 50 SEK &nbsp;discount with Early Bird.</p>\n<p><strong>First-timers in tango:</strong></p>\n<p>Haven’t danced tango before? No problem! We offer you first-timers &nbsp;three evenings with a new intro-class each evening. After the class you &nbsp;just continue into the world of tango by attending the social dancing &nbsp;and of course you will also see shows performed by the teachers, live &nbsp;musi etc.</p>\n<p>One evening with one intro class and dance evening with show = 200 SEK ,&nbsp;<em>First-timers Package:</em>&nbsp;3 &nbsp;evenings with intro-class (1 hour) and dance evening/night (in total 3 &nbsp;intro-classes and 3 dance evenings): 400 SEK (33% discount).</p>\n<p><strong>For intermediate and experienced dancers</strong><br>\n&nbsp;</p>\n<p>Dance package gives you entry on Friday, Saturday, Sunday and Monday (daytime): 350 SEK,</p>\n<p><em>Small Package: 4 ws (6 hours of classes)</em> (including the dancepackage 1050 SEK</p>\n<p>Festivalito package 6 ws (9 hours of classes) and the dancepackage 1350 SEK</p>\n<p><em>Super package:</em>&nbsp;Take it all (all workshops and the dancepackage) 1900 SEK</p>\n<p>Single workshops for tangodancers 1,5 hours:&nbsp;250 SEK but 200 SEK with Early Bird.</p>\n<ul>\n  <li>Friday , milonga with a show good DJ and long open hours: 130 but &nbsp;100 for Camarins members, weekly students at Tangokompaniet and those &nbsp;crossing the bridge (brorabatt)</li>\n  <li>Saturday milonga with live music: 160 SEK</li>\n  <li>Sunday milonga with a show good DJ and long open hours: 130 but 100 &nbsp;for weekly students at Tangokompaniet and those crossing the bridge &nbsp;(brorabatt)</li>\n  <li>Monday tangobrunch, 70 SEK entry and 70 SEK for brunch</li>\n</ul>', '2019-09-23 12:11:32', '2019-09-23 14:20:56');
INSERT INTO `tbl_text_WITHOUT_TEXTID` (`id`, `routeId`, `groupId`, `textId`, `label`, `language`, `textTitle`, `textBody`, `creationTime`, `updateTime`) VALUES
(37, 'Event', 'Festivalito', '', 'Start', 'EN', '', '<h2>&nbsp;&nbsp;Tangokompaniet welcomes you to</h2>\n<h3>Tango festivalito Malmö 10-12:th of November.</h3>\n<h1><img alt=\"image1\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/image1-300x300.jpeg\" width=\"300\" height=\"300\"/></h1>\n<h1>There will be workshops, ws and lots of social dancing and live m with Bandonegro.</h1>\n<h1><img alt=\"bandonegro\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/bandonegro-300x170.jpg\" width=\"300\" height=\"170\"/></h1>\n<p>We also offer intro-classes for complete beginners, so everyone can join!</p>\n<p>There will be asddfdfadfasdfaddfsa many different themes of workshops with Tangokompaniets excellent teachers but in new constellations. That will shakings up a bit. Come and learn all the good stuff in tango so that you can enjoy this wonderful dance even more and be inspired by their performances in the evenings. <strong>Sonny La, Dal Carlsson, Cecilia Warfvinge, Anna Sol,</strong>&nbsp;<strong>Per Berseus, Tava Sieh, Camila, Holst-Viancos and Nidia Martinez </strong>will guide you.</p>\n<p>Behind the wheels of the music machine we have; Friday DJ Per, Saturday DJ Sten and Eva and Sunday DJ Johan&nbsp; who will do their absolute best to keep you dancing all night long on the wonderful&nbsp;dance floors&nbsp;of<strong> Casino Cosmopol&nbsp;</strong>and&nbsp;at&nbsp;<strong>Tangokompaniet.</strong></p>\n<p><strong>We look forward to meet all of you at this wonderful week of tango in Malmö!</strong></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>samarbete med</p>\n<p><img alt=\"mebo\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/mebo-300x119.jpg\" width=\"300\" height=\"119\"/></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '2018-01-21 18:28:19', '2018-11-06 08:28:46'),
(38, 'Event', 'Festivalito', '', 'Schedule', 'EN', '', '\r\n\r\n		<div id=\"primary\">\r\n			<div id=\"content\" role=\"main\">\r\n\r\n				\r\n					<h1>The schedule for</h1>\r\n<h1>Autumn Festivalito&nbsp;10-12:th of November</h1>\r\n<br><b>Levels &amp; teachers:</b><br>\r\n\r\n<i>beg</i>: Beginners in tango, totally new dancers <br> \r\n<i>all levels</i>: All levels of dancers, intermediate to advanced, except complete beginners<br> \r\n<i>exp/adv</i>: Only for experienced and advanced dancers<br>\r\n<i>The teachers</i> Anna, Camila, Cecilia, Daniel, Nidia, Sonny, Per, Tava will be teaching in different constellations\r\n\r\n\r\n<br>\r\n\r\n\r\n\r\n\r\n\r\n           <h2>Friday 10:th of November - Casino Cosmopol, PS! BRING VALID ID!</h2>\r\n\r\n      <table class=\"table-schedule\" width=\"500\" cellspacing=\"0\" cellpadding=\"4\" border=\"0\">\r\n\r\n<tbody><tr>\r\n\r\n         <td class=\"even-row\" width=\"120\" valign=\"top\">Time</td><td>Theme</td><td>Venue</td>\r\n\r\n\r\n\r\n      </tr><tr>\r\n\r\n<td class=\"odd-row\" width=\"120\" valign=\"top\">17.30 - 19.00</td>\r\n         <td class=\"odd-row\"><b>Ws1: Barridas, contact and creativity</b> How to use a magnetic feeling in the contact and use that in a creative and playfull way in tango when it comes to contact in the feet. <i> all levels, A+N</i>\r\n</td><td class=\"odd-row\">Casino</td></tr>\r\n\r\n\r\n      <tr>\r\n           \r\n\r\n      </tr><tr>\r\n\r\n<td class=\"even-row\" width=\"120\" valign=\"top\">19.00 - 20.30</td>\r\n         <td class=\"even-row\"><b>Ws2: Milonga</b> Basics for milonga, the faster and more playfull dance and music. For some of you this will be repetition to become more confident and fluid and for others it will be more like an introduction. It is always useful to repeat some core ideas and fundamental pilars for a dance. <i> all levels, A+Ca</i>\r\n</td><td class=\"even-row\">Casino</td></tr>\r\n\r\n\r\n      <tr>\r\n\r\n<td class=\"odd-row\" width=\"120\" valign=\"top\">19.00 - 20.00</td>\r\n\r\n\r\n <td class=\"odd-row\"><b>Introclass to tango</b> <b> </b>  <i>beg S+T</i>\r\n </td><td class=\"odd-row\">Casino Cosmopol</td></tr>\r\n     \r\n<tr><td class=\"even-row\" width=\"120\" valign=\"top\">20.00 - 02.30</td>\r\n <td class=\"even-row\"><b>Tangoball, Live music with Bandonegro</b> <b> </b>  <i>DJ Per Berseus</i>\r\n </td><td class=\"even-row\">Casino Cosmopol</td></tr>\r\n     \r\n       \r\n\r\n     \r\n\r\n</tbody></table>\r\n\r\n<br>\r\n<p></p>\r\n\r\n\r\n\r\n\r\n      <h2>Saturday 11:th of November - Casino Cosmopol, Slottsgatan 33, PS! BRING VALID ID!</h2>\r\n      <table class=\"table-schedule\" width=\"500\" cellspacing=\"0\" cellpadding=\"4\" border=\"0\">\r\n<tbody><tr>\r\n         <td class=\"even-row\" width=\"120\" valign=\"top\">Time</td><td>Theme</td><td>Venue</td>\r\n\r\n\r\n\r\n\r\n\r\n </tr>\r\n\r\n\r\n\r\n\r\n <tr>\r\n\r\n<td class=\"even-row\" valign=\"top\">14.00 - 15.30</td>\r\n\r\n\r\n         <td class=\"even-row\"><b>Ws3: Spine in motion</b> anatomy and body awareness for tango\r\n<div class=\"comment more\">\r\n\r\n \r\nWhat are the structures of the spine and how does it allow us to move through space? How is our spine connected to our central axis and how does this awareness impact our dance? This workshop will include theory, individual practice, and excercises in pairs relating to Tango. Bring comfy clothes and curiousity! </div>\r\n <i> all levels, N+T</i></td>  <td class=\"even-row\">Casino</td>   \r\n  </tr>\r\n\r\n    \r\n <tr>\r\n         <td class=\"odd-row\" valign=\"top\">14.30 - 18.00</td>\r\n<td class=\"odd-row\"><b>Dagmilonga på Casinots lilla sal\r\n</b> <i>DJ Sten Odelberg </i></td><td class=\"odd-row\">Casino</td>\r\n\r\n</tr>\r\n\r\n\r\n\r\n    \r\n<tr>\r\n         <td class=\"even-row\" valign=\"top\">15.45 - 17.15</td>\r\n       \r\n<td class=\"even-row\"><b>Ws4: Technique workshop </b> both for leaders and for followers, embellishments, balance, timing, footwork, technique for pivots , lapiz, planeo, rolos, enrosques <i> all levels D+S </i></td><td class=\"even-row\">Casino</td>\r\n\r\n\r\n     </tr>\r\n\r\n \r\n <tr>\r\n\r\n\r\n\r\n    \r\n </tr><tr>\r\n         <td class=\"odd-row\" valign=\"top\">17.30 - 19.00</td>\r\n<td class=\"odd-row\"><b>Ws5: Changing roles smoothly \r\n</b> For all you who allready dance at least one of the roles and want to learn more about tango, changing roles is a really efficent way to get more clarity in how things work in the dance and you will benefit in one role when learning the other. <i> all levels, D+P</i></td><td class=\"odd-row\">Casino</td>\r\n\r\n</tr>\r\n\r\n \r\n      \r\n\r\n <tr>\r\n         <td class=\"even-row\" valign=\"top\">19.00 - 20.30</td>\r\n         <td class=\"even-row\"><b>Ws6: Vals</b> For you who danced a while and want some challenges and get better at differentiating your vals from your tango. <i> exp/adv, A+S</i></td> <td class=\"even-row\">Casino</td>\r\n\r\n \r\n\r\n\r\n </tr><tr>\r\n         <td class=\"odd-row\" valign=\"top\">19.00 - 20.00</td>\r\n         <td class=\"odd-row\"><b>Introclass to tango</b> Both for totally new dancers and for those who forgot and want to comeback to tango. The introductions to tango during this weekend can be taken as a package or separate. <i>beg, Ca+D </i> </td> <td class=\"odd-row\">Casino</td>\r\n\r\n   \r\n\r\n</tr>\r\n       <tr>\r\n         <td class=\"even-row\" width=\"120\" valign=\"top\">20.00 - 02.30 \r\n\r\n</td>\r\n         <td class=\"even-row\"><b>Tangoball</b> <b></b> <b></b><b> </b> <i> DJ Eva Lehrmann</i> </td> <td class=\"even-row\">Casino</td>\r\n</tr>\r\n\r\n            </tbody></table>\r\n\r\n\r\n\r\n\r\n           <h2>Sunday 12:th of November - TKstudio, Fredriksbergsgatan 7, Don\'t bring your ID </h2>\r\n\r\n      <table class=\"table-schedule\" width=\"500\" cellspacing=\"0\" cellpadding=\"4\" border=\"0\">\r\n\r\n<tbody><tr>\r\n\r\n         <td class=\"even-row\" width=\"120\" valign=\"top\">Time</td><td>Theme</td><td>Venue</td>\r\n\r\n</tr><tr>\r\n      \r\n<td class=\"odd-row\" valign=\"top\">13.30 - 15.00</td>\r\n         <td class=\"odd-row\"><b>Ws7: Relaxation and tension\r\n</b> We can reduce and increase tensions according to which action is required. Some bodyparts must be relaxed and others has to be tense in order to perform figures effectively with different qualities and dynamics.\r\nThe workshop will have 3 parts.\r\n1. Self-observation in movement with focus in tonicity: Which are our tendencies in terms of tonicity? Which parts are more tense and which are more relaxed?.\r\n2. Relaxation-tension dancing tango: How much tension-relaxation we use when we dance? Which changes can help us in order to perform tango figures?.\r\n3. Adaptability to new partners: How much do we need to change this tension-relaxation in order to adapt ourselves to different partners?\". <i> all levels, D+N</i> \r\n</td><td class=\"odd-row\">TKstudio</td></tr>\r\n\r\n\r\n<tr>\r\n         <td class=\"even-row\" valign=\"top\">15.30 - 17.00</td>\r\n       \r\n<td class=\"even-row\"><b>Ws8: Soltada turns - spins with good balance and good leading </b> For a may playfull dance and for more feeling of selfconfidence making soltadas is a great tool. How to make spins in a tango will also be taught during this workshop. With lots of experience both from tango and salsa Camila and Per will guide you. <i> all levels, Ca+P</i></td><td class=\"even-row\">Tkstudio</td>\r\n\r\n\r\n     </tr>\r\n\r\n      \r\n\r\n     \r\n\r\n <tr>\r\n         <td class=\"odd-row\" valign=\"top\">17.15 - 18.45</td>\r\n         <td class=\"odd-row\"><b>Ws9: Musicality - timing matters \r\n</b>\r\n <i>all levels, P+Ce</i></td>  <td class=\"odd-row\">TKstudio</td>\r\n</tr>\r\n\r\n\r\n      <tr>\r\n\r\n<td class=\"even-row\" width=\"120\" valign=\"top\">19.00 - 20.00</td>\r\n         <td class=\"even-row\"><b>Introclass to tango</b> <i> beg, Ca+S</i>\r\n</td><td class=\"even-row\">TKstudio</td></tr>\r\n\r\n\r\n      <tr>\r\n\r\n<td class=\"odd-row\" width=\"120\" valign=\"top\">20.00 - 24.00</td>\r\n         <td class=\"odd-row\"><b>Last milonga of the festival</b>  <b></b>  <i>DJ Johan Nordström</i>\r\n </td><td class=\"odd-row\">TKstudio</td></tr>\r\n  </tbody></table>\r\n\r\n\r\n\r\n      \r\n\r\n\r\n\r\n\r\n      \r\n \r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><a><img class=\"alignnone size-medium wp-image-359\" alt=\"\" width=\"212\" height=\"300\"></a></p>\r\n\r\n				\r\n			</div><!-- #content -->\r\n		</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2018-11-06 08:28:46'),
(39, 'Event', 'Festivalito', '', 'Payment', 'EN', '', '<p>Payment is done to bankgiro 5532-8223; please write “Festivalito” in the message. If you don’t have a Swedish bank you pay cash upon arrival, please then send an email about that.</p>\n<h1>Prices and Payment</h1>\n<p><strong>Early Bird:</strong></p>\n<p>When booking a package and paying at least 1 month before the festival you qualify as an Early Bird and you get a discount of 100 SEK on any bookings concerning at least 6h classes.</p>\n<p><strong>First-timers in tango:</strong></p>\n<p>Haven’t danced tango before? No problem! We offer you first-timers three evenings with a new intro-class each evening. After the class you just continue into the world of tango by attending the social dancing and of course you will also see shows performed by the teachers, live music on Friday.</p>\n<p>One evening with one intro class and dance evening with show = 200 SEK ,&nbsp;<em>First-timers Package:</em>&nbsp;3 evenings with intro-class (1 hour) and dance evening/night (in total 3 intro-classes and 3 dance evenings): 400 SEK (33% discount)</p>\n<p><strong>For intermediate and experienced dancers</strong></p>\n<p>Dance package: 400 SEK, 3 evenings and daymilonga</p>\n<p><em>Small Package: 4 ws (6 hours of classes)</em> and all social dancing 1060 SEK</p>\n<p>Festivalito package 6 ws (9 hours of classes) and all social dancing 1300 SEK</p>\n<p><em>Super package:</em>&nbsp;Take it all (all social dance/workshops/) 1700 SEK</p>\n<p>Single workshops for tangodancers 1,5 hours:&nbsp;250 SEK but 200 SEK with Early Bird. 3 h seminar = 2 workshops</p>\n<p>&nbsp;</p>\n<ul>\n  <li>Friday milonga live music (Bandonegro) and show: 180 SEK</li>\n  <li>Saturday daymilonga/practica 70 SEK</li>\n  <li>Saturday milonga with show: 130 SEK</li>\n  <li>Sunday evening with show: 100 SEK</li>\n</ul>\n<p>&nbsp;</p>', '2018-01-21 18:28:19', '2018-11-06 08:28:46'),
(40, 'Event', 'Festivalito', '', 'Register', 'EN', '', '<h1>Register</h1>\n<p>You welcome to register per e-mail: <a href=\"mailto:daniel@tangokompaniet.com\" title=\"mailto:daniel@tangokompaniet.com\">daniel@tangokompaniet.com</a> after choosing your package and follow payments instructions at “Prices”. Once you have paid you are registered!</p>\n<p>You do not need to register with a partner, but to be more sure that you get a place in the workshops it will help if you do. We have a&nbsp;<a title=\"TK partnership on facebook\" href=\"https://www.facebook.com/groups/501494573205992/\" target=\"_blank\">“Tangokompaniet – partnersearch”</a>&nbsp;on facebook!&nbsp;are also willing to assist you on this matter if needed.</p>\n<p>Workshops get full quite fast and registration is binding if you unregister later than a week before the festival.&nbsp;If you have registered and are not able to participate contact us as soon as possible.</p>\n<p><strong>WELCO TO THE FESTIVAL!</strong></p>', '2018-01-21 18:28:19', '2018-11-06 08:28:46'),
(41, 'Event', 'Festivalito', '', 'Venues', 'EN', '', '<h1>enues</h1>\n<p>the Casino Cosmopol, Slottsgatan 33. Here you need to be at least 20 years old and bring a valid photo ID to enter. Scandinavian drivers licenses and European IDs are valid. If you are a citizen from outside Europe, please bring your passport. The venue is really elegant and the floor is fantastic.</p>\n<p>&nbsp;</p>\n<p><strong>Casino Cosmopol</strong></p>\n<p>In the ballroom of the casino in Malmö we will have a great wooden dance floor, chandeliers in the ceiling and a fully served bar to our service. You don’t have to think of anything else then to bring your dancing shoes and your ID!</p>\n<p>To this venue you come easy by walking from the centralstation. The adress is Slottsgatan 33</p>\n<p><img alt=\"CasinoCosmopol\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/CasinoCosmopol-225x300.jpg\" width=\"225\" height=\"300\"/></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>Tangokompaniet studio</strong></p>\n<p>A pulsating bunker with bar, lunge and a great dance floor. Tangokompaniet is a base for training, courses, milongas and practicas!</p>\n<p>To get to TK-studio at Fredriksbergsgatan 7, you can take bus no 3 or 7 from the Centralstation and get off at the stop “Slussen”, or you can walk. You enter the studio around the corner of no 7, where we have an elevator of our own, taking you one floor down.</p>\n<p><img alt=\"Tangokompanietstudio\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/Tangokompanietstudio-300x199.jpg\" width=\"300\" height=\"199\"/></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>Travel</strong></p>\n<p>You can get to Malmö by car train and by flying to Sturup or Kastrup-Copenhagen Airport. The bus from Sturup takes 40 min and the train from Kastrup about 20 min.</p>\n<p>You can take the local green buses all around Malmö. To search for a route check www.skanetrafiken.se Remember that you can not pay by cash on the bus; but through their app or by a prepaid card baught at Pressbyrån or at Skånetrafiken office at the Centralstation.</p>\n<p>Share a cheap cab! Call Taxiverket +46-40-232323 or codrive with other tangueros.</p>\n<p>&nbsp;</p>\n<p><img alt=\"\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/tk_studio_dansare.jpg\" width=\"400\" height=\"220\"/><em>Tango night.</em></p>', '2018-01-21 18:28:19', '2018-11-06 08:28:46'),
(42, 'Event', 'Festivalito', '', 'Teachers and DJs', 'EN', '', '\r\n\r\n<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n\r\n				\r\n					<h1>The crew</h1>\r\n<h1></h1>\r\n<p><strong style=\"color: black; font-family: Verdana, Arial, sans-serif; font-size: 11px;\">The teachers and performers</strong></p>\r\n<p>&nbsp;</p>\r\n<p><b>Anna Sol&nbsp;</b><img alt=\"anna.solakius\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/anna.solakius.jpg\" width=\"212\" height=\"300\"><br>\r\nAnna teaches and organizes in Tangokompaniet since 2002. Her teaching offers the opportunity to explore her own body, the communication in dance and the expression in the music. Her dance expresses her person; energy, joy and the pursuit of consciousness. She is also a very active DJ, both regionally, nationally and internationally, and also hosts seminars on tango music and DJing.</p>\r\n<p><strong>Camila Holst-Viancos&nbsp;</strong><img class=\"alignnone size-medium wp-image-441\" alt=\"DSC_1302\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/DSC_1302-199x300.jpg\" width=\"199\" height=\"300\"></p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; -webkit-text-stroke: #000000}\r\nspan.s1 {font-kerning: none}\r\nspan.s2 {font: 12.0px \'Helvetica Neue\'; font-kerning: none}\r\n--></style>\r\n<p>Camila Viancos has a broad experience with teaching, dancing and performing from different dance styles such as salsa and modern dancing.&nbsp;Her focus in tango dancing is connection, musicality and body awareness. She is very passionated about teaching and she currently lives from teaching dance, yoga and pilates.&nbsp;Camila is also&nbsp;performing as a singer and teaches musicality for salsa dancers with live musicians.</p>\r\n<p><strong>Cecilia Warfvinge&nbsp;</strong><img alt=\"cecilia\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/cecilia-248x300.jpeg\" width=\"248\" height=\"300\"></p>\r\n<p>For Cecilia, Tangon offers the opportunity to express dynamic musicality, and her dance has been described as elegant and musical. She has a background in classical music, and therefore has a deep understanding of the different expressions of music. Cecilia is inspired by her interest in fitness and Chinese Tai Chi, and advocates bodily control and playfulness in the dance.</p>\r\n<p><b>Daniel Carlsson&nbsp;</b><img class=\"alignnone size-medium wp-image-426\" alt=\"daniel.carlsson\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/daniel.carlsson.jpg\" width=\"212\" height=\"300\"></p>\r\n<div id=\"tw-target-text-container\">\r\n<p dir=\"ltr\" id=\"tw-target-text\" data-placeholder=\"Översättning\">Daniel is one of the founders of Tangokompaniet. After touring around the world teaching tango during many years and teaching in over 20 countries Daniel decided to put more focus on making the Öresundtango grow in many aspects. For Daniel feeling, connection and creativity are the key words.</p>\r\n<p><strong>Nidia Martinez&nbsp;</strong><img alt=\"nidia\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/nidia-248x300.jpg\" width=\"248\" height=\"300\"><br>\r\nNidia is educated in contemporary / modern dance and works as a dancer, choreographer and teacher. She is also Pilate’s instructor. Nidia started dancing tango in Argentina and is interested in tango as social dance but also as a technique that makes her artistic expression richer. As a teacher, she focuses on body communication and awareness. She develops her training method for tango dancers with her knowledge of Pilates and Contact Improvisation (contemporary / modern dance).</p>\r\n<p>&nbsp;</p>\r\n<pre lang=\"en\"></pre>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p><b>Per Berseus&nbsp;</b><img class=\"alignnone size-medium wp-image-424\" alt=\"per.berseus\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/per.berseus.jpg\" width=\"212\" height=\"300\"></p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Helvetica; -webkit-text-stroke: #000000}\r\nspan.s1 {font-kerning: none}\r\n--></style>\r\n<p>With one foot in musicianship and the other in movement practices, Per has an in-depth relationship with dancing and teaching. Ever since his childhood he has kept playing in a symphony orchestra, and he was immediately captured by the tango music when he started dancing in 2003. Over the last 10 years Per draws inspiration from movement disciplines such as yoga and Gyrotonic, and he teaches tango as an embodied experience of warm-hearted expression</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sonny La&nbsp;</strong><img class=\"alignnone size-medium wp-image-423\" alt=\"sonny\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/sonny-211x300.jpg\" width=\"232\" height=\"330\"><br>\r\nTango is for Sonny a dance of presence and musical expression. His dance can be described as conscious and playful. Sonny has a background in Chinese Kung Fu and Tai Chi, exhibiting both physical strength and soft dynamics. With his good educational ability, he inspires his students to dare to experiment and experiment with their dance.</p>\r\n<p><b>Tava Sieh&nbsp;</b><img alt=\"Tava\" src=\"http://festivalito.tangokompaniet.com/wp-content/uploads/Tava.jpg\" width=\"180\" height=\"240\"></p>\r\n<p>Tava’s love for dance and enthusiasm for teaching is informed by her experiences as a physiotherapist, massage therapist, and yoga practitioner. She began her Tango journey in Boulder, Colorado and the path lead quickly to Buenos Aires, and then onward Sweden where she has been teaching with Tangokompaniet since 2012.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>DJs</strong></p>\r\n<p>Per Berseus</p>\r\n<p>Johan Nordström</p>\r\n<p>Sten Odelberg</p>\r\n<style type=\"text/css\"><!--\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 23.0px Times; color: #454545; -webkit-text-stroke: #454545} span.s1 {font-kerning: none}\r\n--></style>\r\n\r\n				\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2018-11-06 08:28:46'),
(43, 'Event', 'Festivalito', '', 'Other Info', 'EN', '', '<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n<h1>Other info</h1>\r\n<h3>Food and Beverages</h3>\r\n<p>Coffee, tea, coke, chocolate, fruits will be available. Malmoe has many good restaurants; so no need to be hungry!</p>\r\n<h3>TK-Tango-shop</h3>\r\n<p>Tangokompaniet offers many models from several different brands of good shoes for dancing – both classical and sneakers for both men and women in the studio at Fredriksbergsgatan 7. You can also find music, CDs, books and clothing! Some of our brands: Bandolera, Regina, Vikinga, Fabioshoes, DNI, Carlos Ferroni, Bloch, DSOL</p>\r\n<h3>Dancepartner</h3>\r\n<p>Please use Tangokompaniet Festivalito event on Facebook to search partner or Tangokompaniets Partnersearch on facebook. You can register without partner but it is easier with! We can help with partnersearch if you tried and didnt succeed !</p>\r\n<h3>Accomodation</h3>\r\n<p>Please search for local dancers that might take you in or look for youth hostels or hotels; you can find good deals at <a href=\"http://www.booking.com\" class=\"autohyperlink\" title=\"http://www.booking.com\">www.booking.com</a>. If nothing is found contact us !</p>\r\n<h3></h3>\r\n\r\n				\r\n			\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   ', '2018-01-21 18:28:19', '2018-11-06 08:28:46'),
(44, 'Event', 'Festivalito', '', 'Contact Us', 'EN', '', '<div id=\"primary\">\r\n<div id=\"content\" role=\"main\">\r\n\r\n				\r\n					<h1>Contact</h1>\r\n<p>E-mail: <a href=\"mailto:daniel@tangokompaniet.com\" title=\"mailto:daniel@tangokompaniet.com\">daniel@tangokompaniet.com</a></p>\r\n<p>Daniel 0046-(0)73 6563609</p>\r\n\r\n				\r\n</div><!-- #content -->\r\n</div><!-- #primary -->\r\n\r\n\r\n   \r\n', '2018-01-21 18:28:19', '2018-11-06 08:28:46'),
