(1781, '', 'Course', '', 'No Label', 'SV', '', '<h3>Kursen vänder sig till dig</h3>\r\n<div style={{textAlign:\'center\'}}>\r\n<p>som är nybörjare eller du som vill repetera tangons grunder!&nbsp;</p>\r\n<p>Tips! I din kurs ingår det gratis träningstillfällen; sk practilongas! Ta chansen att sätta stegen och ha kul redan från början!<br>\r\n Förutom våra grundkurser har vi även en helgkurs för nya tangodansare under påsken, se <a href=\"http://www.festivalito.tangokompaniet.com/\">&nbsp;Tango Festivalito Malmö</a> &nbsp;<br>\r\n&nbsp;</p>\r\n</div>\r\n<h3>Kursplan</h3>\r\n<p>På kursen tränar du element som <br>\r\n&nbsp;</p>\r\n<p>- grundrytm &amp; musik<br>\r\n&nbsp;</p>\r\n<p>- dansfattning &amp; hållning<br>\r\n&nbsp;</p>\r\n<p>- steg &amp; kommunikation<br>\r\n&nbsp;</p>\r\n<h3>Mål</h3>\r\n<p>På Grundkurs I lär du dig grunderna i argentinsk tango. Du kommer kunna &nbsp;röra dig tillsammans med en partner till musiken och kunna dansa de &nbsp;vanligaste stegkombinationerna. Under kursen kommer du även fått &nbsp;tillfälle att tillsammans med gruppen och lärarna dansa socialt på en &nbsp;tangokväll. &nbsp;&nbsp;</p>\r\n<h3>Pris</h3>\r\n<p>Grundkurser börjar i januari och i september och varar 7 veckor varpå vi &nbsp;erbjuder fortsättningen grundkurs 2. Priset för en grundkurs är 850 kr. &nbsp;Tar man båda grundkurserna och betalar för båda före grundkurs 1 &nbsp;startar får man det fördelaktiga priset 1500 kr (ordpris 1700 kr)<br>\r\n&nbsp;</p>\r\n<p>Kursen omfattar 7 lektioner och praktikor/danskvällar. Vi ser gärna &nbsp;att man dansar mycket och man tex gå grundkurs 1 men flera tillfällen i &nbsp;veckan betalar man bara 250 kr extra och detta ger snabbare inlärning &nbsp;och ökad säkerhet.<br>\r\n Förbetalning sker till Tangokompaniets bankgiro 5532-8223 <br>\r\nSkriv ditt namn och kurs. &nbsp;</p>\r\n\r\n', '2018-01-23 15:03:50', '2018-11-06 08:28:46'),
(1782, '', 'Course', '', 'No Label', 'SV', '', '<h3>Kursen vänder sig till dig</h3>\r\n<p>som har gått Grundkurs I, eller mer, som vill repetera tangons grunder och lite till!</p>\r\n<h3>Kursplan</h3>\r\n<p>På kursen tränar du element som <br>\r\n</p>\r\n<p>- olika rytmer<br>\r\n - grundteknik<br>\r\n - stegkombinationer &amp; flyt<br>\r\n&nbsp;</p>\r\n<h3>Mål</h3>\r\n<p>På Grundkurs II får du lite mer kött på benen när det gäller din &nbsp;grundteknik i tango. Dessutom kommer du få prova fler nya steg och lära &nbsp;dig att kombinera dem så att du känner flyt i dansen. När du gått denna &nbsp;kurs kan du dansa tango, helt enkelt! &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<h3>Pris</h3>\r\n<p>Grundkurser börjar i januari och i september och varar 7 veckor varpå vi &nbsp;erbjuder fortsättningen grundkurs 2. Priset för en grundkurs är 850 kr. &nbsp;Tar man båda grundkurserna och betalar för båda före grundkurs 1 &nbsp;startar får man det fördelaktiga priset 1500 kr (ordpris 1700 kr)<br>\r\n&nbsp;</p>\r\n<p>Kursen omfattar 7 lektioner och praktikor/danskvällar. Vi ser gärna &nbsp;att man dansar mycket och man tex gå grundkurs 1 men flera tillfällen i &nbsp;veckan betalar man bara 250 kr extra och detta ger snabbare inlärning &nbsp;och ökad säkerhet.<br>\r\n Förbetalning sker till Tangokompaniets bankgiro 5532-8223 <br>\r\nSkriv ditt namn och kurs. &nbsp;&nbsp;</p>\r\n', '2018-01-23 15:04:55', '2018-11-06 08:28:46'),
(1783, NULL, 'Course', '', 'No Label', 'SV', '', '<h3>Kursen vänder sig till dig</h3>\r\n<p>som har god balans och dansar till musiken men vill utveckla din &nbsp;kontakt, hållning och abrazo (kram) ytterligare och få mer variation i &nbsp;din dans&nbsp;</p>\r\n<h3>Förkunskaper</h3>\r\n<p><strong>Erfarenhetsmässigt har du</strong></p>\r\n<p>- gått flera kurser och workshops samt dansat regelbundet på practilongas och milongas<br>\r\n</p>\r\n<p>- du har förmodligen även dansat på någon festival och kanske även i någon annan stad eller land<br>\r\n&nbsp;</p>\r\n<p><strong>Kunskapsmässigt</strong></p>\r\n<p>- du kan dessutom känna igen ett par olika orkestrar och du känner att du har tränat upp en bra hållning och kontakt i dansen</p>\r\n<p>- din balans är bra, dvs du kan vrida på ett ben utan problem och &nbsp;således gå samt göra sacadas, giros, ochos, boleos och ganchos utan att &nbsp;ta stöd från din partner<br>\r\n&nbsp;</p>\r\n<p>- du har en förståelse för dansflödet och de sociala koderna på milongan<br>\r\n&nbsp;</p>\r\n<p><strong>På dansgolvet befinner du dig</strong></p>\r\n<p>- regelbundet på practilongas eller milongas varje vecka <br>\r\n</p>\r\n<h3>Kursplan</h3>\r\n<p>&nbsp;Kursen kommer vara uppdelad i två delar med en påskfestival i mitten. Man kan anmäla sig till den ena eller den andra eller till båda. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\r\n<p>- att utöka din repertoar <br>\r\n&nbsp;</p>\r\n<p>- lyhördhet och balans<br>\r\n&nbsp;</p>\r\n<p>- hållning och kram<br>\r\n&nbsp;</p>\r\n<p>- musik och rytmik<br>\r\n&nbsp;</p>\r\n<h3>Mål</h3>\r\n<p>&nbsp;Vi tränar på att verkligen få fina tangokramar och kontroll på vår kropp &nbsp;utan att tappa kontakten med partnern och medvetenheten om rummet. Vi &nbsp;tränar på att variera dansen till musiken och utnyttja energin i våra &nbsp;rörelser på ett smart sätt. Efter kursen är tanken att såväl balans som &nbsp;omfamningar och medvetandet ska ha klarnat upp ytterligare. &nbsp;</p>\r\n<h2>Vilken kurs ska jag välja?</h2>\r\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\r\n</p>\r\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\r\n\r\n', '2018-01-24 10:10:15', '2018-11-06 08:28:46'),
(1784, NULL, 'Course', '', 'No Label', 'SV', '', '<h3>Kurserna vänder sig till dig</h3>\r\n<p>som har dansat tango en längre tid och som vill utveckla din tango till att bli ännu mer dynamisk och varierad.</p>\r\n<h3>Förkunskaper</h3>\r\n<p><strong>Tidsmässigt har du</strong></p>\r\n<p>- dansat tango i ett par eller många år och har spenderat en hel del tid på på kurs och på det sociala dansgolvet <br>\r\n</p>\r\n<p><strong>Kunskapsmässigt</strong></p>\r\n<p>- har du bra balans, du pivoterar lätt ståendes på en fot <br>\r\n&nbsp;</p>\r\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\r\n&nbsp;</p>\r\n<p>- du hinner med en utsmyckning på vägen mellan en rörelse och nästa<br>\r\n&nbsp;</p>\r\n<p>- du dansar i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\r\n&nbsp;</p>\r\n<p>- du kan musiken och har favoritorkestrar och -låtar<br>\r\n&nbsp;</p>\r\n<p>- du har förståelse för skapande och improvisation <br>\r\n&nbsp;</p>\r\n<p><strong>På dansgolvet befinner du dig</strong></p>\r\n<p>- frekvent både på practilongas och milongas i regionen<br>\r\n&nbsp;</p>\r\n<p>- självklart när det är festival i Sverige och någon gång även kanske utomlands &nbsp;<br>\r\n</p>\r\n<h3>Kursplan</h3>\r\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\r\n<p>- teknik och kommunikation <br>\r\n&nbsp;</p>\r\n<p>- improvisation och struktur<br>\r\n&nbsp;</p>\r\n<p>- variation i stil <br>\r\n&nbsp;</p>\r\n<p>- musik och rytmik<br>\r\n&nbsp;</p>\r\n<h3>Mål</h3>\r\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\r\n&nbsp;</p>\r\n<h3>Vilken kurs ska jag välja?</h3>\r\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\r\n</p>\r\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\r\n\r\n', '2018-01-24 10:10:52', '2018-11-06 08:28:46'),
(1785, NULL, 'Course', '', 'No Label', 'SV', '', '<h3>Kurserna vänder sig till dig</h3>\r\n<p>som har dansat tango en längre tid och som vill utveckla din tango till att bli ännu mer dynamisk och varierad.</p>\r\n<h3>Förkunskaper</h3>\r\n<p><strong>Tidsmässigt har du</strong></p>\r\n<p>- dansat tango i ett par eller många år och har spenderat en hel del tid på på kurs och på det sociala dansgolvet <br>\r\n</p>\r\n<p><strong>Kunskapsmässigt</strong></p>\r\n<p>- har du bra balans, du pivoterar lätt ståendes på en fot <br>\r\n&nbsp;</p>\r\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\r\n&nbsp;</p>\r\n<p>- du hinner med en utsmyckning på vägen mellan en rörelse och nästa<br>\r\n&nbsp;</p>\r\n<p>- du dansar i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\r\n&nbsp;</p>\r\n<p>- du kan musiken och har favoritorkestrar och -låtar<br>\r\n&nbsp;</p>\r\n<p>- du har förståelse för skapande och improvisation <br>\r\n&nbsp;</p>\r\n<p><strong>På dansgolvet befinner du dig</strong></p>\r\n<p>- frekvent både på practilongas och milongas i regionen<br>\r\n&nbsp;</p>\r\n<p>- självklart när det är festival i Sverige och någon gång även kanske utomlands &nbsp;<br>\r\n</p>\r\n<h3>Kursplan</h3>\r\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\r\n<p>- teknik och kommunikation <br>\r\n&nbsp;</p>\r\n<p>- improvisation och struktur<br>\r\n&nbsp;</p>\r\n<p>- variation i stil <br>\r\n&nbsp;</p>\r\n<p>- musik och rytmik<br>\r\n&nbsp;</p>\r\n<h3>Mål</h3>\r\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\r\n&nbsp;</p>\r\n<h2>Vilken kurs ska jag välja?</h2>\r\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\r\n</p>\r\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\r\n\r\n', '2018-01-24 10:16:27', '2018-11-06 08:28:46'),
(1786, NULL, 'Course', '', 'No Label', 'SV', '', '<h3>Kursen vänder sig till dig</h3>\r\n<p>som har grunderna i tango och vill &nbsp;utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt &nbsp;vill du känna att du dansar mer till musiken och känna dig säkrare i &nbsp;dina egna rörelser.&nbsp;</p>\r\n<h3>Förkunskaper</h3>\r\n<p><strong>Erfarenhetsmässigt har du</strong></p>\r\n<p>- gått grundkurs i tango samt varit ute och dansat några gånger på practilongas och milongas &nbsp;&nbsp;<br>\r\n</p>\r\n<p><strong>Kunskapsmässigt</strong></p>\r\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken &nbsp;och din partner, hittat ett dansflöde, konsten att gå tillsammans både i &nbsp;parallell gång och i korsad gång. Du har även tränat på ochos, giros &nbsp;och gungor etc. <br>\r\n&nbsp;</p>\r\n<p><strong>På dansgolvet befinner du dig</strong></p>\r\n<p>- någon till några gånger i månaden <br>\r\n&nbsp;</p>\r\n<h3>Kursplan</h3>\r\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\r\n<p>- att utöka din repertoar <br>\r\n&nbsp;</p>\r\n<p>- lyhördhet och balans<br>\r\n&nbsp;</p>\r\n<p>- musik och rytmik<br>\r\n&nbsp;</p>\r\n<h3>Mål</h3>\r\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, &nbsp;musiken och din partner. Det kan kännas svårt att ha fokus på allt detta &nbsp;samtidigt och bibehålla ett flyt i dansen; på kursen bygger vi gradvis &nbsp;upp denna medvetenhet. Det är det som ger kvalitet i dansen och njutbara &nbsp;danser!</p>\r\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar &nbsp;tango och fått mer känsla av sammanhang och flyt. Vi ökar på din &nbsp;repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. På kursen &nbsp;arbetar vi med att få ett flyt i &nbsp;dansen genom att bli skickligare på grunderna och kombinera olika &nbsp;möjligheter. Orden blir till meningar!&nbsp;</p>\r\n<h3>Vilken kurs ska jag välja?</h3>\r\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\r\n</p>\r\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\r\n\r\n', '2018-01-24 10:17:23', '2018-11-06 08:28:46'),
(1787, '', 'Course', '', 'No Label', 'SV', '', '<h3>Kursen vänder sig till dig</h3>\n<p>som har grunderna i tango och vill &nbsp;utöka din repertoar, få mer teknik och en säkrare kontakt med musiken &nbsp;och med danspartners och känna dig säkrare i dina egna rörelser.&nbsp;</p>\n<h2>Fortsättare 2</h2>\n<p>Startdatum5/9 2018 Kurstid:17.30-19:00 Kurslängd:15 veckor. 14 lektioner + 1 lärarledd praktika + avslutningsfest Adress:Tangokompaniet studio, Fredriksbergsgatan 7, <br>\n<strong>Malmö</strong> <a href=\"http://kartor.eniro.se/\">Klicka här för karta</a> &nbsp;Lärare:<a href=\"https://www.tangokompaniet.com/lararna/#daniel\">Daniel</a><a href=\"https://www.tangokompaniet.com/lararna/#camila\">Camila</a> &nbsp;&nbsp;</p>\n<h2>Kursen vänder sig till dig</h2>\n<p>som har grunderna i tango och vill &nbsp;utöka din repertoar, få mer teknik och en säkrare kontakt. Samtidigt &nbsp;vill du känna att du dansar mer till musiken och känna dig säkrare i &nbsp;dina egna rörelser.&nbsp;</p>\n<h3>Förkunskaper</h3>\n<p><strong>Erfarenhetsmässigt har du</strong></p>\n<p>- gått grundkurs i tango och ngn kurs till samt varit ute och dansat minst 15 ggr &nbsp;gånger på practilongas och milongas &nbsp;&nbsp;<br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du lärt dig vissa grundläggande element som att lyssna på musiken &nbsp;och din partner, hittat ett dansflöde, konsten att gå tillsammans både i &nbsp;parallell gång och i korsad gång. Du har även tränat på ochos, giros &nbsp;och gungor etc. <br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- någon till några gånger i månaden <br>\n&nbsp;</p>\n<h3>Kursplan</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- att utöka din repertoar <br>\n&nbsp;</p>\n<p>- lyhördhet och balans<br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<h3>Mål</h3>\n<p>Kursen fokuserar på att gradvis öka din medvetenhet om rummet, kroppen, &nbsp;musiken och din partner. Det kan kännas svårt att ha fokus på allt detta &nbsp;samtidigt och bibehålla ett flyt i dansen; på kursen bygger vi gradvis &nbsp;upp denna medvetenhet. Det är det som ger kvalitet i dansen och njutbara &nbsp;danser!</p>\n<p>&nbsp;I slutet av kursen kommer du känna dig betydligt säkrare när du dansar &nbsp;tango och fått mer känsla av sammanhang och flyt. Vi ökar på din &nbsp;repertoar så att du känner dig friare att uttrycka dig genom fler &nbsp;möjligheter och variationer. Pä kursen &nbsp;arbetar vi med att få ett flyt i &nbsp;dansen genom att bli skickligare på grunderna och kombinera olika &nbsp;möjligheter. Orden blir till meningar!&nbsp;</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\n</p>\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>', '2018-01-24 10:18:48', '2018-11-06 08:28:46'),
(1788, NULL, 'Course', '', 'No Label', 'SV', '', '<h3>Kurserna vänder sig till&nbsp;</h3>\r\n<p>de mest inbitna tangodansaren i &nbsp;regionen! Du vill få utmaningar i din tango och tycker sällan att något &nbsp;är för svårt. Tangon är en självklar del i din livsstil!</p>\r\n<h3>Förkunskaper</h3>\r\n<p><strong>Tidsmässigt har du</strong></p>\r\n<p>- dansat tango i många år och flera kvällar i veckan <br>\r\n&nbsp;</p>\r\n<p><strong>Kunskapsmässigt</strong></p>\r\n<p>- har du riktigt bra balans, du pivoterar lätt ståendes på en fot <br>\r\n&nbsp;</p>\r\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\r\n&nbsp;</p>\r\n<p>- hinner du lätt med en utsmyckning på vägen mellan en rörelse och nästa<br>\r\n&nbsp;</p>\r\n<p>- dansar du i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\r\n&nbsp;</p>\r\n<p>- kan du musiken och har favoritorkestrar och -låtar<br>\r\n&nbsp;</p>\r\n<p>- har du förståelse för skapande och improvisation <br>\r\n&nbsp;</p>\r\n<p><strong>På dansgolvet befinner du dig</strong></p>\r\n<p>- frekvent både på practilongas och milongas i regionen <br>\r\n&nbsp;</p>\r\n<p>- självklart när det är festival eller maraton i Sverige och då och då runtom i Europa<br>\r\n&nbsp;</p>\r\n<h3>Kursplan</h3>\r\n<p>Kursen är 19 veckor lång men vid behov kan vi avtala att ngn går en &nbsp;del av den tex vid utlandsresor mm annars kan man ta igen missade &nbsp;lektioner på andra kurser. <br>\r\n&nbsp;</p>\r\n<h3>Mål</h3>\r\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\r\n&nbsp;</p>\r\n<h2>Vilken kurs ska jag välja?</h2>\r\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\r\n</p>\r\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\r\n\r\n', '2018-01-24 10:20:30', '2018-11-06 08:28:46'),
(1799, NULL, 'Show', '', 'No Label', 'EN', '', '<p>A show is when the teachers show their dance skills officially with funny clothes.&nbsp;</p>', '2018-01-25 12:50:37', '2018-11-06 08:28:46'),
(1800, NULL, 'Show', '', 'No Label', 'SV', '', '<p>En tangoshow är normalt uppvisning av ett duktigt par som visar i fin klädsel gör tre till fyra uppvisningsdanser under cirka 20 minuter. Tangokompaniet har uppvisningspar och gör shower mot rimlig ersättning.</p>', '2018-01-25 12:51:38', '2018-11-06 08:28:46'),
(1802, NULL, 'Companies', '', 'No Label', 'EN', '', '<p>No description in English yet.</p>', '2018-01-25 12:56:47', '2018-11-06 08:28:46'),
(1804, '', 'PrivateLessons', '', 'No Label', 'EN', '', '<h2><br></h2>\n<h2>Privatlektioner</h2>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;Allmänt om privatlektioner</p>\n<p>Tangokompaniet erbjuder privatlektioner – oavsett om du aldrig dansat tango tidigare, eller om du har flera års erfarenhet. Privatlektioner är den effektivaste undervisningsmetoden eftersom man får lärarens hela uppmärksamhet. Man mister dock den sociala kontakten med sina kursare om man endast tar privatlektioner och därför rekommenderar vi er att kombinera dessa två undervisningsformer.Under en privatlektion kan du utveckla din:t</p>\n<ul>\n  <li>teknik,&nbsp;</li>\n  <li>balans,&nbsp;</li>\n  <li>hållning</li>\n  <li>kommunikationkänsla för musiken och rytmflyt i dansenimprovisations</li>\n  <li>förmåga i olika lägenvariation i stil och rytm…och mycket mer</li>\n</ul>', '2018-01-25 13:20:01', '2018-11-06 08:28:46'),
(1805, '', '', '', 'No Label', 'EN', '', '<p>No text in english</p>', '2018-01-25 13:40:46', '2018-01-25 13:40:46'),
(1815, '', 'Teacher', '', 'No Label', 'SV', '', '<p>Daniel, en &nbsp;av Tangokompaniets grundare. Efter att ha tangoturnerat i världen vill han satsa på att få Öresundstangon att växa snabbare. Flyt, fokus och fantasi!</p>', '2018-01-25 15:03:27', '2018-11-06 08:28:46'),
(1816, '', 'PrivateLessons', '', 'No Label', 'SV', '', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Privatlektioner &nbsp;&nbsp;Allmänt om privatlektionerTangokompaniet erbjuder privatlektioner – oavsett om du aldrig dansat tango tidigare, eller om du har flera års erfarenhet. Privatlektioner är den effektivaste undervisningsmetoden eftersom man får lärarens hela uppmärksamhet. Man mister dock den sociala kontakten med sina kursare om man endast tar privatlektioner och därför rekommenderar vi er att kombinera dessa två undervisningsformer.Under en privatlektion kan du utveckla din:teknik, balans, hållningkommunikationkänsla för musiken och rytmflyt i dansenimprovisationsförmåga i olika lägenvariation i stil och rytm…och mycket mer</p>', '2018-01-25 15:05:20', '2018-11-06 08:28:46'),
(1817, NULL, 'PrivateLessons', '', 'No Label', 'EN', '', '<p>&nbsp;&nbsp;Lärare som ger privatlektioner</p>', '2018-01-25 15:10:07', '2018-11-06 08:28:46'),
(1819, '', 'PrivateLessons', '', 'No Label', 'SV', '', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Lärare som ger privatlektioner</p>', '2018-01-25 15:22:23', '2018-11-06 08:28:46'),
(1820, NULL, 'PrivateLessons', '', 'No Label', 'SV', '', '<p>&nbsp;&nbsp;&nbsp;Priser för privatlektioner:I Sverige 600 SEK per lektion á 60 minuter INKL lokalhyran – dvs vid köp av 5 eller fler privatlektioner.Vid köp av endast en lektion kontakta Tangokompaniet för prisuppgift. 700 SEK om det är två elever och en lärare.Vid undervisning utomlands gäller andra priser:600 DKK i Danmark700 NOK i Norge100 CHF i Schweiz70 EUR i Frankrike.80 EUR i Moskva85 USD i USA Vid avbokning senare än 48 timmar innan lektion debiteras 1/4 av lektionspriset.Vid köp av flera lektioner samtidigt, ska alla lektioner tas inom ett år räknat från första lektionstillfället.&nbsp;</p>', '2018-01-25 15:22:28', '2018-11-06 08:28:46'),
(1821, '', 'Alert', '', 'No Label', 'EN', '', '<p>Ja ja ja&nbsp;</p>', '2018-01-25 15:24:22', '2018-11-06 08:28:46');
INSERT INTO `tbl_text_WITHOUT_TEXTID` (`id`, `routeId`, `groupId`, `textId`, `label`, `language`, `textTitle`, `textBody`, `creationTime`, `updateTime`) VALUES
(1822, '', 'Home', '', 'No Label', 'EN', '', '<p>Tangokompaniet is the largest tangoschool in Sweden. We arrange courses, workshops, festivals, maratons and a diversity of other tango events for private persons in all ages. We also make arrangements for companies. Tangokompaniet is located in Malmö and in Lund. We have customers allover the globe, but our focus is on the Öresund region. Our teachers are frequently invited as guest teachers and for shows in Sweden and abroad.</p>', '2018-01-25 15:24:28', '2018-11-06 08:28:46'),
(1824, '', 'Course', '', 'No Label', 'SV', '', '<p>Kursen är till för dig som vill lära dig de viktigaste knepen för att &nbsp;bli både en grundad, smidig och säker följare i tango. Vi tittar på &nbsp;tekniker som hjälper dig att utveckla just detta. Kursens material &nbsp;passar både erfarna och nyare dansare och alla tränar på sin egen nivå. <br>\n</p>\n<p>Du anmäler dig utan partner och kursen är öppen för alla. <br>\n</p>\n<p>Tid: Torsdagar kl 17:30-19.00.<br>\n Plats: Tangokompaniet studio, Fredriksbergsgatan 7 i Malmö<br>\n Pris: 800kr (om du redan går en terminskurs hos Tangokompaniet får du 100 kr rabatt) <br>\n Längd: 5 veckor, start 1e februari 2018. Det ingår också en lärarledd practica och avslutningsfesten.<br>\n&nbsp;</p>\n<p>För frågor och anmälan kontakta Anna på anna@tangokompaniet.com eller 0705-150345. VÄLKOMMEN!</p>', '2018-04-16 15:29:21', '2018-11-06 08:28:46'),
(1825, NULL, 'Help', '', 'No Label', 'EN', '', '<h2>So far no help text.</h2>\n<ul>\n  <li>Some must decide what you want here.It is possible to edit this text if you login under Admin.</li>\n</ul>', '2018-04-17 13:42:47', '2018-11-06 08:28:46'),
(1827, '', 'Home', '', 'No Label', 'SE', '', '<p>Tangokompaniet är Sveriges största tangoskola och arrangerar kurser, workshops och olika tangoevenemang för företag och privatpersoner i alla åldrar. Vi finns främst i Lund, Malmö och runtom i Öresunds- regionen men vi bjuds även in som gästlärare runtom i världen.</p>', '2018-01-25 15:24:28', '2018-11-06 08:28:46'),
(1829, NULL, 'Teacher', '', 'No Label', 'EN', '', '<p>Anna teaches and organizes in Tangokompaniet since 2002. Her teaching offers the opportunity to explore her own body, the communication in dance and the expression in the music. Her dance expresses her person; energy, joy and the pursuit of consciousness. She is also a very active DJ, both regionally, nationally and internationally, and also hosts seminars on tango music and DJing.</p>', '2018-05-02 13:12:26', '2018-11-06 08:28:46'),
(1830, NULL, 'Teacher', '', 'No Label', 'EN', '', 'Daniel is one of the founders of Tangokompaniet.                  After touring around the world teaching tango during many years and teaching                  in over 20 countries Daniel decided to put more focus on making the Öresundtango                  grow in many aspects. For Daniel feeling, connection and creativity are the key words.', '2018-05-02 13:12:52', '2018-11-06 08:28:46'),
(1831, NULL, 'Teacher', '', 'No Label', 'EN', '', 'For Cecilia the tango offers the opportunity to express dynamic musicality,                 and her dance has been described as elegant and musical.                 She has a background in classical music, and therefore has a deep understanding of                 the different expressions of music.                 Cecilia is inspired by her interest in fitness and Chinese Tai Chi,                 and advocates bodily control and playfulness in the dance.', '2018-05-02 13:13:05', '2018-11-06 08:28:46'),
(1832, NULL, 'Teacher', '', 'No Label', 'EN', '', 'Camila Viancos has a broad experience with teaching, dancing and performing from different             ance styles such as salsa and modern dancing. Her focus in tango dancing is connection, musicality             and body awareness. She is very passionated about teaching and she currently lives from teaching dance,             yoga and pilates. Camila is also performing as a singer and teaches musicality for salsa dancers             with live musicians.', '2018-05-02 13:13:12', '2018-11-06 08:28:46'),
(1833, NULL, 'Teacher', '', 'No Label', 'EN', '', 'Nidia is educated in contemporary / modern dance and works as a dancer,             choreographer and teacher. She is also Pilate’s instructor. Nidia started dancing tango             in Argentina and is interested in tango as social dance but also as a technique that             makes her artistic expression richer. As a teacher, she focuses on body communication and awareness.             She develops her training method for tango dancers with her knowledge of Pilates and Contact             Improvisation (contemporary / modern dance).', '2018-05-02 13:13:18', '2018-11-06 08:28:46'),
(1834, NULL, 'Teacher', '', 'No Label', 'EN', '', 'With one foot in musicianship and the other in movement practices,                 Per has an in-depth relationship with dancing and teaching. Ever since his childhood he has                 kept playing in a symphony orchestra, and he was immediately captured by the tango music when                 he started dancing in 2003. Over the last 10 years Per draws inspiration from movement                 disciplines such as yoga and Gyrotonic, and he teaches tango as an embodied experience                 of warm-hearted expression', '2018-05-02 13:13:25', '2018-11-06 08:28:46'),
(1835, NULL, 'Teacher', '', 'No Label', 'EN', '', 'Tango is for Sonny a dance of presence and musical expression. His dance can be described             is conscious and playful. Sonny has a background in Chinese Kung Fu and Tai Chi,             exhibiting both physical strength and soft dynamics. With his good educational ability,             he inspires his students to dare to experiment and experiment with their dance.', '2018-05-02 13:13:32', '2018-11-06 08:28:46'),
(1836, NULL, 'Teacher', '', 'No Label', 'EN', '', 'Tava’s love for dance and enthusiasm for teaching is informed by her experiences as a physiotherapist,                 massage therapist, and yoga practitioner. She began her Tango journey in Boulder, Colorado and the path lead                 quickly to Buenos Aires, and then onward Sweden where she has been teaching with Tangokompaniet since 2012', '2018-05-02 13:13:38', '2018-11-06 08:28:46'),
(1837, NULL, 'Course', '', 'No Label', 'ES', '', '<p>Tenemos &nbsp;una amplia gama de cursos y talleres en todos los niveles que ofrecemos &nbsp;regularmente varias veces al año. Para más detalles, haga clic en los cursos que le interesen a continuación.</p>', '2018-05-12 07:13:57', '2018-11-06 08:28:46'),
(1838, NULL, 'Course', '', 'No Label', 'EN', '', '<p>We &nbsp;have a wide range of courses and workshops at all levels that we &nbsp;provide regularly several times a year. For details click on courses you &nbsp;are interested in below.</p>', '2018-05-12 07:15:16', '2018-11-06 08:28:46'),
(1839, '', 'Schedule2', '', 'No Label', 'EN', '', '<p>&nbsp;To register on a course click the button of the course you desire to put it in the shopping cart shown above this text. Green button means that there is space available on the course. Yellow button means that gender imbalance and you will be put on waiting list. Orange button means that course is full and you will be put on a list waiting for cancellation.</p>', '2018-05-14 16:19:37', '2018-11-06 08:28:46'),
(1840, NULL, 'Course', '', 'No Label', 'SV', '', '<p>Daniel måste fylla i här.</p>', '2018-05-14 17:12:55', '2018-11-06 08:28:46'),
(1841, NULL, 'Course', '', 'No Label', 'SV', '', '<p>Daniel måste fylla i denna kurs.</p>', '2018-05-14 17:13:15', '2018-11-06 08:28:46'),
(1842, NULL, 'Schedule2', '', 'No Label', 'ES', '', '<p>Para registrarse en un curso, haga clic en el botón del curso que desea colocar en el carrito de compras que se muestra arriba de este texto. El botón verde significa que hay espacio disponible en el curso. El botón amarillo significa que el desequilibrio de género y se le pondrá en la lista de espera. El botón naranja significa que el curso está lleno y se te colocará en una lista esperando la cancelación.</p>', '2018-05-23 15:26:05', '2018-11-06 08:28:46'),
(1843, NULL, 'Course', '', 'No Label', 'SV', '', '<h3>GRUNDKURS I&nbsp;</h3>\n<h2>Kursen vänder sig till dig</h2>\n<p>som är nybörjare eller du som vill repetera tangons grunder!&nbsp;</p>\n<p>Tips! I din kurs ingår det gratis träningstillfällen; sk practilongas! Ta chansen att sätta stegen och ha kul redan från början! Förutom våra grundkurser har vi även under festivaler helgkurser för nya tangodansare, se <a href=\"http://www.festivalito.tangokompaniet.com/\">&nbsp;våra Tangofestivaler i Malmö</a> &nbsp;<br>\n&nbsp;</p>\n<h3>KURSPLAN</h3>\n<p>På kursen tränar du element som <br>\n&nbsp;</p>\n<p>- grundrytm &amp; musik<br>\n&nbsp;</p>\n<p>- dansfattning &amp; hållning<br>\n&nbsp;</p>\n<p>- steg &amp; kommunikation<br>\n&nbsp;</p>\n<p>- caminada, ocho, giro, salida &nbsp;</p>\n<h3>MåL</h3>\n<p>På Grundkurs I lär du dig grunderna i argentinsk tango. Du kommer kunna &nbsp;röra dig tillsammans med en partner till musiken och kunna dansa de &nbsp;vanligaste stegkombinationerna. Under kursen kommer du även fått &nbsp;tillfälle att tillsammans med gruppen och lärarna dansa socialt på en &nbsp;tangokväll. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<h2>Pris</h2>\n<p>Grundkurser börjar i januari och i september och varar 7 veckor varpå vi &nbsp;erbjuder fortsättningen grundkurs 2. Priset för en grundkurs är 850 kr. &nbsp;Tar man båda grundkurserna och betalar för båda före grundkurs 1 &nbsp;startar får man det fördelaktiga priset 1500 kr (ordpris 1700 kr)<br>\n&nbsp;</p>\n<p>Kursen omfattar 7 lektioner och praktikor/danskvällar. Man kan &nbsp;betala 1000 kr och då får man gå 2 grundkurs 1 eller 2 samtidigt. Man &nbsp;kan ocksÃ¥ betala 2000 kr och gå dubbelt både under grundkurs 1 och på &nbsp;grundkurs 2 (2 st grundkurs 1 och 2 st grundkurs 2) &nbsp;Förbetalning sker till Tangokompaniets bankgiro 5532-8223 . <br>\nSkriv ditt namn och kurs.</p>', '2018-05-31 10:28:33', '2018-11-06 08:28:46'),
(1844, NULL, 'Course', '', 'No Label', 'SV', '', '<h2>Kurserna vänder sig till dig</h2>\n<p>som har dansat tango en längre tid och som vill utveckla din tango till att bli ännu mer dynamisk och varierad.</p>\n<h3>Förkunskaper</h3>\n<p><strong>Tidsmässigt har du</strong></p>\n<p>- dansat tango i ett par eller många år och har spenderat en hel del tid på kurs och på det sociala dansgolvet <br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du bra balans, du pivoterar lätt ståendes på en fot <br>\n&nbsp;</p>\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\n&nbsp;</p>\n<p>- du hinner med en utsmyckning på vägen mellan en rörelse och nästa<br>\n&nbsp;</p>\n<p>- du dansar i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\n&nbsp;</p>\n<p>- du kan musiken och har favoritorkestrar och -låtar<br>\n&nbsp;</p>\n<p>- du har förståelse för skapande och improvisation <br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- självklart när det är festival i Sverige och någon gång även kanske utomlands &nbsp;<br>\n</p>\n<h3>KURSPLAN</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- teknik och kommunikation <br>\n&nbsp;</p>\n<p>- improvisation och struktur<br>\n&nbsp;</p>\n<p>- variation i stil <br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<h3>Mål</h3>\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\n&nbsp;</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\n</p>\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>\n<h3>SCHEMA</h3>\n<p>&nbsp;Avancerade1Enter text for AV2 ...</p>', '2018-05-31 10:32:06', '2018-11-06 08:28:46'),
(1845, NULL, 'Course', '', 'No Label', 'SV', '', '<h2>Kurserna vänder sig till dig</h2>\n<p>som har dansat tango en längre tid och som vill utveckla din tango till att bli ännu mer dynamisk och varierad.</p>\n<h3>Förkunskaper</h3>\n<p><strong>Tidsmässigt har du</strong></p>\n<p>- dansat tango i ett par eller många år och har spenderat en hel del tid på kurs och på det sociala dansgolvet <br>\n</p>\n<p><strong>Kunskapsmässigt</strong></p>\n<p>- har du bra balans, du pivoterar lätt ståendes på en fot <br>\n&nbsp;</p>\n<p>- kan du göra sacadas, giros, ochos, boleos och ganchos utan att ta stöd från din partner<br>\n&nbsp;</p>\n<p>- du hinner med en utsmyckning på vägen mellan en rörelse och nästa<br>\n&nbsp;</p>\n<p>- du dansar i både öppen och sluten omfamning och dansriktingen är för dig självklar<br>\n&nbsp;</p>\n<p>- du kan musiken och har favoritorkestrar och -låtar<br>\n&nbsp;</p>\n<p>- du har förståelse för skapande och improvisation <br>\n&nbsp;</p>\n<p><strong>På dansgolvet befinner du dig</strong></p>\n<p>- självklart när det är festival i Sverige och någon gång även kanske utomlands &nbsp;<br>\n</p>\n<h3>KURSPLAN</h3>\n<p><strong>Du kommer jobba med&nbsp;</strong></p>\n<p>- teknik och kommunikation <br>\n&nbsp;</p>\n<p>- improvisation och struktur<br>\n&nbsp;</p>\n<p>- variation i stil <br>\n&nbsp;</p>\n<p>- musik och rytmik<br>\n&nbsp;</p>\n<h3>Mål</h3>\n<p>På kursen öppnas nya dörrar och gränserna tänjs så att tango fortsätter &nbsp;att vara spännande och utmanande i dess olika former. Målet med kursen &nbsp;är att du ska känna att din dans blir rikare och att du lättare kan &nbsp;anpassa dig till olika partners och dansstilar och genom detta bli &nbsp;friare i din dans! &nbsp;<br>\n&nbsp;</p>\n<h2>Vilken kurs ska jag välja?</h2>\n<p>Om du tvekar är det ofta bra att välja en lägre nivå. Repetition ger &nbsp;färdighet medan för svåra utmaningar kan stjälpa ens glädje och &nbsp;självförtroende. Du kan alltid höra av dig till oss på &nbsp;info@tangokompaniet.com och be om hjälp när du ska välja kurs. <br>\n</p>\n<p><strong>Du har också möjlighet att gå dubbla kurser till rabatterat pris!&nbsp;</strong></p>', '2018-05-31 10:33:04', '2018-11-06 08:28:46'),
(1846, NULL, 'Home', '', 'No Label', 'SV', '', '<p>Tangokompaniet är Sveriges största tangoskola och arrangerar kurser, workshops och olika tangoevenemang för företag och privatpersoner i alla åldrar. Vi finns främst i Lund, Malmö och runtom i Öresunds- regionen men vi bjuds även in som gästlärare runtom i världen.</p>', '2018-09-05 18:05:46', '2018-11-06 08:28:46'),
(1847, NULL, 'Home', '', 'No Label', 'ES', '', '<p>Tangokompaniet es la escuela de tango más grande de Suecia y organiza cursos, talleres y varios eventos de tango para compañías y personas de todas las edades. Estamos ubicados principalmente en Lund, Malmö y alrededor de la región de Öresund, pero también estamos invitados como profesores invitados en todo el mundo.</p>', '2018-09-06 05:07:03', '2018-11-06 08:28:46'),
(1848, '', 'Schedule2', '', 'No Label', 'SV', '', '<p><br></p>', '2018-09-17 01:35:02', '2018-11-06 08:28:46');
